INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('100042', 'Dumb and Dumber To', 'tt2096672', '20 years after the dimwits set out on their first adventure, they head out in search of one of their long lost children in the hope of gaining a new kidney.', '/Ekw3ijq9L6RiKvv5m2tPOEklHF.jpg', '2014-11-12', '[{"id":35,"name":"Comedy"}]'),
('10009', 'Brother Bear', 'tt0328880', 'When a young Inuit hunter needlessly kills a bear, he is magically changed into a bear himself as punishment with a talkative cub being his only guide to changing back.', '/eX2LXUvmSZW7gow2J4icmUj4EK0.jpg', '2003-10-31', '[{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('10020', 'Beauty and the Beast', 'tt0101414', 'Follow the adventures of Belle, a bright young woman who finds herself in the castle of a prince whos been turned into a mysterious beast. With the help of the castles enchanted staff, Belle soon learns the most important lesson of all -- that true beauty comes from within.', '/b9QJr2oblOu1grgOMUZF1xkUJdh.jpg', '1991-11-12', '[{"id":10749,"name":"Romance"},{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":14,"name":"Fantasy"},{"id":10402,"name":"Music"}]'),
('10022', 'The Pacifier', 'tt0395699', 'Disgraced Navy SEAL Shane Wolfe is handed a new assignment: Protect the five Plummer kids from enemies of their recently deceased father -- a government scientist whose top-secret experiment remains hidden in the kids house.', '/mHFWjLbJYWFxgrfTAHgbLbVcFug.jpg', '2005-03-04', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"},{"id":53,"name":"Thriller"}]'),
('100402', 'Captain America: The Winter Soldier', 'tt1843866', 'After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.', '/5TQ6YDmymBpnF005OyoB7ohZps9.jpg', '2014-03-20', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('10045', 'Banlieue 13', 'tt0414852', 'Set in the ghettos of Paris in 2010, an undercover cop and ex-thug try to infiltrate a gang in order to defuse a neutron bomb.', '/4mxGgU8aUxjjv1E0Zoww061WdWB.jpg', '2004-11-09', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('10065', 'The Amityville Horror', 'tt0384806', 'A family is terrorized by demonic forces after moving into a home that was the site of a grisly mass-murder.', '/cZW2ajrHSiA0Ar2o00g4ezUYqZX.jpg', '2005-04-15', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"}]'),
('101', 'Léon', 'tt0110413', 'Leon, the top hit man in New York, has earned a rep as an effective cleaner. But when his next-door neighbors are wiped out by a loose-cannon DEA agent, he becomes the unwilling custodian of 12-year-old Mathilda. Before long, Mathildas thoughts turn to revenge, and she considers following in Leons footsteps.', '/gE8S02QUOhVnAmYu4tcrBlMTujz.jpg', '1994-09-14', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('101299', 'The Hunger Games: Catching Fire', 'tt1951264', 'Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a Victors Tour of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever.', '/Hn0KgefVEp0GkdTexS6gfKTMfi.jpg', '2013-11-15', '[{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('10138', 'Iron Man 2', 'tt1228705', 'With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press, and the public to share his technology with the military. Unwilling to let go of his invention, Stark, along with Pepper Potts, and James Rhodey Rhodes at his side, must forge new alliances - and confront powerful enemies.', '/ArqpkNYGfcTIA6umWt6xihfIZZv.jpg', '2010-04-28', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('10144', 'The Little Mermaid', 'tt0097757', 'This colorful adventure tells the story of an impetuous mermaid princess named Ariel who falls in love with the very human Prince Eric and puts everything on the line for the chance to be with him. Memorable songs and characters -- including the villainous sea witch Ursula.', '/ivdzLXCVgPUyjphKbbB40z8FQp8.jpg', '1989-11-17', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('1018', 'Mulholland Drive', 'tt0166924', 'After a car wreck on the winding Mulholland Drive renders a woman amnesic, she and a perky Hollywood-hopeful search for clues and answers across Los Angeles in a twisting venture beyond dreams and reality.', '/fMC8JBWx2VjsJ53JopAcFjqmlYv.jpg', '2001-05-16', '[{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('10184', 'Hes Just Not That Into You', 'tt1001508', 'Remember that really cute guy who said hed call...and didnt? Maybe he lost your number. Maybe hes in the hospital. Maybe hes awed by your beauty, brains or success. Or maybe Hes Just Not That into You.', '/PsJ4XddymZ1RglzPg2wWrgYjb1.jpg', '2009-02-06', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('10189', 'Pineapple Express', 'tt0910936', 'A stoner and his dealer are forced to go on the run from the police after the pothead witnesses a cop commit a murder.', '/scEvOPl6ZJctQVnRWHvq0pP0DkM.jpg', '2008-08-06', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('10191', 'How to Train Your Dragon', 'tt0892769', 'As the son of a Viking leader on the cusp of manhood, shy Hiccup Horrendous Haddock III faces a rite of passage: he must kill a dragon to prove his warrior mettle. But after downing a feared dragon, he realizes that he no longer wants to destroy it, and instead befriends the beast – which he names Toothless – much to the chagrin of his warrior father', '/zMAm3WYmvD40FaWFsOmpicQFabz.jpg', '2010-03-05', '[{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('10192', 'Shrek Forever After', 'tt0892791', 'A bored and domesticated Shrek pacts with deal-maker Rumpelstiltskin to get back to feeling like a real ogre again, but when hes duped and sent to a twisted version of Far Far Away—where Rumpelstiltskin is king, ogres are hunted, and he and Fiona have never met—he sets out to restore his world and reclaim his true love.', '/enqVwbUu6OX5LHq0fuk7sLT35zy.jpg', '2010-05-16', '[{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('10193', 'Toy Story 3', 'tt0435761', 'Woody, Buzz, and the rest of Andys toys havent been played with in years. With Andy about to go to college, the gang find themselves accidentally left at a nefarious day care center. The toys must band together to escape and return home to Andy.', '/tOwAAVeL1p3ls9dhOBo45ElodU3.jpg', '2010-06-16', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"}]'),
('10195', 'Thor', 'tt0800369', 'Against his father Odins will, The Mighty Thor -a powerful but arrogant warrior god -recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.', '/bIuOWTtyFPjsFDevqvF3QrD1aun.jpg', '2011-04-21', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('10198', 'The Princess and the Frog', 'tt0780521', 'A waitress, desperate to fulfill her dreams as a restaurant owner, is set on a journey to turn a frog prince back into a human being, but she has to do face the same problem after she kisses him.', '/bVRHirC6uIZL9VtRqYRxdedYnOG.jpg', '2009-12-08', '[{"id":10749,"name":"Romance"},{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":10402,"name":"Music"}]'),
('10200', 'The Day the Earth Stood Still', 'tt0970416', 'A representative of an alien race that went through drastic evolution to survive its own climate change, Klaatu comes to Earth to assess whether humanity can prevent the environmental damage they have inflicted on their own planet. When barred from speaking to the United Nations, he decides humankind shall be exterminated so the planet can survive.', '/7fNFk4EAGbuRFqrSJprgXEIX5Za.jpg', '2008-12-10', '[{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('10201', 'Yes Man', 'tt1068680', 'Carl Allen has stumbled across a way to shake free of post-divorce blues and a dead-end job: embrace life and say yes to everything.', '/zqSqnHb045TN8Lzt2X4IVy8dfAW.jpg', '2008-12-09', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('102362', 'Dead Man Down', 'tt2101341', 'In New York City, a crime lords right-hand man is seduced by a woman seeking retribution.', '/4hcWLlWTu3Saq2j24dHTKSLQSGe.jpg', '2013-03-08', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('102382', 'The Amazing Spider-Man 2', 'tt1872181', 'For Peter Parker, life is busy. Between taking out the bad guys as Spider-Man and spending time with the person he loves, Gwen Stacy, high school graduation cannot come quickly enough. Peter has not forgotten about the promise he made to Gwen’s father to protect her by staying away, but that is a promise he cannot keep. Things will change for Peter when a new villain, Electro, emerges, an old friend, Harry Osborn, returns, and Peter uncovers new clues about his past.', '/mUjWof8LHDgCZC9mFp0UYKBf1Dm.jpg', '2014-04-16', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('102651', 'Maleficent', 'tt1587310', 'The untold story of Disneys most iconic villain from the 1959 classic Sleeping Beauty. A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land.  Maleficent rises to be the lands fiercest protector, but she ultimately suffers a ruthless betrayal – an act that begins to turn her heart into stone. Bent on revenge, Maleficent faces an epic battle with the invading Kings successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom - and to Maleficents true happiness as well.', '/4FYu1AAu14tuBU0lns0hbKiHUcH.jpg', '2014-05-28', '[{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":10751,"name":"Family"},{"id":10749,"name":"Romance"}]'),
('102899', 'Ant-Man', 'tt0478970', 'Armed with the astonishing ability to shrink in scale but increase in strength, con-man Scott Lang must embrace his inner-hero and help his mentor, Dr. Hank Pym, protect the secret behind his spectacular Ant-Man suit from a new generation of towering threats. Against seemingly insurmountable obstacles, Pym and Lang must plan and pull off a heist that will save the world.', '/D6e8RJf2qUstnfkTslTXNTUAlT.jpg', '2015-07-14', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('10312', 'Patch Adams', 'tt0129290', 'Meet Patch Adams, a doctor who doesnt look, act or think like any doctor youve met before. For Patch, humor is the best medicine, and hes willing to do just anything to make his patients laugh - even if it means risking his own career.', '/2T0Mj8gkTXgciedz8W5nsnjCHig.jpg', '1998-12-25', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('10315', 'Fantastic Mr. Fox', 'tt0432283', 'The Fantastic Mr. Fox bored with his current life, plans a heist against the three local farmers. The farmers, tired of sharing their chickens with the sly fox, seek revenge against him and his family.', '/750pfEttsYAVmynRg2vmt1AXh4q.jpg', '2009-10-23', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('10330', 'Freaky Friday', 'tt0322330', 'Jamie Lee Curtis stars as Tess Coleman, mother of 15-year-old Anna (Lindsay Lohan), in this remake of the 1976 Jodie Foster comedy. Mother and daughter bicker over everything -- what Anna wears, whom she likes and what she wants to do when shes older. In turn, Anna detests Tesss fiancé (Mark Harmon). When a magical fortune cookie switches their personalities, they each get a peek at how the other person feels, thinks and lives.', '/fBtYKVgpGNoUsmRGy7rLjIQsmpf.jpg', '2003-08-03', '[{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('10386', 'The Iron Giant', 'tt0129167', 'A giant metal machine falls to Earth and frightens the residents of a small town in Maine in 1958, until it befriends a nine-year-old boy named Hogarth and ultimately finds its humanity by unselfishly saving people from their own fears and prejudices.', '/rdN6IjV4xlDDhrT8ewkkJfPvp2e.jpg', '1999-08-06', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('10431', 'War', 'tt0499556', 'FBI agent Jack Crawford is out for revenge when his partner is killed and all clues point to the mysterious assassin Rogue. But when Rogue turns up years later to take care of some unfinished business, he triggers a violent clash of rival gangs. Will the truth come out before its too late? And when the dust settles, who will remain standing?', '/envBC1uSYRWVj2p3Im8XbPKZ4B5.jpg', '2007-08-24', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('105', 'Back to the Future', 'tt0088763', 'Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents first meeting and attracting his mothers romantic interest. Marty must repair the damage to history by rekindling his parents romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.', '/pTpxQB1N0waaSc3OSn0e9oc8kx9.jpg', '1985-07-03', '[{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"},{"id":10751,"name":"Family"}]'),
('10527', 'Madagascar: Escape 2 Africa', 'tt0479952', 'Alex, Marty, Melman, Gloria, King Julien, Maurice, the penguins and the chimps are back and still marooned on Madagascar. In the face of this obstacle, the New Yorkers have hatched a plan so crazy it just might work. With military precision, the penguins have repaired an old crashed plane... sort of.', '/9mohxwknsHcwFBSAAhoQXwFV5zn.jpg', '2008-10-30', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"}]'),
('10528', 'Sherlock Holmes', 'tt0988045', 'Eccentric consulting detective Sherlock Holmes and Doctor John Watson battle to bring down a new nemesis and unravel a deadly plot that could destroy England.', '/22ngurXbLqab7Sko6aTSdwOCe5W.jpg', '2009-01-07', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"}]'),
('10530', 'Pocahontas', 'tt0114148', 'History comes gloriously to life in Disneys epic animated tale about love and adventure in the New World. Pocahontas is a Native American woman whose father has arranged for her to marry her villages best warrior. But a vision tells her change is coming, and soon she comes face to face with it in the form of Capt. John Smith.', '/qk95miOV8wDABbO5gyCpCrvbVFu.jpg', '1995-06-14', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"}]'),
('10555', 'Shark Tale', 'tt0307453', 'Oscar is a small fish whose big aspirations often get him into trouble. Meanwhile, Lenny is a great white shark with a surprising secret that no sea creature would guess: Hes a vegetarian. When a lie turns Oscar into an improbable hero and Lenny becomes an outcast, the two form an unlikely friendship.', '/zSHqX4qklYrHMEcv2GiHG5UwVsz.jpg', '2004-09-20', '[{"id":16,"name":"Animation"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('10582', 'Shifshuf Naim', 'tt0082528', 'Momo and Yudale take turns mounting Bentzis foreign buxom cousin, but Yudale and her get stuck together. Momo raises the bar even further by proving the rumors of an accepting older buxom piano tutor, Fritzi. Bentzi looks for love.', '/fVtA8FrcHeiY6leezkwjOgJ6iwQ.jpg', '1981-04-07', '[{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('105864', 'The Good Dinosaur', 'tt1979388', 'An epic journey into the world of dinosaurs where an Apatosaurus named Arlo makes an unlikely human friend.', '/2ZckiMTfSkCep2JTtZbr73tnQbN.jpg', '2015-11-14', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('10590', 'We Were Soldiers', 'tt0277434', 'The story of the first major battle of the American phase of the Vietnam War and the soldiers on both sides that fought it.', '/kjG02l5Nqcgd3ZOb7aMBb9CIIIi.jpg', '2002-03-01', '[{"id":28,"name":"Action"},{"id":36,"name":"History"},{"id":10752,"name":"War"}]'),
('106', 'Predator', 'tt0093773', 'Dutch and his group of commandos are hired by the CIA to rescue downed airmen from guerillas in a Central American jungle. The mission goes well but as they return they find that something is hunting them. Nearly invisible, it blends in with the forest, taking trophies from the bodies of its victims as it goes along. Occasionally seeing through its eyes, the audience sees it is an intelligent alien hunter, hunting them for sport, killing them off one at a time.', '/p6fhq04t75yCfE0kSTNZGQvWuQ1.jpg', '1987-06-11', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('10625', 'Mean Girls', 'tt0377092', 'Cady Heron is a hit with The Plastics, the A-list girl clique at her new school, until she makes the mistake of falling for Aaron Samuels, the ex-boyfriend of alpha Plastic Regina George.', '/lDlGPZS0UJYKxVlpyff3BMyPc2H.jpg', '2004-04-30', '[{"id":35,"name":"Comedy"}]'),
('106646', 'The Wolf of Wall Street', 'tt0993846', 'A New York stockbroker refuses to cooperate in a large securities fraud case involving corruption on Wall Street, corporate banking world and mob infiltration. Based on Jordan Belforts autobiography.', '/vK1o5rZGqxyovfIhZyMELhk03wO.jpg', '2013-12-25', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('10674', 'Mulan', 'tt0120762', 'A tomboyish girl disguises herself as a young man so she can fight with the Imperial Chinese Army against the invading Huns. With help from wise-cracking dragon Mushu, Mulan just might save her country -- and win the heart of handsome Captain Li Shang.', '/dffoV5USC8kdgax6vXys8QHvMZ9.jpg', '1998-06-18', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"}]'),
('10681', 'WALL·E', 'tt0910970', 'WALL·E is the last robot left on an Earth that has been overrun with garbage and all humans have fled to outer space. For 700 years he has continued to try and clean up the mess, but has developed some rather interesting human-like qualities. When a ship arrives with a sleek new type of robot, WALL·E thinks hes finally found a friend and stows away on the ship when it leaves.', '/4qOKgcDcB0SojUIg2syzor1FeL7.jpg', '2008-06-22', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('10693', 'Peter Pan', 'tt0046183', 'Leaving the safety of their nursery behind, Wendy, Michael and John follow Peter Pan to a magical world where childhood lasts forever. But while in Neverland, the kids must face Captain Hook and foil his attempts to get rid of Peter for good.', '/aWLgUzpkVFk8OVcg5jJte5I0Ces.jpg', '1953-02-05', '[{"id":16,"name":"Animation"},{"id":10402,"name":"Music"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('107', 'Snatch', 'tt0208092', 'The second film from British director Guy Ritchie. Snatch tells an obscure story similar to his first fast-paced crazy character-colliding filled film “Lock, Stock and Two Smoking Barrels.” There are two overlapping stories here – one is the search for a stolen diamond, and the other about a boxing promoter who’s having trouble with a psychotic gangster.', '/on9JlbGEccLsYkjeEph2Whm1DIp.jpg', '2000-09-01', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('10761', 'Made of Honor', 'tt0866439', 'Tom and Hannah have been platonic friends for 10 years. Hes a serial dater, while she wants marriage but hasnt found Mr. Right. Just as Tom is starting to think that he is relationship material after all, Hannah gets engaged. When she asks Tom to be her maid of honor, he reluctantly agrees just so he can attempt to stop the wedding and woo her.', '/676inzl4mQBKdXTfkv6XCXGCi4.jpg', '2008-05-02', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('10764', 'Quantum of Solace', 'tt0830515', 'Quantum of Solace continues the adventures of James Bond after Casino Royale. Betrayed by Vesper, the woman he loved, 007 fights the urge to make his latest mission personal. Pursuing his determination to uncover the truth, Bond and M interrogate Mr. White, who reveals that the organization that blackmailed Vesper is far more complex and dangerous than anyone had imagined.', '/6mlNx0Jiqhg3D7NlANT9pidsgPJ.jpg', '2008-10-30', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('10781', 'The Texas Chainsaw Massacre: The Beginning', 'tt0420294', 'Chrissie and her friends set out on a road trip for a final fling before one is shipped off to Vietnam. Along the way, bikers harass the foursome and cause an accident that throws Chrissie from the vehicle. The lawman who arrives on the scene kills one of the bikers and brings Chrissies friends to the Hewitt homestead, where young Leatherface is learning the tools of terror.', '/9elCJIG1TOJ0wew3JVx5ZMkHq5w.jpg', '2006-10-06', '[{"id":27,"name":"Horror"}]'),
('107846', 'Escape Plan', 'tt1211956', 'Ray Breslin is the worlds foremost authority on structural security. After analyzing every high security prison and learning a vast array of survival skills so he can design escape-proof prisons, his skills are put to the test. Hes framed and incarcerated in a master prison he designed himself. He needs to escape and find the person who put him behind bars.', '/1jHF5or25uCZr7O5c7CYm9eTrTw.jpg', '2013-10-09', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('107985', 'The Worlds End', 'tt1213663', 'Five friends who reunite in an attempt to top their epic pub crawl from 20 years earlier unwittingly become humankinds only hope for survival.', '/9DBKqINsayQRZU0Ry0HFjeps5XJ.jpg', '2013-07-18', '[{"id":35,"name":"Comedy"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('10865', 'Atlantis: The Lost Empire', 'tt0230011', 'The worlds most highly qualified crew of archaeologists and explorers is led by historian Milo Thatch as they board the incredible 1,000-foot submarine Ulysses and head deep into the mysteries of the sea.', '/9kbLIQEj99g5Hb9g1IG3VNdtt3h.jpg', '2001-06-02', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('1090', 'The Thirteenth Floor', 'tt0139809', 'Computer scientist Hannon Fuller has discovered something extremely important. Hes about to tell the discovery to his colleague, Douglas Hall, but knowing someone is after him, the old man leaves a letter in his computer generated parallel world thats just like the 30s with seemingly real people with real emotions.', '/19XUd3YoAY2cwWJnutvq5VEtiIO.jpg', '1999-04-16', '[{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"}]'),
('109424', 'Captain Phillips', 'tt1535109', 'The true story of Captain Richard Phillips and the 2009 hijacking by Somali pirates of the US-flagged MV Maersk Alabama, the first American cargo ship to be hijacked in two hundred years.', '/AnMTMPTUzeWNbYxzp29WqYf1br1.jpg', '2013-10-10', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('109428', 'Evil Dead', 'tt1288558', 'Evil Dead, the fourth installment of the Evil Dead franchise, serving as both a reboot and as a loose continuation of the series, features Mia, a young woman struggling with sobriety, heads to a remote cabin with a group of friends where the discovery of a Book of the Dead unwittingly summon up dormant demons which possess the youngsters one by one.', '/z56CMoFXOhq4zieKMsokLaiB4qE.jpg', '2013-04-05', '[{"id":27,"name":"Horror"}]'),
('109439', 'The Hangover Part III', 'tt1951261', 'This time, theres no wedding. No bachelor party. What could go wrong, right? But when the Wolfpack hits the road, all bets are off.', '/etxhFiukXlYKVm4Yxon01YbiC5Y.jpg', '2013-05-23', '[{"id":35,"name":"Comedy"}]'),
('109445', 'Frozen', 'tt2294629', 'Young princess Anna of Arendelle dreams about finding true love at her sister Elsa’s coronation. Fate takes her on a dangerous journey in an attempt to end the eternal winter that has fallen over the kingdom. Shes accompanied by ice delivery man Kristoff, his reindeer Sven, and snowman Olaf. On an adventure where she will find out what friendship, courage, family, and true love really means.', '/jIjdFXKUNtdf1bwqMrhearpyjMj.jpg', '2013-11-27', '[{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"}]'),
('10995', 'LAmant', 'tt0101316', 'A poor French teenage girl engages in an illicit affair with a wealthy Chinese heir in 1920s Saigon. For the first time in her young life she has control, and she wields it deftly over her besotted lover throughout a series of clandestine meetings and torrid encounters.', '/iey1UA4hav2cn60qGi1zgKxpPBl.jpg', '1992-02-22', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('11', 'Star Wars', 'tt0076759', 'Princess Leia is captured and held hostage by the evil Imperial forces in their effort to take over the galactic Empire. Venturesome Luke Skywalker and dashing captain Han Solo team together with the loveable robot duo R2-D2 and C-3PO to rescue the beautiful princess and restore peace and justice in the Empire.', '/tvSlBzAdRE29bZe5yYWrJ2ds137.jpg', '1977-03-20', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('11036', 'The Notebook', 'tt0332280', 'An epic love story centered around an older man who reads aloud to a woman with Alzheimers. From a faded notebook, the old mans words bring to life the story about a couple who is separated by World War II, and is then passionately reunited, seven years later, after they have taken different paths.', '/gMfstesBXKdsHToAUXVPHujUDfb.jpg', '2004-06-25', '[{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('110415', 'Snowpiercer', 'tt1706620', 'In a future where a failed global-warming experiment kills off most life on the planet, a class system evolves aboard the Snowpiercer, a train that travels around the globe via a perpetual-motion engine.', '/oP0ZWr6MsaQ1TV7xvnZJMKSfz0H.jpg', '2013-08-01', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"}]'),
('11072', 'Blazing Saddles', 'tt0071230', 'The Ultimate Western Spoof. A town where everyone seems to be named Johnson is in the way of the railroad. In order to grab their land, Hedley Lemar, a politically connected nasty person, sends in his henchmen to make the town unlivable. After the sheriff is killed, the town demands a new sheriff from the Governor. Hedley convinces him to send the town the first Black sheriff in the west.', '/bRifj54SVHmnhKuG90hzxZFb8Eo.jpg', '1974-02-07', '[{"id":35,"name":"Comedy"},{"id":37,"name":"Western"}]'),
('111', 'Scarface', 'tt0086250', 'After getting a green card in exchange for assassinating a Cuban government official, Tony Montana stakes a claim on the drug trade in Miami. Viciously murdering anyone who stands in his way, Tony eventually becomes the biggest drug lord in the state, controlling nearly all the cocaine that comes through Miami. But increased pressure from the police, wars with Colombian drug cartels and his own drug-fueled paranoia serve to fuel the flames of his eventual downfall.', '/zr2p353wrd6j3wjLgDT4TcaestB.jpg', '1983-12-08', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('11199', 'Wild Hogs', 'tt0486946', 'Restless and ready for adventure, four suburban bikers leave the safety of their subdivision and head out on the open road. But complications ensue when they cross paths with an intimidating band of New Mexico bikers known as the Del Fuegos.', '/auKcnTuYtB7v1t4yLC4y29ZwyTq.jpg', '2007-03-02', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('112160', 'Chroniques sexuelles dune famille daujourdhui', 'tt1753584', 'Three generations of a French family open up about their sexual experiences and desires after young Romain is caught masturbating in his biology class.', '/pU2nD3Llaz3Taq5FAaQUg00uJYD.jpg', '2012-05-09', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('112205', 'The Family', 'tt2404311', 'The Manzoni family, a notorious mafia clan, is relocated to Normandy, France under the witness protection program, where fitting in soon becomes challenging as their old habits die hard.', '/9Qnug9QrwUCQhd7dSfGJfJMO1zS.jpg', '2013-09-13', '[{"id":80,"name":"Crime"},{"id":35,"name":"Comedy"},{"id":28,"name":"Action"}]'),
('11224', 'Cinderella', 'tt0042332', 'When Cinderellas cruel stepmother prevents her from attending the Royal Ball, she gets some unexpected help from the lovable mice Gus and Jaq, and from her Fairy Godmother.', '/scNoXmnYdZKh1ccQzXBWWGVloes.jpg', '1950-03-04', '[{"id":14,"name":"Fantasy"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":10749,"name":"Romance"}]'),
('11228', 'Daylight', 'tt0116040', 'A group of armed robbers fleeing the police head for the New Jersey Tunnel and run right into trucks transporting toxic waste. The spectacular explosion that follows results in both ends of the tunnel collapsing and the handful of people who survived the explosion are now in peril. Kit Latura is the only man with the skill and knowledge to lead the band of survivors out of the tunnel before the structure collapses.', '/cPl88Kh44fo005rYrdIxm62GQCb.jpg', '1996-12-06', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('11238', 'Aladdin and the King of Thieves', 'tt0115491', 'At long last, Aladdin is about to marry the Princess Jasmine. Despite the presence and encouragement of his friends Genie, Carpet, and Abu, he is fearful and anxious. He is most worried as to what kind of father he will be, having never known his own. But when the 40 Thieves disrupt the wedding trying to steal a magical oracular talisman, Aladdin is drawn into a dangerous quest to stop the thieves.', '/f6cwFA76j6aaRu1KOQ8bBYfSlLx.jpg', '1996-05-20', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"},{"id":14,"name":"Fantasy"}]'),
('1124', 'The Prestige', 'tt0482571', 'A mysterious story of two magicians whose intense rivalry leads them on a life-long battle for supremacy -- full of obsession, deceit and jealousy with dangerous and deadly consequences.', '/5MXyQfz8xUP3dIFPTubhTsbFY6N.jpg', '2006-10-19', '[{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('11321', 'Seven Pounds', 'tt0814314', 'An IRS agent with a fateful secret embarks on an extraordinary journey of redemption by forever changing the lives of seven strangers.', '/mX8SsTw2uApc02W8SBIKeprcWr1.jpg', '2008-12-18', '[{"id":18,"name":"Drama"}]'),
('11322', 'Public Enemies', 'tt1152836', 'Depression-era bank robber John Dillingers charm and audacity endear him to much of Americas downtrodden public, but hes also a thorn in the side of J. Edgar Hoover and the fledgling FBI. Desperate to capture the elusive outlaw, Hoover makes Dillinger his first Public Enemy Number One and assigns his top agent, Melvin Purvis, the task of bringing him in dead or alive.', '/qisfF7ENdmGI8fpQJoCxIIU1QhH.jpg', '2009-07-01', '[{"id":36,"name":"History"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('11324', 'Shutter Island', 'tt1130884', 'World War II soldier-turned-U.S. marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by his own troubling visions and by Dr. Cawley.', '/2tZqOGvOT5ad6RNc10CYJ2Ol2ED.jpg', '2010-02-18', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('11360', 'Dumbo', 'tt0033563', 'Dumbo is a baby elephant born with oversized ears and a supreme lack of confidence. But thanks to his even more diminutive buddy -- Timothy the Mouse -- the pint-sized pachyderm learns to surmount all obstacles.', '/rI2OAxQnmKTv0o5L9Adrkydpxiz.jpg', '1941-10-23', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('11371', 'The Score', 'tt0227445', 'An aging thief hopes to retire and live off his ill-gotten wealth when a young kid convinces him into doing one last heist.', '/8d9HG9An0WOPNQywo99QyEptLHz.jpg', '2001-07-13', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('113833', 'The Normal Heart', 'tt1684226', 'The story of the onset of the HIV-AIDS crisis in New York City in the early 1980s, taking an unflinching look at the nations sexual politics as gay activists and their allies in the medical community fight to expose the truth about the burgeoning epidemic to a city and nation in denial.', '/fIf4nLpWHK8BsbH76fPgMbLSjuU.jpg', '2014-05-25', '[{"id":18,"name":"Drama"}]'),
('114', 'Pretty Woman', 'tt0100405', 'When millionaire wheeler-dealer Edward Lewis enters a business contract with Hollywood hooker Vivian Ward, he loses his heart in the bargain in this charming romantic comedy. After Edward hires Vivian as his date for a week and gives her a Cinderella makeover, she returns the favor by mellowing the hardnosed tycoons outlook. Can the poor prostitute and the rich capitalist live happily ever after?', '/4ufvm0uwtvilabyUP5Zo6QeraB2.jpg', '1990-03-23', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"}]'),
('11439', 'The Ghost Writer', 'tt1139328', 'A writer stumbles upon a long-hidden secret when he agrees to help former British Prime Minister Adam Lang complete his memoirs on a remote island after the politicians assistant drowns in a mysterious accident. In director Roman Polanskis tense drama, the author realizes that his discovery threatens some very powerful people who will do anything to ensure that certain episodes from Langs past remain buried.', '/p4HtT6IHPAVg8usYdyv8gZN8Qbm.jpg', '2010-02-12', '[{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('115', 'The Big Lebowski', 'tt0118715', 'Jeffrey The Dude Lebowski, a Los Angeles slacker who only wants to bowl and drink white Russians, is mistaken for another Jeffrey Lebowski, a wheelchair-bound millionaire, and finds himself dragged into a strange series of events involving nihilists, adult film producers, ferrets, errant toes, and large sums of money.', '/aHaVjVoXeNanfwUwQ92SG7tosFM.jpg', '1998-02-15', '[{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('11544', 'Lilo & Stitch', 'tt0275847', 'A lonely Hawaiian girl named Lilo is being raised by her older sister, Nani, after their parents die -- under the watch of social worker Cobra Bubbles. When Lilo adopts a funny-looking dog and names him Stitch, she doesnt realize her new best friend is a wacky alien created by mad scientist Dr. Jumba.', '/30ZmDr2RQSd42TDoQbT1y2KqiJi.jpg', '2002-06-21', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('116', 'Match Point', 'tt0416320', 'Match Point is Woody Allen’s satire of the British High Society and the ambition of a young tennis instructor to enter into it. Yet when he must decide between two women - one assuring him his place in high society, and the other that would bring him far from it - palms start to sweat and a dark psychological match in his head begins.', '/8RNqM1CGFNrdgJ1JacUFHKOkNPl.jpg', '2005-05-12', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":10749,"name":"Romance"}]'),
('116149', 'Paddington', 'tt1109624', 'A young Peruvian bear with a passion for all things British travels to London in search of a home. Finding himself lost and alone at Paddington Station, he begins to realize that city life is not all he had imagined - until he meets the kindly Brown family, who read the label around his neck (Please look after this bear. Thank you.) and offer him a temporary haven. It looks as though his luck has changed until this rarest of bears catches the eye of a museum taxidermist...', '/Sw7g22Wt4IILyD8LepkjNe5ql9.jpg', '2014-11-27', '[{"id":35,"name":"Comedy"}]'),
('117', 'The Untouchables', 'tt0094226', 'Young Treasury Agent Elliot Ness arrives in Chicago and is determined to take down Al Capone but its not going to be easy, because Capone has the police in his pocket. Ness meets Jimmy Malone a veteran patrolman and probably the most honorable one in the force. He asks Malone to help him get Capone but Malone warns him that if he goes after Capone, he is going to war.', '/qx4CDBhJDX5LQoVZ8UXPxQy5pt7.jpg', '1987-06-02', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":36,"name":"History"},{"id":53,"name":"Thriller"}]'),
('117251', 'White House Down', 'tt2334879', 'Capitol Policeman John Cale has just been denied his dream job with the Secret Service of protecting President James Sawyer. Not wanting to let down his little girl with the news, he takes her on a tour of the White House, when the complex is overtaken by a heavily armed paramilitary group. Now, with the nations government falling into chaos and time running out, its up to Cale to save the president, his daughter, and the country.', '/niYdnzkrtBduR5lKtfeLXKXNaTT.jpg', '2013-06-26', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('117263', 'Olympus Has Fallen', 'tt2302755', 'When the White House (Secret Service Code: Olympus) is captured by a terrorist mastermind and the President is kidnapped, disgraced former Presidential guard Mike Banning finds himself trapped within the building. As the national security team scrambles to respond, they are forced to rely on Bannings inside knowledge to help retake the White House, save the President and avert an even bigger disaster.', '/a2r2mvky2D5QCyYLdu2c3A4LOmb.jpg', '2013-03-20', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('118', 'Charlie and the Chocolate Factory', 'tt0367594', 'A young boy wins a tour through the most magnificent chocolate factory in the world, led by the worlds most unusual candy maker.', '/dvHl1dYvaZRhj9Gk0ITcCHr4DIJ.jpg', '2005-07-09', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('118340', 'Guardians of the Galaxy', 'tt2015381', 'Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.', '/y31QB9kn3XSudA15tV7UWQ9XLuW.jpg', '2014-07-30', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"}]'),
('119450', 'Dawn of the Planet of the Apes', 'tt2103281', 'A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.', '/2EUAUIu5lHFlkj5FRryohlH6CRO.jpg', '2014-06-26', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('11970', 'Hercules', 'tt0119282', 'Bestowed with superhuman strength, a young mortal named Hercules sets out to prove himself a hero in the eyes of his father, the great god Zeus. Along with his friends Pegasus, a flying horse, and Phil, a personal trainer, Hercules is tricked by the hilarious, hotheaded villain Hades, whos plotting to take over Mount Olympus!', '/yds93kIrmH1aNN0YKAcHLyOkNEV.jpg', '1997-06-26', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('12', 'Finding Nemo', 'tt0266543', 'A tale which follows the comedic and eventful journeys of two fish, the fretful Marlin and his young son Nemo, who are separated from each other in the Great Barrier Reef when Nemo is unexpectedly taken from his home and thrust into a fish tank in a dentists office overlooking Sydney Harbor. Buoyed by the companionship of a friendly but forgetful fish named Dory, the overly cautious Marlin embarks on a dangerous trek and finds himself the unlikely hero of an epic journey to rescue his son.', '/zjqInUwldOBa0q07fOyohYCWxWX.jpg', '2003-05-30', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('120', 'The Lord of the Rings: The Fellowship of the Ring', 'tt0120737', 'Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.', '/bxVxZb5O9OxCO0oRUNdCnpy9NST.jpg', '2001-12-18', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('120467', 'The Grand Budapest Hotel', 'tt2278388', 'The Grand Budapest Hotel tells of a legendary concierge at a famous European hotel between the wars and his friendship with a young employee who becomes his trusted protégé. The story involves the theft and recovery of a priceless Renaissance painting, the battle for an enormous family fortune and the slow and then sudden upheavals that transformed Europe during the first half of the 20th century.', '/nX5XotM9yprCKarRH4fzOq1VM1J.jpg', '2014-02-26', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('12092', 'Alice in Wonderland', 'tt0043274', 'On a golden afternoon, young Alice follows a White Rabbit, who disappears down a nearby rabbit hole. Quickly following him, she tumbles into the burrow - and enters the merry, topsy-turvy world of Wonderland! Memorable songs and whimsical escapades highlight Alices journey, which culminates in a madcap encounter with the Queen of Hearts - and her army of playing cards!', '/9gJa2B6M8jt85aDkb0MF98MLZ9T.jpg', '1951-07-03', '[{"id":10402,"name":"Music"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"}]'),
('121', 'The Lord of the Rings: The Two Towers', 'tt0167261', 'Frodo and Sam are trekking to Mordor to destroy the One Ring of Power while Gimli, Legolas and Aragorn search for the orc-captured Merry and Pippin. All along, nefarious wizard Saruman awaits the Fellowship members at the Orthanc Tower in Isengard.', '/5o5fv1dHG7vWoH2hmqwihVPBoBm.jpg', '2002-12-18', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('12113', 'Body of Lies', 'tt0758774', 'Body of Lies follows CIA operative, Roger Ferris, as he uncovers a lead on a major terrorist leader suspected to be operating out of Jordan. When Ferris devises a plan to infiltrate his network, he must first win the backing of cunning CIA veteran Ed Hoffman and the collegial, but perhaps suspect, head of Jordanian intelligence.', '/bOlzJMKHv2EG3Kbn4CMOoTImuH7.jpg', '2008-10-10', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('12155', 'Alice in Wonderland', 'tt1014759', 'Alice, an unpretentious and individual 19-year-old, is betrothed to a dunce of an English nobleman. At her engagement party, she escapes the crowd to consider whether to go through with the marriage and falls down a hole in the garden after spotting an unusual rabbit. Arriving in a strange and surreal place called Underland, she finds herself in a world that resembles the nightmares she had as a child, filled with talking animals, villainous queens and knights, and frumious bandersnatches. Alice realizes that she is there for a reason--to conquer the horrific Jabberwocky and restore the rightful queen to her throne.', '/pvEE5EN5N1yjmHmldfL4aJWm56l.jpg', '2010-03-03', '[{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"}]'),
('12162', 'The Hurt Locker', 'tt0887912', 'Forced to play a dangerous game of cat-and-mouse in the chaos of war, an elite Army bomb squad unit must come together in a city where everyone is a potential enemy and every object could be a deadly bomb.', '/uduCNFTuEcbvhvK8rrvNdf3ahzW.jpg', '2008-10-10', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('122', 'The Lord of the Rings: The Return of the King', 'tt0167260', 'Aragorn is revealed as the heir to the ancient kings as he, Gandalf and the other members of the broken fellowship struggle to save Gondor from Saurons forces. Meanwhile, Frodo and Sam bring the ring closer to the heart of Mordor, the dark lords realm.', '/50LoR9gJhbWZ5PpoHgi8MNTYgzd.jpg', '2003-12-01', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('12208', 'Casino Royale', 'tt0061452', 'Sir James Bond is called back out of retirement to stop SMERSH. In order to trick SMERSH, Bond thinks up the ultimate plan. That every agent will be named James Bond. One of the Bonds, whose real name is Evelyn Tremble is sent to take on Le Chiffre in a game of baccarat, but all the Bonds get more than they can handle, especially when the ultimate villain turns out to be Bonds nephew.', '/g5fBYuP5Wc4yle6eXsKY6HQsbw2.jpg', '1967-04-13', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('12230', 'One Hundred and One Dalmatians', 'tt0055254', 'When a litter of dalmatian puppies are abducted by the minions of Cruella De Vil, the parents must find them before she uses them for a diabolical fashion statement.', '/vo5j5OZIdnfMIZSkVfSvh8cJUU.jpg', '1961-01-25', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('12242', 'Mulan II', 'tt0279967', 'Fa Mulan gets the surprise of her young life when her love, Captain Li Shang asks for her hand in marriage. Before the two can have their happily ever after, the Emperor assigns them a secret mission, to escort three princesses to Changan, China. Mushu is determined to drive a wedge between the couple after he learns that he will lose his guardian job if Mulan marries into the Li family.', '/ebuRP7g3tJlLxeejylu4Wx4Qsjv.jpg', '2004-11-03', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":28,"name":"Action"}]'),
('122917', 'The Hobbit: The Battle of the Five Armies', 'tt2310332', 'Immediately after the events of The Desolation of Smaug, Bilbo and the dwarves try to defend Erebors mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbos hands.', '/vgAHvS0bT3fpcpnJqT6uDTUsHTo.jpg', '2014-12-10', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('123025', 'Batman: The Dark Knight Returns, Part 1', 'tt2313197', 'Batman has not been seen for ten years. A new breed of criminal ravages Gotham City, forcing 55-year-old Bruce Wayne back into the cape and cowl. But, does he still have what it takes to fight crime in a new era?', '/t1UAqk1Yej8rfxEUqNLFyKkcny1.jpg', '2012-09-06', '[{"id":28,"name":"Action"},{"id":16,"name":"Animation"}]'),
('123553', 'The Mortal Instruments: City of Bones', 'tt1538403', 'In New York City, Clary Fray, a seemingly ordinary teenager, learns that she is descended from a line of Shadowhunters — half-angel warriors who protect humanity from evil forces. After her mother disappears, Clary joins forces with a group of Shadowhunters and enters Downworld, an alternate realm filled with demons, vampires, and a host of other creatures. Clary and her companions must find and protect an ancient cup that holds the key to her mothers future.', '/zz2OClGxhm5D4bfyhzWvYj3cFjT.jpg', '2013-08-21', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":10749,"name":"Romance"},{"id":14,"name":"Fantasy"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('12405', 'Slumdog Millionaire', 'tt1010048', 'Jamal Malik is an impoverished Indian teen who becomes a contestant on the Hindi version of Who Wants to be A Millionaire?. After he wins, he is suspected of cheating.', '/ojgf8iJpS4VX6jJfWGLpuEx0wm.jpg', '2008-05-12', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('12437', 'Underworld: Rise of the Lycans', 'tt0834001', 'A prequel to the first two Underworld films, this fantasy explains the origins of the feud between the Vampires and the Lycans. Aided by his secret love, Sonja, courageous Lucian leads the Lycans in battle against brutal Vampire king Viktor. Determined to break the kings enslavement of his people, Lucian faces off against the Death Dealer army in a bid for Lycan independence.', '/hZtK6fkusSKzGc0f7yQ2syo14Ze.jpg', '2009-01-22', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('12444', 'Harry Potter and the Deathly Hallows: Part 1', 'tt0926084', 'The end begins as Harry, Ron, and Hermione walk away from their last year at Hogwarts to find and destroy the remaining Horcruxes, putting an end to Voldemorts bid for immortality. But with Harrys beloved Dumbledore dead and Voldemorts unscrupulous Death Eaters on the loose, the world is more dangerous than ever.', '/maP4MTfPCeVD2FZbKTLUgriOW4R.jpg', '2010-10-17', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('12445', 'Harry Potter and the Deathly Hallows: Part 2', 'tt1201607', 'In the second installment of the two-part conclusion, Harry and his best friends, Ron and Hermione, continue their quest to vanquish the evil Voldemort once and for all. Just as things begin to look hopeless for the young wizards, Harry discovers a trio of magical objects that endow him with powers to rival Voldemorts formidable skills.', '/fTplI1NCSuEDP4ITLcTps739fcC.jpg', '2011-07-07', '[{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('1246', 'Rocky Balboa', 'tt0479143', 'When he loses a highly publicized virtual boxing match to ex-champ Rocky Balboa, reigning heavyweight titleholder Mason Dixon retaliates by challenging the Itallian Stallion to a nationally televised, 10-round exhibition bout. To the surprise of his son and friends, Rocky agrees to come out of retirement and face an opponent whos faster, stronger and thirty years his junior.', '/usZMPGxyRsyOpX5nuqHFxH3qlMh.jpg', '2006-12-20', '[{"id":18,"name":"Drama"}]'),
('124905', 'Godzilla', 'tt0831387', 'Fifteen years after an incident at a Japanese nuclear power plant, physicist Joe Brody joins forces with his soldier son Ford to discover for themselves what really happened.  What they uncover is prelude to global-threatening devastation.  An epic rebirth to Tohos iconic Godzilla, this spectacular adventure pits the worlds most famous monster against malevolent creatures who, bolstered by humanitys scientific arrogance, threaten our very existence.', '/szVwkB4H5yyOJBVuQ432b9boO0N.jpg', '2014-05-14', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('1250', 'Ghost Rider', 'tt0259324', 'In order to save his dying father, young stunt cyclist Johnny Blaze sells his soul to Mephistopheles and sadly parts from the pure-hearted Roxanne Simpson, the love of his life. Years later, Johnnys path crosses again with Roxanne, now a gogetting reporter, and also with Mephistopheles, who offers to release Johnnys soul if Johnny becomes the fabled, fiery Ghost Rider.', '/jnllnSq8u4d1oQPU7PsoAHD6bLU.jpg', '2007-02-16', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"},{"id":27,"name":"Horror"}]'),
('1251', 'Letters from Iwo Jima', 'tt0498380', 'The story of the battle of Iwo Jima between the United States and Imperial Japan during World War II, as told from the perspective of the Japanese who fought it.', '/nWJJqOryTQOmVXvKUkLcEETUHgT.jpg', '2006-12-19', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":10752,"name":"War"}]'),
('1259', 'Notes on a Scandal', 'tt0465551', 'A veteran high school teacher befriends a younger art teacher, who is having an affair with one of her 15-year-old students. However, her intentions with this new friend also go well beyond platonic friendship.', '/auGdbhh2LklmZV1LLLwQ5uvHiX4.jpg', '2006-12-25', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('1271', '300', 'tt0416449', 'Based on Frank Millers graphic novel, 300 is very loosely based the 480 B.C. Battle of Thermopylae, where the King of Sparta led his army against the advancing Persians; the battle is said to have inspired all of Greece to band together against the Persians, and helped usher in the worlds first democracy.', '/bYR8O1H1ZlME7Dm9ysfTYZnRDpw.jpg', '2006-12-09', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":10752,"name":"War"}]'),
('1272', 'Sunshine', 'tt0448134', '50 years from now the sun is dying and life on earth is threatened by arctic temperatures. Mankind puts together all its resources and sends a spaceship carrying a huge bomb designed to re-ignite the dying sun.', '/upgi8oTlMthM9sweAyBoXqr8doZ.jpg', '2007-04-05', '[{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('127380', 'Finding Dory', 'tt2277860', 'Finding Dory reunites Dory with friends Nemo and Marlin on a search for answers about her past. What can she remember? Who are her parents? And where did she learn to speak Whale?', '/z09QAf8WbZncbitewNk6lKYMZsh.jpg', '2016-06-16', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"}]'),
('127585', 'X-Men: Days of Future Past', 'tt1877832', 'The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past – to save our future.', '/qKkFk9HELmABpcPoc1HHZGIxQ5a.jpg', '2014-05-15', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('128', 'もののけ姫', 'tt0119698', 'Ashitaka, a prince of the disappearing Ainu tribe, is cursed by a demonized boar god and must journey to the west to find a cure. Along the way, he encounters San, a young human woman fighting to protect the forest, and Lady Eboshi, who is trying to destroy it. Ashitaka must find a way to bring balance to this conflict.', '/gzlJkVfWV5VEG5xK25cvFGJgkDz.jpg', '1997-07-12', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":16,"name":"Animation"}]'),
('129', '千と千尋の神隠し', 'tt0245429', 'Spirited Away is an Oscar winning Japanese animated film about a ten year old girl who wanders away from her parents along a path that leads to a world ruled by strange and unusual monster-like animals. Her parents have been changed into pigs along with others inside a bathhouse full of these creatures. Will she ever see the world how it once was?', '/ynXoOxmDHNQ4UAy0oU6avW71HVW.jpg', '2001-07-20', '[{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('13', 'Forrest Gump', 'tt0109830', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events - in each case, far exceeding what anyone imagined he could do. Yet, despite all the things he has attained, his one true love eludes him. Forrest Gump is the story of a man who rose above his challenges, and who proved that determination, courage, and love are more important than ability.', '/z4ROnCrL77ZMzT0MsNXY5j25wS2.jpg', '1994-07-06', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('131631', 'The Hunger Games: Mockingjay - Part 1', 'tt1951265', 'Katniss Everdeen reluctantly becomes the symbol of a mass rebellion against the autocratic Capitol.', '/gj282Pniaa78ZJfbaixyLXnXEDI.jpg', '2014-11-18', '[{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('131634', 'The Hunger Games: Mockingjay - Part 2', 'tt1951266', 'With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.', '/w93GAiq860UjmgR6tU9h2T24vaV.jpg', '2015-11-18', '[{"id":10752,"name":"War"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('13183', 'Watchmen', 'tt0409459', 'In a gritty and alternate 1985 the glory days of costumed vigilantes have been brought to a close by a government crackdown, but after one of the masked veterans is brutally murdered an investigation into the killer is initiated. The reunited heroes set out to prevent their own destruction, but in doing so uncover a sinister plot that puts all of humanity in grave danger.', '/jXggcKzlyxj7yMBUIsqwiaaEtD5.jpg', '2009-03-05', '[{"id":28,"name":"Action"},{"id":9648,"name":"Mystery"},{"id":878,"name":"Science Fiction"}]'),
('13186', 'Wrong Turn 2: Dead End', 'tt0804555', 'Retired military commander Colonel Dale Murphy hosts the simulated post-apocalyptic reality show where participants are challenged to survive a remote West Virginia wasteland. But the show turns into a nightmarish showdown when each realizes they are being hunted by an inbred family of cannibals determined to make them all dinner!', '/ftmiyfrTrqTi5Qod62nGRP9BGPn.jpg', '2007-08-25', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('13223', 'Gran Torino', 'tt1205489', 'Walt Kowalski, an iron-willed and inflexible Korean War veteran living in a changing world, is forced by his immigrant neighbors to confront his long-held prejudices.', '/yeBc5vpEiqIAZrbVQnl833GlBEi.jpg', '2008-12-11', '[{"id":18,"name":"Drama"}]'),
('132232', 'Mama', 'tt2023587', 'Guillermo del Toro presents Mama, a supernatural thriller that tells the haunting tale of two little girls who disappeared into the woods the day that their parents were killed. When they are rescued years later and begin a new life, they find that someone or something still wants to come tuck them in at night.', '/lPcwVnhg3T3MQBtTU31Rx4xwEQH.jpg', '2013-01-17', '[{"id":27,"name":"Horror"}]'),
('133805', 'Carrie', 'tt1939659', 'A reimagining of the classic horror tale about Carrie White, a shy girl outcast by her peers and sheltered by her deeply religious mother, who unleashes telekinetic terror on her small town after being pushed too far at her senior prom.', '/j0999NYddCGcishJlxluDRQIn6k.jpg', '2013-10-16', '[{"id":18,"name":"Drama"},{"id":27,"name":"Horror"}]'),
('13387', 'Transporter 3', 'tt1129442', 'Frank Martin puts the driving gloves on to deliver Valentina, the kidnapped daughter of a Ukranian government official, from Marseilles to Odessa on the Black Sea. En route, he has to contend with thugs who want to intercept Valentinas safe delivery and not let his personal feelings get in the way of his dangerous objective.', '/d3rokRfJUtSg3wFaTdUKKodhfaA.jpg', '2008-11-26', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('13448', 'Angels & Demons', 'tt0808151', 'Harvard symbologist Robert Langdon investigates a mysterious symbol seared into the chest of a murdered physicist. He discovers evidence of the unimaginable, the rebirth of an ancient secret brotherhood known as the Illuminati, the most powerful underground organization ever to walk the earth.', '/grN4lETrHNejatQZFP2F2DAWMU4.jpg', '2009-05-13', '[{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('13460', 'Doomsday', 'tt0483607', 'A lethal virus spreads throughout the British isles,infecting millions and killing hundreds of thousands. To contain the threat, acting authorities brutally quarantine the country as it succumbs to fear and chaos. The quarantine is successful. Three decades later, the Reaper virus violently resurfaces in a major city. An elite group of specialists is urgently dispatched into the still-quarantined country to retrieve a cure by any means necessary. Shut off from the rest of the world, the unit must battle through a landscape that has become a waking nightmare.', '/d5rTA0dNsK9iLnRW7SDBwGuClI8.jpg', '2008-03-14', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('13475', 'Star Trek', 'tt0796366', 'The fate of the galaxy rests in the hands of bitter rivals. One, James Kirk, is a delinquent, thrill-seeking Iowa farm boy. The other, Spock, a Vulcan, was raised in a logic-based society that rejects all emotion. As fiery instinct clashes with calm reason, their unlikely but powerful partnership is the only thing capable of leading their crew through unimaginable danger, boldly going where no one has gone before. The human adventure has begun again.', '/xPihqTMhCh6b8DHYzE61jrIiNMS.jpg', '2009-05-06', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('135397', 'Jurassic World', 'tt0369610', 'Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.', '/jjBgi2r5cRt36xF6iNUEhzscEcb.jpg', '2015-06-09', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('1359', 'American Psycho', 'tt0144084', 'A wealthy New York investment banking executive hides his alternate psychopathic ego from his co-workers and friends as he escalates deeper into his illogical, gratuitous fantasies.', '/qXsylPM4Lr5397R3eHrfqHhTUNc.jpg', '2000-04-13', '[{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('136400', '2 Guns', 'tt1272878', 'A DEA agent and an undercover Naval Intelligence officer who have been tasked with investigating one another find they have been set up by the mob -- the very organization the two men believe they have been stealing money from.', '/30lM3Uvzs6HOG5l4hzhwxYTWgd3.jpg', '2013-08-02', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"},{"id":53,"name":"Thriller"}]'),
('13654', '101 Dalmatians II: Patchs London Adventure', 'tt0324941', 'A direct-to-video sequel Roger, Anita and their canine clan are packing for the big move to Dalmatian Plantation, a home in the country with plenty of room for the 101 pups and far from the clutches of Cruella DeVil. The feistiest pup, Patch, feels lost in a sea of spots and longs to be a one-of-a-kind wonderdog like his TV hero,.', '/ht4h6I7WwaZa1E8xzb1jE94mDvS.jpg', '2003-01-21', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('1366', 'Rocky', 'tt0075148', 'When world heavyweight boxing champ Apollo Creed wants to give an unknown fighter a shot at the title as a publicity stunt, his handlers pick palooka Rocky Balboa, an uneducated collector for a Philadelphia loan shark.', '/lmwGr6J5y6kngFNQuFV2y1yw4OB.jpg', '1976-11-21', '[{"id":18,"name":"Drama"}]'),
('1367', 'Rocky II', 'tt0079817', 'After Rocky goes the distance with champ Apollo Creed, both try to put the fight behind them and move on. Rocky settles down with Adrian but cant put his life together outside the ring, while Creed seeks a rematch to restore his reputation. Soon enough, the Master of Disaster and the Italian Stallion are set on a collision course for a climactic battle that is brutal and unforgettable.', '/NGxIbk3qNtPACVN9Y6c9qDkOir.jpg', '1979-06-15', '[{"id":18,"name":"Drama"}]'),
('136797', 'Need for Speed', 'tt2369135', 'The film revolves around a local street-racer who partners with a rich and arrogant business associate, only to find himself framed by his colleague and sent to prison. After he gets out, he joins a New York-to-Los Angeles race to get revenge. But when the ex-partner learns of the scheme, he puts a massive bounty on the racers head, forcing him to run a cross-country gauntlet of illegal racers in all manner of supercharged vehicles.', '/lN0mP3BNaKirkKl6FJ0yL0wmjSJ.jpg', '2014-03-13', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('1369', 'Rambo: First Blood Part II', 'tt0089880', 'Col. Troutman recruits ex-Green Beret John Rambo for a highly secret and dangerous mission. Teamed with freedom fighter Co Bao, Rambo goes deep into Vietnam to rescue POWs. Deserted by his own team, hes left in a hostile jungle to fight for his life, avenge the death of a woman and bring corrupt officials to justice.', '/dWMnmw2nJ0bCK62W1JCNXvUQQKC.jpg', '1985-05-21', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('137', 'Groundhog Day', 'tt0107048', 'A narcissistic TV weatherman, along with his attractive-but-distant producer and mawkish cameraman, is sent to report on Groundhog Day in the small town of Punxsutawney, where he finds himself repeating the same day over and over.', '/vXjVd0Vu0MXRZnga7wEnHIIhO5B.jpg', '1993-02-11', '[{"id":10749,"name":"Romance"},{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('1370', 'Rambo III', 'tt0095956', 'Combat has taken its toll on Rambo, but hes finally begun to find inner peace in a monastery. When Rambos friend and mentor Col. Trautman asks for his help on a top secret mission to Afghanistan, Rambo declines but must reconsider when Trautman is captured.', '/oCD41FfUs1OMCdPaf5EcJ6dxxMW.jpg', '1988-05-24', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('137113', 'Edge of Tomorrow', 'tt1631867', 'Major Bill Cage is an officer who has never seen a day of combat when he is unceremoniously demoted and dropped into combat. Cage is killed within minutes, managing to take an alpha alien down with him. He awakens back at the beginning of the same day and is forced to fight and die again... and again - as physical contact with the alien has thrown him into a time loop.', '/tpoVEYvm6qcXueZrQYJNRLXL88s.jpg', '2014-05-27', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1372', 'Blood Diamond', 'tt0450259', 'An ex-mercenary turned smuggler. A Mende fisherman. Amid the explosive civil war overtaking 1999 Sierra Leone, these men join for two desperate missions: recovering a rare pink diamond of immense value and rescuing the fishermans son conscripted as a child soldier into the brutal rebel forces ripping a swath of torture and bloodshed countrywide.', '/wRamTzV6udKaMXrspxqOuo02zk0.jpg', '2006-12-07', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":28,"name":"Action"}]'),
('1374', 'Rocky IV', 'tt0089927', 'Rocky must come out of retirement to battle a gargantuan Soviet fighter named Drago, who brutally punished Rockys friend and former rival, Apollo Creed. Seeking revenge in the name of his fallen comrade and his country, Rocky agrees to fight Drago in Moscow on Christmas, and the bout changes both fighters -- and the world.', '/edI4vIemJ5NwIORVbGtLdbJA2ih.jpg', '1985-11-21', '[{"id":18,"name":"Drama"}]'),
('1381', 'The Fountain', 'tt0414993', 'Spanning over one thousand years, and three parallel stories, The Fountain is a story of love, death, spirituality, and the fragility of our existence in this world.', '/lGIJvQ8ZQazOHVAA0E34yIy7gxv.jpg', '2006-09-06', '[{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":10749,"name":"Romance"}]'),
('138103', 'The Expendables 3', 'tt2333784', 'Barney, Christmas and the rest of the team comes face-to-face with Conrad Stonebanks, who years ago co-founded The Expendables with Barney. Stonebanks subsequently became a ruthless arms trader and someone who Barney was forced to kill… or so he thought. Stonebanks, who eluded death once before, now is making it his mission to end The Expendables -- but Barney has other plans. Barney decides that he has to fight old blood with new blood, and brings in a new era of Expendables team members, recruiting individuals who are younger, faster and more tech-savvy. The latest mission becomes a clash of classic old-school style versus high-tech expertise in the Expendables’ most personal battle yet.', '/xczFwJhcCb2rUMylXam0Ni7Yn5o.jpg', '2014-08-04', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('13811', 'Knowing', 'tt0448011', 'A teacher opens a time capsule that has been dug up at his sons elementary school; in it are some chilling predictions -- some that have already occurred and others that are about to -- that lead him to believe his family plays a role in the events that are about to unfold.', '/5XnNteYoOQ727JoZqyVcENT28Dv.jpg', '2009-03-19', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('138832', 'Were the Millers', 'tt1723121', 'A veteran pot dealer creates a fake family as part of his plan to move a huge shipment of weed into the U.S. from Mexico.', '/digXuLXmk88Ar23LYUQTLcz5npA.jpg', '2013-08-07', '[{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('138843', 'The Conjuring', 'tt1457767', 'Paranormal investigators Ed and Lorraine Warren work to help a family terrorized by a dark presence in their farmhouse. Forced to confront a powerful entity, the Warrens find themselves caught in the most terrifying case of their lives.', '/xYGkdhOEVoFrLNUotuTXemtQAWd.jpg', '2013-07-18', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('13885', 'Sweeney Todd: The Demon Barber of Fleet Street', 'tt0408236', 'The infamous story of Benjamin Barker, a.k.a Sweeney Todd, who sets up a barber shop down in London which is the basis for a sinister partnership with his fellow tenant, Mrs. Lovett. Based on the hit Broadway musical.', '/v2pOGxz1wi3plr9aT0zScH6Em4X.jpg', '2007-12-20', '[{"id":18,"name":"Drama"},{"id":27,"name":"Horror"},{"id":10402,"name":"Music"}]'),
('14', 'American Beauty', 'tt0169547', 'Lester Burnham, a depressed suburban father in a mid-life crisis, decides to turn his hectic life around after developing an infatuation with his daughters attractive friend.', '/or1MP8BZIAjqWYxPdPX724ydKar.jpg', '1999-09-15', '[{"id":18,"name":"Drama"}]'),
('1402', 'The Pursuit of Happyness', 'tt0454921', 'Based on a true story about a man named Christopher Gardner, who has invested heavily in a device known as a Bone Density scanner. However, the devices do not sell as they are just marginally better than the current technology at a much higher price. As Gardner tries to figure out how to sell them, his wife leaves him, he loses his house, his bank account, and credit cards. Forced to live out in the streets with his son, Gardner is now desperate to find a steady job; he takes on a job as a stockbroker, but before he can receive pay, he needs to go through 6 months of training, and to sell his devices.', '/iMNp6gTeDBXbzjKRNYtorxZ76G2.jpg', '2006-12-14', '[{"id":18,"name":"Drama"}]'),
('140300', 'Kung Fu Panda 3', 'tt2267968', 'Continuing his legendary adventures of awesomeness, Po must face two hugely epic, but different threats: one supernatural and the other a little closer to his home.', '/MZFPacfKzgisnPoJIPEFZUXBBT.jpg', '2016-01-23', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('140420', 'Paperman', 'tt2388725', 'An urban office worker finds that paper airplanes are instrumental in meeting a girl in ways he never expected.', '/3TpMBcAYH4cxCw5WoRacWodMTCG.jpg', '2012-11-02', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":10749,"name":"Romance"}]'),
('140607', 'Star Wars: The Force Awakens', 'tt2488496', 'Thirty years after defeating the Galactic Empire, Han Solo and his allies face a new threat from the evil Kylo Ren and his army of Stormtroopers.', '/weUSwMdQIa3NaXVzwUoIIcAi85d.jpg', '2015-12-15', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":14,"name":"Fantasy"}]'),
('141', 'Donnie Darko', 'tt0246578', 'A troubled teenager is plagued by visions of a large bunny rabbit that manipulates him to commit a series of crimes, after narrowly escaping a bizarre accident.', '/tRV9ShhJkIjGRC6YilqFwgdSjmh.jpg', '2001-01-18', '[{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('14160', 'Up', 'tt1049413', 'After a lifetime of dreaming of traveling the world, 78-year-old homebody Carl flies away on an unbelievable adventure with Russell, an 8-year-old Wilderness Explorer, unexpectedly in tow. Together, the unlikely pair embarks on a thrilling odyssey full of jungle beasts and rough terrain.', '/gfFqBcoFW8uczyl2ytVmVmUg82k.jpg', '2009-05-13', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"}]'),
('14161', '2012', 'tt1190080', 'Dr. Adrian Helmsley, part of a worldwide geophysical team investigating the effect on the earth of radiation from unprecedented solar storms, learns that the earths core is heating up. He warns U.S. President Thomas Wilson that the crust of the earth is becoming unstable and that without proper preparations for saving a fraction of the worlds population, the entire race is doomed. Meanwhile, writer Jackson Curtis stumbles on the same information. While the worlds leaders race to build arks to escape the impending cataclysm, Curtis struggles to find a way to save his family. Meanwhile, volcanic eruptions and earthquakes of unprecedented strength wreak havoc around the world.', '/5tIW9nTuxxy8iXSvsKJqFDVZpyg.jpg', '2009-10-10', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('1417', 'El laberinto del fauno', 'tt0457430', 'Living with her tyrannical stepfather in a new home with her pregnant mother, 10-year-old Ofelia feels alone until she explores a decaying labyrinth guarded by a mysterious faun who claims to know her destiny. If she wishes to return to her real father, Ofelia must complete three terrifying tasks.', '/t0TDsqbCTgSi0AL7k4baZrOYYhi.jpg', '2006-05-27', '[{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":10752,"name":"War"}]'),
('142061', 'Batman: The Dark Knight Returns, Part 2', 'tt2166834', 'Batman has stopped the reign of terror that The Mutants had cast upon his city.  Now an old foe wants a reunion and the government wants The Man of Steel to put a stop to Batman.', '/wPeorCnD9MRR2S9Dzh4OpIgNLiv.jpg', '2013-01-18', '[{"id":16,"name":"Animation"},{"id":28,"name":"Action"}]'),
('1422', 'The Departed', 'tt0407887', 'To take down South Bostons Irish Mafia, the police send in one of their own to infiltrate the underworld, not realizing the syndicate has done likewise in Martin Scorseses multiple Oscar-winning crime thriller. While an undercover cop curries favor with the mob kingpin, a career criminal rises through the police ranks. But both sides soon discover theres a mole among them.', '/tGLO9zw5ZtCeyyEWgbYGgsFxC6i.jpg', '2006-10-05', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('1427', 'Perfume: The Story of a Murderer', 'tt0396171', 'Jean-Baptiste Grenouille, born in the stench of eighteenth century Paris, develops a superior olfactory sense, which he uses to create the worlds finest perfumes. His work, however, takes a dark turn as he tries to preserve scents in the search for the ultimate perfume.', '/zC9JHS6NlkJKPYFxOOqBl7fQCjT.jpg', '2006-09-13', '[{"id":80,"name":"Crime"},{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"}]'),
('14306', 'Marley & Me', 'tt0822832', 'A newly married couple who, in the process of starting a family, learn many of lifes important lessons from their trouble-loving retriever, Marley. Packed with plenty of laughs to lighten the load, the film explores the highs and lows of marriage, maturity and confronting ones own mortality, as seen through the lens of family life with a dog.', '/uyVj4K1DiYpxxRpFYdN1ZWSBJ2.jpg', '2008-12-25', '[{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"}]'),
('14359', 'Doubt', 'tt0918927', 'In 1964, a Catholic school nun questions a priests ambiguous relationship with a troubled young student, suspecting him of abuse. He denies the charges, and much of the films quick-fire dialogue tackles themes of religion, morality, and authority.', '/eoxF1LlYvJeVJcEmptfV8PLtpBK.jpg', '2008-11-27', '[{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('1443', 'The Virgin Suicides', 'tt0159097', 'A group of male friends become obsessed with five mysterious sisters who are sheltered by their strict, religious parents.', '/uokfCMwTIyYaXfo3KoNSmzvjXn1.jpg', '1999-04-21', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('1452', 'Superman Returns', 'tt0348150', 'Set 5 years after the end of Superman II, the film begins when Superman returns to discover his absence allowed Lex Luthor to walk free, and that those he was closest too felt abandoned and have moved on. Luthor plots his ultimate revenge that could see millions killed and change the face of the planet forever, as well as ridding himself of the Man Of Steel.', '/fTWi7V04VrtDj0hm1YDJYK4VpJW.jpg', '2006-06-28', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('14564', 'Rings', 'tt0498381', 'The film revolves around the events that took place before The Ring. It tells the story of the years before the video tape came to be and the beginning of how Samaras terror began.', '/ueu1Mo2XRZ2C2aBisP30e1d5SmA.jpg', '2016-10-27', '[{"id":27,"name":"Horror"}]'),
('146198', 'Triple 9', 'tt1712261', 'A gang of criminals and corrupt cops plan the murder of a police officer in order to pull off their biggest heist yet across town.', '/i7hpdsd77vdTk11RalLrQ2PXzX5.jpg', '2016-02-19', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('147441', 'Exodus: Gods and Kings', 'tt1528100', 'The defiant leader Moses rises up against the Egyptian Pharaoh Ramses, setting 600,000 slaves on a monumental journey of escape from Egypt and its terrifying cycle of deadly plagues.', '/tCN8NXset4NQ5qU0uBxqKOM0r5r.jpg', '2014-12-03', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":28,"name":"Action"}]'),
('14869', 'G.I. Joe: The Rise of Cobra', 'tt1046173', 'From the Egyptian desert to deep below the polar ice caps, the elite G.I. JOE team uses the latest in next-generation spy and military equipment to fight the corrupt arms dealer Destro and the growing threat of the mysterious Cobra organization to prevent them from plunging the world into chaos.', '/29eW5c5DaCFQejdt9V14RrA51yD.jpg', '2009-08-04', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('1487', 'Hellboy', 'tt0167190', 'In the final days of World War II, the Nazis attempt to use black magic to aid their dying cause. The Allies raid the camp where the ceremony is taking place, but not before a demon - Hellboy - has already been conjured. Joining the Allied forces, Hellboy eventually grows to adulthood, serving the cause of good rather than evil.', '/3fAWzI9MUosggdGMu7EaDhn44m6.jpg', '2004-04-02', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1491', 'The Illusionist', 'tt0443543', 'With his eye on a lovely aristocrat, a gifted illusionist named Eisenheim uses his powers to win her away from her betrothed, a crowned prince. But Eisenheims scheme creates tumult within the monarchy and ignites the suspicion of a dogged inspector.', '/sRYw9oAiporMpq1GWcYHqmpdeAO.jpg', '2006-08-18', '[{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":10749,"name":"Romance"}]'),
('150540', 'Inside Out', 'tt2096673', 'Growing up can be a bumpy road, and its no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Like all of us, Riley is guided by her emotions - Joy, Fear, Anger, Disgust and Sadness. The emotions live in Headquarters, the control center inside Rileys mind, where they help advise her through everyday life. As Riley and her emotions struggle to adjust to a new life in San Francisco, turmoil ensues in Headquarters. Although Joy, Rileys main and most important emotion, tries to keep things positive, the emotions conflict on how best to navigate a new city, house and school.', '/aAmfIX3TT40zUHGcCKrlOZRKC7u.jpg', '2015-06-09', '[{"id":35,"name":"Comedy"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('150689', 'Cinderella', 'tt1661199', 'When her father unexpectedly passes away, young Ella finds herself at the mercy of her cruel stepmother and her daughters. Never one to give up hope, Ellas fortunes begin to change after meeting a dashing stranger in the woods.', '/2i0JH5WqYFqki7WDhUW56Sg0obh.jpg', '2015-03-12', '[{"id":10749,"name":"Romance"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"},{"id":18,"name":"Drama"}]'),
('15092', 'Crank: High Voltage', 'tt1121931', 'Chelios faces a Chinese mobster who has stolen his nearly indestructible heart and replaced it with a battery-powered ticker that requires regular jolts of electricity to keep working.', '/6WLcJkIwyycyUDDfZ5VWU1TcLwF.jpg', '2009-04-16', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('151960', 'Planes', 'tt1691917', 'Dusty is a cropdusting plane who dreams of competing in a famous aerial race. The problem? He is hopelessly afraid of heights. With the support of his mentor Skipper and a host of new friends, Dusty sets off to make his dreams come true.', '/c8ALtmmmtofVYOxSJG0S5ZcP2pF.jpg', '2013-08-09', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('152532', 'Dallas Buyers Club', 'tt0790636', 'Loosely based on the true-life tale of Ron Woodroof, a drug-taking, women-loving, homophobic man who in 1986 was diagnosed with HIV/AIDS and given thirty days to live.', '/aoxYci1HnJdb4bno2jYSnzSGDkL.jpg', '2013-09-07', '[{"id":18,"name":"Drama"},{"id":36,"name":"History"}]'),
('152601', 'Her', 'tt1798709', 'In the not so distant future, Theodore, a lonely writer purchases a newly developed operating system designed to meet the users every needs. To Theordores surprise, a romantic relationship develops between him and his operating system. This unconventional love story blends science fiction and romance in a sweet tale that explores the nature of love and the ways that technology isolates and connects us all.', '/fsoTLnUXEUTNuVCBxAJMY0HPPd.jpg', '2013-12-18', '[{"id":10749,"name":"Romance"},{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"}]'),
('152737', 'August: Osage County', 'tt1322269', 'A look at the lives of the strong-willed women of the Weston family, whose paths have diverged until a family crisis brings them back to the Midwest house they grew up in, and to the dysfunctional woman who raised them.', '/hkG0j7bfSBGB6NpPtYwW7zH0fU5.jpg', '2013-12-09', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('153518', 'The Angry Birds Movie', 'tt1985949', 'An island populated entirely by happy, flightless birds or almost entirely. In this paradise, Red, a bird with a temper problem, speedy Chuck, and the volatile Bomb have always been outsiders. But when the island is visited by mysterious green piggies, it’s up to these unlikely outcasts to figure out what the pigs are up to.', '/t2mZzQXjpQxmqtJOPpe8Dr2YpMl.jpg', '2016-05-11', '[{"id":28,"name":"Action"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('154400', 'The Drop', 'tt1600196', 'Bob Saginowski finds himself at the center of a robbery gone awry and entwined in an investigation that digs deep into the neighborhoods past where friends, families, and foes all work together to make a living - no matter the cost.', '/lj8AMCjWx0jU93XajzUEOUUNKZF.jpg', '2014-09-12', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('155', 'The Dark Knight', 'tt0468569', 'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', '/1hRoyzDtpgMU7Dz4JF22RANzQO7.jpg', '2008-07-16', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('156022', 'The Equalizer', 'tt0455944', 'In The Equalizer, Denzel Washington plays McCall, a man who believes he has put his mysterious past behind him and dedicated himself to beginning a new, quiet life. But when McCall meets Teri (Chloë Grace Moretz), a young girl under the control of ultra-violent Russian gangsters, he can’t stand idly by – he has to help her. Armed with hidden skills that allow him to serve vengeance against anyone who would brutalize the helpless, McCall comes out of his self-imposed retirement and finds his desire for justice reawakened. If someone has a problem, if the odds are stacked against them, if they have nowhere else to turn, McCall will help. He is The Equalizer.', '/2eQfjqlvPAxd9aLDs8DvsKLnfed.jpg', '2014-09-06', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"}]'),
('1562', '28 Weeks Later', 'tt0463854', 'In this chilling sequel to 28 Days Later, the inhabitants of the British Isles appear to have lost their battle against the onslaught of disease, as the deadly rage virus has killed every citizen there. Six months later, a group of Americans dare to set foot on the isles, convinced the danger has come and gone. But it soon becomes all too clear that the scourge continues to live, waiting to pounce on its next victims.', '/kcJ99AtUykDhpzfQOApsViQa3fj.jpg', '2007-04-26', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('1571', 'Live Free or Die Hard', 'tt0337978', 'John McClane is back and badder than ever, and this time hes working for Homeland Security. He calls on the services of a young hacker in his bid to stop a ring of Internet terrorists intent on taking control of Americas computer infrastructure.', '/pHWgbaXiQD2nmex7u8Xv6XmhaZS.jpg', '2007-06-20', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('1572', 'Die Hard: With a Vengeance', 'tt0112864', 'New York detective John McClane is back and kicking bad-guy butt in the third installment of this action-packed series, which finds him teaming with civilian Zeus Carver to prevent the loss of innocent lives. McClane thought hed seen it all, until a genius named Simon engages McClane, his new partner -- and his beloved city -- in a deadly game that demands their concentration.', '/ivpXGcsPZglyYrN65THWSD7JM3q.jpg', '1995-05-19', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('1573', 'Die Hard 2', 'tt0099423', 'John McClane is an off-duty cop gripped with a feeling of déjà vu when on a snowy Christmas Eve in the nations capital, terrorists seize a major international airport, holding thousands of holiday travelers hostage. Renegade military commandos led by a murderous rogue officer plot to rescue a drug lord from justice and are prepared for every contingency except one: McClanes smart-mouthed heroics.', '/zSgL998DXaljsCmwQuwDM8Ak4rV.jpg', '1990-07-02', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('157336', 'Interstellar', 'tt0816692', 'Interstellar chronicles the adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.', '/nBNZadXqJSdt05SHLqgT0HuC5Gm.jpg', '2014-11-05', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"}]'),
('157350', 'Divergent', 'tt1840309', 'In a world divided into factions based on personality types, Tris learns that shes been classified as Divergent and wont fit in. When she discovers a plot to destroy Divergents, Tris and the mysterious Four must find out what makes Divergents dangerous before its too late.', '/yTtx2ciqk4XdN1oKhMMDy3f5ue3.jpg', '2014-03-14', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('157353', 'Transcendence', 'tt2209764', 'Two leading computer scientists work toward their goal of Technological Singularity,  as a radical anti-technology organization fights to prevent them from creating a world where computers can transcend the abilities of the human brain.', '/4eESVBvr7KEvPGUZVL5LDWsANda.jpg', '2014-04-16', '[{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('157386', 'The Spectacular Now', 'tt1714206', 'A hard-partying high school seniors philosophy on life changes when he meets the not-so-typical nice girl.', '/iklgvkUqlruQrz8DlUsJzaa9HZh.jpg', '2013-08-02', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('1576', 'Resident Evil', 'tt0120804', 'When a virus leaks from a top-secret facility, turning all resident researchers into ravenous zombies and their lab animals into mutated hounds from hell, the government sends in an elite military task force to contain the outbreak. Alice and Rain are charged with leading the mission. But they only have three hours before the pathogen becomes airborne and infects the world.', '/fttmSgLEOdBNwQepW2lC6t0mbOm.jpg', '2002-03-15', '[{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1579', 'Apocalypto', 'tt0472043', 'Set in the Mayan civilization, when a mans idyllic presence is brutally disrupted by a violent invading force, he is taken on a perilous journey to a world ruled by fear and oppression where a harrowing end awaits him. Through a twist of fate and spurred by the power of his love for his woman and his family he will make a desperate break to return home and to ultimately save his way of life.', '/5BTFXR96hcBzmJvd9FwNayV79Xu.jpg', '2006-12-07', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"}]'),
('158011', 'The Call', 'tt1911644', 'Jordan Turner (Halle Berry) is an experienced 911 operator but when she makes an error in judgment and a call ends badly, Jordan is rattled and unsure if she can continue. But then teenager Casey Welson (Abigail Breslin) is abducted in the back of a mans car and calls 911. And Jordan is the one called upon to use all of her experience, insights and quick thinking to help Casey escape, and not just to save Casey, but to make sure the man is brought to justice.', '/ekKVxnKeHEQiBznaEnj0VmK28bc.jpg', '2013-03-14', '[{"id":53,"name":"Thriller"}]'),
('158015', 'The Purge', 'tt2184339', 'Given the countrys overcrowded prisons, the U.S. government begins to allow 12-hour periods of time in which all illegal activity is legal. During one of these free-for-alls, a family must protect themselves from a home invasion.', '/tGGJOuLHX7UDlTz57sjfhW1qreP.jpg', '2013-05-31', '[{"id":878,"name":"Science Fiction"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('1581', 'The Holiday', 'tt0457939', 'Two women, one (Cameron Diaz) from America and one (Kate Winslet) from Britain, swap homes at Christmastime after bad breakups with their boyfriends. Each woman finds romance with a local man (Jude Law, Jack Black) but realizes that the imminent return home may end the relationship.', '/ixNtpuq8OVp4IckgzkSJIflFDkw.jpg', '2006-12-08', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('158852', 'Tomorrowland', 'tt1964418', 'Bound by a shared destiny, a bright, optimistic teen bursting with scientific curiosity and a former boy-genius inventor jaded by disillusionment embark on a danger-filled mission to unearth the secrets of an enigmatic place somewhere in time and space that exists in their collective memory as Tomorrowland.', '/mGA8JtBKUs8HtdoiPad1FOlsLBi.jpg', '2015-05-19', '[{"id":28,"name":"Action"},{"id":10751,"name":"Family"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":9648,"name":"Mystery"}]'),
('1593', 'Night at the Museum', 'tt0477347', 'Chaos reigns at the natural history museum when night watchman Larry Daley accidentally stirs up an ancient curse, awakening Attila the Hun, an army of gladiators, a Tyrannosaurus rex and other exhibits. Larry tries desperately to keep the museum under control, but hes fighting a losing battle until President Teddy Roosevelt comes to the rescue.', '/NUbCSwy2EQ9Z6psUjPqr3WdVI2.jpg', '2006-10-20', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('1597', 'Meet the Parents', 'tt0212338', 'Greg Focker is ready to marry his girlfriend, Pam, but before he pops the question, he must win over her formidable father, humorless former CIA agent Jack Byrnes, at the wedding of Pams sister. As Greg bends over backward to make a good impression, his visit to the Byrnes home turns into a hilarious series of disasters, and everything that can go wrong does, all under Jacks critical, hawklike gaze.', '/wVjtQtzv9IcNRGnOOdcK797Sdxx.jpg', '2000-10-05', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('159824', 'Hotel Transylvania 2', 'tt2510894', 'When the old-old-old-fashioned vampire Vlad arrives at the hotel for an impromptu family get-together, Hotel Transylvania is in for a collision of supernatural old-school and modern day cool.', '/t4PLWexbe4wbNydCOBv18cYexup.jpg', '2015-09-21', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('16048', 'All About Anna', 'tt0349080', 'Anna is a young costume designer, focused on her job and wary of getting caught in romantic relationships. She has just found a new apartment, and is tempted to let her latest boyfriend, Frank, move in with her. Instead, she finds a tenant: The flamboyant, fun-loving Camilla, who shares Anna’s views on love and commitment. For both of them, it’s all about fun.', '/xiQKxPbn3LyVqI3cBtdyp4XIdLx.jpg', '2005-11-24', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('161', 'Oceans Eleven', 'tt0240772', 'Less than 24 hours into his parole, charismatic thief Danny Ocean is already rolling out his next plan: In one night, Dannys hand-picked crew of specialists will attempt to steal more than $150 million from three Las Vegas casinos. But to score the cash, Danny risks his chances of reconciling with ex-wife, Tess.', '/8QRqrKmBb4wlhHpcGiwltQYHy2y.jpg', '2001-12-07', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('161337', 'Underworld: Endless War', 'tt2381375', 'Underworld: Endless War is a collection of three short, anime-style tie-in stories-—whose creation was supervised by Len Wiseman, director of the first 2 Underworld movies and producer of Underworld 3 &amp; 4--each tell a different story, and at different periods of history to highlight new events of the Underworld mythology. These stories also tell of what happened before the events in Underworld: Awakening', '/niYJWvwVLiWiJmoVP8bowMRzPH8.jpg', '2011-10-19', '[{"id":28,"name":"Action"},{"id":16,"name":"Animation"},{"id":27,"name":"Horror"}]'),
('1620', 'Hitman', 'tt0465494', 'The best-selling videogame, Hitman, roars to life with both barrels blazing in this hardcore action-thriller starring Timothy Olyphant. A genetically engineered assassin with deadly aim, known only as Agent 47 eliminates strategic targets for a top-secret organization. But when hes double-crossed, the hunter becomes the prey as 47 finds himself in a life-or-death game of international intrigue.', '/1U2FpMotSyaciATw5qfEsKdgpX4.jpg', '2007-11-21', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('1624', 'Liar Liar', 'tt0119528', 'Fletcher Reede is a fast-talking attorney and habitual liar. When his son Max blows out the candles on his fifth birthday he has just one wish - that his dad will stop lying for 24 hours. When Maxs wish comes true, Fletcher discovers that his mouth has suddenly become his biggest liability.', '/qd8VcWKrE4cNfInl9Osb8o8h9KP.jpg', '1997-03-21', '[{"id":35,"name":"Comedy"}]'),
('163', 'Oceans Twelve', 'tt0349903', 'Danny Ocean reunites with his old flame and the rest of his merry band of thieves in a caper concerning three huge heists in Rome, Paris and Amsterdam. But Europol agent Isabel Lahiri is hot on their heels.', '/oBJ8LF80wX8PzhnPcNO0E9lnmYA.jpg', '2004-12-09', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('1631', 'Une vraie jeune fille', 'tt0135024', 'Bored and restless, Alice spends much of her time lusting after Jim, a local sawmill worker. When not lusting after him, Alice fills the hours with such pursuits as writing her name on a mirror with vaginal secretions and wandering the fields with her underwear around her ankles. And, in true teenaged tradition, she spends a lot of time writing in her diary.', '/39AriYTuZbwsMrTMc72mkO8dbVh.jpg', '1976-01-01', '[{"id":18,"name":"Drama"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('16320', 'Serenity', 'tt0379786', 'When the renegade crew of Serenity agrees to hide a fugitive on their ship, they find themselves in an action-packed battle between the relentless military might of a totalitarian regime who will destroy anything - or anyone - to get the girl back and the bloodthirsty creatures who roam the uncharted areas of space. But, the greatest danger of all may be on their ship.', '/1Hq659V31ER9pQQvVBUUJbwR7NT.jpg', '2005-08-25', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('1635', 'The Island', 'tt0399201', 'Lincoln Six-Echo is a resident of a seemingly Utopian but contained facility in the year 2019. Like all of the inhabitants of this carefully controlled environment, Lincoln hopes to be chosen to go to the The Island - reportedly the last uncontaminated spot on the planet. But Lincoln soon discovers that everything about his existence is a lie. He and all of the other inhabitants of the facility are actually human clones. Lincoln makes a daring escape with a beautiful fellow resident named Jordan Two-Delta. Relentlessly pursued by the forces of the sinister institute that once housed them, Lincoln and Jordan engage in a race for their lives to literally meet their makers.', '/erprD7GIkvZz2KM4Z35eyTJKZMI.jpg', '2005-07-20', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"}]'),
('1637', 'Speed', 'tt0111257', 'Los Angeles SWAT cop Jack Traven is up against bomb expert Howard Payne, whos after major ransom money. First its a rigged elevator in a very tall building. Then its a rigged bus--if it slows, it will blow, bad enough any day, but a nightmare in LA traffic. And thats still not the end.', '/bDLiyoxdK8mZHaeYVOxMZj7WGkb.jpg', '1994-06-09', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('165', 'Back to the Future Part II', 'tt0096874', 'Marty and Doc are at it again in this wacky sequel to the 1985 blockbuster as the time-traveling duo head to 2015 to nip some McFly family woes in the bud. But things go awry thanks to bully Biff Tannen and a pesky sports almanac. In a last-ditch attempt to set things straight, Marty finds himself bound for 1955 and face to face with his teenage parents -- again.', '/k5dzvCQkXU2CAhLtlj9BHE7xmyK.jpg', '1989-11-20', '[{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"}]'),
('16523', 'Where the Wild Things Are', 'tt0386117', 'Max imagines running away from his mom and sailing to a far-off land where large talking beasts -- Ira, Carol, Douglas, the Bull, Judith and Alexander -- crown him as their king, play rumpus, build forts and discover secret hideaways.', '/2bdxzUBv6h6gFEcrTO4BUzkBIck.jpg', '2009-10-16', '[{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('16538', 'I Love You, Man', 'tt1155056', 'Peter Klaven is a successful real estate agent who, upon getting engaged to the woman of his dreams, Zooey, discovers, to his dismay and chagrin, that he has no male friend close enough to serve as his Best Man. Peter immediately sets out to rectify the situation, embarking on a series of bizarre and awkward man-dates, before meeting Sydney Fife.', '/gFL5cazCOhgsoO2mQuYPMdFekfE.jpg', '2009-03-20', '[{"id":35,"name":"Comedy"}]'),
('16614', 'Adventureland', 'tt1091722', 'In the summer of 1987, a college graduate takes a nowhere job at his local amusement park, only to find its the perfect course to get him prepared for the real world.', '/hjSN69srPDuFeUkrChIgZ0Vh3i0.jpg', '2009-04-03', '[{"id":35,"name":"Comedy"}]'),
('166424', 'Fantastic Four', 'tt1502712', 'Four young outsiders teleport to a dangerous universe, which alters their physical form in shocking ways. Their lives irrevocably upended, the team must learn to harness their daunting new abilities and work together to save Earth from a former friend turned enemy.', '/g23cs30dCMiG4ldaoVNP1ucjs6.jpg', '2015-08-05', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('166426', 'Pirates of the Caribbean: Dead Men Tell No Tales', 'tt1790809', 'Thrust into an all-new adventure, a down-on-his-luck Captain Jack Sparrow finds the winds of ill-fortune blowing even more strongly when deadly ghost pirates led by his old nemesis, the terrifying Captain Salazar (Bardem), escape from the Devils Triangle, determined to kill every pirate at sea...including him. Captain Jacks only hope of survival lies in seeking out the legendary Trident of Poseidon, a powerful artifact that bestows upon its possessor total control over the seas.', '/mUQq4k4LxsXaiBrfIlRDyXq71aw.jpg', '2017-05-24', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":14,"name":"Fantasy"}]'),
('167073', 'Brooklyn', 'tt2381111', 'In 1950s Ireland and New York, young Ellis Lacey has to choose between two men and two countries.', '/yeA0eyNUmMlvXPkm9AHQfzxOwPy.jpg', '2015-11-04', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('168098', 'Cell', 'tt0775440', 'When a strange signal pulsates through all cell phone networks worldwide, it starts a murderous epidemic of epic proportions when users become bloodthirsty creatures, and a group of people in New England are among the survivors to deal with the ensuing chaos after.', '/sbflMQPcCXykooBh3aDX4LOSOlB.jpg', '2016-07-06', '[{"id":27,"name":"Horror"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('168259', 'Furious 7', 'tt2820852', 'Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.', '/dCgm7efXDmiABSdWDHBDBx2jwmn.jpg', '2015-04-01', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('168530', 'Ride Along', 'tt1408253', 'For the past two years, high-school security guard Ben has been trying to show decorated APD detective James that hes more than just a video-game junkie whos unworthy of James sister, Angela. When Ben finally gets accepted into the academy, he thinks hes earned the seasoned policemans respect and asks for his blessing to marry Angela. Knowing that a ride along will demonstrate if Ben has what it takes to take care of his sister, James invites him on a shift designed to scare the hell out of the trainee. But when the wild night leads them to the most notorious criminal in the city, James will find that his new partners rapid-fire mouth is just as dangerous as the bullets speeding at it.', '/fLXPcxZ1fJjxqUg94FFb8wwM9YN.jpg', '2014-01-17', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('16869', 'Inglourious Basterds', 'tt0361748', 'In Nazi-occupied France during World War II, a group of Jewish-American soldiers known as The Basterds are chosen specifically to spread fear throughout the Third Reich by scalping and brutally killing Nazis. The Basterds, lead by Lt. Aldo Raine soon cross paths with a French-Jewish teenage girl who runs a movie theater in Paris which is targeted by the soldiers.', '/6zYuTKyvcwmtNvXXvJZNT0IgBL0.jpg', '2009-08-18', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('169917', 'A Walk Among the Tombstones', 'tt0365907', 'Private investigator Matthew Scudder is hired by a drug kingpin to find out who kidnapped and murdered his wife.', '/xxe77USOk2tPnq7G4cL42gf1OxQ.jpg', '2014-09-18', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('16995', 'State of Play', 'tt0473705', 'Handsome, unflappable U.S. Congressman Stephen Collins is the future of his political party: an honorable appointee who serves as the chairman of a committee overseeing defense spending. All eyes are upon the rising star to be his partys contender for the upcoming presidential race. Until his research assistant/mistress is brutally murdered and buried secrets come tumbling out.', '/lH5rHsUM7Umo9xyyjPguK5kTXKd.jpg', '2009-04-17', '[{"id":28,"name":"Action"}]'),
('170522', 'Astérix: Le domaine des dieux', 'tt3759416', 'In order to wipe out the Gaulish village by any means necessary, Caesar plans to absorb the villagers into Roman culture by having an estate built next to the village to start a new Roman colony.', '/uGJmA6bh4gtH2nLMn4wlKazpGlj.jpg', '2014-11-26', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"}]'),
('170687', 'The Boxtrolls', 'tt0787474', 'The Boxtrolls is a comedic fable that unfolds in Cheesebridge, a posh Victorian-era town obsessed with wealth, class and the stinkiest of fine cheeses. Beneath its charming cobblestone streets dwell the Boxtrolls, foul monsters who crawl out of the sewers at night and steal what the townspeople hold most dear: their children and their cheeses. At least that’s the legend residents have always believed. In truth, the Boxtrolls are an underground cavern-dwelling community of quirky and lovable oddballs who wear recycled cardboard boxes the way turtles wear their shells. The Boxtrolls have raised an orphaned human boy since infancy as one of their dumpster-diving and mechanical junk-collecting own. When the Boxtrolls are targeted by a villainous pest exterminator who is bent on eradicating them as his ticket to Cheesebridge society, the kind-hearted band of tinkerers must turn to their adopted charge and an adventurous rich girl to bridge two worlds amidst the winds of change – and cheese.', '/82BWSf1NfCm18ZJtAOIym1QRd24.jpg', '2014-09-10', '[{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"}]'),
('171274', 'Inherent Vice', 'tt1791528', 'In Los Angeles at the turn of the 1970s, drug-fueled detective Larry Doc Sportello investigates the disappearance of an ex-girlfriend.', '/2fCg6FORkgRLpFIKlUg4gULIn1u.jpg', '2014-12-25', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('1715', 'The Cider House Rules', 'tt0124315', 'Homer is an orphan who was never adopted, becoming the favorite of orphanage director Dr. Larch. Dr. Larch imparts his full medical knowledge on Homer, who becomes a skilled, albeit unlicensed, physician. But Homer yearns for a self-chosen life outside the orphanage. What will Homer learn about life and love in the cider house? What of the destiny that Dr. Larch has planned for him?', '/lgRNj2qa6EWPqJQmtejkGKBZkvm.jpg', '1999-12-17', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('172385', 'Rio 2', 'tt2357291', 'Its a jungle out there for Blu, Jewel and their three kids after theyre hurtled from Rio de Janeiro to the wilds of the Amazon. As Blu tries to fit in, he goes beak-to-beak with the vengeful Nigel, and meets the most fearsome adversary of all: his father-in-law.', '/jZcF7xZVvrX2A4qNOqeHpmtbdBT.jpg', '2014-03-19', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('1724', 'The Incredible Hulk', 'tt0800080', 'Scientist Bruce Banner scours the planet for an antidote to the unbridled force of rage within him: the Hulk. But when the military masterminds who dream of exploiting his powers force him back to civilization, he finds himself coming face to face with a new, deadly foe.', '/qTghl3lO8PhmIxkf8eN5WQQefHI.jpg', '2008-06-12', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('1726', 'Iron Man', 'tt0371746', 'Tony Stark. Genius, billionaire, playboy, philanthropist. Son of legendary inventor and weapons contractor Howard Stark. When Tony Stark is assigned to give a weapons presentation to an Iraqi unit led by Lt. Col. James Rhodes, hes given a ride on enemy lines. That ride ends badly when Starks Humvee that hes riding in is attacked by enemy combatants. He survives - barely - with a chest full of shrapnel and a car battery attached to his heart. In order to survive he comes up with a way to miniaturize the battery and figures out that the battery can power something else. Thus Iron Man is born. He uses the primitive device to escape from the cave in Iraq. Once back home, he then begins work on perfecting the Iron Man suit. But the man who was put in charge of Stark Industries has plans of his own to take over Tonys technology for other matters.', '/s2IG9qXfhJYxIttKyroYFBsHwzQ.jpg', '2008-04-30', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"}]'),
('1734', 'The Mummy Returns', 'tt0209163', 'Rick and Evelyn OConnell, along with their 8 year old son Alex, discover the key to the legendary Scorpion Kings might, the fabled Bracelet of Anubis. Unfortunately, a newly resurrected Imhotep has designs on the bracelet as well, and isnt above kidnapping its new bearer, Alex, to gain control of Anubis otherworldly army.', '/hioiYUZVIuYIhagDGhIAjyNEUu0.jpg', '2001-04-28', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":14,"name":"Fantasy"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('17431', 'Moon', 'tt1182345', 'With only three weeks left in his three year contract, Sam Bell is getting anxious to finally return to Earth. He is the only occupant of a Moon-based manufacturing facility along with his computer and assistant, GERTY. The long period of time alone however has resulted in him talking to himself for the most part, or to his plants. Direct communication with Earth is not possible due to a long-standing communication malfunction but he does get an occasional message from his wife Tess. When he has an accident however, he wakens to find that he is not alone. He also comes to realize that his world is not what he thought it was.', '/2tgl9q3ZaVQUfSsbftqhRxXCElB.jpg', '2009-06-12', '[{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"}]'),
('17532', 'S. Darko', 'tt1231277', 'S. Darko follows Samantha Darko, the younger sister of Donnie, the protagonist of Donnie Darko, and her friend Corey. On their way to California, their car breaks down, forcing them to wait in a small town until it is fixed. While there, Samantha begins to have dreams that warn her of the end of the universe.', '/dAol6pkKEX7zM1rICqPgUWmas2S.jpg', '2009-04-28', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"}]'),
('17654', 'District 9', 'tt1136608', 'Aliens land in South Africa and have no way home. Years later after living in a slum and wearing out their welcome the Non-Humans are being moved to a new tent city overseen by Multi-National United (MNU). The movie follows an MNU employee tasked with leading the relocation and his relationship with one of the alien leaders.', '/axFmCRNQsW6Bto8XuJKo08MPPV5.jpg', '2009-08-05', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('1771', 'Captain America: The First Avenger', 'tt0458339', 'Predominantly set during World War II, Steve Rogers is a sickly man from Brooklyn whos transformed into super-soldier Captain America to aid in the war effort. Rogers must stop the Red Skull – Adolf Hitlers ruthless head of weaponry, and the leader of an organization that intends to use a mysterious device of untold powers for world domination.', '/dlIPGXPxXQTp9kFrRzn0RsfUelx.jpg', '2011-07-22', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('177572', 'Big Hero 6', 'tt2245084', 'The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.', '/hGRfWcy1HRGbsjK6jF7NILmqmFT.jpg', '2014-10-22', '[{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('177677', 'Mission: Impossible - Rogue Nation', 'tt2381249', 'Ethan and team take on their most impossible mission yet, eradicating the Syndicate - an International rogue organization as highly skilled as they are, committed to destroying the IMF.', '/z2sJd1OvAGZLxgjBdSnQoLCfn3M.jpg', '2015-07-23', '[{"id":28,"name":"Action"}]'),
('179', 'The Interpreter', 'tt0373926', 'A thriller about an interpreter who has overheard plans of an assassination at United Nations headquarters. An American Secret Service agent is sent to investigate as Silvia Broome, the interpreter, is in danger of being killed by the assassins.', '/aAW4W8x41TwWQUQpLQqkWNQbtlv.jpg', '2005-04-04', '[{"id":28,"name":"Action"}]'),
('18', 'The Fifth Element', 'tt0119116', 'It’s the year 2257 and a taxi driver has been unintentionally given the task of saving a young girl who is part of the key that will ensure the survival of humanity. The Fifth Element takes place in a futuristic metropolitan city and is filmed in a French comic book aesthetic by a British, French and American lineup.', '/zaFa1NRZEnFgRTv5OVXkNIZO78O.jpg', '1997-05-07', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('180', 'Minority Report', 'tt0181689', 'John Anderton is a top Precrime cop in the late-21st century, when technology can predict crimes before theyre committed. But Anderton becomes the quarry when another investigator targets him for a murder charge. Can Anderton find a glitch in the system and prove his innocence before its too late?', '/h3lpltSn7Rj1eYTPQO1lYGdw4Bz.jpg', '2002-06-20', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"}]'),
('181283', 'Child 44', 'tt1014763', 'Set in Stalin-era Soviet Union, a disgraced MGB agent is dispatched to investigate a series of child murders -- a case that begins to connect with the very top of party leadership.', '/nzXwfnBcsmREzHlem6fkStN1RUH.jpg', '2015-03-15', '[{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('181533', 'Night at the Museum: Secret of the Tomb', 'tt2692250', 'When the magic powers of The Tablet of Ahkmenrah begin to die out, Larry Daley (Ben Stiller) spans the globe, uniting favorite and new characters while embarking on an epic quest to save the magic before it is gone forever.', '/tWwASv4CU1Au1IukacdSUewDCV3.jpg', '2014-12-17', '[{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('1817', 'Phone Booth', 'tt0183649', 'A slick New York publicist who picks up a ringing receiver in a phone booth is told that if he hangs up, hell be killed... and the little red light from a laser rifle sight is proof that the caller isnt kidding.', '/xIaUpPok8WFnr79EAvgtGsIaJzV.jpg', '2002-09-09', '[{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"}]'),
('18239', 'The Twilight Saga: New Moon', 'tt1259571', 'Forks, Washington resident Bella Swan is reeling from the departure of her vampire love, Edward Cullen, and finds comfort in her friendship with Jacob Black, a werewolf. But before she knows it, shes thrust into a centuries-old conflict, and her desire to be with Edward at any cost leads her to take greater and greater risks.', '/4O6OCHVrXie2Th8asDn5utvlTwC.jpg', '2009-03-15', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('1824', '50 First Dates', 'tt0343660', 'Henry is a player skilled at seducing women. But when this veterinarian meets Lucy, a girl with a quirky problem when it comes to total recall, he realizes its possible to fall in love all over again…and again, and again. Thats because the delightful Lucy has no short-term memory, so Henry must woo her day after day until he finally sweeps her off her feet.', '/vKKdsaq3OomDvFdpPpWVg0L6gB9.jpg', '2004-02-13', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('18240', 'The Proposal', 'tt1041829', 'When she learns shes in danger of losing her visa status and being deported, overbearing book editor Margaret Tate forces her put-upon assistant, Andrew Paxton, to marry her.', '/xippClkb4VCE15uva13SAGf8Vsd.jpg', '2009-06-01', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('1830', 'Lord of War', 'tt0399295', 'Yuri Orlov is a globetrotting arms dealer. Through some of the deadliest war zones, Yuri struggles to stay one step ahead of a relentless Interpol agent, his business rivals, even some of his customers who include many of the worlds most notorious dictators. Finally, Yuri must also face his own conscience.', '/nwPUI9WlYtDmE5VO6eEFCfrNXWl.jpg', '2005-09-16', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('18360', 'Night at the Museum: Battle of the Smithsonian', 'tt1078912', 'Hapless museum night watchman Larry Daley must help his living, breathing exhibit friends out of a pickle now that theyve been transferred to the archives at the Smithsonian Institution. Larrys (mis)adventures this time include close encounters with Amelia Earhart, Abe Lincoln and Ivan the Terrible.', '/qbU6AxmO69bBwu6Tw8HtcRoltAA.jpg', '2009-05-20', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('184315', 'Hercules', 'tt1267297', 'Fourteen hundred years ago, a tormented soul walked the earth that was neither man nor god. Hercules was the powerful son of the god king Zeus, for this he received nothing but suffering his entire life. After twelve arduous labors and the loss of his family, this dark, world-weary soul turned his back on the gods finding his only solace in bloody battle. Over the years he warmed to the company of six similar souls, their only bond being their love of fighting and presence of death. These men and woman never question where they go to fight or why or whom, just how much they will be paid. Now the King of Thrace has hired these mercenaries to train his men to become the greatest army of all time. It is time for this bunch of lost souls to finally have their eyes opened to how far they have fallen when they must train an army to become as ruthless and blood thirsty as their reputation has become.', '/wGAWxOnVjwXqvoiKX7Pf6XOWnPJ.jpg', '2014-07-23', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('1844', 'Entrapment', 'tt0137494', 'When retired thief Robert Mac MacDougal is implicated in the disappearance of a priceless painting, insurance investigator Virginia Gin Baker sets a trap to catch her suspect. But Gin is not exactly who she seems. Soon, she and Mac have joined forces to pull off -- quite literally -- the heist of the millennium.', '/6IKmjW52qeMXx8xXMdX6RRshmY0.jpg', '1999-04-30', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":10749,"name":"Romance"}]'),
('185', 'A Clockwork Orange', 'tt0066921', 'The head of a gang of toughs, in an insensitive futuristic society, is conditioned to become physically ill at sex and violence during a prison sentence. When he is released, hes brutally beaten by all of his old adversaries.', '/hJYwfHxh9O7lyF7hTIT7ZoP8FYQ.jpg', '1971-12-18', '[{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"}]'),
('18501', 'Gamer', 'tt1034032', 'Mind-control technology has taken society by a storm, a multiplayer on-line game called Slayers allows players to control human prisoners in mass-scale. Simon (Lerman) controls Kable (Butler), the online champion of the game. Kables ultimate challenge becomes regaining his identity and independence by defeating the games mastermind (Hall).', '/ki0s06d4iUeDEdLfCcQQO2NY6Co.jpg', '2009-09-03', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('18533', 'Bronson', 'tt1172570', 'A young man who was sentenced to 7 years in prison for robbing a post office ends up spending 30 years in solitary confinement. During this time, his own personality is supplanted by his alter ego, Charles Bronson.', '/dnNR1IpEboT6zmWdo4lw7LTzVEm.jpg', '2008-10-09', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"}]'),
('1865', 'Pirates of the Caribbean: On Stranger Tides', 'tt1298650', 'Captain Jack Sparrow crosses paths with a woman from his past, and hes not sure if its love -- or if shes a ruthless con artist whos using him to find the fabled Fountain of Youth. When she forces him aboard the Queen Annes Revenge, the ship of the formidable pirate Blackbeard, Jack finds himself on an unexpected adventure in which he doesnt know who to fear more: Blackbeard or the woman from his past.', '/jUkGuSC9Kt29rW3x6UiB9zyZr1M.jpg', '2011-05-11', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"}]'),
('187', 'Sin City', 'tt0401792', 'Welcome to Sin City. This town beckons to the tough, the corrupt, the brokenhearted. Some call it dark… Hard-boiled. Then there are those who call it home — Crooked cops, sexy dames, desperate vigilantes. Some are seeking revenge, others lust after redemption, and then there are those hoping for a little of both. A universe of unlikely and reluctant heroes still trying to do the right thing in a city that refuses to care.', '/vKJVGOKPyWqp9d2EX5NH1liqRqR.jpg', '2005-03-31', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('187017', '22 Jump Street', 'tt2294449', 'After making their way through high school (twice), big changes are in store for officers Schmidt and Jenko when they go deep undercover at a local college. But when Jenko meets a kindred spirit on the football team, and Schmidt infiltrates the bohemian art major scene, they begin to question their partnership. Now they dont have to just crack the case - they have to figure out if they can have a mature relationship. If these two overgrown adolescents can grow from freshmen into real men, college might be the best thing that ever happened to them.', '/gNlV5FhDZ1PjxSv2aqTPS30GEon.jpg', '2014-06-05', '[{"id":80,"name":"Crime"},{"id":35,"name":"Comedy"},{"id":28,"name":"Action"}]'),
('1878', 'Fear and Loathing in Las Vegas', 'tt0120669', 'The hallucinogenic misadventures of sportswriter Raoul Duke and his Samoan lawyer, Dr. Gonzo, on a three-day romp from Los Angeles to Las Vegas. Motoring across the Mojave Desert on the way to Sin City, Duke and his purple haze passenger ingest a cornucopia of drugs ranging from acid to ether.', '/u9ffgobMADj6GCafeImbov566j9.jpg', '1998-05-22', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('18785', 'The Hangover', 'tt1119646', 'When three friends finally come to after a raucous night of bachelor-party revelry, they find a baby in the closet and a tiger in the bathroom. But they cant seem to locate their best friend, Doug -- whos supposed to be tying the knot. Launching a frantic search for Doug, the trio perseveres through a nasty hangover to try to make it to the church on time.', '/eshEkiG7NmU4ekA8CtpIdYiYufZ.jpg', '2009-06-05', '[{"id":35,"name":"Comedy"}]'),
('188222', 'Entourage', 'tt1674771', 'Movie star Vincent Chase, together with his boys, Eric, Turtle and Johnny, are back…and back in business with super agent-turned-studio head Ari Gold. Some of their ambitions have changed, but the bond between them remains strong as they navigate the capricious and often cutthroat world of Hollywood.', '/lR4dwcfgCBMklKjiQXuFzRM3gfl.jpg', '2015-06-03', '[{"id":35,"name":"Comedy"}]'),
('18823', 'Clash of the Titans', 'tt0800320', 'Born of a god but raised as a man, Perseus is helpless to save his family from Hades, vengeful god of the underworld. With nothing to lose, Perseus volunteers to lead a dangerous mission to defeat Hades before he can seize power from Zeus and unleash hell on earth. Battling unholy demons and fearsome beasts, Perseus and his warriors will only survive if Perseus accepts his power as a god, defies fate and creates his own destiny.', '/n8W2Y72VzSi8Yz6IvYWwfoiMTS6.jpg', '2010-04-01', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('1883', 'Malcolm X', 'tt0104797', 'The biopic of the controversial and influential Black Nationalist leader.', '/jDQ2iBJuiimvYqk9orA2YaigBmW.jpg', '1992-11-18', '[{"id":18,"name":"Drama"},{"id":36,"name":"History"}]'),
('188927', 'Star Trek Beyond', 'tt2660888', 'The USS Enterprise crew explores the furthest reaches of uncharted space, where they encounter a mysterious new enemy who puts them and everything the Federation stands for to the test.', '/ghL4ub6vwbYShlqCFHpoIRwx2sm.jpg', '2016-07-07', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('189', 'Sin City: A Dame to Kill For', 'tt0458481', 'Some of Sin Citys most hard-boiled citizens cross paths with a few of its more reviled inhabitants.', '/k80qKrJ0qQ6ocVo5N932stNSg6j.jpg', '2014-08-20', '[{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('1891', 'The Empire Strikes Back', 'tt0080684', 'The epic saga continues as Luke Skywalker, in hopes of defeating the evil Galactic Empire, learns the ways of the Jedi from aging master Yoda. But Darth Vader is more determined than ever to capture Luke. Meanwhile, rebel leader Princess Leia, cocky Han Solo, Chewbacca, and droids C-3PO and R2-D2 are thrown into various stages of capture, betrayal and despair.', '/6u1fYtxG5eqjhtCPDx04pJphQRW.jpg', '1980-01-01', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1892', 'Return of the Jedi', 'tt0086190', 'As Rebel leaders map their strategy for an all-out attack on the Emperors newer, bigger Death Star. Han Solo remains frozen in the cavernous desert fortress of Jabba the Hutt, the most loathsome outlaw in the universe, who is also keeping Princess Leia as a slave girl. Now a master of the Force, Luke Skywalker rescues his friends, but he cannot become a true Jedi Knight until he wages his own crucial battle against Darth Vader, who has sworn to win Luke over to the dark side of the Force.', '/jx5p0aHlbPXqe3AH9G15NvmWaqQ.jpg', '1983-05-23', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1893', 'Star Wars: Episode I - The Phantom Menace', 'tt0120915', 'Anakin Skywalker, a young slave strong with the Force, is discovered on Tatooine. Meanwhile, the evil Sith have returned, enacting their plot for revenge against the Jedi.', '/n8V09dDc02KsSN6Q4hC2BX6hN8X.jpg', '1999-05-19', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1894', 'Star Wars: Episode II - Attack of the Clones', 'tt0121765', 'Ten years after the invasion of Naboo, the galaxy is on the brink of civil war. Under the leadership of a renegade Jedi named Count Dooku, thousands of solar systems threaten to break away from the Galactic Republic. When an assassination attempt is made on Senator Padmé Amidala, the former Queen of Naboo, twenty-year-old Jedi apprentice Anakin Skywalker is assigned to protect her. In the course of his mission, Anakin discovers his love for Padmé as well as his own darker side. Soon, Anakin, Padmé, and Obi-Wan Kenobi are drawn into the heart of the Separatist movement and the beginning of the Clone Wars.', '/2vcNFtrZXNwIcBgH5e2xXCmVR8t.jpg', '2002-05-15', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1895', 'Star Wars: Episode III - Revenge of the Sith', 'tt0121766', 'Years after the onset of the Clone Wars, the noble Jedi Knights lead a massive clone army into a galaxy-wide battle against the Separatists. When the sinister Sith unveil a thousand-year-old plot to rule the galaxy, the Republic crumbles and from its ashes rises the evil Galactic Empire. Jedi hero Anakin Skywalker is seduced by the dark side of the Force to become the Emperors new apprentice -- Darth Vader. The Jedi are decimated, as Obi-Wan Kenobi and Jedi Master Yoda are forced into hiding. The only hope for the galaxy are Anakins own offspring -- the twin children born in secrecy who will grow up to become heroes.', '/tgr5Pdy7ehZYBqBkN2K7Q02xgOb.jpg', '2005-05-17', '[{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":28,"name":"Action"}]'),
('1907', 'The Beach', 'tt0163978', 'Twenty-something Richard travels to Thailand and finds himself in possession of a strange map. Rumours state that it leads to a solitary beach paradise, a tropical bliss - excited and intrigued, he sets out to find it.', '/61tQHc1RL4p2DQKn6JkAdj0WXqI.jpg', '2000-02-11', '[{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"},{"id":10749,"name":"Romance"},{"id":53,"name":"Thriller"}]'),
('190859', 'American Sniper', 'tt2179136', 'U.S. Navy SEAL Chris Kyle takes his sole mission—protect his comrades—to heart and becomes one of the most lethal snipers in American history. His pinpoint accuracy not only saves countless lives but also makes him a prime target of insurgents. Despite grave danger and his struggle to be a good husband and father to his family back in the States, Kyle serves four tours of duty in Iraq. However, when he finally returns home, he finds that he cannot leave the war behind.', '/svPHnYE7N5NAGO49dBmRhq0vDQ3.jpg', '2014-12-11', '[{"id":10752,"name":"War"},{"id":28,"name":"Action"}]'),
('1927', 'Hulk', 'tt0286716', 'Bruce Banner, a genetics researcher with a tragic past, suffers an accident that causes him to transform into a raging green monster when he gets angry', '/ogCQV6mnLtCJuiiHtMB83jvSRfY.jpg', '2003-06-19', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('1930', 'The Amazing Spider-Man', 'tt0948470', 'Peter Parker is an outcast high schooler was abandoned by his parents as a boy, leaving him to be raised by his Uncle Ben and Aunt May. Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents disappearance—leading him directly to Oscorp and the lab of Dr. Curt Connors, his fathers former partner. As Spider-Man is set on a collision course with Connors alter ego, The Lizard, Peter will make life-altering choices to use his powers and shape his destiny to become a hero.', '/eA2D86Y6VPWuUzZyatiLBwpTilQ.jpg', '2012-06-27', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('193610', 'The Other Woman', 'tt2203939', 'After discovering her boyfriend is married, Carly soon meets the wife hes been cheating on. And when yet another affair is discovered, all three women team up to plot mutual revenge on the three-timing SOB.', '/fu7K3rPwJcScizlXbxWAR7ZoUxt.jpg', '2014-04-16', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('193756', 'Lone Survivor', 'tt1091191', 'Based on the failed June 28, 2005 mission Operation Red Wing. Four members of SEAL Team 10, were tasked with the mission to capture or kill notorious Taliban leader, Ahmad Shah. Only one member of the team survived.', '/8ST6iVp3fkUSbUpXRAc2Q96YQRk.jpg', '2013-12-24', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('193893', 'Lets Be Cops', 'tt1924435', 'Its the ultimate buddy cop movie except for one thing: theyre not cops.  When two struggling pals dress as police officers for a costume party, they become neighborhood sensations.  But when these newly-minted “heroes” get tangled in a real life web of mobsters and dirty detectives, they must put their fake badges on the line.', '/8GVU8AaYpxiIS462SZgAtjh02pm.jpg', '2014-08-13', '[{"id":35,"name":"Comedy"}]'),
('194', 'Le fabuleux destin dAmélie Poulain', 'tt0211915', 'At a tiny Parisian café, the adorable yet painfully shy Amélie (Audrey Tautou) accidentally discovers a gift for helping others. Soon Amelie is spending her days as a matchmaker, guardian angel, and all-around do-gooder. But when she bumps into a handsome stranger, will she find the courage to become the star of her very own love story?', '/f0uorE7K7ggHfr8r7pUTOHWkOlE.jpg', '2001-04-25', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('194662', 'Birdman', 'tt2562232', 'A fading actor best known for his portrayal of a popular superhero attempts to mount a comeback by appearing in a Broadway play. As opening night approaches, his attempts to become more altruistic, rebuild his career, and reconnect with friends and family prove more difficult than expected.', '/rSZs93P0LLxqlVEbI001UKoeCQC.jpg', '2014-10-17', '[{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('1954', 'The Butterfly Effect', 'tt0289879', 'A young man struggles to access sublimated childhood memories. He finds a technique that allows him to travel back into the past, to occupy his childhood body and change history. However, he soon finds that every change he makes has unexpected consequences.', '/dixYctWFLuuWCHrk25zt7QsFJqd.jpg', '2004-01-22', '[{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('195589', 'Neighbors', 'tt2004420', 'A couple with a newborn baby face unexpected difficulties after they are forced to live next to a fraternity house.', '/bpj8myebvnTw5HDmzTSI8N6WFYr.jpg', '2014-05-08', '[{"id":35,"name":"Comedy"}]'),
('196', 'Back to the Future Part III', 'tt0099088', 'The final installment of the Back to the Future trilogy finds Marty digging the trusty DeLorean out of a mineshaft and looking up Doc in the Wild West of 1885. But when their time machine breaks down, the travelers are stranded in a land of spurs. More problems arise when Doc falls for pretty schoolteacher Clara Clayton, and Marty tangles with Buford Tannen.', '/6DmgPTZYaug7QNDjOhUDWyjOQDl.jpg', '1990-05-25', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"},{"id":10751,"name":"Family"}]'),
('1966', 'Alexander', 'tt0346491', 'Alexander, the King of Macedonia, leads his legions against the giant Persian Empire. After defeating the Persians he leads his Army across the then known world venturing further than any Westerner had ever gone all the way to India.', '/cJrnmbsFm5cEt0pHZZ2a1ueH5aT.jpg', '2004-11-23', '[{"id":10752,"name":"War"},{"id":36,"name":"History"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('196867', 'Annie', 'tt1823664', 'Ever since her parents left her as a baby, little Annie has led a hard-knock life with her calculating foster mother, Miss Hannigan. However, all that changes when hard-nosed billionaire and mayoral candidate Will Stacks takes her in on the recommendation of his advisers. Stacks believes that hes Annies guardian angel, but the plucky youngsters confidence and sunny outlook may mean that Annie will save Will instead.', '/hkvKhuUUgjJ4jrXKkvqoQ5JnQx5.jpg', '2014-12-19', '[{"id":10402,"name":"Music"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"}]'),
('197', 'Braveheart', 'tt0112573', 'Enraged at the slaughter of Murron, his new bride and childhood love, legendary Scottish warrior William Wallace slays a platoon of the local English lords soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.', '/2qAgGeYdLjelOEqjW9FYvPHpplC.jpg', '1995-05-24', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":36,"name":"History"},{"id":10752,"name":"War"}]'),
('1979', '4: Rise of the Silver Surfer', 'tt0486576', 'The Fantastic Four return to the big screen as a new and all powerful enemy threatens the Earth. The seemingly unstoppable Silver Surfer, but all is not what it seems and there are old and new enemies that pose a greater threat than the intrepid superheroes realize.', '/fXpziQgnBnB4bLgjKhjTbLQumE5.jpg', '2007-06-13', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('198184', 'Chappie', 'tt1823672', 'Every child comes into the world full of promise, and none more so than Chappie: he is gifted, special, a prodigy. Like any child, Chappie will come under the influence of his surroundings—some good, some bad—and he will rely on his heart and soul to find his way in the world and become his own man. But theres one thing that makes Chappie different from any one else: he is a robot.', '/saF3HtAduvrP9ytXDxSnQJP3oqx.jpg', '2015-03-04', '[{"id":80,"name":"Crime"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('198277', 'Begin Again', 'tt1980929', 'Grettas celebrity boyfriend breaks up with her after a long-term relationship, leaving the singer to find success on her own. With the help of record producer, Dan and hip-hop celebrity, Trouble Gum, Gretta strives to fulfil her musical ambitions.', '/og7KVMqGTFaCNPmGVetxtR30Q0z.jpg', '2013-09-07', '[{"id":35,"name":"Comedy"},{"id":10402,"name":"Music"},{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('198663', 'The Maze Runner', 'tt1790864', 'Set in a post-apocalyptic world, young Thomas is deposited in a community of boys after his memory is erased, soon learning theyre all trapped in a maze that will require him to join forces with fellow runners for a shot at escape.', '/coss7RgL0NH6g4fC2s5atvf3dFO.jpg', '2014-09-10', '[{"id":28,"name":"Action"},{"id":9648,"name":"Mystery"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('19898', 'Pandorum', 'tt1188729', 'Two crew members wake up on an abandoned spacecraft with no idea who they are, how long theyve been asleep, or what their mission is. The two soon discover theyre actually not alone - and the reality of their situation is more horrifying than they could have imagined.', '/qFd7dNvV1neXBV5OZdU5jOhdDZ6.jpg', '2009-09-08', '[{"id":28,"name":"Action"},{"id":27,"name":"Horror"},{"id":9648,"name":"Mystery"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('199', 'Star Trek: First Contact', 'tt0117731', 'The Borg, a relentless race of cyborgs, are on a direct course for Earth. Violating orders to stay away from the battle, Captain Picard and the crew of the newly-commissioned USS Enterprise E pursue the Borg back in time to prevent the invaders from changing Federation history and assimilating the galaxy.', '/qhVB8eUGwkdVvd8Fezk0AgcMPDH.jpg', '1996-11-21', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('19908', 'Zombieland', 'tt1156398', 'Columbus has made a habit of running from what scares him. Tallahassee doesnt have fears. If he did, hed kick their ever-living ass. In a world overrun by zombies, these two are perfectly evolved survivors. But now, theyre about to stare down the most terrifying prospect of all: each other.', '/vUzzDpVrab1BOG3ogxhRGfLN94d.jpg', '2009-10-07', '[{"id":35,"name":"Comedy"},{"id":27,"name":"Horror"}]'),
('1991', 'Death Proof', 'tt1028528', 'Austins hottest DJ, Jungle Julia, sets out into the night to unwind with her two friends Shanna and Arlene. Covertly tracking their moves is Stuntman Mike, a scarred rebel leering from behind the wheel of his muscle car, revving just feet away.', '/nyQBcpxqS4im2akQlWG9Y1oeM2V.jpg', '2007-05-21', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('19913', '(500) Days of Summer', 'tt1022603', 'Tom (Joseph Gordon-Levitt), greeting-card writer and hopeless romantic, is caught completely off-guard when his girlfriend, Summer (Zooey Deschanel), suddenly dumps him. He reflects on their 500 days together to try to figure out where their love affair went sour, and in doing so, Tom rediscovers his true passions in life.', '/5SjtNPD1bb182vzQccvEUpXHFjN.jpg', '2009-07-17', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('1995', 'Lara Croft: Tomb Raider', 'tt0146316', 'English aristocrat Lara Croft is skilled in hand-to-hand combat and in the middle of a battle with a secret society. The shapely archaeologist moonlights as a tomb raider to recover lost antiquities and meets her match in the evil Powell, whos in search of a powerful relic.', '/m6aodY7SrvlTRiUFkxClaNAIQT.jpg', '2001-06-11', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('1996', 'Lara Croft Tomb Raider: The Cradle of Life', 'tt0325703', 'Intrepid British archaeologist Lara Croft has made perhaps the most important archaeological discovery in history: an orb that leads to the mythical Pandoras Box. Unfortunately, the orb falls into the hands of Jonathan Reiss, an evil scientist who deals in killer viruses and hopes to sell the secrets of the box as the ultimate weapon.', '/pkSnQzjjQ3Z9B2CJVSZCfL0Ea3s.jpg', '2003-07-21', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":53,"name":"Thriller"}]'),
('19995', 'Avatar', 'tt0499549', 'In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.', '/tcqb9NHdw9SWs2a88KCDD4V8sVR.jpg', '2009-12-10', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('200727', 'Love, Rosie', 'tt1638002', 'Rosie and Alex are best friends. They are suddenly separated when Alex and his family move from Dublin to America. Can their friendship survive years and miles? Will they gamble everything for true love?', '/qGYr7P3s0gx5YLvrILnbAkpTt1K.jpg', '2014-07-02', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('201', 'Star Trek: Nemesis', 'tt0253754', 'En route to the honeymoon of William Riker to Deanna Troi on her home planet of Betazed, Captain Jean-Luc Picard and the crew of the U.S.S. Enterprise receives word from Starfleet that a coup has resulted in the installation of a new Romulan political leader, Shinzon, who claims to seek peace with the human-backed United Federation of Planets. Once in enemy territory, the captain and his crew make a startling discovery: Shinzon is human, a slave from the Romulan sister planet of Remus, and has a secret, shocking relationship to Picard himself.', '/n4TpLWPi062AofIq4kwmaPNBSvA.jpg', '2002-12-12', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('201085', 'Crimson Peak', 'tt2554274', 'In the aftermath of a family tragedy, an aspiring author is torn between love for her childhood friend and the temptation of a mysterious outsider. Trying to escape the ghosts of her past, she is swept away to a house that breathes, bleeds… and remembers.', '/pCj8zem1NDAODdtvha9WFEB6iWR.jpg', '2015-10-13', '[{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"},{"id":14,"name":"Fantasy"},{"id":27,"name":"Horror"},{"id":18,"name":"Drama"}]'),
('201088', 'Blackhat', 'tt2717822', 'A man is released from prison to help American and Chinese authorities pursue a mysterious cyber criminal. The dangerous search leads them from Chicago to Hong Kong.', '/sW3VEsulmxMlOmQwm0h7H7lZROi.jpg', '2015-01-13', '[{"id":9648,"name":"Mystery"},{"id":80,"name":"Crime"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"}]'),
('2034', 'Training Day', 'tt0139654', 'On his first day on the job as a narcotics officer, a rookie cop works with a rogue detective who isnt what he appears.', '/sDT2biSB7wzBJdXq9o3ldr7VfvY.jpg', '2001-10-05', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('20352', 'Despicable Me', 'tt1323594', 'In a happy suburban neighbourhood surrounded by white picket fences with flowering rose bushes, sits a black house with a dead lawn. Unbeknownst to the neighbours, hidden deep beneath this home is a vast secret hideout. Surrounded by an army of tireless, little yellow minions, we discover Gru, planning the biggest heist in the history of the world. He is going to steal the moon (Yes, the moon!) to prove to his Mum that he is better than the other super-villains, especially the new kid on the block, Vector. Gru delights in all things wicked. Armed with his arsenal of shrink rays, freeze guns and battle-ready vehicles for land and air, he vanquishes all who stand in his way. Until the day he encounters the immense will of three little orphaned girls who look at him and see something that no one else has ever seen: a potential dad.', '/4zHJhBSY4kNZXfhTlmy2TzXD51M.jpg', '2010-07-08', '[{"id":28,"name":"Action"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('203801', 'The Man from U.N.C.L.E.', 'tt1638355', 'At the height of the Cold War, a mysterious criminal organization plans to use nuclear weapons and technology to upset the fragile balance of power between the United States and Soviet Union. CIA agent Napoleon Solo and KGB agent Illya Kuryakin are forced to put aside their hostilities and work together to stop the evildoers in their tracks. The duos only lead is the daughter of a missing German scientist, whom they must find soon to prevent a global catastrophe.', '/5ttOaThDVmTpV8iragbrhdfxEep.jpg', '2015-08-13', '[{"id":35,"name":"Comedy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('204', 'Le salaire de la peur', 'tt0046268', 'In the South American jungle, supplies of nitroglycerine are needed at a remote oil field. The oil company pays four men to deliver the supplies in two trucks. A tense rivalry develops between the two sets of drivers on the rough remote roads where the slightest jolt can result in death.', '/3IGuAr1xsErR4XqmHZcfyQ4f8KY.jpg', '1953-04-22', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('204082', 'Homefront', 'tt2312718', 'Phil Broker is a former DEA agent who has gone through a crisis after his action against a biker gang went horribly wrong and it cost the life of his boss son. He is recently widowed and is left with a 9-years-old daughter,Maddy. He decides to quit the turbulent and demanding life of thrill for Maddys sake and retires to a small town. His daughter fights off a boy who was bullying her at school and this sets in motion a round of events that end in his direct confrontation with the local Meth drug lord. His past history with the biker gang also enters the arena, making matters more complex. But he has a mission in his mind to protect his daughter and he is ready to pay any cost that it demands.', '/6ymSuhG28tF2lnDxVTNibzlYzn0.jpg', '2013-11-27', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('2048', 'I, Robot', 'tt0343818', 'In the year 2035, where robots are common and abide by the three laws of robotics, a techno-phobic cop investigates an apparent suicide. Suspecting that a robot may be responsible for the death, his investigation leads him to believe that humanity may be in danger.', '/2mkFzf168xJrV6Leqq0bjqOlJCK.jpg', '2004-07-16', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('204922', 'Before I Go to Sleep', 'tt1726592', 'A woman wakes up every day, remembering nothing as a result of a traumatic accident in her past. One day, new terrifying truths emerge that force her to question everyone around her.', '/3UG2Pb122c7Va8MBtr1OHRB1YPh.jpg', '2014-09-03', '[{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('20504', 'The Book of Eli', 'tt1037705', 'A post-apocalyptic tale, in which a lone man fights his way across America in order to protect a sacred book that holds the secrets to saving humankind.', '/qL3FnEug9DyBcaBXVb0oT3DJMJu.jpg', '2010-01-14', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('20526', 'TRON: Legacy', 'tt1104001', 'Sam Flynn, the tech-savvy and daring son of Kevin Flynn, investigates his fathers disappearance and is pulled into The Grid. With the help of a mysterious program named Quorra, Sam quests to stop evil dictator Clu from crossing into the real world.', '/vllvystwQjmXzy5OvBKnGl1JREF.jpg', '2010-12-10', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('205584', 'Gods of Egypt', 'tt2404233', 'A common thief joins a mythical god on a quest through Egypt.', '/uPqAW07bGoljf3cmT5gecdOvVol.jpg', '2016-02-25', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('205587', 'The Judge', 'tt1872194', 'A successful lawyer returns to his hometown for his mothers funeral only to discover that his estranged father, the towns judge, is suspected of murder.', '/v6s65U6qisvxWgO3cNnreaaaite.jpg', '2014-10-08', '[{"id":18,"name":"Drama"}]'),
('205588', 'Our Kind of Traitor', 'tt1995390', 'A young Oxford academic and his attorney girlfriend holiday on Antigua. They bump into a Russian millionaire who owns a peninsula and a diamond watch. He wants a game of tennis. What else he wants propels the lovers on a tortuous journey to the City of London and its unholy alliance with Britains intelligence establishment, to Paris and the Alps.', '/mQHscrTWLHdrsyGYolSevlGtTVa.jpg', '2016-05-05', '[{"id":53,"name":"Thriller"}]'),
('205596', 'The Imitation Game', 'tt2084970', 'Based on the real life story of legendary cryptanalyst Alan Turing, the film portrays the nail-biting race against time by Turing and his brilliant team of code-breakers at Britains top-secret Government Code and Cypher School at Bletchley Park, during the darkest days of World War II.', '/noUp0XOqIcmgefRnRZa1nhtRvWO.jpg', '2014-11-14', '[{"id":36,"name":"History"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('205775', 'In the Heart of the Sea', 'tt1390411', 'In the winter of 1820, the New England whaling ship Essex was assaulted by something no one could believe: a whale of mammoth size and will, and an almost human sense of vengeance.  The real-life maritime disaster would inspire Herman Melville’s Moby Dick.  But that told only half the story.  “Heart of the Sea” reveals the encounter’s harrowing aftermath, as the ship’s surviving crew is pushed to their limits and forced to do the unthinkable to stay alive.  Braving storms, starvation, panic and despair, the men will call into question their deepest beliefs, from the value of their lives to the morality of their trade, as their captain searches for direction on the open sea and his first mate still seeks to bring the great whale down.', '/uekIGnzTACciWrfR7jOuof7xHgR.jpg', '2015-11-20', '[{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":36,"name":"History"}]'),
('2059', 'National Treasure', 'tt0368891', 'Modern treasure hunters, led by archaeologist Ben Gates, search for a chest of riches rumored to have been stashed away by George Washington, Thomas Jefferson and Benjamin Franklin during the Revolutionary War. The chests whereabouts may lie in secret clues embedded in the Constitution and the Declaration of Independence, and Gates is in a race to find the gold before his enemies do.', '/luMoc56LLMWUt60vUNNpwxrbTNt.jpg', '2004-11-08', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('2062', 'Ratatouille', 'tt0382932', 'In one of Paris finest restaurants, Remy, a determined young rat, dreams of becoming a renowned French chef. Torn between his familys wishes and his true calling. Remy and his pal Linguini set in motion a hilarious chain of events that turns the City of Lights upside down.', '/y8y6Fv0k068OnHBZtu949A1t6pj.jpg', '2007-06-28', '[{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":16,"name":"Animation"}]'),
('206487', 'Predestination', 'tt2397535', 'Predestination chronicles the life of a Temporal Agent sent on an intricate series of time-travel journeys designed to prevent future killers from committing their crimes. Now, on his final assignment, the Agent must stop the one criminal that has eluded him throughout time and prevent a devastating attack in which thousands of lives will be lost.', '/kDdUtDsGMQ3OYwoBtEQyJIGPz4V.jpg', '2014-08-28', '[{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('20662', 'Robin Hood', 'tt0955308', 'When soldier Robin happens upon the dying Robert of Loxley, he promises to return the mans sword to his family in Nottingham. There, he assumes Roberts identity; romances his widow, Marion; and draws the ire of the towns sheriff and King Johns henchman, Godfrey.', '/4gH0vhyOcl7QV3t81653CpWjEB6.jpg', '2010-05-12', '[{"id":28,"name":"Action"}]'),
('206647', 'Spectre', 'tt2379713', 'A cryptic message from Bond’s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.', '/hE24GYddaxB9MVZl1CaiI86M3kp.jpg', '2015-10-26', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":80,"name":"Crime"}]'),
('207', 'Dead Poets Society', 'tt0097165', 'At an elite, old-fashioned boarding school in New England, a passionate English teacher inspires his students to rebel against convention and seize the potential of every day, courting the disdain of the stern headmaster.', '/3Ri2GReavqSHqWemlP6HYn8i2P9.jpg', '1989-06-02', '[{"id":18,"name":"Drama"}]'),
('207703', 'Kingsman: The Secret Service', 'tt2802144', 'The story of a super-secret spy organization that recruits an unrefined but promising street kid into the agencys ultra-competitive training program just as a global threat emerges from a twisted tech genius.', '/8x7ej0LnHdKUqilNNJXYOeyB6L9.jpg', '2014-12-13', '[{"id":80,"name":"Crime"},{"id":35,"name":"Comedy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('207932', 'Inferno', 'tt3062096', 'After waking up in a hospital with amnesia, professor Robert Langdon and a doctor must race against time to foil a deadly global plot.', '/dQSHZCeKPV8bMzL7Dn1XrKpxm97.jpg', '2016-10-13', '[{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('207933', 'Stonehearst Asylum', 'tt1772264', 'A Harvard Medical School graduate takes a position at a mental institution and soon becomes obsessed with a female mental patient, but he has no idea of a recent and horrifying staffing change.\r The Call director Brad Anderson returns to the helm for this psychological thriller loosely based on Edgar Allan Poes 1845 short story The System of Doctor Tarr and Professor Fether, and centered on the experiences of a Harvard Medical School graduate (Jim Sturgess) who becomes obsessed with a mental patient named Eliza Graves (Kate Beckinsale) while working at a mental asylum thats been taken over by the inmates.', '/6PXtqaYOpLTpxfKtwvAK3xCQfXZ.jpg', '2014-09-11', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('209112', 'Batman v Superman: Dawn of Justice', 'tt2975590', 'Fearing the actions of a god-like Super Hero left unchecked, Gotham City’s own formidable, forceful vigilante takes on Metropolis’s most revered, modern-day savior, while the world wrestles with what sort of hero it really needs. And with Batman and Superman at war with one another, a new threat quickly arises, putting mankind in greater danger than it’s ever known before.', '/cGOPbv9wA5gEejkUN892JrveARt.jpg', '2016-03-23', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('210577', 'Gone Girl', 'tt2267998', 'With his wifes disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when its suspected that he may not be innocent.', '/gdiLTof3rbPDAmPaCf4g6op46bj.jpg', '2014-10-01', '[{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"}]'),
('2108', 'The Breakfast Club', 'tt0088847', 'Five high school students, all different stereotypes, meet in detention, where they pour their hearts out to each other, and discover how they have a lot more in common than they thought.', '/4ZejrrCpfoypR5lHoT3pq6yVldW.jpg', '1985-02-15', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('210860', 'Mortdecai', 'tt3045616', 'Art dealer, Charles Mortdecai, searches for a stolen painting rumored to contain a secret code that gains access to hidden Nazi gold.', '/56rS3ipzekH2VlHpnH8VOTkKjwR.jpg', '2015-01-21', '[{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"}]'),
('2114', 'Final Fantasy: The Spirits Within', 'tt0173840', 'Led by a strange dream, scientist Aki Ross struggles to collect the eight spirits in the hope of creating a force powerful enough to protect the planet. With the aid of the Deep Eyes Squadron and her mentor, Dr. Sid, Aki must save the Earth from its darkest hate and unleash the spirits within.', '/ixu5L3L55wJPVUGAfwdE4qVwWbi.jpg', '2001-07-02', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":16,"name":"Animation"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('211672', 'Minions', 'tt2293640', 'Minions Stuart, Kevin and Bob are recruited by Scarlet Overkill, a super-villain who, alongside her inventor husband Herb, hatches a plot to take over the world.', '/q0R4crx2SehcEEQEkYObktdeFy.jpg', '2015-06-17', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('2118', 'L.A. Confidential', 'tt0119488', 'Three detectives in the corrupt and brutal L.A. police force of the 1950s use differing methods to uncover a conspiracy behind the shotgun slayings of the patrons at an all-night diner in this lush tribute to tough film noir crime films. Based on the multi-layered James Ellroy novel.', '/rIXzJCAvyd3Ci8ipylDQ5wUKqwh.jpg', '1997-09-19', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('21208', 'Orphan', 'tt1148204', 'A married couple with a rocky past adopt the 9-year old Esther to fill the void created by a recently-stillborn baby. However, Esther is not quite what she seems.', '/dVP8tE9bV2oIv1l0aWtTUJndZvc.jpg', '2009-07-24', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('2123', 'Me, Myself & Irene', 'tt0183505', 'Rhode Island State Trooper Charlie Baileygates has a multiple personality disorder. One personality is crazy and aggressive, while the other is more friendly and laid back. Both of these personalities fall in love with the same woman named Irene after Charlie loses his medication.', '/y7OG1Y2UvnaEoQEQIonnykJvdwt.jpg', '2000-06-22', '[{"id":35,"name":"Comedy"}]'),
('212778', 'Chef', 'tt2883512', 'A chef who loses his restaurant job starts up a food truck in an effort to reclaim his creative promise, while piecing back together his estranged family.', '/eXizmokfQYgDM0UZm2v8zdgYhD7.jpg', '2014-05-08', '[{"id":35,"name":"Comedy"}]'),
('2133', 'The Perfect Storm', 'tt0177971', 'In October 1991, a confluence of weather conditions combined to form a killer storm in the North Atlantic. Caught in the storm was the sword-fishing boat Andrea Gail. Magnificent foreshadowing and anticipation fill this true-life drama while minute details of the fishing boats, their gear and the weather are juxtaposed with the sea adventure.', '/uARMPDyjiENKyUz7JRmQmLCH8L5.jpg', '2000-03-15', '[{"id":18,"name":"Drama"}]'),
('214756', 'Ted 2', 'tt2637276', 'Newlywed couple Ted and Tami-Lynn want to have a baby, but in order to qualify to be a parent, Ted will have to prove hes a person in a court of law.', '/A7HtCxFe7Ms8H7e7o2zawppbuDT.jpg', '2015-06-25', '[{"id":35,"name":"Comedy"}]'),
('216015', 'Fifty Shades of Grey', 'tt2322441', 'When college senior Anastasia Steele steps in for her sick roommate to interview prominent businessman Christian Grey for their campus paper, little does she realize the path her life will take. Christian, as enigmatic as he is rich and powerful, finds himself strangely drawn to Ana, and she to him. Though sexually inexperienced, Ana plunges headlong into an affair -- and learns that Christians true sexual proclivities push the boundaries of pain and pleasure.', '/jV8wnk3Jgz6f7degmT3lHNGI2tK.jpg', '2015-02-11', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('216282', 'Into the Storm', 'tt2106361', 'The town of Silverton is in one day destroyed by the unprecedented power of a series of tornadoes. The population is at the mercy of the unpredictable and deadly cyclones, while hunters warn that the worst is yet to come. Most people find shelter, but some just go to the tornado for that one, unique shot.', '/dtuyhlOtqj8zPPFgTgWJ0bF3s2h.jpg', '2014-08-06', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('217', 'Indiana Jones and the Kingdom of the Crystal Skull', 'tt0367882', 'During the Cold War, Soviet agents watch Professor Henry Jones when a young man brings him a coded message from an aged, demented colleague, Henry Oxley. Led by the brilliant Irina Spalko, the Soviets tail Jones and the young man, Mutt, to Peru. With Oxleys code, they find a legendary skull made of a single piece of quartz. If Jones can deliver the skull to its rightful place, all may be well; but if Irina takes it to its origin, shell gain powers that could endanger the West. Aging professor and young buck join forces with a woman from Joness past to face the dangers of the jungle, Russia, and the supernatural.', '/qY1x6v5daMDTr904G3y84WVgpfC.jpg', '2008-05-21', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"}]'),
('218', 'The Terminator', 'tt0088247', 'In the post-apocalyptic future, reigning tyrannical supercomputers teleport a cyborg assassin known as the Terminator back to 1984 to kill Sarah Connor, whose unborn son is destined to lead insurgents against 21st century mechanical hegemony. Meanwhile, the human-resistance movement dispatches a lone warrior to safeguard Sarah. Can he stop the virtually indestructible killing machine?', '/q8ffBuxQlYOHrvPniLgCbmKK4Lv.jpg', '1984-10-26', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('218043', 'Left Behind', 'tt2467046', 'A small group of survivors are left behind after millions of people suddenly vanish during the rapture and the world is plunged into chaos and destruction.', '/lWf8po2lGleVuzRB4lpHavVT1Lv.jpg', '2014-10-03', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('218836', 'Planes: Fire & Rescue', 'tt2980706', 'When world-famous air racer Dusty learns that his engine is damaged and he may never race again, he must shift gears and is launched into the world of aerial firefighting. Dusty joins forces with veteran fire and rescue helicopter Blade Ranger and his team, a bunch of all-terrain vehicles known as The Smokejumpers. Together, the fearless team battles a massive wildfire, and Dusty learns what it takes to become a true hero.', '/b5Xn7UQf7s6ZPsDTVT0NeLqiiHY.jpg', '2014-07-17', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"}]'),
('219814', 'Les nuits brûlantes de Linda', 'tt0221443', 'A young woman is hired to care for an elderly man who lives on an island off the Greek coast. When she arrives there the man warns her that his daughters are evil and dangerous. The woman discovers that one of the daughters is a crazed nymphomaniac who pursues, and seduces, everyone in the house, including her crippled sister.', '/e1CikDtm5axXLuaW1NLMukkGNRb.jpg', '1975-07-16', '[{"id":18,"name":"Drama"}]'),
('22', 'Pirates of the Caribbean: The Curse of the Black Pearl', 'tt0325980', 'Jack Sparrow, a freewheeling 17th-century pirate who roams the Caribbean Sea butts heads with a rival pirate bent on pillaging the village of Port Royal. When the governors daughter is kidnapped, Sparrow decides to help the girls love save her. But their seafaring mission is hardly simple.', '/tkt9xR1kNX5R9rCebASKck44si2.jpg', '2003-07-09', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('222935', 'The Fault in Our Stars', 'tt2582846', 'Despite the tumor-shrinking medical miracle that has bought her a few years, Hazel has never been anything but terminal, her final chapter inscribed upon diagnosis. But when a patient named Augustus Waters suddenly appears at Cancer Kid Support Group, Hazels story is about to be completely rewritten.', '/sc6XLX6J714LDkVV3Ys3clgypQS.jpg', '2014-05-16', '[{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('223485', 'Slow West', 'tt3205376', 'In the Old West, a 17-year-old Scottish boy teams up with a mysterious gunman to find the woman with whom he is infatuated.', '/4d4rl3MzxC8lkXTq8XBOCZfaYmp.jpg', '2015-04-16', '[{"id":10749,"name":"Romance"},{"id":53,"name":"Thriller"},{"id":37,"name":"Western"}]'),
('223702', 'Sausage Party', 'tt1700841', 'Sausage Party, the first R-rated CG animated movie, is about one sausage leading a group of supermarket products on a quest to discover the truth about their existence and what really happens when they become chosen to leave the grocery store.', '/jDeDRLEa8JqB3xmKVy6q3bkmDt6.jpg', '2016-07-11', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":14,"name":"Fantasy"}]'),
('224141', 'Into the Woods', 'tt2180411', 'A witch conspires to teach important lessons to various characters of popular childrens stories including Little Red Riding Hood, Cinderella, Jack and the Beanstalk and Rapunzel.', '/5h91odPFNlBuJbRBj5N4MEBfXDE.jpg', '2014-12-25', '[{"id":10402,"name":"Music"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":35,"name":"Comedy"}]'),
('22538', 'Scott Pilgrim vs. the World', 'tt0446029', 'Scott Pilgrim is a film adaptation of the critically acclaimed, award-winning series of graphic novels of the same name by Canadian cartoonist Bryan Lee O’Malley. Scott Pilgrim is a 23 year old Canadian slacker and wannabe rockstar who falls in love with an American delivery girl, Ramona V. Flowers, and must defeat her seven evil exes to be able to date her.', '/lafRuPbjEQrrHG9QEaoyV2znZC.jpg', '2010-07-27', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('225574', 'Non-Stop', 'tt2024469', 'Bill Marks is a burned-out veteran of the Air Marshals service. He views the assignment not as a life-saving duty, but as a desk job in the sky. However, todays flight will be no routine trip. Shortly into the transatlantic journey from New York to London, he receives a series of mysterious text messages ordering him to have the government transfer $150 million into a secret account, or a passenger will die every 20 minutes.', '/ifgEHE1ortukpBF6wh03HCuctdr.jpg', '2014-01-26', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('225886', 'Sex Tape', 'tt1956620', 'When Jay and Annie first got together, their romantic connection was intense – but ten years and two kids later, the flame of their love needs a spark.  To kick things up a notch, they decide – why not? – to make a video of themselves trying out every position in The Joy of Sex in one marathon three-hour session.  It seems like a great idea – until they discover that their most private video is no longer private.  With their reputations on the line, they know they’re just one click away from being laid bare to the world... but as their race to reclaim their video leads to a night theyll never forget, theyll find that their video will expose even more than they bargained for.', '/2BMmIPGu5ZbTrwXwomdSUuTB2Ul.jpg', '2014-07-17', '[{"id":35,"name":"Comedy"}]'),
('2270', 'Stardust', 'tt0486655', 'In a countryside town bordering on a magical land, a young man makes a promise to his beloved that hell retrieve a fallen star by venturing into the magical realm. His journey takes him into a world beyond his wildest dreams and reveals his true identity.', '/A9gXvPOnMu961E36x5p3RT4FQ5E.jpg', '2007-08-09', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10749,"name":"Romance"},{"id":10751,"name":"Family"}]'),
('22705', 'Tra(sgre)dire', 'tt0200192', 'While scouting out apartments in London for her Venetian boyfriend, Carla rents an apartment that overlooks the Thames. There she meet the lesbian hyper-horny real estate agent Moira.', '/kZITrLEiTfzzJhtwtXhQUl3ImCQ.jpg', '2000-01-28', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('227156', 'The Giver', 'tt0435651', 'In a seemingly perfect community, without war, pain, suffering, differences or choice, a young boy is chosen to learn from an elderly man about the true pain and pleasure of the real world.', '/4g19qQ4pfQz6nlVctA0q3y7Dieg.jpg', '2014-08-11', '[{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"}]'),
('227159', 'Horrible Bosses 2', 'tt2170439', 'Dale, Kurt and Nick decide to start their own business but things dont go as planned because of a slick investor, prompting the trio to pull off a harebrained and misguided kidnapping scheme.', '/zRkLCOx7o9tjPYb9s7u6mpw8VOs.jpg', '2014-11-26', '[{"id":35,"name":"Comedy"}]'),
('227306', 'Unbroken', 'tt1809398', 'A chronicle of the life of Louis Zamperini, an Olympic runner who was taken prisoner by Japanese forces during World War II.', '/qvRHvtjNfvq0R0IwV2oVmW6DduS.jpg', '2014-12-25', '[{"id":18,"name":"Drama"},{"id":10752,"name":"War"}]'),
('227348', 'Paranormal Activity: The Marked Ones', 'tt2473682', 'Seventeen-year-old Jesse has been hearing terrifying sounds coming from his neighbor’s apartment, but when he turns on his camera and sets out to uncover their source, he encounters an ancient evil that won’t rest until it’s claimed his very soul.', '/f9zf4k8VSqkcv65plF5Wi9jy0Sr.jpg', '2013-12-31', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('227719', 'Project Almanac', 'tt2436386', 'A group of teens discover secret plans of a time machine, and construct one. However, things start to get out of control.', '/g3Krq7P7pkgjWpzUDA6lrniiSJ7.jpg', '2015-01-30', '[{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('228150', 'Fury', 'tt2713180', 'Last months of World War II in April 1945. As the Allies make their final push in the European Theater, a battle-hardened U.S. Army sergeant in the 2nd Armored Division named Wardaddy commands a Sherman tank called Fury and its five-man crew on a deadly mission behind enemy lines. Outnumbered and outgunned, Wardaddy and his men face overwhelming odds in their heroic attempts to strike at the heart of Nazi Germany.', '/il9XWx5CbNd2KdDUwrcClEZiLkv.jpg', '2014-10-15', '[{"id":10752,"name":"War"},{"id":18,"name":"Drama"},{"id":28,"name":"Action"}]'),
('228161', 'Home', 'tt2224026', 'When Earth is taken over by the overly-confident Boov, an alien race in search of a new place to call home, all humans are promptly relocated, while all Boov get busy reorganizing the planet. But when one resourceful girl, Tip (Rihanna), manages to avoid capture, she finds herself the accidental accomplice of a banished Boov named Oh (Jim Parsons). The two fugitives realize there’s a lot more at stake than intergalactic relations as they embark on the road trip of a lifetime.', '/nIvfqZkq4nQmmIwOowRgBLhWoDd.jpg', '2015-03-18', '[{"id":14,"name":"Fantasy"},{"id":35,"name":"Comedy"},{"id":16,"name":"Animation"},{"id":878,"name":"Science Fiction"},{"id":10751,"name":"Family"}]'),
('228326', 'The Book of Life', 'tt2262227', 'The journey of Manolo, a young man who is torn between fulfilling the expectations of his family and following his heart. Before choosing which path to follow, he embarks on an incredible adventure that spans three fantastical worlds where he must face his greatest fears.', '/5B4lKHSQAtT1FSEfbjJkQ8ylxAY.jpg', '2014-10-01', '[{"id":10749,"name":"Romance"},{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('228967', 'The Interview', 'tt2788710', 'Dave Skylark is king of the celebrity interview and host of the hit night time talk show Skylark Tonight.  The brain behind Daves empire is his producer and best friend, Aaron Rapoport. Unfulfilled, Aaron yearns to do meaningful work.  He scores the chance of a lifetime when he secures an interview for Dave with Kim Jong-Un, the mysterious and ruthless dictator of a nuclear-armed North Korea.  As Dave and Aaron prepare to leave for North Korea, they are approached by the CIA and asked to assassinate Kim.  They accept the mission, becoming two of the least qualified men ever to assassinate – or interview – the most dangerous man on earth.', '/2uWb0aSm5cFmRCHP95OdA6hvTEs.jpg', '2014-12-25', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('22970', 'The Cabin in the Woods', 'tt1259521', 'Five college friends spend the weekend at a remote cabin in the woods, where they get more than they bargained for. Together, they must discover the truth behind the cabin in the woods.', '/t8cW3FSCDYCaWRiNHSvI6SDuWeA.jpg', '2012-04-12', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('22972', 'Green Zone', 'tt0947810', 'During the U.S.-led occupation of Baghdad in 2003, Chief Warrant Officer Roy Miller and his team of Army inspectors were dispatched to find weapons of mass destruction believed to be stockpiled in the Iraqi desert. Rocketing from one booby-trapped and treacherous site to the next, the men search for deadly chemical agents but stumble instead upon an elaborate cover-up that threatens to invert the purpose of their mission.', '/7O3IkeHvp1sq5yMN0O8FsTee1C0.jpg', '2010-03-11', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('2300', 'Space Jam', 'tt0117705', 'Michael Jordan agrees to help the Looney Tunes play a basketball game against alien slavers to determine their freedom.', '/bJhVLribUKCrKv1h1WFqv4QmRWM.jpg', '1996-11-15', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('232672', 'Blended', 'tt1086772', 'After a bad blind date, a man and woman find themselves stuck together at a resort for families, where their attractions grows as their respective kids benefit from the burgeoning relationship.', '/l99PKd9tdwtpOS5jxHwDGKTsVUo.jpg', '2014-05-21', '[{"id":35,"name":"Comedy"}]'),
('2330', 'Taxi', 'tt0152930', 'In Marseilles (France), skilled pizza delivery boy Daniel who drives a scooter finally has his dreams come true. He gets a taxi license. Caught by the police for a huge speed infraction, he will help Emilien, a loser inspector who cant drive, on the track of German bank robbers, so he doesnt lose his license and his dream job.', '/13vrEB6T3DuDz26rWAUfHZV0eSm.jpg', '1998-04-04', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"}]'),
('233063', 'Fack ju Göhte', 'tt2987732', 'A comedy that follows an ex-con who lands a position at a school that sits over the spot where money from one of his earlier robberies was stashed.', '/9GSGg4McYID6Ld0OMwimLr1Zx4J.jpg', '2013-11-07', '[{"id":35,"name":"Comedy"}]'),
('2332', 'Taxi 2', 'tt0183869', 'A cabdriver and a cop race to Paris to rescue a love interest and the Japanese minister of defense from kidnappers.', '/bsbllNS0oeKoxKJB0mAKnaeUjkE.jpg', '2000-03-24', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('23437', 'A Nightmare on Elm Street', 'tt1179056', 'The film that brings back horror icon Freddy Krueger as a darker and more sinister character than ever before. While Freddy is on the prowl a group of teenagers being stalked soon learn they all have a common factor making them targets for this twisted killer.', '/zPdMcikD993AQRd92iNv0Dxb67T.jpg', '2010-04-30', '[{"id":27,"name":"Horror"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('23483', 'Kick-Ass', 'tt1250777', 'Dave Lizewski is an unnoticed high school student and comic book fan who one day decides to become a super-hero, even though he has no powers, training or meaningful reason to do so.', '/gtfggr5n3ED1neoTqVYmsVCoSS.jpg', '2010-03-22', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"}]'),
('23629', 'Sucker Punch', 'tt0978764', 'A young girl is institutionalized by her abusive stepfather. Retreating to an alternative reality as a coping strategy, she envisions a plan which will help her escape from the mental facility.', '/s5SjC5pXsBQG3wx9iVzaIzJzpFl.jpg', '2011-03-24', '[{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"},{"id":53,"name":"Thriller"}]'),
('238', 'The Godfather', 'tt0068646', 'The story spans the years from 1945 to 1955 and chronicles the fictional Italian-American Corleone crime family. When organized crime family patriarch Vito Corleone barely survives an attempt on his life, his youngest son, Michael, steps in to take care of the would-be killers, launching a campaign of bloody revenge.', '/d4KNaTrltq6bpkFS01pYtyXa09m.jpg', '1972-03-15', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('238615', 'Self/less', 'tt2140379', 'An extremely wealthy elderly man dying from cancer undergoes a radical medical procedure that transfers his consciousness to the body of a healthy young man but everything may not be as good as it seems when he starts to uncover the mystery of the bodys origins and the secret organization that will kill to keep its secrets.', '/5MUyULSD4syaMQFcfPABqopAO4e.jpg', '2015-07-10', '[{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('238636', 'The Purge: Anarchy', 'tt2975578', 'Three groups of people are trying to survive Purge Night, when their stories intertwine and are left stranded in The Purge trying to survive the chaos and violence that occurs.', '/l1DRl40x2OWUoPP42v8fjKdS1Z3.jpg', '2014-07-17', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('238713', 'Spy', 'tt3079380', 'A desk-bound CIA analyst volunteers to go undercover to infiltrate the world of a deadly arms dealer, and prevent diabolical global disaster.', '/49Akyhe0gnuokaDIKKDldFRBoru.jpg', '2015-05-06', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('239563', 'St. Vincent', 'tt2170593', 'A young boy whose parents just divorced finds an unlikely friend and mentor in the misanthropic, bawdy, hedonistic, war veteran who lives next door.', '/w0hzr4eQBk1X4m63fb7sOSt9Bnn.jpg', '2014-10-09', '[{"id":35,"name":"Comedy"}]'),
('24', 'Kill Bill: Vol. 1', 'tt0266697', 'An assassin is shot at the altar by her ruthless employer, Bill, and other members of their assassination circle. But The Bride lives to plot her vengeance. Setting out for some payback, she makes a death list and hunts down those who wronged her, saving Bill for last.', '/vdENJAPObttowMtIwe9jgtbsEnq.jpg', '2003-10-10', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"}]'),
('240', 'The Godfather: Part II', 'tt0071562', 'The continuing saga of the Corleone crime family tells the story of a young Vito Corleone growing up in Sicily and in 1910s New York; and follows Michael Corleone in the 1950s as he attempts to expand the family business into Las Vegas, Hollywood and Cuba', '/tHbMIIF51rguMNSastqoQwR0sBs.jpg', '1974-12-20', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('240832', 'Lucy', 'tt2872732', 'A woman, accidentally caught in a dark deal, turns the tables on her captors and transforms into a merciless warrior evolved beyond human logic.', '/rwn876MeqienhOVSSjtUPnwxn0Z.jpg', '2014-07-14', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('24122', 'The Rebound', 'tt1205535', 'Sandy, upon discovering her husbands infidelity while watching her sons birthday video, leaves the suburbs and moves into the city. She gets an apartment thats above a coffee house where she befriends one of the workers, Aram, a guy whose wife only married him so she could get a green card. Arams family thinks hes wasting his life and education by working in the coffee house. Soon after moving into the apartment, Sandy hires Aram to be her nanny while she takes on work for the first time since her children where born. It isnt long when Aram and Sandy find they get along wonderfully and start to date. But the question is: is their relationship real or is it, in fact, just a rebound for both of them?', '/nkkFebe8ZgE843rnTrlaRWJy0g9.jpg', '2009-09-16', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('241239', 'A Most Violent Year', 'tt2937898', 'A thriller set in New York City during the winter of 1981, statistically one of the most violent years in the citys history, and centered on a the lives of an immigrant and his family trying to expand their business and capitalize on opportunities as the rampant violence, decay, and corruption of the day drag them in and threaten to destroy all they have built.', '/7xvfhwi1RjF27z3TfaJFAsIaO3x.jpg', '2014-12-30', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('241251', 'The Boy Next Door', 'tt3181822', 'A recently cheated on married woman falls for a younger man who has moved in next door, but their torrid affair soon takes a dangerous turn.', '/h28t2JNNGrZx0fIuAw8aHQFhIxR.jpg', '2015-01-23', '[{"id":53,"name":"Thriller"}]'),
('241254', 'The Prince', 'tt1085492', 'A family man who turns out to be a retired mob enforcer must travel across the country to find his daughter who has gone missing.', '/y7jSioitJoolDvn29D0yLJLCk30.jpg', '2014-08-22', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"}]'),
('241259', 'Alice Through the Looking Glass', 'tt2567026', 'In the sequel to Tim Burtons Alice in Wonderland, Alice Kingsleigh returns to Underland and faces a new adventure in saving the Mad Hatter.', '/7rfucKCjV01OEsGr9grXa34Aywd.jpg', '2016-05-25', '[{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('241554', 'Run All Night', 'tt2199571', 'Brooklyn mobster and prolific hit man Jimmy Conlon has seen better days. Longtime best friend of a mob boss, Jimmy is haunted by the sins of his past—as well as a dogged police detective who’s been one step behind Jimmy for 30 years. But when Jimmy’s estranged son becomes a target, Jimmy must make a choice between the crime family he chose and the real family he abandoned long ago. Now, with nowhere safe to turn, Jimmy has just one night to figure out exactly where his loyalties lie and to see if he can finally make things right.', '/aqNJrAxudMRNo8jg3HOUQqdl2xr.jpg', '2015-03-11', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('242', 'The Godfather: Part III', 'tt0099674', 'In the midst of trying to legitimize his business dealings in 1979 New York and Italy, aging mafia don Michael Corleone seeks forgiveness for his sins while taking a young protege under his wing.', '/uzaP0L7BEprcJHCuwbaHiYT0UYX.jpg', '1990-12-24', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('242224', 'The Babadook', 'tt2321549', 'A single mother, plagued by the violent death of her husband, battles with her sons fear of a monster lurking in the house, but soon discovers a sinister presence all around her.', '/b3YzM03YxkOaJw2PglfKlcwr8bM.jpg', '2014-05-22', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":27,"name":"Horror"}]'),
('242512', 'Ouija', 'tt1204977', 'A group of friends must confront their most terrifying fears when they awaken the dark powers of an ancient spirit board.', '/i52JCZSHDvkHtjQwlPqMAsjULVH.jpg', '2014-10-24', '[{"id":27,"name":"Horror"}]'),
('242582', 'Nightcrawler', 'tt2872718', 'When Lou Bloom, desperate for work, muscles into the world of L.A. crime journalism, he blurs the line between observer and participant to become the star of his own story. Aiding him in his effort is Nina, a TV-news veteran.', '/8oPY6ULFOTbAEskySNhgsUIN4fW.jpg', '2014-10-23', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('243688', 'Poltergeist', 'tt1029360', 'Legendary filmmaker Sam Raimi and director Gil Kenan reimagine and contemporize the classic tale about a family whose suburban home is invaded by angry spirits. When the terrifying apparitions escalate their attacks and take the youngest daughter, the family must come together to rescue her.', '/fWOPN0XBvHXFYr3RsPr74qBge2I.jpg', '2015-05-20', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('24428', 'The Avengers', 'tt0848228', 'When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!', '/cezWGskPY5x7GaglTTRN4Fugfb8.jpg', '2012-04-25', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('244761', 'The Captive', 'tt2326612', 'Eight years after the disappearance of Cassandra, some disturbing incidents seem to indicate that shes still alive. Police, parents and Cassandra herself, will try to unravel the mystery of her disappearance.', '/sw3dqauWXgHSbDFUIbDXRikfeYL.jpg', '2014-06-10', '[{"id":53,"name":"Thriller"}]'),
('244786', 'Whiplash', 'tt2582802', 'Under the direction of a ruthless instructor, a talented young drummer begins to pursue perfection at any cost, even his humanity.', '/lIv1QinFqz4dlp5U4lQ6HaiskOZ.jpg', '2014-10-10', '[{"id":18,"name":"Drama"},{"id":10402,"name":"Music"}]'),
('245698', 'Pawn Sacrifice', 'tt1596345', 'American chess champion Bobby Fischer prepares for a legendary match-up against Russian Boris Spassky.', '/mxdpBuSMqql2Uvv27NIV1pahcsW.jpg', '2015-09-16', '[{"id":18,"name":"Drama"}]'),
('245700', 'Mr. Turner', 'tt2473794', 'Eccentric British painter J.M.W. Turner  lives his last 25 years with gusto and secretly becomes involved with a seaside landlady, while his faithful housekeeper bears an unrequited love for him.', '/uZkqc8bHT0XPQrCKZV8QAtmT4cI.jpg', '2014-10-31', '[{"id":36,"name":"History"},{"id":18,"name":"Drama"}]'),
('245703', 'Midnight Special', 'tt2649554', 'A father and son go on the run after the dad learns his child possesses special powers.', '/sp55ilnrp50TC0Qf7F2AC2OqxpB.jpg', '2016-02-18', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"}]'),
('245891', 'John Wick', 'tt2911666', 'After the sudden death of his beloved wife, John Wick receives one last gift from her, a beagle puppy named Daisy, and a note imploring him not to forget how to love. But Johns mourning is interrupted when his 1969 Boss Mustang catches the eye of sadistic thug Iosef Tarasov who breaks into his house and steals it, beating John unconscious in the process. Unwittingly, he has just reawakened one of the most brutal assassins the underworld has ever known.', '/b9uYMMbm87IBFOq59pppvkkkgNg.jpg', '2014-10-22', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('246655', 'X-Men: Apocalypse', 'tt3385516', 'After the re-emergence of the worlds first mutant, world-destroyer Apocalypse, the X-Men must unite to defeat his extinction level plan.', '/zSouWWrySXshPCT4t3UKCQGayyo.jpg', '2016-05-18', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('248574', 'Barely Lethal', 'tt1731701', 'A 16-year-old international assassin yearning for a normal adolescence fakes her own death and enrolls as a senior in a suburban high school. She quickly learns that being popular can be more painful than getting water-boarded.', '/eegYIhkMfolXrmqyG7ZsxcsHo41.jpg', '2015-04-30', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('249070', 'Hitman: Agent 47', 'tt2679042', 'An assassin teams up with a woman to help her find her father and uncover the mysteries of her ancestry.', '/4VmZeT8YkuMI6BrA623mHZDISlN.jpg', '2015-08-20', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('249397', 'Nymphomaniac: Vol. II', 'tt2382009', 'The continuation of Joes sexually dictated life delves into the darker aspects of her adult life and what led to her being in Seligmans care.', '/2FBFiDhx3tGe8PG4A5iuCbeIJ4s.jpg', '2013-12-25', '[{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('25', 'Jarhead', 'tt0418763', 'Jarhead is a film about a US Marine Anthony Swofford’s experience in the Gulf War. After putting up with an arduous boot camp, Swafford and his unit are sent to the Persian Gulf where they are earger to fight but are forced to stay back from the action. Meanwhile Swofford gets news of his girlfriend is cheating on him. Desperately he wants to kill someone and finally put his training to use.', '/kmbyO0XUHRHcMyxVSZAWDdrpxIu.jpg', '2005-11-04', '[{"id":18,"name":"Drama"},{"id":10752,"name":"War"}]'),
('2501', 'The Bourne Identity', 'tt0258463', 'Wounded to the brink of death and suffering from amnesia, Jason Bourne is rescued at sea by a fisherman. With nothing to go on but a Swiss bank account number, he starts to reconstruct his life, but finds that many people he encounters want him dead. Bourne realizes, though, that he has the combat and mental skills of a world-class spy, but who does he work for?', '/bXQIL36VQdzJ69lcjQR1WQzJqQR.jpg', '2002-06-14', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('2502', 'The Bourne Supremacy', 'tt0372183', 'When a CIA operation to purchase classified Russian documents is blown by a rival agent, who then shows up in the sleepy seaside village where Bourne and Marie have been living. The pair run for their lives and Bourne, who promised retaliation should anyone from his former life attempt contact, is forced to once again take up his life as a trained assassin to survive.', '/6a74OaZArLNNDHK9SdiLBUu2JYj.jpg', '2004-07-23', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('2503', 'The Bourne Ultimatum', 'tt0440963', 'Bourne is brought out of hiding once again by reporter Simon Ross who is trying to unveil Operation Blackbriar, an upgrade to Project Treadstone, in a series of newspaper columns. Information from the reporter stirs a new set of memories, and Bourne must finally uncover his dark past while dodging The Companys best efforts to eradicate him.', '/fHho6JYYY0nRcETWSoeI19iZsNF.jpg', '2007-08-03', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('250546', 'Annabelle', 'tt3322940', 'John Form has found the perfect gift for his expectant wife, Mia - a beautiful, rare vintage doll in a pure white wedding dress. But Mias delight with Annabelle doesnt last long. On one horrific night, their home is invaded by members of a satanic cult, who violently attack the couple. Spilled blood and terror are not all they leave behind. The cultists have conjured an entity so malevolent that nothing they did will compare to the sinister conduit to the damned that is now... Annabelle.', '/yAgxM61Sn0dYML4C9v3MJFp5zPI.jpg', '2014-10-02', '[{"id":27,"name":"Horror"}]'),
('251783', 'Pleasure or Pain', 'tt2091327', 'A young designer falls under a mans erotic spell and is drawn into a world of sexual abandon from which she may never return.', '/kVPMuYjBsGVExXTCQZb3oL7NwGc.jpg', '2013-10-22', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('252578', 'ประโยคสัญญารัก', 'tt3021842', 'Jing is a teenager who starts dating Eiam, a woman who is 20 years older than him.  Things go well at the beginning of their relationship because of their optimistic attitude and strong efforts to adjust to each others lifestyles. However, when Eiam turns 40 and Jing starts to mature, the couple increasingly experiences conflicts and arguments.  Things get even more complicated when Jing becomes attracted to a younger woman.', '/eeDwTO18lMDXhtnl18z4U9SSSkD.jpg', '2013-07-18', '[{"id":10749,"name":"Romance"}]'),
('252838', 'The Wedding Ringer', 'tt0884732', 'Doug Harris is a loveable but socially awkward groom-to-be with a problem: he has no best man.  With less than two weeks to go until he marries the girl of his dreams, Doug is referred to Jimmy Callahan, owner and CEO of Best Man, Inc., a company that provides flattering best men for socially challenged guys in need.  What ensues is a hilarious wedding charade as they try to pull off the big con, and an unexpected budding bromance between Doug and his fake\r best man Jimmy.', '/u3gLkiOpkNb01r7yvrbbOfBJv3R.jpg', '2015-01-16', '[{"id":35,"name":"Comedy"}]'),
('253412', 'Everest', 'tt2719848', 'Inspired by the incredible events surrounding a treacherous attempt to reach the summit of the worlds highest mountain, Everest documents the awe-inspiring journey of two different expeditions challenged beyond their limits by one of the fiercest snowstorms ever encountered by mankind. Their mettle tested by the harshest of elements found on the planet, the climbers will face nearly impossible obstacles as a lifelong obsession becomes a breathtaking struggle for survival.', '/t3ELL46AnqjS9djz1vEVh4MpKv0.jpg', '2015-09-10', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"}]'),
('254', 'King Kong', 'tt0360717', 'In 1933 New York, an overly ambitious movie producer coerces his cast and hired ship crew to travel to mysterious Skull Island, where they encounter Kong, a giant ape who is immediately smitten with leading lady Ann Darrow.', '/ueMFrWi2NTqvpDAUWh5lSewai8Q.jpg', '2005-12-14', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":28,"name":"Action"}]'),
('254128', 'San Andreas', 'tt2126355', 'In the aftermath of a massive earthquake in California, a rescue-chopper pilot makes a dangerous journey across the state in order to rescue his estranged daughter.', '/qey0tdcOp9kCDdEZuJ87yE3crSe.jpg', '2015-05-27', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('254320', 'The Lobster', 'tt3464902', 'In a dystopian near future, single people, according to the laws of The City, are taken to The Hotel, where they are obliged to find a romantic partner in forty-five days or are transformed into beasts and sent off into The Woods.', '/yR60EqMGS9hHq9I5Pkq2hG984TP.jpg', '2015-10-08', '[{"id":53,"name":"Thriller"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"},{"id":878,"name":"Science Fiction"}]'),
('254470', 'Pitch Perfect 2', 'tt2848292', 'The Bellas are back, and they are better than ever. After being humiliated in front of none other than the President of the United States of America, the Bellas are taken out of the Aca-Circuit. In order to clear their name, and regain their status, the Bellas take on a seemingly impossible task: winning an international competition no American team has ever won. In order to accomplish this monumental task, they need to strengthen the bonds of friendship and sisterhood and blow away the competition with their amazing aca-magic! With all new friends and old rivals tagging along for the trip, the Bellas can hopefully accomplish their dreams.', '/eqMkpgTFGSDySzPs5VlvVwhhjfL.jpg', '2015-05-07', '[{"id":35,"name":"Comedy"},{"id":10402,"name":"Music"}]'),
('254904', 'The November Man', 'tt2402157', 'An ex- CIA operative is brought back in on a very personal mission and finds himself pitted against his former pupil in a deadly game involving high level CIA officials and the Russian president-elect.', '/lcg1bkriMVvc8m0jz5zk0yvzVTA.jpg', '2014-08-27', '[{"id":80,"name":"Crime"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('255343', 'Escobar: Paradise Lost', 'tt2515030', 'For Pablo Escobar family is everything. When young surfer Nick falls for Escobars niece, Maria, he finds his life on the line when hes pulled into the dangerous world of the family business.', '/4e1q2uZ4GB89n9iJa9lRx4mv37W.jpg', '2014-10-11', '[{"id":53,"name":"Thriller"},{"id":10749,"name":"Romance"}]'),
('256591', 'Focus', 'tt2381941', 'A veteran grifter takes a young, attractive woman under his wing, but things get complicated when they become romantically involved.', '/9IElGiLkxPLUWZ3avy31bNSG3Tq.jpg', '2015-02-25', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('256961', 'Paul Blart: Mall Cop 2', 'tt3450650', 'Security guard Paul Blart is headed to Las Vegas to attend a Security Guard Expo with his teenage daughter Maya before she departs for college. While at the convention, he inadvertently discovers a heist - and its up to Blart to apprehend the criminals.', '/618jhN1vEFHkA3MBrURuBZ7SuID.jpg', '2015-04-16', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('257088', 'Point Break', 'tt2058673', 'A young undercover FBI agent infiltrates a gang of thieves who share a common interest in extreme sports. A remake of the 1991 film, Point Break.', '/4zfbf70df2ySChbsIEjhAC9oXJ1.jpg', '2015-12-03', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('257091', 'Get Hard', 'tt2561572', 'When obscenely rich hedge-fund manager James is convicted of fraud and sentenced to a stretch in San Quentin, the judge gives him one month to get his affairs in order. Knowing that he wont survive more than a few minutes in prison on his own, James desperately turns to Darnell-- a black businessman whos never even had a parking ticket -- for help. As Darnell puts James through the wringer, both learn that they were wrong about many things, including each other.', '/qRzUSrN4p6B7fzA5XGm4ebFg3co.jpg', '2015-03-26', '[{"id":35,"name":"Comedy"}]'),
('257211', 'The Intern', 'tt2361509', '70-year-old widower Ben Whittaker has discovered that retirement isnt all its cracked up to be. Seizing an opportunity to get back in the game, he becomes a senior intern at an online fashion site, founded and run by Jules Ostin.', '/vQ7oVX2j7BnMDYyzuFeG1epqvGb.jpg', '2015-09-24', '[{"id":35,"name":"Comedy"}]'),
('257344', 'Pixels', 'tt2120120', 'Video game experts are recruited by the military to fight 1980s-era video game characters whove attacked New York.', '/ktyVmIqfoaJ8w0gDSZyjhhOPpD6.jpg', '2015-07-16', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"}]'),
('257345', 'The Darkness', 'tt1878841', 'A family returns from a Grand Canyon vacation with a supernatural presence in tow.', '/56VZyi1zJpUcZiDtVYAV0dcWH6S.jpg', '2016-05-13', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('257657', 'Giulia', 'tt0431785', 'Giulia is an independent young woman who is prepared to offer her body and her spirit against all the religious taboos.', '/yWMZ5rRQPqyI3FZHwtqr0s4hFZp.jpg', '1999-01-01', '[{"id":18,"name":"Drama"},{"id":14,"name":"Fantasy"}]'),
('258480', 'Carol', 'tt2402927', 'In 1950s New York, a department-store clerk who dreams of a better life falls for an older, married woman.', '/v9xSiXv10NjFdCfQtwurAzPUz5I.jpg', '2015-11-20', '[{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('258489', 'The Legend of Tarzan', 'tt0918940', 'Tarzan, having acclimated to life in London, is called back to his former home in the jungle to investigate the activities at a mining encampment.', '/6FxOPJ9Ysilpq0IgkrMJ7PubFhq.jpg', '2016-06-29', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('259611', 'Frontera', 'tt2510028', 'After crossing the border illegally for work, Miguel, a hard-working father and devoted husband, finds himself wrongfully accused of murdering a former sheriff’s wife. After learning of his imprisonment, Miguel’s pregnant wife tries to come to his aid and lands in the hands of corrupt coyotes who hold her for ransom. Dissatisfied with the police department’s investigation, the former sheriff tries to uncover the truth about his wife’s death and discovers disturbing evidence that will destroy one family’s future, or tear another’s apart.', '/zvc5iQnvmkmAqnUdgXhxN6R42Ra.jpg', '2014-07-31', '[{"id":37,"name":"Western"},{"id":18,"name":"Drama"}]'),
('259693', 'The Conjuring 2', 'tt3065204', 'Lorraine and Ed Warren travel to north London to help a single mother raising four children alone in a house plagued by malicious spirits.', '/e3lBJCedHnZPfNfmBArKHZXXNC0.jpg', '2016-06-08', '[{"id":27,"name":"Horror"}]'),
('259694', 'How to Be Single', 'tt1292566', 'New York City is full of lonely hearts seeking the right match, and what Alice, Robin, Lucy, Meg, Tom and David all have in common is the need to learn how to be single in a world filled with ever-evolving definitions of love.', '/jAhFr4OKTq8c5YYi8Xe5raYMU8O.jpg', '2016-01-21', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('260346', 'Taken 3', 'tt2446042', 'Ex-government operative Bryan Mills finds his life is shattered when hes falsely accused of a murder that hits close to home. As hes pursued by a savvy police inspector, Mills employs his particular set of skills to track the real killer and exact his unique brand of justice.', '/ikDwR3i2bczqnRf1urJTy77YTFf.jpg', '2015-01-01', '[{"id":80,"name":"Crime"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('261392', 'American Ultra', 'tt3316948', 'American Ultra is a fast-paced action comedy about Mike, a seemingly hapless and unmotivated stoner whose small-town life with his live-in girlfriend, Phoebe, is suddenly turned upside down.  Unbeknownst to him, Mike is actually a highly trained, lethal sleeper agent. In the blink of an eye, as his secret past comes back to haunt him, Mike is thrust into the middle of a deadly government operation and is forced to summon his inner action-hero in order to survive.', '/auQHgr1FO6upJpXx1eYEeyq2sMs.jpg', '2015-08-19', '[{"id":35,"name":"Comedy"},{"id":28,"name":"Action"}]'),
('262500', 'Insurgent', 'tt2908446', 'Beatrice Prior must confront her inner demons and continue her fight against a powerful alliance which threatens to tear her society apart.', '/6w1VjTPTjTaA5oNvsAg0y4H6bou.jpg', '2015-03-18', '[{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('262504', 'Allegiant', 'tt3410834', 'Beatrice Prior and Tobias Eaton venture into the world outside of the fence and are taken into protective custody by a mysterious agency known as the Bureau of Genetic Welfare.', '/tSFBh9Ayn5uiwbUK9HvD2lrRgaQ.jpg', '2016-03-09', '[{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('263472', 'Knock Knock', 'tt3605418', 'When a devoted husband and father is left home alone for the weekend, two stranded young women unexpectedly knock on his door for help. What starts out as a kind gesture results in a dangerous seduction and a deadly game of cat and mouse.', '/eynMtjBB1fXsB5vsQylVmsDLmvw.jpg', '2015-06-26', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('264644', 'Room', 'tt3170832', 'Jack is a young boy of 5 years old who has lived all his life in one room. He believes everything within it are the only real things in the world. But what will happen when his Ma suddenly tells him that there are other things outside of Room?', '/eqFckcHuFCT1FrzLOAvXBb4jHwq.jpg', '2015-10-16', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('264660', 'Ex Machina', 'tt0470752', 'Caleb, a 26 year old coder at the worlds largest internet company, wins a competition to spend a week at a private mountain retreat belonging to Nathan, the reclusive CEO of the company. But when Caleb arrives at the remote location he finds that he will have to participate in a strange and fascinating experiment in which he must interact with the worlds first true artificial intelligence, housed in the body of a beautiful robot girl.', '/btbRB7BrD887j5NrvjxceRDmaot.jpg', '2015-01-21', '[{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"}]'),
('2649', 'The Game', 'tt0119174', 'In honor of his birthday, San Francisco banker Nicholas Van Orton, a financial genius and a coldhearted loner, receives an unusual present from his younger brother, Conrad -- a gift certificate to play a unique kind of game. In nary a nanosecond, Nicholas finds himself consumed by a dangerous set of ever-changing rules, unable to distinguish where the charade ends and reality begins.', '/reLfX4fIasqLXCdgZ7vnnYWYhe3.jpg', '1997-09-12', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('2652', 'Hard Candy', 'tt0424136', 'A mature 14-year old girl meets a charming 32-year old photographer on the Internet. Suspecting that he is a pedophile, she goes to his home in an attempt to expose him.', '/1xInhmQVOOVS7xFT5DthpIwUTDI.jpg', '2005-01-14', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('265208', 'Wild Card', 'tt2231253', 'When a Las Vegas bodyguard with lethal skills and a gambling problem gets in trouble with the mob, he has one last play… and its all or nothing.', '/s5qUhHvFAZZ7Q4r5Dn3GdsfaPKI.jpg', '2015-01-14', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('2654', 'In the Mouth of Madness', 'tt0113409', 'With the disappearance of hack horror writer Sutter Cane, all Hell is breaking loose...literally! Author Cane, it seems, has a knack for description that really brings his evil creepy-crawlies to life. Insurance investigator John Trent is sent to investigate Canes mysterious vanishing act and ends up in the sleepy little East Coast town of Hobbs End.', '/xgrCUFFimv5gom3X01KpLIPVt1E.jpg', '1994-12-12', '[{"id":9648,"name":"Mystery"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('266285', 'The Salvation', 'tt2720680', 'In 1870s America, a peaceful American settler kills his familys murderer which unleashes the fury of a notorious gang leader. His cowardly fellow townspeople then betray him, forcing him to hunt down the outlaws alone.', '/b8uBcz6CgXOUsZhf2Y4RLHCwk19.jpg', '2014-05-22', '[{"id":18,"name":"Drama"},{"id":37,"name":"Western"}]'),
('2666', 'Dark City', 'tt0118929', 'A man struggles with memories of his past, including a wife he cannot remember, in a nightmarish world with no sun and run by beings with telekinetic powers who seek the souls of humans.', '/yR7rapBFxBoBT0vkZQIXhLBr726.jpg', '1998-02-27', '[{"id":9648,"name":"Mystery"},{"id":878,"name":"Science Fiction"}]'),
('266647', 'Pan', 'tt3332064', 'Living a bleak existence at a London orphanage, 12-year-old Peter finds himself whisked away to the fantastical world of Neverland. Adventure awaits as he meets new friend James Hook and the warrior Tiger Lily. They must band together to save Neverland from the ruthless pirate Blackbeard. Along the way, the rebellious and mischievous boy discovers his true destiny, becoming the hero forever known as Peter Pan.', '/uflLJBg5iVWaPpzc4Qm54HNoGYd.jpg', '2015-07-14', '[{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('266856', 'The Theory of Everything', 'tt2980516', 'A look at the relationship between the famous physicist Stephen Hawking and his wife.', '/4jspr8hLLuju59bCnMiefzRW4p0.jpg', '2014-11-26', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('267192', 'Genius', 'tt1703957', 'New York in the 1920s. Max Perkins, literary editor at Scribner’s Sons is the first to sign such subsequent literary greats as Ernest Hemingway and F. Scott Fitzgerald. When a sprawling, chaotic 1,000-page manuscript by an unknown writer named Thomas Wolfe falls into his hands, Perkins is convinced he has discovered a literary genius. Together the two men set out to work on a version for publication and a seemingly endless struggle over every single phrase ensues. During this process, Perkins the gentle family man and Wolfe the eccentric author become close – a relationship eyed with suspicion by their wives. When ‘Look Homeward, Angel’ becomes a resounding success, the writer grows increasingly paranoid.', '/nwnmZkRkXpu11Zfku8DUSRu7JWs.jpg', '2016-06-10', '[{"id":18,"name":"Drama"}]'),
('267193', 'Grimsby', 'tt3381008', 'Wrongfully accused and on the run, a top MI6 assassin joins forces with his long-lost, football hooligan brother to save the world from a sinister plot.', '/foEAe9AlPfQmaVngziK4vbFBnP3.jpg', '2016-02-24', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('2675', 'Signs', 'tt0286106', 'A family living on a farm finds mysterious crop circles in their fields which suggests something more frightening to come.', '/bY9lCUVUajpkKWlfjWF1mtXaSUp.jpg', '2002-08-02', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"}]'),
('267860', 'London Has Fallen', 'tt3300542', 'In London for the Prime Ministers funeral, Mike Banning discovers a plot to assassinate all the attending world leaders.', '/9j2AmDhZvdwMyYKpqe4CtBkN1Tw.jpg', '2016-01-22', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('267935', 'The BFG', 'tt3691740', 'The BFG is no ordinary bone-crunching giant. He is far too nice and jumbly. Its lucky for Sophie that he is. Had she been carried off in the middle of the night by the Bloodbottler, or any of the other giants—rather than the BFG—she would have soon become breakfast. When Sophie hears that the giants are flush-bunking off to England to swollomp a few nice little chiddlers, she decides she must stop them once and for all. And the BFG is going to help her!', '/xMvzfhXZdfeLBZZUIQRB4vw1EtA.jpg', '2016-06-28', '[{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('268', 'Batman', 'tt0096895', 'The Dark Knight of Gotham City begins his war on crime with his first major enemy being the clownishly homicidal Joker, who has seized control of Gothams underworld.', '/kBf3g9crrADGMc2AMAMlLBgSm2h.jpg', '1989-06-23', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('269149', 'Zootopia', 'tt2948356', 'Determined to prove herself, Officer Judy Hopps, the first bunny on Zootopias police force, jumps at the chance to crack her first case - even if it means partnering with scam-artist fox Nick Wilde to solve the mystery.', '/sM33SANp9z6rXW8Itn7NnG1GOEs.jpg', '2016-02-11', '[{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"}]'),
('2698', 'Evan Almighty', 'tt0413099', 'Buffalo newsman Evan Baxter is elected to Congress with the slogan, Change the world. He lucks into a huge house in a new Virginia suburb. His Capitol office is also fantastic, but theres a catch: hes tapped by the powerful Congressman Long to co-sponsor a bill to allow development in national parks. In steps God, who appears to a disbelieving Evan and gently commands him to build an ark', '/mtIjd19s4eOSkUm9P9iDVY35TsQ.jpg', '2007-06-09', '[{"id":14,"name":"Fantasy"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('270303', 'It Follows', 'tt3235888', 'For 19-year-old Jay, fall should be about school, boys and weekends out at the lake. But a seemingly innocent physical encounter turns sour and gives her the inescapable sense that someone, or something, is following her. Faced with this burden, Jay and her teenage friends must find a way to escape the horror that seems to be only a few steps behind.', '/4MrwJZr0R9LbyOgZqwLNmtzzxbu.jpg', '2014-08-27', '[{"id":53,"name":"Thriller"},{"id":27,"name":"Horror"}]'),
('270487', 'Hail, Caesar!', 'tt0475290', 'Tells the comedic tale of Eddie Mannix, a fixer who worked for the Hollywood studios in the 1950s. The story finds him at work when a star mysteriously disappears in the middle of filming.', '/rzMYZYphL9qrbBClQq1Jc0zPMmY.jpg', '2016-02-05', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10402,"name":"Music"},{"id":9648,"name":"Mystery"}]'),
('27066', 'Luomo che guarda', 'tt0111573', 'At a college in Rome, a professor, nicknamed Dodo is in a deep depression. His stunningly beautiful wife has just left him for another man. Dodo wants her back very badly and has erotic daydreams about her. A beautiful young student in his class asks him for a ride home and seduces the lucky man, but still he wonders about his wife and her lover.', '/q7WqaOYnWcgoNlwm5rTDNhsDoLI.jpg', '1994-01-27', '[{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('270774', 'Skiptrace', 'tt2238032', 'A detective from Hong Kong teams up with an American gambler to battle against a notorious Chinese criminal.', '/aDBiscx8KLKFV01fs7ei97P0J6Q.jpg', '2016-07-21', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('270946', 'Penguins of Madagascar', 'tt1911658', 'Skipper, Kowalski, Rico and Private join forces with undercover organization The North Wind to stop the villainous Dr. Octavius Brine from destroying the world as we know it.', '/pRer59eyY4rjkLPeKXKo7fPxCHH.jpg', '2014-11-22', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('271110', 'Captain America: Civil War', 'tt3498820', 'Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.', '/5N20rQURev5CNDcMjHVUZhpoCNC.jpg', '2016-04-27', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('271718', 'Trainwreck', 'tt3152624', 'Having thought that monogamy was never possible, a commitment-phobic career woman may have to face her fears when she meets a good guy.', '/2USk7mhiCXRkU9NzttXCzOjg2iV.jpg', '2015-07-17', '[{"id":35,"name":"Comedy"}]'),
('271969', 'Ben-Hur', 'tt2638144', 'A falsely accused nobleman survives years of slavery to take vengeance on his best friend who betrayed him.', '/sRxazAAodkAWVPJighRAsls2zCo.jpg', '2016-08-17', '[{"id":12,"name":"Adventure"},{"id":36,"name":"History"},{"id":18,"name":"Drama"}]'),
('272', 'Batman Begins', 'tt0372784', 'Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.', '/xiosOeLfzPbfLfqui41kSWnO0sZ.jpg', '2005-06-14', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('27205', 'Inception', 'tt1375666', 'Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: inception, the implantation of another persons idea into a targets subconscious.', '/qmDpIHrmpJINaRKAfWQfftjCdyi.jpg', '2010-07-14', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"},{"id":12,"name":"Adventure"}]'),
('272693', 'The DUFF', 'tt1666801', 'Bianca is a content high school senior whose world is shattered when she learns the student body refers to her as ‘The DUFF’ (Designated Ugly Fat Friend) to her prettier, more popular friends. With her universe turned upside down, she ignoreswords of wisdom from her favorite teacher and enlists Wesley, a slick but charming jock, to help set her apart from the pack and erase her label forever. In doing so, she hopes to land her crush Toby, and find the confidence to overthrow the school’s ruthless label maker Madison by reminding everyone that no matter what people look or act like, we are all someone’s DUFF…and that’s totally fine.', '/dBBgPTCN5Zze4POXWVVpwf3wkra.jpg', '2015-02-19', '[{"id":35,"name":"Comedy"}]'),
('273248', 'The Hateful Eight', 'tt3460252', 'Bounty hunters seek shelter from a raging blizzard and get caught up in a plot of betrayal and deception.', '/fqe8JxDNO8B8QfOGTdjh6sPCdSC.jpg', '2015-12-25', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":37,"name":"Western"}]'),
('273481', 'Sicario', 'tt3397884', 'A young female FBI agent joins a secret CIA operation to take down a Mexican cartel boss, a job that ends up pushing her ethical and moral values to the limit.', '/p2SdfGmQRaw8xhFbexlHL7srMM8.jpg', '2015-09-11', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('274167', 'Daddys Home', 'tt1528854', 'The story of a mild-mannered radio executive (Ferrell) who strives to become the best stepdad ever to his wifes two children, but complications ensue when their freewheeling, freeloading real father arrives, forcing stepdad to compete for the affection of the kids.', '/diEAZtU6KJzo6VStL5US8arkdIQ.jpg', '2015-12-25', '[{"id":35,"name":"Comedy"}]'),
('274479', 'Joy', 'tt2446980', 'A story based on the life of a struggling Long Island single mom who became one of the countrys most successful entrepreneurs.', '/zNjxzdgSwzRXnP8Stu3HGzKQKWp.jpg', '2015-12-24', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('274854', 'The Last Witch Hunter', 'tt1618442', 'The modern world holds many secrets, but by far the most astounding is that witches still live among us; vicious supernatural creatures intent on unleashing the Black Death upon the world and putting an end to the human race once and for all. Armies of witch hunters have battled this unnatural enemy for centuries, including Kaulder, a valiant warrior who many years ago slayed the all-powerful Witch Queen, decimating her followers in the process. In the moments right before her death, the Queen cursed Kaulder with immortality, forever separating him from his beloved wife and daughter. Today, Kaulder is the last living hunter who has spent his immortal life tracking down rogue witches, all the while yearning for his long-lost family.', '/xw1GFKzxjgfm3dQoK1swFcHmfaC.jpg', '2015-10-21', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('275', 'Fargo', 'tt0116282', 'Jerry, a small-town Minnesota car salesman is bursting at the seams with debt... but hes got a plan. Hes going to hire two thugs to kidnap his wife in a scheme to collect a hefty ransom from his wealthy father-in-law. Its going to be a snap and nobodys going to get hurt... until people start dying. Enter Police Chief Marge, a coffee-drinking, parka-wearing - and extremely pregnant - investigator wholl stop at nothing to get her man. And if you think her small-time investigative skills will give the crooks a run for their ransom... you betcha!', '/aZeX4XNSqa08TdMHRB1gDLO6GOi.jpg', '1996-04-05', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('27576', 'Salt', 'tt0944835', 'As a CIA officer, Evelyn Salt swore an oath to duty, honor and country. Her loyalty will be tested when a defector accuses her of being a Russian spy. Salt goes on the run, using all her skills and years of experience as a covert operative to elude capture. Salts efforts to prove her innocence only serve to cast doubt on her motives, as the hunt to uncover the truth behind her identity continues and the question remains: Who is Salt?', '/956xMjH4sPoqimqoLOP6AI19mjm.jpg', '2010-07-21', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"}]'),
('27578', 'The Expendables', 'tt1320253', 'Barney Ross leads a band of highly skilled mercenaries including knife enthusiast Lee Christmas, a martial arts expert, heavy weapons specialist, demolitionist, and a loose-cannon sniper. When the group is commissioned by the mysterious Mr. Church to assassinate the dictator of a small South American island, Barney and Lee visit the remote locale to scout out their opposition and discover the true nature of the conflict engulfing the city.', '/y2qJoYxOhzyidsA60Mqn29H38Lk.jpg', '2010-08-03', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('27581', 'The Other Guys', 'tt1386588', 'NYPD detectives Christopher Danson (Johnson) and P.K. Highsmith (Jackson) are the baddest and most beloved cops in New York City. They dont get tattoos, other men get tattoos of them. Two desks over and one back, sit detectives Allen Gamble (Ferrell) and Terry Hoitz (Wahlberg). Youve seen them in the background of photos of Danson and Highsmith, out of focus and eyes closed. Theyre not heroes, theyre the other guys. But every cop has his or her day and soon Gamble and Hoitz stumble into a seemingly innocuous case no other detective wants to touch that could turn into NYCs biggest crime. Its the opportunity of their lives, but do these guys have the right stuff?', '/b4mYjC8kKx32BnCNBQeDCA76WBd.jpg', '2010-08-06', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('27582', 'The Mechanic', 'tt0472399', 'Arthur Bishop (Statham) is a mechanic - an elite assassin with a strict code and unique talent for cleanly eliminating targets. Its a job that requires professional perfection and total detachment, and Bishop is the best in the business. But when he is ordered to take out his mentor and close friend Harry (Sutherland), Bishop is anything but detached.', '/eScKoGnjaUvGD2OkK3DImyzfVkt.jpg', '2011-01-13', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('276907', 'Legend', 'tt3569230', 'Suave, charming and volatile, Reggie Kray and his unstable twin brother Ronnie start to leave their mark on the London underworld in the 1960s. Using violence to get what they want, the siblings orchestrate robberies and murders while running nightclubs and protection rackets. With police Detective Leonard Nipper Read hot on their heels, the brothers continue their rapid rise to power and achieve tabloid notoriety.', '/fVQksuppOoqysj481qJ77LFH387.jpg', '2015-09-09', '[{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('277', 'Underworld', 'tt0320691', 'Vampires and werewolves have waged a nocturnal war against each other for centuries. But all bets are off when a female vampire warrior named Selene, whos famous for her strength and werewolf-hunting prowess, becomes smitten with a peace-loving male werewolf, Michael, who wants to end the war.', '/rdkxl5iXdpVU188cL1LLG3sy6z4.jpg', '2003-09-18', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('2770', 'American Pie 2', 'tt0252866', 'The whole gang are back and as close as ever. They decide to get even closer by spending the summer together at a beach house. They decide to hold the biggest party ever to be seen, even if the preparation doesnt always go to plan. Especially when Stifler, Finch and Jim become more close to each other than they ever want to be and when Jim mistakes super glue for lubricant...', '/q4LNgUnRfltxzp3gf1MAGiK5LhV.jpg', '2001-08-10', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('277216', 'Straight Outta Compton', 'tt1398426', 'In 1987, five young men, using brutally honest rhymes and hardcore beats, put their frustration and anger about life in the most dangerous place in America into the most powerful weapon they had: their music.  Taking us back to where it all began, Straight Outta Compton tells the true story of how these cultural rebels—armed only with their lyrics, swagger, bravado and raw talent—stood up to the authorities that meant to keep them down and formed the world’s most dangerous group, N.W.A.  And as they spoke the truth that no one had before and exposed life in the hood, their voice ignited a social revolution that is still reverberating today.', '/X7S1RtotXOZNV7OlgCfh5VKZSB.jpg', '2015-08-13', '[{"id":18,"name":"Drama"},{"id":10402,"name":"Music"}]'),
('278', 'The Shawshank Redemption', 'tt0111161', 'Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', '/9O7gLzmreU0nGkIB6K3BsJbzvNv.jpg', '1994-09-10', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('278154', 'Ice Age: Collision Course', 'tt3416828', 'Set after the events of Continental Drift, Scrats epic pursuit of his elusive acorn catapults him outside of Earth, where he accidentally sets off a series of cosmic events that transform and threaten the planet. To save themselves from peril, Manny, Sid, Diego, and the rest of the herd leave their home and embark on a quest full of thrills and spills, highs and lows, laughter and adventure while traveling to exotic new lands and encountering a host of colorful new characters.', '/1ZQVHkvOegv5wVzxD2fphcxl1Ba.jpg', '2016-06-23', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":878,"name":"Science Fiction"}]'),
('278924', 'Mechanic: Resurrection', 'tt3522806', 'Arthur Bishop thought he had put his murderous past behind him when his most formidable foe kidnaps the love of his life. Now he is forced to travel the globe to complete three impossible assassinations, and do what he does best, make them look like accidents.', '/tgfRDJs5PFW20Aoh1orEzuxW8cN.jpg', '2016-08-25', '[{"id":80,"name":"Crime"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('278927', 'The Jungle Book', 'tt3040964', 'After a threat from the tiger Shere Khan forces him to flee the jungle, a man-cub named Mowgli embarks on a journey of self discovery with the help of panther, Bagheera, and free spirited bear, Baloo.', '/vOipe2myi26UDwP978hsYOrnUWC.jpg', '2016-04-07', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":14,"name":"Fantasy"}]'),
('279641', 'Whiskey Tango Foxtrot', 'tt3553442', 'In 2002, cable news producer Kim Barker (Tina Fey) decides to shake up her routine by taking a daring new assignment in Kabul, Afghanistan. Dislodged from her comfortable American lifestyle, Barker finds herself in the middle of an out-of-control war zone. Luckily, she meets Tanya Vanderpoel (Margot Robbie), a fellow journalist who takes the shellshocked reporter under her wing. Amid the militants, warlords and nighttime partying, Barker discovers the key to becoming a successful correspondent.', '/96vLovyljHFXIZIF0Ffar5qcldV.jpg', '2016-03-04', '[{"id":10752,"name":"War"},{"id":35,"name":"Comedy"}]'),
('280', 'Terminator 2: Judgment Day', 'tt0103064', 'Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.', '/2y4dmgWYRMYXdD1UyJVcn2HSd1D.jpg', '1991-07-01', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('280996', 'Mr. Holmes', 'tt3168230', 'The story is set in 1947, following a long-retired Holmes living in a Sussex village with his housekeeper and rising detective son. But then he finds himself haunted by an unsolved 50-year old case. Holmes memory isnt what it used to be, so he only remembers fragments of the case: a confrontation with an angry husband, a secret bond with his beautiful but unstable wife.', '/9v25BUcPSxRS3yJ2yd3GHZOtoS8.jpg', '2015-06-19', '[{"id":9648,"name":"Mystery"},{"id":18,"name":"Drama"}]'),
('281957', 'The Revenant', 'tt1663202', 'In the 1820s, a frontiersman, Hugh Glass, sets out on a path of vengeance against those who left him for dead after a bear mauling.', '/oXUWEc5i3wYyFnL1Ycu8ppxxPvs.jpg', '2015-12-25', '[{"id":37,"name":"Western"},{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('282984', 'Irrational Man', 'tt3715320', 'On a small town college campus, a philosophy professor in existential crisis gives his life new purpose when he enters into a relationship with his student.', '/aBHkXfleH4MBTUqrCQYCIGbp9Fd.jpg', '2015-07-17', '[{"id":9648,"name":"Mystery"},{"id":18,"name":"Drama"}]'),
('283227', 'A Little Chaos', 'tt2639254', 'A landscape gardener is hired by famous architect Le Nôtre to construct the grand gardens at the palace of Versailles. As the two work on the palace, they find themselves drawn to each other and are thrown into rivalries within the court of King Louis XIV.', '/8Q8q0oBI99tfw3x5ozoKEtHKvO0.jpg', '2014-09-13', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('283552', 'The Light Between Oceans', 'tt2547584', 'A lighthouse keeper and his wife living off the coast of Western Australia raise a baby they rescue from an adrift rowboat.', '/pEFRzXtLmxYNjGd0XqJDHPDFKB2.jpg', '2016-09-02', '[{"id":18,"name":"Drama"}]'),
('283587', 'Beasts of No Nation', 'tt1365050', 'A drama based on the experiences of Agu, a child soldier fighting in the civil war of an unnamed African country.', '/mhqavU5fQGQyiNyqFWFR0I0r2e4.jpg', '2015-09-11', '[{"id":18,"name":"Drama"},{"id":10752,"name":"War"}]'),
('284053', 'Thor: Ragnarok', 'tt3501632', 'Thor must confront other gods when Asgard is threatened with Ragnarok, the Norse Apocalypse.', '/kVSQZgHlUQ7MFfMadfwJyGXuxTX.jpg', '2017-10-26', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('284294', 'Time Out of Mind', 'tt3505712', 'Evicted from his squat and suddenly alone on the streets, George is a man without a home. Struggling with his demons and desperately trying to connect with the daughter he abandoned, he navigates the system, hustling for change and somewhere safe and quiet to gather his thoughts. But the streets are relentless and soon, George finds himself teetering on the edge, alone and abandoned.', '/a9SQXoFCqzLMCDCIhIzTTDd7cg0.jpg', '2014-09-07', '[{"id":18,"name":"Drama"}]'),
('284427', 'Who Am I - Kein System ist sicher', 'tt3042408', 'Benjamin, a young German computer whiz, is invited to join a subversive hacker group that wants to be noticed on the worlds stage.', '/pOvTNdPmYsHXSFWSud9VIgRhLpL.jpg', '2014-09-25', '[{"id":53,"name":"Thriller"}]'),
('28468', 'La chiave', 'tt0085328', 'After twenty years of marriage, art professor Nino Rolfe attempts to break down his wife Teresas conventional modesty. Noticing her affection for their daughters fiancé, Nino instigates her sexual interest in him as well. This sets off a chain of unexpected events and emotional complications, as Nino and his unpredictable fascist daughter find that they both enjoy being jealous.', '/oFpx4nvtglzlXxuUrw2HiVnVWEU.jpg', '1983-10-18', '[{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('285', 'Pirates of the Caribbean: At Worlds End', 'tt0449088', 'Captain Barbossa, long believed to be dead, has come back to life and is headed to the edge of the Earth with brave Will Turner and feisty Elizabeth Swann. And what of Jack Sparrow? Nothing is as it seems.', '/bXb00CkHqx7TPchTGG131sWV59y.jpg', '2007-05-19', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('285783', 'The Walk', 'tt3488710', 'The story of French high-wire artist Philippe Petits attempt to cross the Twin Towers of the World Trade Center in 1974.', '/zoWwJS1J1KkVWpvtmU4J9KzX8Q4.jpg', '2015-09-30', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('286217', 'The Martian', 'tt3659388', 'During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon his ingenuity, wit and spirit to subsist and find a way to signal to Earth that he is alive.', '/5aGhaIHYuQbqlHWvWYqMCnj40y2.jpg', '2015-09-30', '[{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('286565', 'Paper Towns', 'tt3622592', 'Quentin Jacobsen has spent a lifetime loving the magnificently adventurous Margo Roth Spiegelman from afar. So when she cracks open a window and climbs back into his life-dressed like a ninja and summoning him for an ingenious campaign of revenge-he follows. After their all-nighter ends and a new day breaks, Q arrives at school to discover that Margo, always an enigma, has now become a mystery. But Q soon learns that there are clues-and theyre for him. Urged down a disconnected path, the closer he gets, the less Q sees of the girl he thought he knew.', '/mIYVDgnzx6Y0f1bSx50cPiBTc2t.jpg', '2015-07-09', '[{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":10749,"name":"Romance"}]'),
('290250', 'The Nice Guys', 'tt3799694', 'A private eye investigates the apparent suicide of a fading porn star in 1970s Los Angeles and uncovers a conspiracy.', '/vNCeqxbKyDHL9LUza03V2Im16wB.jpg', '2016-05-15', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('290595', 'The Huntsman: Winters War', 'tt2381991', 'As two evil sisters prepare to conquer the land, two renegades - Eric the Huntsman - who aided Snow White in defeating Ravenna in Snowwhite and the Huntsman, and his forbidden lover, Sara, set out to stop them.', '/b77l5vmp6PYsc98LE6Uf1mXtmHh.jpg', '2016-04-06', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"}]'),
('290764', 'Tracers', 'tt2401097', 'Wanted by the mafia, a New York City bike messenger escapes into the world of parkour after meeting a beautiful stranger.', '/mctuPOqqkXJM8zwqhHindrMycmt.jpg', '2015-01-15', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('291270', 'Anomalisa', 'tt2401878', 'A man crippled by the mundanity of his life experiences something out of the ordinary.', '/5DpDEEb6UJUiSaXyNegYlCqsZdd.jpg', '2015-12-30', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('291351', 'The Sea of Trees', 'tt3450900', 'A suicidal American befriends a Japanese man lost in a forest near Mt. Fuji and the two search for a way out.', '/vkdqENJoesFJfj9D3fh85yjqwMC.jpg', '2016-04-27', '[{"id":18,"name":"Drama"}]'),
('291805', 'Now You See Me 2', 'tt3110958', 'One year after outwitting the FBI and winning the public’s adulation with their mind-bending spectacles, the Four Horsemen resurface only to find themselves face to face with a new enemy who enlists them to pull off their most dangerous heist yet.', '/hU0E130tsGdsYa4K9lc3Xrn5Wyt.jpg', '2016-06-02', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('291870', 'Dirty Grandpa', 'tt1860213', 'Jason Kelly is one week away from marrying his bosss uber-controlling daughter, putting him on the fast track for a partnership at the law firm. However, when the straight-laced Jason is tricked into driving his foul-mouthed grandfather, Dick, to Daytona for spring break, his pending nuptials are suddenly in jeopardy. Between riotous frat parties, bar fights, and an epic night of karaoke, Dick is on a quest to live his life to the fullest and bring Jason along for the ride.', '/cZEx6mB5Ftnt7LvlDjTKXcrTvyg.jpg', '2016-01-21', '[{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('292431', 'Love', 'tt3774694', 'Murphy is an American living in Paris who enters a highly sexually and emotionally charged relationship with the unstable Electra. Unaware of the seismic effect it will have on their relationship, they invite their pretty neighbor into their bed.', '/dw7Lbq7luiH11cbL5MlJwUdxkUk.jpg', '2015-07-06', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('293452', 'The Disappointments Room', 'tt2364897', 'A mother and her young son release unimaginable horrors from the attic of their rural dream home.', '/59IqLbM1S4A0ilSiYARsg2ZfKpy.jpg', '2016-09-09', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('293660', 'Deadpool', 'tt1431045', 'Based upon Marvel Comics’ most unconventional anti-hero, DEADPOOL tells the origin story of former Special Forces operative turned mercenary Wade Wilson, who after being subjected to a rogue experiment that leaves him with accelerated healing powers, adopts the alter ego Deadpool. Armed with his new abilities and a dark, twisted sense of humor, Deadpool hunts down the man who nearly destroyed his life.', '/inVq3FRqcYIRl2la8iZikYYxFNR.jpg', '2016-02-09', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('293863', 'The Age of Adaline', 'tt1655441', 'After 29-year-old Adaline recovers from a nearly lethal accident, she inexplicably stops growing older. As the years stretch on and on, Adaline keeps her secret to herself  until she meets a man who changes her life.', '/gEDGROZ4NQDlRjUPPSSyIf0hKvD.jpg', '2015-04-16', '[{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('294016', 'Trumbo', 'tt3203606', 'The career of screenwriter Dalton Trumbo is halted by a witch hunt in the late 1940s when he defies the anti-communist HUAC committee and is blacklisted.', '/fulPs5eEBXeAeBFI6KAfTkeEgJg.jpg', '2015-10-27', '[{"id":18,"name":"Drama"}]'),
('294254', 'Maze Runner: The Scorch Trials', 'tt4046784', 'Thomas and his fellow Gladers face their greatest challenge yet: searching for clues about the mysterious and powerful organization known as WCKD. Their journey takes them to the Scorch, a desolate landscape filled with unimaginable obstacles. Teaming up with resistance fighters, the Gladers take on WCKD’s vastly superior forces and uncover its shocking plans for them all.', '/vlTPQANjLYTebzFJM1G4KeON0cb.jpg', '2015-09-09', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('294272', 'Petes Dragon', 'tt2788732', 'Pete is a mysterious 10-year-old with no family and no home who claims to live in the woods with a giant, green dragon named Elliott. With the help of Natalie, an 11-year-old girl whose father Jack owns the local lumber mill, forest ranger Grace sets out to determine where Pete came from, where he belongs, and the truth about this dragon.', '/e9Rzr8Hhu3pqdJtdDLC52PerLk1.jpg', '2016-08-10', '[{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('296', 'Terminator 3: Rise of the Machines', 'tt0181852', 'Its been 10 years since John Connor saved Earth from Judgment Day, and hes now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connors former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.', '/lz4xYdF1n09lyiCfZWtWT44SZiG.jpg', '2003-07-02', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('296096', 'Me Before You', 'tt2674426', 'A small town girl is caught between dead-end jobs. A high-profile, successful man becomes wheelchair bound following an accident. The man decides his life is not worth living until the girl is hired for six months to be his new caretaker. Worlds apart and trapped together by circumstance, the two get off to a rocky start. But the girl becomes determined to prove to the man that life is worth living and as they embark on a series of adventures together, each finds their world changing in ways neither of them could begin to imagine.', '/oN5lELHH5Xheiy0YdhnY3JB4hx2.jpg', '2016-03-03', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('296098', 'Bridge of Spies', 'tt3682448', 'During the Cold War, the Soviet Union captures U.S. pilot Francis Gary Powers after shooting down his U-2 spy plane. Sentenced to 10 years in prison, Powers only hope is New York lawyer James Donovan, recruited by a CIA operative to negotiate his release. Donovan boards a plane to Berlin, hoping to win the young mans freedom through a prisoner exchange. If all goes well, the Russians would get Rudolf Abel, the convicted spy who Donovan defended in court.', '/xPCNA8zJxyyFKTj47QpvkXHukzB.jpg', '2015-10-15', '[{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"}]'),
('296099', 'Vacation', 'tt1524930', 'Hoping to bring his family closer together and to recreate his childhood vacation for his own kids, a grown up Rusty Griswold takes his wife and their two sons on a cross-country road trip to the coolest theme park in America, Walley World. Needless to say, things dont go quite as planned.', '/q9kL9WW0Uu4AcfTi5iCLcYzBgnm.jpg', '2015-07-28', '[{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('296360', 'Love & Friendship', 'tt3068194', 'From Jane Austen’s novella, the beautiful and cunning Lady Susan Vernon visits the estate of her in-laws to wait out colorful rumors of her dalliances and to find husbands for herself and her daughter. Two young men, handsome Reginald DeCourcy and wealthy Sir James Martin, severely complicate her plans.', '/v1Vrrmh8CH9waRdwbRRZqKy8Jr5.jpg', '2016-06-03', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('297270', 'Tinker Bell and the Legend of the NeverBeast', 'tt3120408', 'Fun and talented animal fairy Fawn believes you cant judge a book by its cover, or an animal by its fangs, so she befriends a huge and mysterious creature known as the NeverBeast. While Tinkerbell and her friends arent so sure about this scary addition to Pixie Hollow, the elite Scout Fairies set out to capture the monster before he destroys their home. Fawn must trust her heart and take a leap of faith if she hopes to rally the girls to save the NeverBeast.', '/lKNYRlJ9jJAPU7yNYU0qTSQ4AYa.jpg', '2014-12-12', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('297761', 'Suicide Squad', 'tt1386697', 'From DC Comics comes the Suicide Squad, an antihero team of incarcerated supervillains who act as deniable assets for the United States government, undertaking high-risk black ops missions in exchange for commuted prison sentences.', '/e1mjopzAS2KNsvpbpahQ1a6SkSn.jpg', '2016-08-03', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":14,"name":"Fantasy"}]'),
('2978', 'Ghostbusters II', 'tt0097428', 'Five years after they defeated Zuul, the Ghostbusters are out of business. When Dana begins to have ghost problems again, the boys come out of retirement to aid her and hopefully save New York City from a new paranormal threat.', '/4nN0EYNbOWHJ9UO39maO5Kvcdfa.jpg', '1989-06-15', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"},{"id":10751,"name":"Family"}]'),
('298', 'Oceans Thirteen', 'tt0496806', 'Danny Oceans team of criminals are back and are composing a plan more personal than ever. When ruthless casino owner Willy Bank double-crosses Reuben Tishkoff, causing a heart attack, Danny Ocean vows that him and his team will do anything to bring Willy Bank and everything hes got down. Even if it includes hiring help from one of their own enemies, Terry Benedict.', '/k7jNRNN9UuUc2VQg21YXYn3JGVY.jpg', '2007-06-07', '[{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('299536', 'Avengers: Infinity War', 'tt4154756', 'Plot unknown.', '/pPEbiPHyXeRGPxrVnq9JGnYV1pe.jpg', '2018-04-25', '[{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"}]'),
('299687', 'The 5th Wave', 'tt2304933', '16-year-old Cassie Sullivan tries to survive in a world devastated by the waves of an alien invasion that has already decimated the population and knocked mankind back to the Stone Age.', '/cgxEscv6TQRK6a514FwuJOjcqQ5.jpg', '2016-01-14', '[{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('300669', 'Dont Breathe', 'tt4160708', 'A group of teens break into a blind mans home thinking theyll get away with the perfect crime. Theyre wrong.', '/lw0IqOSMsQcy1QnVIEIDppLmNwk.jpg', '2016-08-25', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('300671', '13 Hours: The Secret Soldiers of Benghazi', 'tt4172430', 'An American Ambassador is killed during an attack at a U.S. compound in Libya as a security team struggles to make sense out of the chaos.', '/m4ZfuML89Rq8gbRGdm9ncSibjlx.jpg', '2016-01-13', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('300673', 'The Finest Hours', 'tt2025690', 'The Coast Guard makes a daring rescue attempt off the coast of Cape Cod after a pair of oil tankers are destroyed during a blizzard in 1952.', '/5vfRMplGxOzMiJu0FGFCA1ic44Q.jpg', '2016-01-25', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":36,"name":"History"},{"id":53,"name":"Thriller"}]'),
('301351', 'We Are Your Friends', 'tt3787590', 'Young Cole Carter dreams of hitting the big time as a Hollywood disc jockey, spending his days and nights hanging with buddies and working on the one track that will set the world on fire. Opportunity comes knocking when he meets James Reed, a charismatic DJ who takes the 23-year-old under his wing. Soon, his seemingly clear path to success gets complicated when he starts falling for his mentors girlfriend, jeopardizing his new friendship and the future he seems destined to fulfill.', '/accc6f6h3Xi8kURvYpPoATOsm2Z.jpg', '2015-08-26', '[{"id":18,"name":"Drama"},{"id":10402,"name":"Music"},{"id":10749,"name":"Romance"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('301365', 'The Neon Demon', 'tt1974419', 'When aspiring model Jesse moves to Los Angeles, her youth and vitality are devoured by a group of beauty-obsessed women who will take any means necessary to get what she has.', '/pksGBk7yJqSuQ2F47S9eoqbtjWt.jpg', '2016-06-08', '[{"id":53,"name":"Thriller"},{"id":27,"name":"Horror"}]'),
('301608', 'The Trust', 'tt3733774', 'A pair of cops investigating a drug invasion stumble upon a mysterious bank vault.', '/leh0cI5mnwJbDm9EL5IGglDkBxk.jpg', '2016-04-29', '[{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('301875', 'Equals', 'tt3289728', 'A futuristic love story set in a world where emotions have been eradicated.', '/hhTg6vU9gmItu01Ac6r1U4ZdPGH.jpg', '2015-09-04', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"},{"id":878,"name":"Science Fiction"}]'),
('3021', '1408', 'tt0450385', 'A man who specializes in debunking paranormal occurrences checks into the fabled room 1408 in the Dolphin Hotel. Soon after settling in, he confronts genuine terror.', '/4onX7UF2MPUgIpkUerLC3dpVfNZ.jpg', '2007-07-12', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('302156', 'Criminal', 'tt3014866', 'Bill Pope is a CIA agent on a mission in London tracking down a shadowy hacker nicknamed The Dutchman. When he gets mysteriously ambushed and killed, an experimental procedure is used to transfer his memories into dangerous ex-convict Jericho Stewart. When he wakes up with the CIA agents memories, his mission is to find The Dutchman and eliminate him before the hacker launches ICBMs and starts World War III. But complications soon arise and the mission turns personal.', '/6K5JOW6HmrwJnP0VILq667cspnS.jpg', '2016-04-13', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('302688', 'My Big Fat Greek Wedding 2', 'tt3760922', 'The continuing adventures of the Portokalos family. A follow-up to the 2002 comedy, My Big Fat Greek Wedding.', '/gN7Su6RP9zDXJigHGyGLnRaWqsb.jpg', '2016-03-24', '[{"id":35,"name":"Comedy"}]'),
('302699', 'Central Intelligence', 'tt1489889', 'After he reunites with an old pal through Facebook, a mild-mannered accountant is lured into the world of international espionage.', '/q7GOSxRsBLTJysmAEjFoQZfScsq.jpg', '2016-06-15', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('303858', 'Money Monster', 'tt2241351', 'In the real-time, high stakes thriller Money Monster, George Clooney and Julia Roberts star as financial TV host Lee Gates and his producer Patty, who are put in an extreme situation when an irate investor who has lost everything (Jack OConnell) forcefully takes over their studio. During a tense standoff broadcast to millions on live TV, Lee and Patty must work furiously against the clock to unravel the mystery behind a conspiracy at the heart of todays fast-paced, high-tech global markets.', '/4BKptydRqLY9dQoAghJJJmrJuwR.jpg', '2016-05-12', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('303991', 'Demolition', 'tt1172049', 'An emotionally desperate investment banker finds hope through a woman he meets in Chicago.', '/xWT9630LEKF9jEXSNjukmpl7mAH.jpg', '2016-04-06', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('306', 'Beverly Hills Cop III', 'tt0109254', 'Detroit cop Axel Foley is back in sunny Southern California in the third installment of the comedic fish-out-of-water Beverly Hills Cop series. On the trail of two murderers, Axel again teams up with Los Angeles cop Billy Rosewood. Soon, they discover that an amusement park is being used as a front for a massive counterfeiting ring -- and its run by the same gang that shot Billys boss.', '/tw9gAhqQcBFX0X0XfVbWqUsmzoU.jpg', '1994-05-24', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('306745', 'Freeheld', 'tt1658801', 'New Jersey car mechanic Stacie Andree and her police detective girlfriend Laurel Hester both battle to secure Hesters pension benefits after she was diagnosed with a terminal illness.', '/uznb3nUaOMtKWlvy2mKeZkDkfdj.jpg', '2015-09-13', '[{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('306819', 'The Danish Girl', 'tt0810819', 'When Gerda Wegener asks her husband Einar to fill in as a portrait model, Einar discovers the person shes meant to be and begins living her life as Lili Elbe. Having realized her true self and with Gerdas love and support, Lili embarks on a groundbreaking journey as a transgender pioneer.', '/seWQ6UKCrhGH0eP7dFZvmIBQtKF.jpg', '2015-11-27', '[{"id":18,"name":"Drama"}]'),
('307081', 'Southpaw', 'tt1798684', 'Billy The Great Hope, the reigning junior middleweight boxing champion, has an impressive career, a loving wife and daughter, and a lavish lifestyle. However, when tragedy strikes, Billy hits rock bottom, losing his family, his house and his manager. He soon finds an unlikely savior in Tick Willis, a former fighter who trains the citys toughest amateur boxers. With his future on the line, Hope fights to reclaim the trust of those he loves the most.', '/50d0XQQETSyg3bwBXhC7K33pKgc.jpg', '2015-06-15', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"}]'),
('307663', 'Vice', 'tt3480796', 'Julian Michaels has designed the ultimate resort: VICE, where anything goes and the customers can play out their wildest fantasies with artificial inhabitants who look, think and feel like humans. When an artificial becomes self-aware and escapes, she finds herself caught in the crossfire between Julians mercenaries and a cop who is hell-bent on shutting down Vice, and stopping the violence once and for all.', '/gwiY5RJFYSjsoSwoeeo6AbGYjpb.jpg', '2015-01-16', '[{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('308266', 'War Dogs', 'tt2005151', 'Based on a true story, “War Dogs” follows two friends in their early 20s living in Miami during the first Iraq War who exploit a little-known government initiative that allows small businesses to bid on U.S. Military contracts.  Starting small, they begin raking in big money and are living the high life.  But the pair gets in over their heads when they land a 300 million dollar deal to arm the Afghan Military—a deal that puts them in business with some very shady people, not the least of which turns out to be the U.S. Government.', '/wJXku1YhMKeuzYNEHux7XtaYPsE.jpg', '2016-08-18', '[{"id":10752,"name":"War"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('308529', 'Kickboxer: Vengeance', 'tt3082898', 'Eric and Kurt Sloan are the descendants of a well-known Venice, California-based family of martial artists.  Kurt, the younger of the two,  has always been in his brother Eric’s shadow, and despite his talent has been told he lacks the instinct needed to become a champion.  But when Kurt witnesses the merciless murder of his brother at the hands of Muay Thai champion Tong Po, he vows revenge.  He trains with his brother’s mentor for a fight to the death with Tong Po. At first it seems impossible to turn Kurt into the living weapon he must become to beat Tong Po, but through a series of tests and dangerous encounters, Kurt proves he has a deeper strength that will carry him through to his final showdown with Tong Po.', '/fHwikdzHy8btv7Rn1eRGe9rvLVO.jpg', '2016-09-02', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"}]'),
('308531', 'Teenage Mutant Ninja Turtles: Out of the Shadows', 'tt3949660', 'After supervillain Shredder escapes custody, he joins forces with mad scientist Baxter Stockman and two dimwitted henchmen, Bebop and Rocksteady, to unleash a diabolical plan to take over the world. As the Turtles prepare to take on Shredder and his new crew, they find themselves facing an even greater evil with similar intentions: the notorious Krang.', '/5BCpxPLyp4wGcTribpZ6WtNkVJ5.jpg', '2016-06-01', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"}]'),
('308639', 'Dope', 'tt3850214', 'Malcolm is carefully surviving life in a tough neighborhood in Los Angeles while juggling college applications, academic interviews, and the SAT. A chance invitation to an underground party leads him into an adventure that could allow him to go from being a geek, to being dope, to ultimately being himself.', '/a8ATKI5pks0uMQFQzEhElBUrBiQ.jpg', '2015-06-19', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('3093', 'Basic Instinct 2', 'tt0430912', 'Novelist Catherine Tramell is once again in trouble with the law, and Scotland Yard appoints psychiatrist Dr. Michael Glass to evaluate her. Though, like Detective Nick Curran before him, Glass is entranced by Tramell and lured into a seductive game.', '/mr8JpPoxIew3WNWck4ONMzH1lg6.jpg', '2006-03-29', '[{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('309809', 'The Little Prince', 'tt1754656', 'Based on the best-seller book The Little Prince, the movie tells the story of a little girl that lives with resignation in a world where efficiency and work are the only dogmas. Everything will change when accidentally she discovers her neighbor that will tell her about the story of the Little Prince that he once met.', '/uUNd8rVnHxhl2DOtaU7itT2vv78.jpg', '2015-07-29', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":14,"name":"Fantasy"}]'),
('309886', 'Blood Father', 'tt3647498', 'An ex-con reunites with his estranged wayward 16-year old daughter to protect her from drug dealers who are trying to kill her.', '/rQ3CKv33u2Z4keC2AYZqi3RGIdX.jpg', '2016-08-11', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('310', 'Bruce Almighty', 'tt0315327', 'Bruce Nolan toils as a human interest television reporter in Buffalo, N.Y. Despite his high ratings and the love of his beautiful girlfriend, Grace, Bruce remains unfulfilled. At the end of the worst day in his life, he angrily ridicules God -- and the Almighty responds, endowing Bruce with all of His divine powers.', '/y5TEe8Qbgn91dwqVm9FqE2PEL4Q.jpg', '2003-05-23', '[{"id":14,"name":"Fantasy"},{"id":35,"name":"Comedy"}]'),
('310131', 'The Witch', 'tt4263482', 'New England in the 1630s: William and Katherine lead a devout Christian life with five children, homesteading on the edge of an impassable wilderness. When their newborn son vanishes and crops fail, the family turns on one another. Beyond their worst fears, a supernatural evil lurks in the nearby wood.', '/jfGsfzq5JrMAKbAOV2TmhsOs3tf.jpg', '2015-03-24', '[{"id":9648,"name":"Mystery"},{"id":27,"name":"Horror"}]'),
('312221', 'Creed', 'tt3076658', 'The former World Heavyweight Champion Rocky Balboa serves as a trainer and mentor to Adonis Johnson, the son of his late friend and former rival Apollo Creed.', '/xSE4NBFDzqedwa4AIj99r1Z7ljF.jpg', '2015-11-25', '[{"id":18,"name":"Drama"}]'),
('313297', 'Kubo and the Two Strings', 'tt4302938', 'In the epic fantasy, scruffy, kindhearted Kubo ekes out a humble living while devotedly caring for his mother in their sleepy shoreside village. It is a quiet existence – until a spirit from the past catches up with him to enforce an age-old vendetta. Suddenly on the run from gods and monsters, Kubo’s chance for survival rests on finding the magical suit of armor once worn by his fallen father, the greatest samurai the world has ever known. Summoning courage, Kubo embarks on a thrilling odyssey as he faces his family’s history, navigates the elements, and bravely fights for the earth and the stars.', '/oeUpeSMGzZE3BXzaIUDWzCGB46Y.jpg', '2016-08-18', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('314365', 'Spotlight', 'tt1895587', 'The true story of how The Boston Globe uncovered the massive scandal of child molestation and cover-up within the local Catholic Archdiocese, shaking the entire Catholic Church to its core.', '/ngKxbvsn9Si5TYVJfi1EGAGwThU.jpg', '2015-11-06', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":36,"name":"History"}]'),
('315664', 'Florence Foster Jenkins', 'tt4136084', 'The story of Florence Foster Jenkins, a New York heiress, who dreamed of becoming an opera singer, despite having a terrible singing voice.', '/aBjQeNw7JBpXWGFaPYcGNlecRyr.jpg', '2016-05-06', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('316152', 'Free State of Jones', 'tt1124037', 'True Civil War era story about a white Southerner who falls for a slave and consequently rebels against the Confederacy.', '/vLXX3lrDnGrSjEkB6Uf39pojIY7.jpg', '2016-03-10', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":36,"name":"History"}]'),
('316727', 'The Purge: Election Year', 'tt4094724', 'Two years after choosing not to kill the man who killed his son, former police sergeant Leo Barnes has become head of security for Senator Charlene Roan, the front runner in the next Presidential election due to her vow to eliminate the Purge. On the night of what should be the final Purge, a betrayal from within the government forces Barnes and Roan out onto the street where they must fight to survive the night.', '/3O1ZpPdcOrvcqHXXynHCuj9e05g.jpg', '2016-06-29', '[{"id":28,"name":"Action"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('3170', 'Bambi', 'tt0034492', 'The animated story of Bambi, a young deer hailed as the Prince of the Forest at his birth. As Bambi grows, he makes friends with the other animals of the forest, learns the skills needed to survive, and even finds love. One day, however, the hunters come, and Bambi must learn to be as brave as his father if he is to lead the other deer to safety.', '/laABfcpEKweQsaZwCWzmGNUpij9.jpg', '1942-08-08', '[{"id":16,"name":"Animation"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"}]'),
('318781', 'Colonia', 'tt4005402', 'A young womans desperate search for her abducted boyfriend that draws her into the infamous Colonia Dignidad, a sect nobody ever escaped from.', '/AmZnx1Lqn9lSRcVRxWzd1cXje0g.jpg', '2015-09-13', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"},{"id":36,"name":"History"}]'),
('318846', 'The Big Short', 'tt1596363', 'The men who made millions from a global economic meltdown.', '/p11Ftd4VposrAzthkhF53ifYZRl.jpg', '2015-12-11', '[{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('319888', 'Eddie the Eagle', 'tt1083452', 'Inspired by true events, Eddie the Eagle is a feel-good story about Michael Eddie Edwards (Taron Egerton), an unlikely but courageous British ski-jumper who never stopped believing in himself - even as an entire nation was counting him out. With the help of a rebellious and charismatic coach (played by Hugh Jackman), Eddie takes on the establishment and wins the hearts of sports fans around the world by making an improbable and historic showing at the 1988 Calgary Winter Olympics.', '/laEdJnz9CiojWcNpqFjPKhrKuBo.jpg', '2016-02-26', '[{"id":36,"name":"History"},{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('321068', 'Mythica: A Quest for Heroes', 'tt3405714', 'Stuck in a life of indentured servitude, Marek dreams of becoming a wizard. When she meets a beautiful priestess, Teela, in need of help, Marek escapes her master and puts together a team of adventurers - including Thane the warrior and Dagen the half-elf thief – and embarks on an epic quest to free Teela’s sister from orcs and ogres. After raiding the orc camp, the group learns that Teela’s sister has been taken into the mountains by a giant ogre. Escaping hellhounds and dragons on their dangerous journey, the team find themselves hopelessly outmatched by the man-eating ogre, and must unite all their talents to free the prisoners and escape with their own lives.', '/3Wz15vPjgN3avkMMD6nkVjS4Kf7.jpg', '2014-12-08', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('321258', 'The Boy', 'tt3882082', 'A nanny, working for a family whose son has just passed away, finds herself put in charge of caring for a lifelike doll that the couple treat as a real child.', '/yHhBfL2msdFWwLpjGSgPJpVmxQN.jpg', '2016-01-22', '[{"id":27,"name":"Horror"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('321697', 'Steve Jobs', 'tt2080374', 'Set backstage at three iconic product launches and ending in 1998 with the unveiling of the iMac, Steve Jobs takes us behind the scenes of the digital revolution to paint an intimate portrait of the brilliant man at its epicenter.', '/ahUiUaeOE2lvnOy7srxaUJbbvYv.jpg', '2015-10-09', '[{"id":36,"name":"History"},{"id":18,"name":"Drama"}]'),
('321741', 'Concussion', 'tt3322364', 'A dramatic thriller based on the incredible true David vs. Goliath story of American immigrant Dr. Bennet Omalu, the brilliant forensic neuropathologist who made the first discovery of CTE, a football-related brain trauma, in a pro player and fought for the truth to be known. Omalus emotional quest puts him at dangerous odds with one of the most powerful institutions in the world.', '/vdK1f9kpY5QEwrAiXs9R7PlerNC.jpg', '2015-11-12', '[{"id":18,"name":"Drama"}]'),
('323676', 'The Boss', 'tt2702724', 'A titan of industry is sent to prison after shes caught for insider trading. When she emerges ready to rebrand herself as Americas latest sweetheart, not everyone she screwed over is so quick to forgive and forget.', '/w8smnnIVlEeFwD4Z0pKPC3RN2xT.jpg', '2016-04-07', '[{"id":35,"name":"Comedy"}]'),
('324230', 'Diet of Sex', 'tt3094816', 'A chance meeting in the street, give you the opportunity to Agata and Marc to help each other to overcome the inertia of their lives. Tired of going from bed to bed and boy to boy, Agata is confronted with the challenge of staying, not flee to problems. But Agata does not know whats wrong, feels a barrier to enjoying sex. The parents of Agata added to the situation, an extra humor and problems. Eroticism, sensuality, tension and humor, make this film a new style of film making, where bodies do not hide and the sex scenes are displayed naturally, openly.', '/4YP0WbIvIZeobvqO0Aa6XleFex2.jpg', '2014-02-14', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('324668', 'Jason Bourne', 'tt4196776', 'The most dangerous former operative of the CIA is drawn out of hiding to uncover hidden truths about his past.', '/lFSSLTlFozwpaGlO31OoUeirBgQ.jpg', '2016-07-27', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('324807', 'A Bigger Splash', 'tt2056771', 'An American couple, Paul and Marianne, spend their vacation in Italy and experiences trouble when the wife invites a former lover and his teenage daughter to visit, which leads to jealousy and dangerous sexual scenarios.', '/yhCZHxKEC9bIlePfcg3aqPPeKOA.jpg', '2015-11-26', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('325133', 'Neighbors 2: Sorority Rising', 'tt4438848', 'A sorority moves in next door to the home of Mac and Kelly Radner who have a young child. The Radners enlist their former nemeses from the fraternity to help battle the raucous sisters.', '/bWUeJHbKIyT306WtJFRHoSzX9nk.jpg', '2016-05-05', '[{"id":35,"name":"Comedy"}]'),
('325348', 'Hardcore Henry', 'tt3072482', 'Henry, a newly resurrected cyborg who must save his wife/creator from the clutches of a psychotic tyrant with telekinetic powers, AKAN, and his army of mercenaries. Fighting alongside Henry is Jimmy, who is Henrys only hope to make it through the day. Hardcore takes place over the course of one day, in Moscow, Russia.', '/qfWLO0iXmbvxzyk0ez4pXrgkRDM.jpg', '2015-09-12', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('32657', 'Percy Jackson & the Olympians: The Lightning Thief', 'tt0814255', 'Accident prone teenager, Percy discovers hes actually a demi-God, the son of Poseidon, and he is needed when Zeus lightning is stolen. Percy must master his new found skills in order to prevent a war between the Gods that could devastate the entire world.', '/5NhyXkodMzDRW8uqtPqlxJsoBhf.jpg', '2010-02-01', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('328111', 'The Secret Life of Pets', 'tt2709768', 'The quiet life of a terrier named Max is upended when his owner takes in Duke, a stray whom Max instantly dislikes.', '/WLQN5aiQG8wc9SeKwixW7pAR8K.jpg', '2016-06-24', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('328387', 'Nerve', 'tt3531824', 'A high school senior finds herself immersed in an online game of truth or dare, where her every move starts to be manipulated by an anonymous community of watchers.', '/3ioyAtm0wXDyPy330Y7mJAJEHpU.jpg', '2016-07-27', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('329', 'Jurassic Park', 'tt0107290', 'A wealthy entrepreneur secretly creates a theme park featuring living dinosaurs drawn from prehistoric DNA. Before opening day, he invites a team of experts and his two eager grandchildren to experience the park and help calm anxious investors. However, the park is anything but amusing as the security systems go off-line and the dinosaurs escape.', '/c414cDeQ9b6qLPLeKmiJuLDUREJ.jpg', '1993-06-11', '[{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('329103', 'Russkaya Lolita', 'tt4136094', 'The action of a controversial novel Lolita, of the famous Russian writer Vladimir Nabokov, reset to present day Russia. A mother and her daughter are running short of money and are thankful that they could rent a room to a writer. The mother is lonely and the daughter is coming of age. The mother immediately gets in love with him, which causing to the daughter a terrible jealousy. And then the daughter chooses the most unfailing weapon - she tries to discourage him from her mother. She tries to get his attention by parading around without panties, asking his help with her shower, and rubbing up against him and flashing him whenever her mother is not looking. She is even trying to convince her mom, that since she is becoming a woman, that he should teach her some of the finer points of love. Could the grown man resist the charms of a 14 year-old nymphet?', '/tXQa4fpOj8ab79ByTd4sGAqz36o.jpg', '2007-01-03', '[{"id":10749,"name":"Romance"}]'),
('33', 'Unforgiven', 'tt0105695', 'William Munny is a retired, once-ruthless killer turned gentle widower and hog farmer. To help support his two motherless children, he accepts one last bounty-hunter mission to find the men who brutalized a prostitute. Joined by his former partner and a cocky greenhorn, he takes on a corrupt sheriff.', '/km6qw4qUkHQRN5y2U1juM1WkBFh.jpg', '1992-08-07', '[{"id":37,"name":"Western"}]'),
('332567', 'The Shallows', 'tt4052882', 'An injured surfer stranded on a buoy needs to get back to shore, but the great white shark stalking her might have other ideas.', '/6vuxwCfBejPfUjMxrPgk0ANmVFq.jpg', '2016-06-24', '[{"id":27,"name":"Horror"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('332872', 'Julieta', 'tt4326444', 'The film spans 30 years in Julieta’s life from a nostalgic 1985 where everything seems hopeful, to 2015 where her life appears to be beyond repair and she is on the verge of madness.', '/vvGuzaTGOFhJYL4MqfrR8Ib1WhA.jpg', '2016-04-08', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('333352', 'Eye in the Sky', 'tt2057392', 'A military officer in command of a drone operation to capture terrorists in Kenya sees her mission escalate from “capture” to “kill” just as a nine-year old girl enters the kill zone.', '/7IUUuB9Nwtp2Lslpt4Jo4bzMGoX.jpg', '2015-09-11', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":10752,"name":"War"}]'),
('333371', '10 Cloverfield Lane', 'tt1179933', 'Waking up from a car accident, a young woman finds herself in the basement of a man who says hes saved her life from a chemical attack that has left the outside uninhabitable.', '/aeiVxTSTeGJ2ICf1iSDXkF3ivZp.jpg', '2016-03-10', '[{"id":18,"name":"Drama"},{"id":27,"name":"Horror"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('333484', 'The Magnificent Seven', 'tt2404435', 'A big screen remake of John Sturges classic western The Magnificent Seven, itself a remake of Akira Kurosawas Seven Samurai. Seven gun men in the old west gradually come together to help a poor village against savage thieves.', '/z6BP8yLwck8mN9dtdYKkZ4XGa3D.jpg', '2016-09-22', '[{"id":37,"name":"Western"},{"id":28,"name":"Action"}]'),
('333669', 'Bastille Day', 'tt2368619', 'Michael Mason is an American pickpocket living in Paris who finds himself hunted by the CIA when he steals a bag that contains more than just a wallet. Sean Briar, the field agent on the case, soon realises that Michael is just a pawn in a much bigger game and is also his best asset to uncover a large-scale conspiracy.', '/8QcOMU8vFSInSJ1kE7Naor7L2vM.jpg', '2016-04-22', '[{"id":28,"name":"Action"}]'),
('334', 'Magnolia', 'tt0175880', 'An epic mosaic of many interrelated characters in search of happiness, forgiveness, and meaning in the San Fernando Valley.', '/jxkHxPiMfGiFvxSOduNV4oIKJI5.jpg', '1999-12-08', '[{"id":18,"name":"Drama"}]'),
('334074', 'Survivor', 'tt3247714', 'A Foreign Service Officer in London tries to prevent a terrorist attack set to hit New York, but is forced to go on the run when she is framed for crimes she did not commit.', '/XtvR1aSph7X3wqrE2PY66IPzVi.jpg', '2015-05-21', '[{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"},{"id":28,"name":"Action"}]'),
('335791', 'When the Bough Breaks', 'tt1389139', 'A surrogate mother harbors a deadly secret desire for a family of her own with the husband who is expecting to raise her child.', '/goPzegO1l1z80dO5tVjDZkdmQeB.jpg', '2016-09-09', '[{"id":9648,"name":"Mystery"},{"id":18,"name":"Drama"},{"id":27,"name":"Horror"}]'),
('335988', 'Transformers: The Last Knight', 'tt3371366', '', '/ncevUXm7j8dVgGkhbgy3Vc4BvJ8.jpg', '2017-06-21', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"}]'),
('337339', 'Fast 8', 'tt4630562', 'The plot is unknown at this time.', '/e7neeG0diSPFZRV0n7N2frmusML.jpg', '2017-04-12', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('337556', 'Smaragdgrün', 'tt4960934', 'Emerald Green is the stunning conclusion to Kerstin Giers Ruby Red Trilogy, picking up where Sapphire Blue left off, reaching new heights of intrigue and romance as Gwen finally uncovers the secrets of the time-traveling society and learns her fate.', '/9VIRyID0f42actTRCCPyN0lelKO.jpg', '2016-07-07', '[{"id":18,"name":"Drama"},{"id":14,"name":"Fantasy"},{"id":10749,"name":"Romance"},{"id":12,"name":"Adventure"}]'),
('338544', 'For the Love of Spock', 'tt4572820', 'A documentary film about the life of Star Treks Mr. Spock as well as that of Leonard Nimoy, the actor who played Mr. Spock for almost fifty years, written and directed by his son, Adam Nimoy.', '/inya59isiVecLxNDRBAz1WYFieY.jpg', '2016-09-09', '[{"id":99,"name":"Documentary"}]'),
('338766', 'Hell or High Water', 'tt2582782', 'A divorced dad and his ex-con brother resort to a desperate scheme in order to save their familys farm in West Texas.', '/rMev9yIIQkAk2odkMVnM8hszPVd.jpg', '2016-08-12', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('339397', 'Café Society', 'tt4513674', 'The story of a young man who arrives in Hollywood during the 1930s hoping to work in the film industry, falls in love, and finds himself swept up in the vibrant café society that defined the spirit of the age.', '/hRrF8R32WIldNEMLOhtNrz9OfAZ.jpg', '2016-07-15', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('339527', 'Solace', 'tt1291570', 'A psychic doctor, John Clancy, works with an FBI special agent in search of a serial killer. After having lived in isolation for two years, since the death of his daughter, Clancy is asked by his friend Joe, an FBI special agent to help him solve several murders committed by a serial killer.', '/4MkNIKVZxYkga4208RXdRZ76zjf.jpg', '2015-09-02', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('339984', 'Miracles from Heaven', 'tt4257926', 'A young girl suffering from a rare digestive disorder finds herself miraculously cured after surviving a terrible accident. Based on the book Three Miracles From Heaven by Christy Beam.', '/3sPIq0Uqe8SN5T0Pq7vUOFLb2Bk.jpg', '2016-03-17', '[{"id":18,"name":"Drama"}]'),
('341012', 'Popstar: Never Stop Never Stopping', 'tt3960412', 'When his new album fails to sell records, pop/rap superstar Conner4real goes into a major tailspin and watches his celebrity high life begin to collapse. Hell try anything to bounce back, anything except reuniting with his old rap group The Style Boyz.', '/m9k2MCvZJWkV5DfJY9fueeeqNxb.jpg', '2016-06-03', '[{"id":35,"name":"Comedy"}]'),
('342521', 'Keanu', 'tt4139124', 'Friends hatch a plot to retrieve a stolen cat by posing as drug dealers for a street gang.', '/udU6t5xPNDLlRTxhjXqgWFFYlvO.jpg', '2016-04-22', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('345911', 'Lights Out', 'tt4786282', 'When Rebecca left home, she thought she left her childhood fears behind. Growing up, she was never really sure of what was and wasn’t real when the lights went out…and now her little brother, Martin, is experiencing the same unexplained and terrifying events that had once tested her sanity and threatened her safety. A frightening entity with a mysterious attachment to their mother, Sophie, has reemerged.', '/rxXA5vwJElXQ8BgrB0pocUcuqFA.jpg', '2016-07-22', '[{"id":27,"name":"Horror"}]'),
('346672', 'Underworld: Blood Wars', 'tt3717252', 'The plot is unknown at this time.', '/8s8ymm1JU4x97KcFaOfJnOqMQcX.jpg', '2017-01-06', '[{"id":27,"name":"Horror"},{"id":28,"name":"Action"}]'),
('347969', 'The Ridiculous 6', 'tt2479478', 'When his long-lost outlaw father returns, Tommy White Knife Stockburn goes on an adventure-filled journey across the Old West with his five brothers.', '/k77xcsBtZMq9zIlTVQV7UBemzXD.jpg', '2015-12-11', '[{"id":35,"name":"Comedy"},{"id":37,"name":"Western"}]'),
('348', 'Alien', 'tt0078748', 'During its return to the earth, commercial spaceship Nostromo intercepts a distress signal from a distant planet. When a three-member team of the crew discovers a chamber containing thousands of eggs on the planet, a creature inside one of the eggs attacks an explorer. The entire crew is unaware of the impending nightmare set to descend upon them when the alien parasite planted inside its unfortunate host is birthed.', '/2h00HrZs89SL3tXB4nbkiM7BKHs.jpg', '1979-05-25', '[{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('34851', 'Predators', 'tt1424381', 'A mercenary named Royce reluctantly leads a motley crew of warriors who soon come to realize theyve been captured and deposited on an alien planet by an unknown nemesis. With the exception of a peculiar physician, they are all cold-blooded killers, convicts, death squad members...hunters who have now become the hunted.', '/xtx2kOAySd2jUVU4eylCgkkIi5v.jpg', '2010-07-03', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('348668', 'Flaskepost fra P', 'tt4088268', 'An old note is found in a bottle in Jutland which has travelled across the ocean for a long time. The note is hard to decipher, but when the Danish investigators from Section Q receive it, the odd personalities within the section find a new angle on it and try to unveil yet another old and diabolic case even though the lead is cold.', '/2K7nz0aYgtw4aB77M0tkLwmoWBM.jpg', '2016-03-03', '[{"id":9648,"name":"Mystery"},{"id":18,"name":"Drama"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('35', 'The Simpsons Movie', 'tt0462538', 'After Homer accidentally pollutes the towns water supply, Springfield is encased in a gigantic dome by the EPA and the Simpsons are declared fugitives.', '/eCytnEriVur3rT47NWfkgPXD9qs.jpg', '2007-07-25', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('350', 'The Devil Wears Prada', 'tt0458352', 'The Devil Wears Prada is about a young journalist who moves to New York to work in the fashion industry. Her boss however is extremely demanding and cruel and won’t let her succeed if she doesn’t fit into the high class elegant look of their magazine when all she really wants to be a good journalist.', '/8unCRm0LeiO0fM6skWAZy3ZfXR1.jpg', '2006-06-30', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('35056', 'Date Night', 'tt1279935', 'The mild-mannered married couple Phil and Claire fear that their relationship may be falling into a stale rut. During their weekly date night, they impetuously steal a dinner reservation, which leads to a case of mistaken identity. Turns out the reservation was for a pair of thieves, and now a number of unsavory characters want Phil and Claire killed.', '/fzzPht9KId6Ollow30jYtABhDY3.jpg', '2010-04-08', '[{"id":35,"name":"Comedy"}]'),
('351211', 'Blair Witch', 'tt1540011', 'A college student ventures with a group of friends into the Black Hills Forest in Maryland to uncover the mystery surrounding the disappearance of his sister years earlier, which many believe is connected to the legend of the Blair Witch. At first the group is hopeful, especially when a pair of locals offer to act as guides through the dark and winding woods, but as the endless night wears on, the group is visited by a menacing presence. Slowly, they begin to realize the legend is all too real and more sinister than they could have imagined.', '/zfpv5xETXC1LvVNzRSAQQ8knL6O.jpg', '2016-09-15', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('352492', 'XOXO', 'tt4855748', 'XOXO follows six strangers whose lives collide in one frenetic, dream-chasing, hopelessly romantic night.', '/3mCcVbVLz23MhCngELFihX2uSwb.jpg', '2016-08-26', '[{"id":18,"name":"Drama"}]'),
('353069', 'Mothers Day', 'tt4824302', 'Intersecting stories with different moms collide on Mothers Day.', '/7tgBdoplLSkHfaB523tzqLACs1Z.jpg', '2016-04-28', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('353326', 'The Man Who Knew Infinity', 'tt0787524', 'Growing up poor in Madras, India, Srinivasa Ramanujan Iyengar earns admittance to Cambridge University during WWI, where he becomes a pioneer in mathematical theories with the guidance of his professor, G.H. Hardy.', '/stXjVMZlY8khhjiJYrq4DdQ5uyV.jpg', '2015-09-17', '[{"id":18,"name":"Drama"}]'),
('3580', 'Changeling', 'tt0824747', 'Christine Collins is overjoyed when her kidnapped son is brought back home. But when Christine suspects that the boy returned to her isnt her child, the police captain has her committed to an asylum.', '/qtte2n6ygA1zVG5kLrjUGui28TJ.jpg', '2008-01-30', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('359412', 'Marauders', 'tt3963816', 'An untraceable group of elite bank robbers is chased by a suicidal FBI agent who uncovers a deeper purpose behind the robbery-homicides.', '/3iOYH67ZPflBMDMMkEv2tKRX4xe.jpg', '2016-07-01', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('360365', 'Tini: El gran cambio de Violetta', 'tt5122374', 'Shot in Spanish and localized for markets around the world, “Tini – El Gran Cambio de Violetta” is set to thrill fans with everything they loved about the worldwide Violetta phenomenon including strong musical elements with new and original tracks, exciting choreography, compelling storylines, and intriguing characters. All made bigger and better for the big screen.  The film shows how taking the role in the TV series was a pivotal moment for Tini leading to a personal ‘coming of age story’ about the young actress. In a story that reflects the teen star’s own real life, Tini will leave behind the world depicted in Violetta, striking out alone and embarking on a brand new adventure over one endless summer that will define her as a person and see her emerge as a new artist.', '/r2EX7Z3X0KHvoUHQYjksoQBvv7b.jpg', '2016-05-04', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10402,"name":"Music"}]'),
('363676', 'Sully', 'tt3263904', 'On January 15, 2009, the world witnessed the Miracle on the Hudson when Captain Sully Sullenberger glided his disabled plane onto the frigid waters of the Hudson River, saving the lives of all 155 aboard. However, even as Sully was being heralded by the public and the media for his unprecedented feat of aviation skill, an investigation was unfolding that threatened to destroy his reputation and his career.', '/43Gr00IiZtq2dOtYZQVOTwMf3kI.jpg', '2016-09-08', '[{"id":36,"name":"History"},{"id":18,"name":"Drama"}]'),
('363841', 'Guernika', 'tt2556114', 'The fates of Henry - an American correspondent - and Teresa, one of the Republics censors during the Spanish Civil War.', '/2gd30NS4RD6XOnDlxp7nXYiCtT1.jpg', '2016-09-09', '[{"id":18,"name":"Drama"},{"id":10752,"name":"War"},{"id":10749,"name":"Romance"}]'),
('364', 'Batman Returns', 'tt0103776', 'Having defeated the Joker, Batman now faces the Penguin - a warped and deformed individual who is intent on being accepted into Gotham society. Crooked businessman Max Schreck is coerced into helping him become Mayor of Gotham and they both attempt to expose Batman in a different light. Selina Kyle, Maxs secretary, is thrown from the top of a building and is transformed into Catwoman - a mysterious figure who has the same personality disorder as Batman. Batman must attempt to clear his name, all the time deciding just what must be done with the Catwoman.', '/jX5THE1yW3zTdeD9dupcIyQvKiG.jpg', '1992-06-19', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('364433', 'Lo chiamavano Jeeg Robot', 'tt3775086', 'A small-time Roman criminal accidentally acquires a superhuman strength and becomes nearly invulnerable.', '/poC4JgAnZYt1aOuUpFrsPpPZTXm.jpg', '2016-02-25', '[{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"}]'),
('36557', 'Casino Royale', 'tt0381061', 'James Bond goes on his first ever mission as a 00. Le Chiffre is a banker to the worlds terrorists. He is participating in a poker game at Montenegro, where he must win back his money, in order to stay safe among the terrorist market. The boss of MI6, known simply as M sends Bond, along with Vesper Lynd to attend this game and prevent Le Chiffre from winning. Bond, using help from Felix Leiter, Mathis and having Vesper pose as his wife, enters the most important poker game in his already dangerous career. But if Bond defeats Le Chiffre, will he and Vesper Lynd remain safe?', '/zlWBxz2pTA9p45kUTrI8AQiKrHm.jpg', '2006-11-14', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('36586', 'Blade II', 'tt0187738', 'A rare mutation has occurred within the vampire community - The Reaper. A vampire so consumed with an insatiable bloodlust that they prey on vampires as well as humans, transforming victims who are unlucky enough to survive into Reapers themselves. Blade is asked by the Vampire Nation for his help in preventing a nightmare plague that would wipe out both humans and vampires.', '/jlURNpXCMK830CsGRd939PJLh8c.jpg', '2002-03-22', '[{"id":878,"name":"Science Fiction"},{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('36593', 'The Naked Gun 33⅓: The Final Insult', 'tt0110622', 'Frank Drebin is persuaded out of retirement to go undercover in a state prison. There he is to find out what top terrorist, Rocco, has planned for when he escapes. Franks wife, Jane, is desperate for a baby.. this adds to Franks problems. A host of celebrities at the Academy awards ceremony are humiliated by Frank as he blunders his way trying to foil Rocco.', '/k3F8N3jeqXOpm1qjY7mL8O6vdx.jpg', '1994-03-18', '[{"id":35,"name":"Comedy"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"}]'),
('36643', 'The World Is Not Enough', 'tt0143145', 'Greed, revenge, world dominance, high-tech terrorism -- its all in a days work for cunning MI6 agent James Bond, whos on a mission to protect beautiful oil heiress Elektra King from a notorious terrorist. In a race against time that culminates in a dramatic submarine showdown, Bond works to defuse the international power struggle that has the worlds oil supply hanging in the balance.', '/aPfALBxfgx2tsbTwRMR1MbNHSvn.jpg', '1999-11-08', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('36647', 'Blade', 'tt0120611', 'When Blades mother was bitten by a vampire during pregnancy, she did not know that she gave her son a special gift while dying: All the good vampire attributes in combination with the best human skills. Blade and his mentor Whistler battle an evil vampire rebel (Deacon Frost) who plans to take over the outdated vampire council, capture Blade and resurrect voracious blood god La Magra.', '/r0RQ9ZOEZglLOeYDNJTehVTRoR6.jpg', '1998-08-21', '[{"id":27,"name":"Horror"},{"id":28,"name":"Action"}]'),
('36648', 'Blade: Trinity', 'tt0359013', 'For years, Blade has fought against the vampires in the cover of the night. But now, after falling into the crosshairs of the FBI, he is forced out into the daylight, where he is driven to join forces with a clan of human vampire hunters he never knew existed - The Nightstalkers. Together with Abigail and Hannibal, two deftly trained Nightstalkers, Blade follows a trail of blood to the ancient creature that is also hunting him, the original vampire, Dracula.', '/4WinsdHQBdh5aTt7Bd7T7dbUXbb.jpg', '2004-12-08', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('366514', 'Un homme à la hauteur', 'tt4699388', 'Diane is a well-known lawyer, divorced for three years. She loses her mobile telephone and receives a call from the person who finds it. That person is Alexandre, a charming man and the perfect gentleman. They make a connection over the phone and agree to meet up the following day. But when Alexandre arrives, theres a surprise in store when Diane discovers he is only 4 6 tall. From that moment on, Diane tries to overcome the prejudices of society and her own fears to experience the best time of her life...', '/bbEKHdrGJCYVnH2h1vuPaUmAAHX.jpg', '2016-05-04', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('36669', 'Die Another Day', 'tt0246460', 'The ever-daring James Bond taking on a North Korean leader who undergoes DNA replacement procedures that allow him to assume different identities. American agent Jinx Johnson assists Bond in thwarting the villains plans to exploit a satellite that is powered by solar energy.', '/1iUZqUXS7x5FcGM5J0u01xuObWC.jpg', '2002-11-17', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('36670', 'Never Say Never Again', 'tt0086006', 'James Bond returns as the secret agent 007 one more time to battle the evil organization SPECTRE. Bond must defeat Largo, who has stolen two atomic warheads for nuclear blackmail. But Bond has an ally in Largos girlfriend, the willowy Domino, who falls for Bond and seeks revenge. This is the last time for Sean Connery as Her Majestys Secret Agent 007.', '/s9tBlhTEW0OtYJdemVMPbRcD7wk.jpg', '1983-10-07', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('368031', 'Friend Request', 'tt3352390', 'Enjoying college life as a popular student, Laura shares everything with her more\r than 800 friends on Facebook. But one day, after accepting a friend request from a\r social outcast named Marina, Laura’s life is cursed...', '/eVzEHCydaBe3AGzgCJC7CDfWIMq.jpg', '2016-01-07', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('368596', 'Back in the Day', 'tt3349772', 'A young boxer is taken under the wing of a mob boss after his mother dies and his father is run out of town for being an abusive alcoholic.', '/is6QqgiPQlI3Wmk0bovqUFKM56B.jpg', '2016-05-20', '[{"id":18,"name":"Drama"}]'),
('368940', 'Robinson Crusoe', 'tt4731008', 'On a tiny exotic island, Tuesday, an outgoing parrot lives with his quirky animal friends in paradise. However, Tuesday cant stop dreaming about discovering the world. After a violent storm, Tuesday and his friends wake up to find a strange creature on the beach: Robinson Crusoe. Tuesday immediately views Crusoe as his ticket off the island to explore new lands. Likewise, Crusoe soon realizes that the key to surviving on the island is through the help of Tuesday and the other animals. It isnt always easy at first, as the animals dont speak human. Slowly but surely, they all start living together in harmony, until one day, when their comfortable life is overturned by two savage cats, who wish to take control of the island. A battle ensues between the cats and the group of friends but Crusoe and the animals soon discover the true power of friendship up against all odds (even savage cats).', '/6BpNPUQhIgymmncLXLl19YJvUXN.jpg', '2016-02-04', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"}]'),
('370687', 'Mythica: The Necromancer', 'tt3608646', 'Mallister takes Thane prisoner and forces Marek and her team on a quest.  Marek tracks down the Necromancer for a final showdown for the Darkspore.', '/pxtb9zC59Cd6jG1qXXcQawcNnSV.jpg', '2015-12-19', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('37135', 'Tarzan', 'tt0120855', 'Tarzan was a small orphan who was raised by an ape named Kala since he was a child. He believed that this was his family, but on an expedition Jane Porter is rescued by Tarzan. He then finds out that hes human. Now Tarzan must make the decision as to which family he should belong to...', '/tWFubl9q3quYuYXBGypXXCNLE00.jpg', '1999-06-18', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"}]'),
('37136', 'The Naked Gun: From the Files of Police Squad!', 'tt0095705', 'When the incompetent Officer Frank Drebin seeks the ruthless killer of his partner, he stumbles upon an attempt to assassinate Queen Elizabeth.', '/gajZQkZjVXPuLJUMoEk1eVeZz61.jpg', '1988-12-02', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('37165', 'The Truman Show', 'tt0120382', 'Truman Burbank is the star of The Truman Show, a 24-hour-a-day reality TV show that broadcasts every aspect of his life -- live and in color -- without his knowledge. His entire life has been an unending soap opera for consumption by the rest of the world. And everyone he knows -- including his wife and his best friend -- is really an actor, paid to be part of his life.', '/EelZzudHRvJmjWccWscN1S5vmI.jpg', '1998-06-04', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('37265', 'Così fan tutte', 'tt0104014', 'Diana is a Roman wife happily married to sympathetic Paolo but she is keen on playing benign games of seduction with other men while resisting the advances of chic lingerie shop owner Silvio and she narrates her adventures to Paolo in order to stimulate their otherwise monotonous sexual life. However, under the influence of her lesbian friend Antonietta and raunchy sister Nadia, Diana starts to move the ongoings further while Paolo is still prone to believing that events narrated by her are merely fantasies. Nevertheless, when the French Sadean antiques dealer Donatien Alphonse leaves marks on her body, Paolo understands that Diana is cheating on him and throws her out of the house.', '/h5xsSUCkXCd0696K5A9hkmgaERE.jpg', '1992-02-21', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('374617', 'Imperium', 'tt4781612', 'Nate Foster, a young, idealistic FBI agent, goes undercover to take down a radical white supremacy terrorist group. The bright up-and-coming analyst must confront the challenge of sticking to a new identity while maintaining his real principles as he navigates the dangerous underworld of white supremacy. Inspired by real events.', '/aRRLpsusORQxOpFkZvXdk00TkoY.jpg', '2016-08-19', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('376570', 'Hush', 'tt5022702', 'A deaf woman is stalked by a psychotic killer in her secluded home.', '/khDYdmPFlaTqeLQVD4ds4xC1mIf.jpg', '2016-04-08', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('376659', 'Bad Moms', 'tt4651520', 'A woman with a seemingly perfect life - a great marriage, overachieving kids, beautiful home, stunning looks and still holding down a career. However shes over-worked, over committed and exhausted to the point that shes about to snap. Fed up, she joins forces with two other over-stressed moms and all go on a quest to liberate themselves from conventional responsibilities, going on a wild un-mom like binge of freedom, fun and self-indulgence - putting them on a collision course with PTA Queen Bee Gwendolyn and her clique of devoted perfect moms.', '/3S7V2Jd2G61LltoCsYUj4GwON5p.jpg', '2016-07-28', '[{"id":35,"name":"Comedy"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('377', 'A Nightmare on Elm Street', 'tt0087800', 'Teenagers in a small town are dropping like flies, apparently in the grip of mass hysteria causing their suicides. A cops daughter, Nancy Thompson (Heather Langenkamp) traces the cause to child molester Fred Krueger (Robert Englund), who was burned alive by angry parents many years before. Krueger has now come back in the dreams of his killers children, claiming their lives as his revenge. Nancy and her boyfriend, Glen (Johnny Depp), must devise a plan to lure the monster out of the realm of nightmares and into the real world...', '/sXFlyjfWv544uKOJmPd2vVsaFm9.jpg', '1984-11-15', '[{"id":27,"name":"Horror"}]'),
('37710', 'The Tourist', 'tt1243957', 'American tourist Frank (Johnny Depp) meets mysterious British woman Elsie (Angelina Jolie) on the train to Venice. Romance seems to bud, but theres more to her than meets the eye. Remake of the 2005 French film Anthony Zimmer, written and directed by Jérôme Salle.', '/jfLFF0Qa9jAoTYQIKaSWmMWcKZd.jpg', '2010-12-08', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":10749,"name":"Romance"}]'),
('37724', 'Skyfall', 'tt1074638', 'When Bonds latest assignment goes gravely wrong and agents around the world are exposed, MI6 is attacked forcing M to relocate the agency. These events cause her authority and position to be challenged by Gareth Mallory (Ralph Fiennes), the new Chairman of the Intelligence and Security Committee. With MI6 now compromised from both inside and out, M is left with one ally she can trust: Bond. 007 takes to the shadows - aided only by field agent, Eve (Naomie Harris) - following a trail to the mysterious Silva (Javier Bardem), whose lethal and hidden motives have yet to reveal themselves.', '/lQCkPLDxFONmgzrWLvq085v1g2d.jpg', '2012-10-25', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('377264', 'Morgan', 'tt4520364', 'Morgan is about a corporate risk-management consultant who has to decide and determine whether or not to terminate an artificial beings life that was made in a laboratory environment.', '/39ia8d9HPZlnYuEX5w2Gk25Tpgs.jpg', '2016-09-02', '[{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('37799', 'The Social Network', 'tt1285016', 'On a fall night in 2003, Harvard undergrad and computer programming genius Mark Zuckerberg sits down at his computer and heatedly begins working on a new idea. In a fury of blogging and programming, what begins in his dorm room as a small site among friends soon becomes a global social network and a revolution in communication. A mere six years and 500 million friends later, Mark Zuckerberg is the youngest billionaire in history... but for this entrepreneur, success leads to both personal and legal complications.', '/ok5Wh8385Kgblq9MSU4VGvazeMH.jpg', '2010-09-30', '[{"id":18,"name":"Drama"}]'),
('38', 'Eternal Sunshine of the Spotless Mind', 'tt0338013', 'A man, Joel Barish, heartbroken that his girlfriend Clementine underwent a procedure to erase him from her memory, decides to do the same. However, as he watches his memories of her fade away, he realizes that he still loves her, and may be too late to correct his mistake.', '/7y3eYvTsGjxPYDtSnumCLIMDkrV.jpg', '2004-03-19', '[{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('38050', 'The Adjustment Bureau', 'tt1385826', 'A man glimpses the future Fate has planned for him – and chooses to fight for his own destiny. Battling the powerful Adjustment Bureau across, under and through the streets of New York, he risks his destined greatness to be with the only woman hes ever loved.', '/g87PqGH9Oo3d3Tbczcfk7ZMAIEk.jpg', '2011-03-03', '[{"id":53,"name":"Thriller"},{"id":10749,"name":"Romance"},{"id":14,"name":"Fantasy"}]'),
('382322', 'Batman: The Killing Joke', 'tt4853102', 'As Batman hunts for the escaped Joker, the Clown Prince of Crime attacks the Gordon family to prove a diabolical point mirroring his own fall into madness. Based on the graphic novel by Alan Moore and Brian Bolland.', '/zm0ODjtfJfJW0W269LqsQl5OhJ8.jpg', '2016-07-24', '[{"id":28,"name":"Action"},{"id":16,"name":"Animation"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('382517', 'Open Season: Scared Silly', 'tt4938374', 'The humans and animals believe a werewolf is on the loose, and former hunter Shaw uses the opportunity to re-open the season. Boog, Elliot, and Mr. Weenie have to face their fears and find the werewolf to get the season closed permanently.', '/1ma0lXsFyWYkxdLkvnwW3Y9GTrR.jpg', '2016-03-10', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"}]'),
('384798', 'Kill Command', 'tt2667380', 'Set in a near future, technology-reliant society that pits man against killing machines. Against this backdrop an elite army unit is helicoptered to a remote, off-the-grid island training facility. What starts out as a simple training exercise for Captain Bukes and his tight-knit unit, descends into a terrifying battle to the death, as the marines discover the island is overrun by an enemy that transcends the human concept of evil.', '/tcYN5N1XdLzdWY1BANkXqOshHOf.jpg', '2016-05-13', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":27,"name":"Horror"}]'),
('38575', 'The Karate Kid', 'tt1155076', '12-year-old Dre Parker could have been the most popular kid in Detroit, but his mothers latest career move has landed him in China. Dre immediately falls for his classmate Mei Ying but the cultural differences make such a friendship impossible. Even worse, Dres feelings make him an enemy of the class bully, Cheng. With no friends in a strange land, Dre has nowhere to turn but maintenance man Mr. Han, who is a kung fu master. As Han teaches Dre that kung fu is not about punches and parries, but maturity and calm, Dre realizes that facing down the bullies will be the fight of his life.', '/l13emtM0cz0HyJeWSxb6ml5RvzT.jpg', '2010-06-10', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"}]'),
('387', 'Das Boot', 'tt0082096', 'A German submarine hunts allied ships during the Second World War. Soon it becomes hunted itself. The crew tries to survive below the surface, while stretching both the boat and themselves to their limits...', '/kI1rptTkqDWj6SBRsYwguBvPViT.jpg', '1981-09-16', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":36,"name":"History"},{"id":10752,"name":"War"},{"id":12,"name":"Adventure"}]'),
('38757', 'Tangled', 'tt0398286', 'When the kingdoms most wanted-and most charming-bandit Flynn Rider hides out in a mysterious tower, hes taken hostage by Rapunzel, a beautiful and feisty tower-bound teen with 70 feet of magical, golden hair. Flynns curious captor, whos looking for her ticket out of the tower where shes been locked away for years, strikes a deal with the handsome thief and the unlikely duo sets off on an action-packed escapade, complete with a super-cop horse, an over-protective chameleon and a gruff gang of pub thugs.', '/re6AOJbhBk9FIK3knwU6rYlbPDx.jpg', '2010-11-24', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('388', 'Inside Man', 'tt0454848', 'An efficient gang enters a Manhattan bank, locks the doors, and takes hostages. They work deliberately, without haste. Detective Frazier is assigned to negotiate, but his mind is occupied with the corruption charges he is facing. With an army of police surrounding the bank, the thief, the cop, and the plutocrats fixer enter high-stakes negotiations. Why are the robbers asking for a plane, if they are so competent and they know they wont get one? Why arent they in more of a hurry?', '/z6wYRuvk1lf60R4SmWETfdUvGsm.jpg', '2006-03-23', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('388191', 'Mythica: The Iron Crown', 'tt5456798', 'When a team of unlikely heroes hijacks a steam-powered battle wagon, a daring young wizard (Marek) steals the final piece of the all-powerful Darkspore and embarks on a desperate quest to deliver the cursed artifact to the gods for safe keeping; but when they are caught in a death race between a ruthless team of elite mercenaries and a trinity of demons, Marek must learn to believe in herself before her friends are killed and the Darkspore is lost, to stop the evil necromancer (Szorlok) from uniting the Darkspore and flooding the living world with his legions of undead.', '/otSfU9MrjYr1bJRhoAO61Pq1csH.jpg', '2016-05-14', '[{"id":14,"name":"Fantasy"}]'),
('389', '12 Angry Men', 'tt0050083', 'The defense and the prosecution have rested and the jury is filing into the jury room to decide if a young Spanish-American is guilty or innocent of murdering his father. What begins as an open and shut case soon becomes a mini-drama of each of the jurors prejudices and preconceptions about the trial, the accused, and each other.', '/qcL1YfkCxfhsdO6sDDJ0PpzMF9n.jpg', '1957-03-25', '[{"id":18,"name":"Drama"}]'),
('390734', 'Kingsglaive: Final Fantasy XV', 'tt5595168', 'The magical kingdom of Lucis is home to the world’s last remaining Crystal, and the menacing empire of Niflheim is determined to steal it. King Regis of Lucis commands an elite force of soldiers called the Kingsglaive. Wielding their king’s magic, they fight to protect Lucis. As the overwhelming military might of the empire bears down, King Regis is faced with an impossible ultimatum – to marry his son, Prince Noctis to Princess Lunafreya of Tenebrae, captive of Niflheim, and surrender his lands to Niflheim rule.  Although the king concedes, it becomes clear that the empire will stop at nothing to achieve their devious goals, with only the Kingsglaive standing between them and world domination.', '/zhPPQfkgdJS8t7LhbIQpwPZSN20.jpg', '2016-07-09', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":18,"name":"Drama"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('391274', 'இரு முகன்', 'tt5372466', 'A disgraced  RAW agent Akilan (Vikram) is recalled by the agency to track down a crazy scientist and a cross dresser Love (also Vikram), who has discovered a deadly new drug  ‘Speed inhaler’.', '/gk5hpFcEgBCctxGEXEnX9sFmn1s.jpg', '2016-09-08', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('392344', 'Baar Baar Dekho', 'tt5197544', 'Baar Baar Dekho is a love-story, which unfolds through flash-backs and flash-forwards. Recently actor Sidharth Malhotra has revealed that, the movie has a unique and has a very unusual storyline. The film is neither science fiction nor does it revolve around time travel. The styling is currently underway. Film has started in 2015 September for which Katrina and Sidharth had shot in London.', '/iOOvZRf9GjdIZErSbhzDhIJl3ET.jpg', '2016-09-09', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('39254', 'Real Steel', 'tt0433035', 'In the near-future, Charlie Kenton is a washed-up fighter who retired from the ring when robots took over the sport. After Charlies robot is trashed, he reluctantly teams up with his estranged son Max to rebuild and train an unlikely contender.', '/drtXi58nN6P3zcoLh6wUlsZAYqh.jpg', '2011-09-28', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"}]'),
('393', 'Kill Bill: Vol. 2', 'tt0378194', 'The Bride unwaveringly continues on her roaring rampage of revenge against the band of assassins who had tried to kill her and her unborn child. The woman visits each of her former associates one by one, checking off the victims on her Death List Five until theres nothing left to do … but kill Bill.', '/au9lFA5a2ZnBKCzPbZQf00r7J64.jpg', '2004-04-16', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('39514', 'RED', 'tt1245526', 'When his peaceful life is threatened by a high-tech assassin, former black-ops agent Frank Moses reassembles his old team in a last ditch effort to survive and uncover his assailants.', '/q2mwTRKrq1etP9S4SZVDIJq0wI2.jpg', '2010-10-13', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('401146', '四月は君の嘘', '', 'Arima Kousei won numerous piano competitions while under the strict watch of his mother. He was known as the human metronome during that time. Since the death of his mother, Kousei has been unable to hear the sound of his piano. He then meets Miyazono Kaori through childhood friend Sawabe Tsubaki. Kaori plays the violin and has a free sprit. Since meeting her, Kousei is able to face the piano again. Meanwhile, Kaori holds a secret.', '/hsYO9T4ibeRKYZUjYDRLsOq3NZA.jpg', '2016-09-10', '[{"id":10402,"name":"Music"},{"id":10749,"name":"Romance"}]'),
('401689', 'Mythica: The Godslayer', 'tt5327922', 'As the Lich Kings zombie legions ravage the world, a cursed young sorceress (Marek) embarks on a quest to obtain a weapon from the gods, with her friend Dagen, a self-serving half-elf rogue. But when she joins her sworn enemy in a desperate attempt to save the world, she must recover the good in herself before her friends are all dead, and defeat the Lich King before the gods are destroyed and the world forever enslaved.', '', '', '[{"id":14,"name":"Fantasy"}]'),
('402', 'Basic Instinct', 'tt0103772', 'A police detective is in charge of the investigation of a brutal murder, in which a beautiful and seductive woman could be involved.', '/p1DHOfLFZmM567ePKfFNMV4mY92.jpg', '1992-03-20', '[{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('402331', 'Hard Target 2', 'tt5241578', 'Forced into a deadly cat-and-mouse game, a disgraced mixed martial arts fighter is hunted through the jungles of Southeast Asia.', '/mYttluBV4372VrfBdheRTLFA4mx.jpg', '2016-09-06', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('408', 'Snow White and the Seven Dwarfs', 'tt0029583', 'A beautiful girl, Snow White, takes refuge in the forest in the house of seven dwarfs to hide from her stepmother, the wicked Queen. The Queen is jealous because she wants to be known as the fairest in the land, and Snow Whites beauty surpasses her own.', '/wbVGRBYPRRahIZNGXY9TfHDUSc2.jpg', '1937-12-20', '[{"id":14,"name":"Fantasy"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('40805', 'The Green Hornet', 'tt0990407', 'Britt Reid (Seth Rogen), the heir to the largest newspaper fortune in Los Angeles, is a spoiled playboy who has been, thus far, happy to lead an aimless life. After his father (Tom Wilkinson) dies, Britt meets Kato (Jay Chou), a resourceful company employee. Realizing that they have the talent and resources to make something of their lives, Britt and Kato join forces as costumed crime-fighters to bring down the citys most-powerful criminal, Chudnofsky (Christoph Waltz).', '/hZvTFnyqiTiQDO1FRsQvwhFNg3G.jpg', '2011-01-12', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":35,"name":"Comedy"}]'),
('40807', '50/50', 'tt1306980', 'Inspired by a true story, a comedy centered on a 27-year-old guy who learns of his cancer diagnosis, and his subsequent struggle to beat the disease.', '/uDKmnFHqE3rQ9r6ErQsOZWuzXN8.jpg', '2011-09-30', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('410200', 'Hello Destroyer', 'tt2489736', 'Jared Abrahamson (Fear the Walking Dead) plays a painfully shy but ruggedly capable enforcer on a minor-league hockey team who discovers the cutthroat nature of his locker-room “family,” in the forceful first feature from Canadian director Kevan Funk.', '/zoXquTtiWs4LqhoobgFPh5FRjgQ.jpg', '2016-09-10', '[]'),
('4108', 'The Transporter', 'tt0293662', 'Former Special Forces officer Frank Martin will deliver anything to anyone for the right price, and his no-questions-asked policy puts him in high demand. But when he realizes his latest cargo is alive, it sets in motion a dangerous chain of events. The bound and gagged Lai is being smuggled to France by a shady American businessman, and Frank works to save her as his own illegal activities are uncovered by a French detective.', '/vD5plFV1ec9CSIsdlPe9icCDRTL.jpg', '2002-10-02', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('411', 'The Chronicles of Narnia: The Lion, the Witch and the Wardrobe', 'tt0363771', 'Join Lucy, Edmund, Susan, and Peter, four siblings who step through a magical wardrobe and find the land of Narnia. There, the they discover a charming, once peaceful kingdom that has been plunged into eternal winter by the evil White Witch, Jadis. Aided by the wise and magnificent lion Aslan, the children lead Narnia into a spectacular, climactic battle to be free of the Witchs glacial powers forever!', '/l8RKDgjl9co0IgFZblxhtIOi5Uj.jpg', '2005-12-07', '[{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('41154', 'Men in Black 3', 'tt1409024', 'Agents J (Will Smith) and K (Tommy Lee Jones) are back...in time. J has seen some inexplicable things in his 15 years with the Men in Black, but nothing, not even aliens, perplexes him as much as his wry, reticent partner. But when Ks life and the fate of the planet are put at stake, Agent J will have to travel back in time to put things right. J discovers that there are secrets to the universe that K never told him - secrets that will reveal themselves as he teams up with the young Agent K (Josh Brolin) to save his partner, the agency, and the future of humankind.', '/l9hrvXyGq19f6jPRZhSVRibTMwW.jpg', '2012-05-23', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"}]'),
('411859', 'Barbie: Star Light Adventure', 'tt5502946', 'Barbie is a cosmic princess who flies high on her hover-board through a far-off universe with her adorable and devoted pet sidekick, Pupcorn. One day, everything changes when the twinkling stars start to dim and slow their dance in the sky. Barbie travels to a beautiful new planet to join a special rescue team on a mission to save the stars. Once there, she teams up with a group of talented new friends who work together to save the galaxy through exciting hover-boarding adventures. Barbie soon discovers that if she listens to her heart, and with the help of her friends, she might be the leader the whole universe has been waiting for!', '/bWuXCDAh8MfPNJRk7j9CNgMYIRQ.jpg', '2016-08-18', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('41233', 'Step Up 3D', 'tt1193631', 'A tight-knit group of New York City street dancers, including Luke and Natalie, team up with NYU freshman Moose, and find themselves pitted against the worlds best hip hop dancers in a high-stakes showdown that will change their lives forever.', '/q8Pm7UpAqDdxo1Xnt29EHHAl2u2.jpg', '2010-08-04', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('412519', 'Honey 3', 'tt4677938', 'While attending college in Cape Town, Melea Martin feels constrained by the schools strict policies, and decides to set out on her own. Searching for a way to use her talents as a dancer and inspire the community around her, Melea rents a failing theater in order to put on a Hip-Hop Romeo and Juliet performance. But much like the Capulets and Montagues, conflicts between cast members threaten to bring the whole performance to a halt...', '/uWnBO4E1vkWy8nQ3KwZ4SVE19Qt.jpg', '2016-09-06', '[{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"},{"id":10751,"name":"Family"},{"id":10402,"name":"Music"}]'),
('41280', 'Private Lessons', 'tt0082948', 'Phillip Filmore is a naive, 15-year-old, preoccupied with sex, who develops a crush on Nicole Mallow, the new 30-something, French housekeeper and sitter to look after him when Phillips father is out of town for the summer on a business trip. But Mr. Filmores unscrupulous chauffeur, Lester Lewis, takes advantage of Phillips crush on Nicole to hire her to seduce the youth, then draws her into a plot to fake her own death in a blackmail scheme aimed to drain Phillips trust fund.', '/zMhUcqWv7eTHIw1PW7l6jdFyPm9.jpg', '1981-08-21', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"}]'),
('4133', 'Blow', 'tt0221027', 'A boy named George Jung grows up in a struggling family in the 1950s. His mother nags at her husband as he is trying to make a living for the family. It is finally revealed that Georges father cannot make a living and the family goes bankrupt. George does not want the same thing to happen to him, and his friend Tuna, in the 1960s, suggests that he deal marijuana. He is a big hit in California in the 1960s, yet he goes to jail, where he finds out about the wonders of cocaine. As a result, when released, he gets rich by bringing cocaine to America. However, he soon pays the price.', '/yCLLbZzAa7jreGus7pvjZmL0bj7.jpg', '2001-04-04', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('414223', 'The Swan Princess: Princess Tomorrow, Pirate Today!', 'tt5915572', 'With her parents away for the summer, fun-loving, young Princess Alise must spend her time with Queen Uberta, training to be the perfect, proper royal...But what she really wants is to become a swashbuckling pirate! Princess Alise sets sail with Lord Rogers, Jean-Bob the frog and Speed the turtle on a bold, high seas journey filled with amazing adventure, danger and discovery. After a shipwreck leaves the brave crew stranded on a wild, mysterious island, they meet Lucas, a young boy who has been living in seclusion. Now the faithful friends must work together to escape the island and the ferociously hungry creatures that dwell there.', '/73ASAO1OmpniM7Qz42WblUAEgIG.jpg', '2016-09-06', '[{"id":35,"name":"Comedy"},{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"}]'),
('414719', 'Interrogation', 'tt4497338', 'After the FBI receives a threat that endangers the entire city, an interrogator (Copeland) and an I.T. specialist (Perry) are plunged into a series of mind games with a criminal mastermind, desperately racing against time to uncover the villains true agenda as they fight to protect thousands of lives. Copeland and Perry deliver a knockout blow in this electrifying thriller that crackles with edge-of-your-seat suspense.', '/pk3TC7rbxLXql68YiwMQ9JeH1v8.jpg', '2016-08-20', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('414743', 'Martin Lawrence Doin’ Time: Uncut', '', 'Comedy legend Martin Lawrence returns to the stand-up stage for a night of impressions and insight on everything from sex, relationships and President Obama, to Bill Cosby, Hollywood and more. Filmed live at LAs Orpheum Theatre.', '/fLuSeSSawMXhuCC0JwGlOW2pre5.jpg', '2016-09-09', '[{"id":35,"name":"Comedy"}]'),
('414917', 'The Timeline: 9/11', '', 'The film looks at how the events of Sept. 11, 2001 impacted the NFL, its players and its fans. It is narrated by Mary McDonald-Lewis.', '', '2016-09-09', '[]'),
('415', 'Batman & Robin', 'tt0118688', 'Along with crime-fighting partner Robin and new recruit Batgirl, Batman battles the dual threat of frosty genius Mr. Freeze and homicidal horticulturalist Poison Ivy. Freeze plans to put Gotham City on ice, while Ivy tries to drive a wedge between the dynamic duo.', '/79AYCcxw3kSKbhGpx1LiqaCAbwo.jpg', '1997-06-20', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":878,"name":"Science Fiction"}]'),
('41513', 'The Smurfs', 'tt0472181', 'When the evil wizard Gargamel chases the tiny blue Smurfs out of their village, they tumble from their magical world and into ours -- in fact, smack dab in the middle of Central Park. Just three apples high and stuck in the Big Apple, the Smurfs must find a way to get back to their village before Gargamel tracks them down.', '/8W9L7ByduypXKD7AticK7GvGqTE.jpg', '2011-07-29', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":14,"name":"Fantasy"}]'),
('415305', 'Ground Zero Rising: Freedom vs. Fear', '', 'An hour-long look at the revitalization of the World Trade Center site', '', '2016-09-11', '[]'),
('415306', 'America’s 9/11 Flag: Rise From the Ashes', '', 'Details the disappearance of the flag raised in the WTC rubble by three firefighters', '', '2016-09-11', '[]'),
('415307', '9/11: Timeline of Terror', '', 'Draws from the network’s archives to re-create the timeline of events', '', '2016-09-11', '[]'),
('41630', 'No Strings Attached', 'tt1411238', 'Emma is a busy doctor who sets up a seemingly perfect arrangement when she offers her best friend Adam a relationship with one rule: No strings attached. But when a fling becomes a thing, can sex friends stay best friends?', '/1AxDwc2eugEvG4dRTear9q8Hzmw.jpg', '2011-01-12', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('41733', 'Due Date', 'tt1231583', 'Peter Highman must scramble across the US in five days to be present for the birth of his first child. He gets off to a bad start when his wallet and luggage are stolen, and put on the no-fly list. Peter embarks on a terrifying journey when he accepts a ride from actor Ethan Tremblay.', '/88m6HPueDnDnuCGwDa2BtA9sK8m.jpg', '2010-11-04', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('423', 'The Pianist', 'tt0253474', 'The Pianist is a film adapted from the biography of Wladyslaw Szpilman. A Jewish-Polish pianist who during the second world war lived and hid miraculously in Warsaw after having gone through a terrible tragedy. A film from Roman Polanski.', '/iunmxWkOi7Vk17Ob3G2HwwjgHsr.jpg', '2002-09-24', '[{"id":18,"name":"Drama"},{"id":10752,"name":"War"}]'),
('424', 'Schindlers List', 'tt0108052', 'Told from the perspective of businessman Oskar Schindler who saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory. Schindler’s List is based on a true story, illustrated in black and white and controversially filmed in many original locations.', '/yPisjyLweCl1tbgwgtzBCNCBle.jpg', '1993-11-29', '[{"id":18,"name":"Drama"},{"id":36,"name":"History"},{"id":10752,"name":"War"}]'),
('4247', 'Scary Movie', 'tt0175142', 'Following on the heels of popular teen-scream horror movies, with uproarious comedy and biting satire. Marlon and Shawn Wayans, Shannon Elizabeth and Carmen Electra pitch in to skewer some of Hollywoods biggest blockbusters, including Scream, I Know What You Did Last Summer, The Matrix, American Pie and The Blair Witch Project.', '/bvVmVFBVQLytK1H4TJTFdnhvf4T.jpg', '2000-07-07', '[{"id":35,"name":"Comedy"}]'),
('4248', 'Scary Movie 2', 'tt0257106', 'While the original parodied slasher flicks like Scream, Keenen Ivory Wayanss sequel to Scary Movie takes comedic aim at haunted house movies. A group of students visit a mansion called Hell House, and murderous high jinks ensue.', '/tSGWhSResV2Cnqqr91TGKyZzf79.jpg', '2001-07-04', '[{"id":35,"name":"Comedy"}]'),
('425', 'Ice Age', 'tt0268380', 'With the impending ice age almost upon them, a mismatched trio of prehistoric critters -- Manny the woolly mammoth, Diego the saber-toothed tiger and Sid the giant sloth -- find an orphaned infant and decide to return it to its human parents. Along the way, the unlikely allies become friends. But when enemies attack, their quest takes on far nobler aims..', '/zpaQwR0YViPd83bx1e559QyZ35i.jpg', '2002-03-10', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"}]'),
('429', 'Il buono, il brutto, il cattivo', 'tt0060196', 'While the Civil War rages between the Union and the Confederacy, three men – a quiet loner, a ruthless hit man and a Mexican bandit – comb the American Southwest in search of a strongbox containing $200,000 in stolen gold.', '/wfPHdfofBD5PN96dV96a51B3Ja2.jpg', '1966-12-23', '[{"id":37,"name":"Western"}]'),
('43074', 'Ghostbusters', 'tt1289401', 'Following a ghost invasion of Manhattan, paranormal enthusiasts Erin Gilbert and Abby Yates, nuclear engineer Jillian Holtzmann, and subway worker Patty Tolan band together to stop the otherworldly threat.', '/4qnJ1hsMADxzwnOmnwjZTNp0rKT.jpg', '2016-07-14', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":14,"name":"Fantasy"}]'),
('4347', 'Atonement', 'tt0783233', 'Fledgling writer Briony Tallis, as a 13-year-old, irrevocably changes the course of several lives when she accuses her older sisters lover of a crime he did not commit. Based on the British romance novel by Ian McEwan.', '/quaWuwYZd8IbZMCOhW3CZEvyCWJ.jpg', '2007-08-29', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('435', 'The Day After Tomorrow', 'tt0319262', 'After years of unabated global warming, the greenhouse effect is wreaking havoc all over the globe in the form of catastrophic hurricanes, tornadoes, tidal waves, floods and, most ominously, the beginning of the next Ice Age. Paleoclimatologist Jack Hall tries to save the world while also shepherding to safety his son Sam, who was in New York when the city was overwhelmed by the beginnings of the new big freeze.', '/pRmpaFjtegy8PnUvSBDyT9dm7c.jpg', '2004-05-26', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('44115', '127 Hours', 'tt1542344', '127 Hours is the true story of mountain climber Aron Ralstons remarkable adventure to save himself after a fallen boulder crashes on his arm and traps him in an isolated canyon in Utah. Over the next five days Ralston examines his life and survives the elements to finally discover he has the courage and the wherewithal to extricate himself by any means necessary, scale a 65 foot wall and hike over eight miles before he is finally rescued. Throughout his journey, Ralston recalls friends, lovers, family, and the two hikers he met before his accident. Will they be the last two people he ever had the chance to meet?', '/c6Nu7UjhGCQtV16WXabqOQfikK6.jpg', '2010-11-05', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('44214', 'Black Swan', 'tt0947798', 'A ballet dancer wins the lead in Swan Lake and is perfect for the role of the delicate White Swan - Princess Odette - but slowly loses her mind as she becomes more and more like Odile, the Black Swan.', '/dQ7uxvsVTspVIsqjfgQj8usJpwX.jpg', '2010-12-02', '[{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('4523', 'Enchanted', 'tt0461770', 'The beautiful princess Giselle is banished by an evil queen from her magical, musical animated land and finds herself in the gritty reality of the streets of modern-day Manhattan. Shocked by this strange new environment that doesnt operate on a happily ever after basis, Giselle is now adrift in a chaotic world badly in need of enchantment. But when Giselle begins to fall in love with a charmingly flawed divorce lawyer who has come to her aid - even though she is already promised to a perfect fairy tale prince back home - she has to wonder: Can a storybook view of romance survive in the real world?', '/65EfHNQ6NCeAoRPNLRhTyLqNZmU.jpg', '2007-11-20', '[{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":10749,"name":"Romance"}]'),
('45243', 'The Hangover Part II', 'tt1411697', 'The Hangover crew heads to Thailand for Stus wedding. After the disaster of a bachelor party in Las Vegas last year, Stu is playing it safe with a mellow pre-wedding brunch. However, nothing goes as planned and Bangkok is the perfect setting for another adventure with the rowdy group.', '/hFUsdnUoQDQ02EVlKTyhDTdehEr.jpg', '2011-05-25', '[{"id":35,"name":"Comedy"}]'),
('45269', 'The Kings Speech', 'tt1504320', 'The Kings Speech tells the story of the man who became King George VI, the father of Queen Elizabeth II. After his brother abdicates, George (Bertie) reluctantly assumes the throne. Plagued by a dreaded stutter and considered unfit to be king, Bertie engages the help of an unorthodox speech therapist named Lionel Logue. Through a set of unexpected techniques, and as a result of an unlikely friendship, Bertie is able to find his voice and boldly lead the country into war.', '/nkFTbA1XjKWo9LCTaV1hV2Lsgr1.jpg', '2010-09-06', '[{"id":18,"name":"Drama"},{"id":36,"name":"History"}]'),
('453', 'A Beautiful Mind', 'tt0268978', 'At Princeton University, John Nash struggles to make a worthwhile contribution to serve as his legacy to the world of mathematics. He finally makes a revolutionary breakthrough that will eventually earn him the Nobel Prize. After graduate school he turns to teaching, becoming romantically involved with his student Alicia. Meanwhile the government asks his help with breaking Soviet codes, which soon gets him involved in a terrifying conspiracy plot. Nash grows more and more paranoid until a discovery that turns his entire world upside down. Now it is only with Alicias help that he will be able to recover his mental strength and regain his status as the great mathematician we know him as today..', '/4SFqHDZ1NvWdysucWbgnYlobdxC.jpg', '2001-12-11', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('4547', 'Panic Room', 'tt0258000', 'Trapped in their New York brownstones panic room, a hidden chamber built as a sanctuary in the event of break-ins, newly divorced Meg Altman and her young daughter Sarah play a deadly game of cat-and-mouse with three intruders - Burnham, Raoul and Junior - during a brutal home invasion. But the room itself is the focal point because what the intruders really want is inside it.', '/hjkugMBhYjV8ZXgvSnGXI3q7wt7.jpg', '2002-03-29', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('45612', 'Source Code', 'tt0945513', 'Decorated soldier Captain Colter Stevens wakes up in the body of an unknown man, discovering hes involved in a mission to find the bomber of a Chicago commuter train. He learns hes part of a top-secret experimental program that enables him to experience the final 8 minutes of another persons life. Colter re-lives the train incident over and over again, gathering more clues each time. But can he discover who is responsible for the attack before the next one happens?', '/cpl7R5d3qwWvykRRSxdhQ0htstU.jpg', '2011-03-30', '[{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"}]'),
('46195', 'Rio', 'tt1436562', 'Captured by smugglers when he was just a hatchling, a macaw named Blu never learned to fly and lives a happily domesticated life in Minnesota with his human friend, Linda. Blu is thought to be the last of his kind, but when word comes that Jewel, a lone female, lives in Rio de Janeiro, Blu and Linda go to meet her. Animal smugglers kidnap Blu and Jewel, but the pair soon escape and begin a perilous adventure back to freedom -- and Linda.', '/isQ9BSjdF8IrSm2g4WPHSJYN5s9.jpg', '2011-04-03', '[{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('4638', 'Hot Fuzz', 'tt0425112', 'Top London cop PC Nicholas Angel is good. Too good. And to stop the rest of his team from looking bad, he is reassigned to the quiet town of Sandford. Paired with simple country cop Danny, everything seems quiet until two actors are found decapitated. It is addressed as an accident, but Angel isnt going to accept that, especially when more and more people turn up dead.', '/5Jx6s6VXnunh8wCLgR0YgjwSgjh.jpg', '2007-02-14', '[{"id":80,"name":"Crime"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('46529', 'I Am Number Four', 'tt1464540', 'A teenage fugitive with an incredible secret races to stay one step ahead of the mysterious forces seeking destroy him in this sci-fi action thriller. With three dead and one on the run, the race to find the elusive Number Four begins. Outwardly normal teen John Smith never gets too comfortable in the same identity, and along with his guardian, Henri, he is constantly moving from town to town. With each passing day, John gains a stronger grasp on his extraordinary new powers, and his bond to the beings that share his fantastic fate grows stronger.', '/36E6t6YgzT4mwgqNt5XbcV4MRNU.jpg', '2011-02-15', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"}]'),
('46705', 'Blue Valentine', 'tt1120985', 'Dean and Cindy live a quiet life in a modest neighborhood. They appear to have the world at their feet at the outset of the relationship. However, his lack of ambition and her retreat into self-absorption cause potentially irreversible cracks in their marriage.', '/r8l15gDSQMupjKXEyXkOMkRpcsn.jpg', '2010-12-27', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('47933', 'Independence Day: Resurgence', 'tt1628841', 'We always knew they were coming back. Using recovered alien technology, the nations of Earth have collaborated on an immense defense program to protect the planet. But nothing can prepare us for the aliens’ advanced and unprecedented force. Only the ingenuity of a few brave men and women can bring our world back from the brink of extinction.', '/9KQX22BeFzuNM66pBA6JbiaJ7Mi.jpg', '2016-06-22', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('47964', 'A Good Day to Die Hard', 'tt1606378', 'Iconoclastic, take-no-prisoners cop John McClane, finds himself for the first time on foreign soil after traveling to Moscow to help his wayward son Jack - unaware that Jack is really a highly-trained CIA operative out to stop a nuclear weapons heist. With the Russian underworld in pursuit, and battling a countdown to war, the two McClanes discover that their opposing methods make them unstoppable heroes.', '/c2SQMd00CCGTiDxGXVqA2J9lmzF.jpg', '2013-02-06', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('489', 'Good Will Hunting', 'tt0119217', 'Will Hunting, a janitor at MIT, has a gift for mathematics but needs help from a psychologist to find direction in his life.', '/jq8LjngZ7XZEQge5JFTdOGMrHyZ.jpg', '1997-12-05', '[{"id":18,"name":"Drama"}]'),
('48988', 'Hall Pass', 'tt0480687', 'When best buds Rick and Fred begin to show signs of restlessness at home, their wives take a bold approach to revitalize their marriages: they grant the guys a hall pass, one week of freedom to do whatever they want. At first, it seems like a dream come true, but they quickly discover that their expectations of the single life - and themselves - are completely and hilariously out of sync with reality.', '/hRvf9rhmwIzvfZwQx4IT6xsUhPe.jpg', '2011-02-25', '[{"id":35,"name":"Comedy"}]'),
('49013', 'Cars 2', 'tt1216475', 'Star race car Lightning McQueen and his pal Mater head overseas to compete in the World Grand Prix race. But the road to the championship becomes rocky as Mater gets caught up in an intriguing adventure of his own: international espionage.', '/AblhtULOVtrkSnFxRPQ8gBemxw9.jpg', '2011-06-11', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"}]'),
('49017', 'Dracula Untold', 'tt0829150', 'Vlad Tepes is a great hero, but when he learns the Sultan is preparing for battle and needs to form an army of 1,000 boys, including Vlads son, he vows to find a way to protect his family. Vlad turns to dark forces in order to get the power to destroy his enemies and agrees to go from hero to monster as hes turned into the mythological vampire Dracula.', '/4oy4e0DP6LRwRszfx8NY8EYBj8V.jpg', '2014-10-01', '[{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":14,"name":"Fantasy"},{"id":10752,"name":"War"}]'),
('49018', 'Insidious', 'tt1591095', 'A family discovers that dark spirits have invaded their home after their son inexplicably falls into an endless sleep. When they reach out to a professional for help, they learn things are a lot more personal than they thought.', '/urAaOffVaxQzRJ8X5Z0oDqOWAjl.jpg', '2010-09-13', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('49021', 'Killer Elite', 'tt1448755', 'Based on a shocking true story, Killer Elite pits two of the world’s most elite operatives—Danny, an ex-special ops agent and Hunter, his longtime mentor—against the cunning leader of a secret military society. Covering the globe from Australia to Paris, London and the Middle East, Danny and Hunter are plunged into a highly dangerous game of cat and mouse—where the predators become the prey.', '/sAb42vKVQCV90poNyBAHa26ZPKF.jpg', '2011-09-23', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('49026', 'The Dark Knight Rises', 'tt1345836', 'Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dents crimes to protect the late attorneys reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gothams finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.', '/dEYnvnUfXrqvqeRSqvIEtmzhoA8.jpg', '2012-07-16', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('49040', 'The Bourne Legacy', 'tt1194173', 'The fourth installment of the highly successful Bourne series sidelines main character Jason Bourne in order to focus on a fellow estranged assassin Aaron Cross. The story centers on new CIA operative, Aaron Cross as he experiences life-or-death stakes that have been triggered by the previous actions of Jason Bourne.', '/AnKnLsybNhnibvA3mba1ct9Nnb6.jpg', '2012-08-08', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('49047', 'Gravity', 'tt1454468', 'Dr. Ryan Stone (Sandra Bullock), a brilliant medical engineer on her first Shuttle mission, with veteran astronaut Matt Kowalsky (George Clooney) in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The Shuttle is destroyed, leaving Stone and Kowalsky completely alone-tethered to nothing but each other and spiraling out into the blackness of space. The deafening silence tells them they have lost any link to Earth and any chance for rescue. As fear turns to panic, every gulp of air eats away at what little oxygen is left. But the only way home may be to go further out into the terrifying expance of space…', '/uPxtxhB2Fy9ihVqtBtNGHmknJqV.jpg', '2013-09-27', '[{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"}]'),
('49051', 'The Hobbit: An Unexpected Journey', 'tt0903624', 'Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.', '/w29Guo6FX6fxzH86f8iAbEhQEFC.jpg', '2012-11-26', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('49444', 'Kung Fu Panda 2', 'tt1302011', 'Po is now living his dream as The Dragon Warrior, protecting the Valley of Peace alongside his friends and fellow kung fu masters, The Furious Five - Tigress, Crane, Mantis, Viper and Monkey. But Po’s new life of awesomeness is threatened by the emergence of a formidable villain, who plans to use a secret, unstoppable weapon to conquer China and destroy kung fu. It is up to Po and The Furious Five to journey across China to face this threat and vanquish it. But how can Po stop a weapon that can stop kung fu? He must look to his past and uncover the secrets of his mysterious origins; only then will he be able to unlock the strength he needs to succeed.', '/9wCrh57WO3mPmn1hWnJRcvdFtIb.jpg', '2011-05-25', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('4951', '10 Things I Hate About You', 'tt0147800', 'Bianca, a tenth grader, has never gone on a date, but she isnt allowed to go out with boys until her older sister Kat gets a boyfriend. The problem is, Kat rubs nearly everyone the wrong way. But Bianca and the guy she has her eye on, Joey, are eager, so Joey fixes Kat up with Patrick, a new kid in town just bitter enough for Kat.', '/paS5plbzKz3PYddxky6svYYz3hS.jpg', '1999-03-30', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('49519', 'The Croods', 'tt0481499', 'The Croods is a prehistoric comedy adventure that follows the worlds first family as they embark on a journey of a lifetime when the cave that has always shielded them from danger is destroyed. Traveling across a spectacular landscape, the Croods discover an incredible new world filled with fantastic creatures -- and their outlook is changed forever.', '/eHi3Nbgh6Cs2KiIyEMF4Ig4CdjX.jpg', '2013-03-20', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('49520', 'The Change-Up', 'tt1488555', 'Dave is a married man with two kids and a loving wife , and Mitch is a single man who is at the prime of his sexual life. One fateful night while Mitch and Dave are peeing in a fountain when lightning strikes and they switch bodies.', '/a3CnrqymnchFAeBoKr6g6KZEuv5.jpg', '2011-08-05', '[{"id":35,"name":"Comedy"}]'),
('49521', 'Man of Steel', 'tt0770828', 'A young boy learns that he has extraordinary powers and is not of this earth. As a young man, he journeys to discover where he came from and what he was sent here to do. But the hero in him must emerge if he is to save the world from annihilation and become the symbol of hope for all mankind.', '/xWlaTLnD8NJMTT9PGOD9z5re1SL.jpg', '2013-06-12', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('49526', 'Premium Rush', 'tt1547234', 'In Manhattan, a bike messenger picks up an envelope that attracts the interest of a dirty cop, who pursues the cyclist throughout the city.', '/yo4lOPF5SVNbUZVeBuAb6bvfkV2.jpg', '2012-08-24', '[{"id":80,"name":"Crime"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('49529', 'John Carter', 'tt0401729', 'Civil War vet John Carter is transplanted to Mars, where he discovers a lush, wildly diverse planet whose main inhabitants are 12-foot tall green barbarians. Finding himself a prisoner of these creatures, he escapes, only to encounter Dejah Thoris, Princess of Helium, who is in desperate need of a savior.', '/4QDBNt9PmxqUH4Ab2R5xKWqzXiQ.jpg', '2012-03-07', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('49530', 'In Time', 'tt1637688', 'In the not-too-distant future the aging gene has been switched off. To avoid overpopulation, time has become the currency and the way people pay for luxuries and necessities. The rich can live forever, while the rest try to negotiate for their immortality. A poor young man who comes into a fortune of time, though too late to help his mother from dying. He ends up on the run from a corrupt police force known as time keepers.', '/lnYuAr3QOPzvuEFlzpsRUq41IEy.jpg', '2011-10-27', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('497', 'The Green Mile', 'tt0120689', 'A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal peoples ailments. When the cellblocks head guard, Paul Edgecomb, recognizes Coffeys miraculous gift, he tries desperately to help stave off the condemned mans execution.', '/3yJUlOtVa09CYJocwBU8eAryja0.jpg', '1999-12-10', '[{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('500', 'Reservoir Dogs', 'tt0105236', 'A botched robbery indicates a police informant, and the pressure mounts in the aftermath at a warehouse. Crime begets violence as the survivors -- veteran Mr. White, newcomer Mr. Orange, psychopathic parolee Mr. Blonde, bickering weasel Mr. Pink and Nice Guy Eddie -- unravel.', '/4ctv9pxKpwjTFevWQbvaqXkXbPF.jpg', '1992-06-25', '[{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('50124', 'Monella', 'tt0174931', 'The story takes place in northern Italy in the 1950s. Lola and Masetto are about to get married. Masetto wants to keep Lola as a virgin until they are married. But Lola is impatient to remain in chastity until the wedding night. She wants to be sure that Masetto is a good lover, before she commits herself into marriage. She does everything to trick Masetto into breaking the moral tradition.', '/5PZTVerLPdHgLWM531Egr4vVPDc.jpg', '1998-01-21', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('5038', 'Vicky Cristina Barcelona', 'tt0497465', 'Two girlfriends on a summer holiday in Spain become enamored with the same painter, unaware that his ex-wife, with whom he has a tempestuous relationship, is about to re-enter the picture.', '/z1EVwBwK3iZrq3HjGoCZ6oJFq8q.jpg', '2008-08-15', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('50544', 'Friends with Benefits', 'tt1632708', 'While trying to avoid the clichés of Hollywood romantic comedies, Dylan and Jamie soon discover however that adding the act of sex to their friendship does lead to complications.', '/tmVuyRSS9RYFs73YGbMnFous7DH.jpg', '2011-07-21', '[{"id":35,"name":"Comedy"}]'),
('50546', 'Just Go With It', 'tt1564367', 'In Just Go With It, a plastic surgeon, romancing a much younger schoolteacher, enlists his loyal assistant to pretend to be his soon to be ex-wife, in order to cover up a careless lie. When more lies backfire, the assistants kids become involved, and everyone heads off for a weekend in Hawaii that will change all their lives.', '/4sJDqzBaqBprkEy0aLjIGl7TrHx.jpg', '2011-02-10', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('50619', 'The Twilight Saga: Breaking Dawn - Part 1', 'tt1324999', 'The new found married bliss of Bella Swan and vampire Edward Cullen is cut short when a series of betrayals and misfortunes threatens to destroy their world. Bella soon discovers she is pregnant, and during a nearly fatal childbirth, Edward finally fulfills her wish to become immortal. But the arrival of their remarkable daughter, Renesmee, sets in motion a perilous chain of events that pits the Cullens and their allies against the Volturi, the fearsome council of vampire leaders, setting the stage for an all-out battle.', '/q23U9glt0RJIvM0f7g5BqJbqncx.jpg', '2011-03-15', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10749,"name":"Romance"}]'),
('50620', 'The Twilight Saga: Breaking Dawn - Part 2', 'tt1673434', 'After the birth of Renesmee, the Cullens gather other vampire clans in order to protect the child from a false allegation that puts the family in front of the Volturi.', '/kJQPygYB8aNEevZZHRifyYrAdU9.jpg', '2012-11-13', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('510', 'One Flew Over the Cuckoos Nest', 'tt0073486', 'While serving time for insanity at a state mental hospital, implacable rabble-rouser Randle Patrick McMurphy inspires his fellow patients to rebel against the authoritarian rule of head nurse Mildred Ratched.', '/2Sns5oMb356JNdBHgBETjIpRYy9.jpg', '1975-11-18', '[{"id":18,"name":"Drama"}]'),
('51540', 'Horrible Bosses', 'tt1499658', 'For Nick (Jason Bateman), Kurt (Jason Sudeikis) and Dale (Charlie Day), the only thing that would make the daily grind more tolerable would be to grind their intolerable bosses (Kevin Spacey, Colin Farrell, Jennifer Aniston) into dust. Quitting is not an option, so, with the benefit of a few-too-many drinks and some dubious advice from a hustling ex-con (Jamie Foxx), the three friends devise a convoluted and seemingly foolproof plan to rid themselves of their respective employers... permanently.', '/17rVRW7ond0PR2KJHY0xY00isTB.jpg', '2011-07-08', '[{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('5157', 'Beneath the Valley of the Ultra-Vixens', 'tt0078846', 'Believe it or not even in Smalltown USA there are still people who are unfulfilled and unrelieved in the midst of plenty. Levonna &amp; Lamar could have the perfect relationship if it were not Lamars obsession with rear entry. After submitting to the one last time Levonna comes up with a plan. While Lamar is trying find other tail to try his technique on, Levonna becomes Lola with aid of a wig and a Mexican accent. A Mexican cocktail later Lola finally has Lamar straight, but he wasnt awake for it. The gay marriage counselor, attracted to Lamars problem, couldnt help them and Lemar must finally seek redemption at the church of Rio Dio Radio and the laying on of hands by Sister Eufaula Roo.', '/k78xEjJ0T1BZ66CQdBor5uaF7CM.jpg', '1979-05-11', '[{"id":35,"name":"Comedy"}]'),
('51620', 'Death Race 2', 'tt1500491', 'In the worlds most dangerous prison, a new game is born: Death Race. The rules of this adrenaline-fueled blood sport are simple, drive or die. When repentant convict Carl Lucas discovers theres a price on his head, his only hope is to survive a twisted race against an army of hardened criminals and tricked-out cars.', '/5ARRXaWPgtIT9qKl8Db3MNuGvo3.jpg', '2010-11-12', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('51876', 'Limitless', 'tt1219289', 'A paranoia-fueled action thriller about an unsuccessful writer whose life is transformed by a top-secret smart drug that allows him to use 100% of his brain and become a perfect version of himself. His enhanced abilities soon attract shadowy forces that threaten his new life in this darkly comic and provocative film.', '/bQfOFEeXxi51ijQrbQY9qvMtYhZ.jpg', '2011-03-08', '[{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"},{"id":878,"name":"Science Fiction"}]'),
('524', 'Casino', 'tt0112641', 'Master director Martin Scorsese depicts the sloping depth of a casino mafia boss’ fall. Filmed in a semi-documentary fashion; about the life of the gambling paradise Las Vegas and its dark mafia underbelly.', '/xo517ibXBDdYQY81j0WIG7BVcWq.jpg', '1995-11-22', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('52449', 'Bad Teacher', 'tt1284575', 'A lazy, incompetent middle school teacher who hates her job and her students is forced to return to her job to make enough money for a boob job after her rich fiancé dumps her.', '/ejTcAKe5F3zsvU9GXyl2ODAhkWl.jpg', '2011-05-16', '[{"id":35,"name":"Comedy"}]'),
('52520', 'Underworld: Awakening', 'tt1496025', 'After being held in a coma-like state for fifteen years, vampire Selene learns that she has a fourteen-year-old vampire/Lycan hybrid daughter named Nissa, and when she finds her, they must stop BioCom from creating super Lycans that will kill them all.', '/76GXWKs2IDi0ZERKLT57wkToV0A.jpg', '2012-01-19', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":27,"name":"Horror"}]'),
('53182', '300: Rise of an Empire', 'tt1253863', 'Based on Frank Millers latest graphic novel Xerxes and told in the breathtaking visual style of the blockbuster 300, this new chapter of the epic saga takes the action to a fresh battlefield--on the sea--as Greek general Themistokles attempts to unite all of Greece by leading the charge that will change the course of the war. 300: Rise of an Empire pits Themistokles against the massive invading Persian forces led by mortal-turned-god Xerxes and Artemesia, the vengeful commander of the Persian navy.', '/gWQf5j3ZqEfOdW2rIZnkuOOva78.jpg', '2014-03-05', '[{"id":28,"name":"Action"},{"id":10752,"name":"War"}]'),
('534', 'Terminator Salvation', 'tt0438488', 'All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether hes friend or foe.', '/hxDfhavtxA2Ayx7O9BsQMcZRdG0.jpg', '2009-05-20', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('539', 'Psycho', 'tt0054215', 'When larcenous real estate clerk Marion Crane goes on the lam with a wad of cash and hopes of starting a new life, she ends up at the notorious Bates Motel, where manager Norman Bates cares for his housebound mother. The place seems quirky, but fine… until Marion decides to take a shower.', '/4ZP1DHlqlp83DH2lqCdqpU2g51c.jpg', '1960-08-14', '[{"id":18,"name":"Drama"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('54138', 'Star Trek Into Darkness', 'tt1408101', 'When the crew of the Enterprise is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis.  With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one man weapon of mass destruction. As our heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.', '/41mhrXASAW3sdn7LBWF49uCX0xi.jpg', '2013-05-05', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('544', 'Theres Something About Mary', 'tt0129387', 'Having never fully recovered from a prom date that became a total disaster, a man finally gets a chance to reunite with his old prom date, only to run up against other suitors including the sleazy detective he hired to find her.', '/hFtnobv2d8WrjhMPCoX4i0oMJio.jpg', '1998-07-15', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"}]'),
('550', 'Fight Club', 'tt0137523', 'A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground fight clubs forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.', '/811DjJTon9gD6hZ8nCjSitaIXFQ.jpg', '1999-10-14', '[{"id":18,"name":"Drama"}]'),
('553', 'Dogville', 'tt0276919', 'A barren soundstage is stylishly utilized to create a minimalist small-town setting in which a mysterious woman named Grace hides from the criminals who pursue her. The town is two-faced and offers to harbor Grace as long as she can make it worth their effort, so Grace works hard under the employ of various townspeople to win their favor. Tensions flare, however, and Graces status as a helpless outsider provokes vicious contempt and abuse from the citizens of Dogville.', '/g1xLrof2RVgtHBB4fLvR5Xr8l5x.jpg', '2003-05-19', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('5548', 'RoboCop', 'tt0093870', 'In a dystopic, future crime-ridden Detroit controlled by a powerful corporation, a terminally wounded cop returns to the force as a company-owned cyborg with submerged memories haunting him.', '/gtGreTdzYBuQsEwTliEFdTzPleV.jpg', '1987-07-17', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('5549', 'RoboCop 2', 'tt0100502', 'A corrupt businesswoman seeks to disable RoboCop in favor of her own model of cyborg.', '/jHE1jOJQILXSPudL4h94NI3TRL.jpg', '1990-06-22', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":80,"name":"Crime"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('557', 'Spider-Man', 'tt0145487', 'After being bitten by a genetically altered spider, nerdy high school student Peter Parker is endowed with amazing powers.', '/A9BYH1DSetvC7bjbHWCaL17Qbp5.jpg', '2002-05-02', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('55721', 'Bridesmaids', 'tt1478338', 'Annie’s life is a mess. But when she finds out her lifetime best friend is engaged, she simply must serve as Lillian’s maid of honor. Though lovelorn and broke, Annie bluffs her way through the expensive and bizarre rituals. With one chance to get it perfect, she’ll show Lillian and her bridesmaids just how far you’ll go for someone you love.', '/x5ucaJZ4FP589Gn3I8l3ZFV3Nl8.jpg', '2011-04-28', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"}]'),
('559', 'Spider-Man 3', 'tt0413300', 'The seemingly invincible Spider-Man goes up against an all-new crop of villains -- including the shape-shifting Sandman -- in the third installment of this blockbusting comic book adventure series. While Spideys superpowers are altered by an alien organism, his alter ego, Peter Parker, deals with nemesis Eddie Brock and gets caught up in a love triangle.', '/62IWJ92nmLVSu5n5Xl4n8aT7gbd.jpg', '2007-05-01', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('562', 'Die Hard', 'tt0095016', 'NYPD cop John McClanes plan to reconcile with his estranged wife, Holly, is thrown for a serious loop when minutes after he arrives at her office, the entire building is overtaken by a group of pitiless terrorists. With little help from the LAPD, wisecracking McClane sets out to single-handedly rescue the hostages and bring the bad guys down.', '/r7CDkRjZIAP79skLaTTvRk8eUp3.jpg', '1988-07-15', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('56292', 'Mission: Impossible - Ghost Protocol', 'tt1229238', 'In the 4th installment of the Mission Impossible series, Ethan Hunt (Cruise) and his team are racing against time to track down a dangerous terrorist named Hendricks (Nyqvist), who has gained access to Russian nuclear launch codes and is planning a strike on the United States. An attempt to stop him ends in an explosion causing severe destruction to the Kremlin and the IMF to be implicated in the bombing, forcing the President to disavow them. No longer being aided by the government, Ethan and his team chase Hendricks around the globe, although they might still be too late to stop a disaster.', '/s58mMsgIVOFfoXPtwPWJ3hDYpXf.jpg', '2011-12-07', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"}]'),
('563', 'Starship Troopers', 'tt0120201', 'Set in the future, the story follows a young soldier named Johnny Rico and his exploits in the Mobile Infantry. Ricos military career progresses from recruit to non-commissioned officer and finally to officer against the backdrop of an interstellar war between mankind and an arachnoid species known as the Bugs.', '/zeCD9WkhABFJmPq3SlTozXJGEtr.jpg', '1997-11-06', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('564', 'The Mummy', 'tt0120616', 'Dashing legionnaire Rick OConnell and Beni, his weasel of a companion, stumble upon the hidden ruins of Hamunaptra while in the midst of a battle in 1923, 3,000 years after Imhotep has suffered a fate worse than death; his body will remain undead for all eternity as a punishment for a forbidden love.', '/cftmDzVCWKynKMfY9oyFj7igFqJ.jpg', '1999-05-06', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('565', 'The Ring', 'tt0298130', 'It sounded like just another urban legend: A videotape filled with nightmarish images, leading to a phone call foretelling the viewers death in exactly seven days. As a newspaper reporter, Rachel Keller was naturally skeptical of the story, until four teenagers all met with mysterious deaths exactly one week after watching just such a tape. Allowing her investigative curiosity to get the better of her, Rachel tracks down the video... and watches it. Now she has just seven days to unravel the mystery of the Ring.', '/zHJFdhqEXZJxG653oZvOM3PmNON.jpg', '2002-10-18', '[{"id":27,"name":"Horror"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('57158', 'The Hobbit: The Desolation of Smaug', 'tt1170358', 'The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.', '/gQCiuxGsfiXH1su6lp9n0nd0UeH.jpg', '2013-12-11', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('57214', 'Project X', 'tt1636826', 'Three high school seniors throw a party to make a name for themselves. As the night progresses, things spiral out of control as word of the party spreads.', '/cWXkRLmzKfYutvWeJXaednoGKdF.jpg', '2012-03-01', '[{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('578', 'Jaws', 'tt0073195', 'An insatiable great white shark terrorizes the townspeople of Amity Island, The police chief, an oceanographer and a grizzled shark hunter seek to destroy the bloodthirsty beast.', '/l1yltvzILaZcx2jYvc5sEMkM7Eh.jpg', '1975-06-18', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"}]'),
('57800', 'Ice Age: Continental Drift', 'tt1667889', 'Manny, Diego, and Sid embark upon another adventure after their continent is set adrift. Using an iceberg as a ship, they encounter sea creatures and battle pirates as they explore a new world.', '/u30xsZd3mijrdBKA6CeDsozx48g.jpg', '2012-06-26', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"}]'),
('58', 'Pirates of the Caribbean: Dead Mans Chest', 'tt0383574', 'The high-seas adventures of happy-go-lucky troublemaker Captain Jack Sparrow, young Will Turner and headstrong beauty Elizabeth Swann continues as Sparrow works his way out of a blood debt with the ghostly Davey Jones, he also attempts to avoid eternal damnation.', '/waFr5RVKaQ9dzOt3nQuIVB1FiPu.jpg', '2006-06-20', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('58423', 'Puss in Boots', 'tt0448694', 'Long before he even met Shrek, the notorious fighter, lover and outlaw Puss in Boots becomes a hero when he sets off on an adventure with the tough and street smart Kitty Softpaws and the mastermind Humpty Dumpty to save his town. This is the true story of The Cat, The Myth, The Legend... The Boots.', '/zy48sYz5TZWC4itoOHaQnUfWKtP.jpg', '2011-10-28', '[{"id":35,"name":"Comedy"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"}]'),
('58431', 'Pride and Prejudice and Zombies', 'tt1374989', 'A zombie outbreak has fallen upon the land in this reimagining of Jane Austen’s classic tale of the tangled relationships between lovers from different social classes in 19th century England. Feisty heroine Elizabeth Bennet (Lily James) is a master of martial arts and weaponry and the handsome Mr. Darcy (Sam Riley) is a fierce zombie killer, yet the epitome of upper class prejudice. As the zombie outbreak intensifies, they must swallow their pride and join forces on the blood-soaked battlefield in order to conquer the undead once and for all.', '/aYxSgQO3TRVtTXZnl46evR6NtvZ.jpg', '2016-02-04', '[{"id":10749,"name":"Romance"},{"id":27,"name":"Horror"},{"id":35,"name":"Comedy"},{"id":53,"name":"Thriller"}]'),
('585', 'Monsters, Inc.', 'tt0198781', 'James Sullivan and Mike Wazowski are monsters, they earn their living scaring children and are the best in the business... even though theyre more afraid of the children than they are of them. When a child accidentally enters their world, James and Mike suddenly find that kids are not to be afraid of and they uncover a conspiracy that could threaten all children across the world.', '/93Y9BGx8blzmZOPSoivkFfaifqU.jpg', '2001-11-01', '[{"id":14,"name":"Fantasy"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"}]'),
('58574', 'Sherlock Holmes: A Game of Shadows', 'tt1515091', 'There is a new criminal mastermind at large--Professor Moriarty--and not only is he Holmes’ intellectual equal, but his capacity for evil and lack of conscience may give him an advantage over the  detective.', '/7OFqsVuS6DlVM10GUD72vCGpQm9.jpg', '2011-11-22', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"}]'),
('58595', 'Snow White and the Huntsman', 'tt1735898', 'After the Evil Queen marries the King, she performs a violent coup in which the King is murdered and his daughter, Snow White, is taken captive. Almost a decade later, a grown Snow White is still in the clutches of the Queen. In order to obtain immortality, The Evil Queen needs the heart of Snow White. After Snow escapes the castle, the Queen sends the Huntsman to find her in the Dark Forest.', '/40iabcM7KQLJzmO8yGm8AvUbxZR.jpg', '2012-05-30', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"}]'),
('587', 'Big Fish', 'tt0319061', 'A frustrated son tries to determine the facts from the fiction in his dying fathers life.', '/6DRFdlNZpAaEt7eejsbAlJGgaM7.jpg', '2003-12-25', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"}]'),
('588', 'Silent Hill', 'tt0384537', 'The eerie and deserted ghost town of Silent Hill draws a young mother desperate to find a cure for her only childs illness. Unable to accept the doctors diagnosis that her daughter should be permanently institutionalized for psychiatric care, Rose flees with her child, heading for the abandoned town in search of answers – and ignoring the protests of her husband. Its soon clear this place is unlike anywhere shes ever been. Its smothered by fog, inhabited by a variety of strange beings and periodically overcome by a living darkness that literally transforms everything it touches. As Rose searches for her little girl, she begins to learn the history of the strange town and realizes that her daughter is just a pawn in a larger game.', '/4Zz9cF8S4E7DITosNYh3spybYJb.jpg', '2006-04-21', '[{"id":27,"name":"Horror"},{"id":9648,"name":"Mystery"}]'),
('59108', 'Tower Heist', 'tt0471042', 'A luxury condo manager leads a staff of workers to seek payback on the Wall Street swindler who defrauded them. With only days until the billionaire gets away with the perfect crime, the unlikely crew of amateur thieves enlists the help of petty crook Slide to steal the $20 million they’re sure is hidden in the penthouse.', '/ze2trl2NHuLOLimimvBkjJID3yG.jpg', '2011-11-02', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('5915', 'Into the Wild', 'tt0758758', 'Based on a true story. After graduating from Emory University in 1992, top student and athlete Christopher McCandless abandoned his possessions, gave his entire $24,000 savings account to charity and hitchhiked to Alaska to live in the wilderness. Along the way, Christopher encounters a series of characters who shape his life.', '/lHyYgaocXR6KcJLxVmxZDj115hH.jpg', '2007-09-11', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"}]'),
('594', 'The Terminal', 'tt0362227', 'Viktor Navorski is a man without a country; his plane took off just as a coup detat exploded in his homeland, leaving it in shambles, and now hes stranded at Kennedy Airport, where hes holding a passport that nobody recognizes. While quarantined in the transit lounge until authorities can figure out what to do with him, Viktor simply goes on living -- and courts romance with a beautiful flight attendant.', '/f4Dup6awDfDqAHKgWqNJ2HFw1qN.jpg', '2004-06-17', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('5966', 'Along Came Polly', 'tt0343135', 'Reuben Feffer (Ben Stiller) is a guy whos spent his entire life playing it safe. Polly Prince (Jennifer Aniston) is irresistible as a free-spirit who lives for the thrill of the moment. When these two comically mismatched souls collide, Reubens world is turned upside down, as he makes an uproarious attempt to change his life from middle-of-the-road to totally-out-there!', '/nIY4kvJTTnxoBR0wycrXng5MOYs.jpg', '2004-01-16', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('597', 'Titanic', 'tt0120338', '84 years later, a 101-year-old woman named Rose DeWitt Bukater tells the story to her granddaughter Lizzy Calvert, Brock Lovett, Lewis Bodine, Bobby Buell and Anatoly Mikailavich on the Keldysh about her life set in April 10th 1912, on a ship called Titanic when young Rose boards the departing ship with the upper-class passengers and her mother, Ruth DeWitt Bukater, and her fiancé, Caledon Hockley. Meanwhile, a drifter and artist named Jack Dawson and his best friend Fabrizio De Rossi win third-class tickets to the ship in a game. And she explains the whole story from departure until the death of Titanic on its first and last voyage April 15th, 1912 at 2:20 in the morning.', '/kHXEpyfl6zqn8a6YuozZUujufXf.jpg', '1997-11-18', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"},{"id":53,"name":"Thriller"}]'),
('59967', 'Looper', 'tt1276104', 'In the futuristic action thriller Looper, time travel will be invented but it will be illegal and only available on the black market. When the mob wants to get rid of someone, they will send their target 30 years into the past where a looper, a hired gun, like Joe is waiting to mop up. Joe is getting rich and life is good until the day the mob decides to close the loop, sending back Joes future self for assassination.', '/o4qXZMrZlfuTfwwNGMyTcx6p2uO.jpg', '2012-09-26', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('602', 'Independence Day', 'tt0116629', 'On July 2, a giant alien mothership enters orbit around Earth and deploys several dozen saucer-shaped destroyer spacecraft that quickly lay waste to major cities around the planet. On July 3, the United States conducts a coordinated counterattack that fails. On July 4 the a plan is devised to gain access to the interior of the alien mothership in space in order to plant a nuclear missile.', '/bqLlWZJdhrS0knfEJRkquW7L8z2.jpg', '1996-06-25', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('6023', 'P.S. I Love You', 'tt0431308', 'A young widow discovers that her late husband has left her 10 messages intended to help ease her pain and start a new life.', '/esfuYEvv7WrLvXNkCg7MCufEEdH.jpg', '2007-11-15', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('603', 'The Matrix', 'tt0133093', 'Thomas A. Anderson is a man living two lives. By day he is an average computer programmer and by night a malevolent hacker known as Neo, who finds himself targeted by the police when he is contacted by Morpheus, a legendary computer hacker, who reveals the shocking truth about our reality.', '/lZpWprJqbIFpEV5uoHfoK0KCnTW.jpg', '1999-03-30', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('60308', 'Moneyball', 'tt1210166', 'The story of Oakland Athletics general manager Billy Beanes successful attempt to put together a baseball team on a budget, by employing computer-generated analysis to draft his players.', '/3oAa8mJJ97CH9AeGEY6vjAxqcvZ.jpg', '2011-09-22', '[{"id":18,"name":"Drama"}]'),
('604', 'The Matrix Reloaded', 'tt0234215', 'Six months after the events depicted in The Matrix, Neo has proved to be a good omen for the free humans, as more and more humans are being freed from the matrix and brought to Zion, the one and only stronghold of the Resistance.  Neo himself has discovered his superpowers including super speed, ability to see the codes of the things inside the matrix and a certain degree of pre-cognition. But a nasty piece of news hits the human resistance: 250,000 machine sentinels are digging to Zion and would reach them in 72 hours. As Zion prepares for the ultimate war, Neo, Morpheus and Trinity are advised by the Oracle to find the Keymaker who would help them reach the Source.  Meanwhile Neos recurrent dreams depicting Trinitys death have got him worried and as if it was not enough, Agent Smith has somehow escaped deletion, has become more powerful than before and has fixed Neo as his next target.', '/ezIurBz2fdUc68d98Fp9dRf5ihv.jpg', '2003-05-15', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('605', 'The Matrix Revolutions', 'tt0242653', 'The human city of Zion defends itself against the massive invasion of the machines as Neo fights to end the war at another front while also opposing the rogue Agent Smith.', '/sKogjhfs5q3azmpW7DFKKAeLEG8.jpg', '2003-11-05', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('607', 'Men in Black', 'tt0119654', 'Men in Black follows the exploits of agents Kay and Jay, members of a top-secret organization established to monitor and police alien activity on Earth. The two Men in Black find themselves in the middle of the deadly plot by an intergalactic terrorist who has arrived on Earth to assassinate two ambassadors from opposing galaxies. In order to prevent worlds from colliding, the MiB must track down the terrorist and prevent the destruction of Earth. Its just another typical day for the Men in Black.', '/f24UVKq3UiQWLqGWdqjwkzgB8j8.jpg', '1997-07-01', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"}]'),
('608', 'Men in Black II', 'tt0120912', 'Kay and Jay reunite to provide our best, last and only line of defense against a sinister seductress who levels the toughest challenge yet to the MIBs untarnished mission statement: protecting the earth from the scum of the universe. Its been four years since the alien-seeking agents averted an intergalactic disaster of epic proportions. And now its a race against the clock as Jay must convince Kay-who not only has absolutely no memory of his time spent with the Men In Black, but is also the only living person left with the expertise to save the galaxy-to reunite with the MIB before the earth submits to ultimate destruction.', '/qWjRfBwr4VculczswwojXgoU0mq.jpg', '2002-07-03', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"}]'),
('609', 'Poltergeist', 'tt0084516', 'Craig T. Nelson stars as Steve Freeling, the main protagonist, who lives with his wife, Diane, and their three children, Dana, Robbie, and Carol Anne, in Southern California where he sells houses for the company that built the neighborhood. It starts with just a few odd occurrences, such as broken dishes and furniture moving around by itself. However, a tree comes alive and takes Robbie through his bedroom window, and Carol Anne is abducted by ghosts. Realizing that something evil haunts his home, Steve calls in a team of parapsychologists led by Dr. Lesh to investigate, hoping to get Carol Anne back, so he can remove his family from the house before its too late.', '/hKs6umpuLSgZhOiZI1pxpO0iVTQ.jpg', '1982-06-04', '[{"id":27,"name":"Horror"}]'),
('61791', 'Rise of the Planet of the Apes', 'tt1318514', 'Scientist Will Rodman is determined to find a cure for Alzheimers, the disease which has slowly consumed his father Charles. Will feels certain he is close to a breakthrough and tests his latest serum on apes, noticing dramatic increases in intelligence and brain activity in the primate subjects... Especially Caesar, his pet chimpanzee.', '/esqXMJv6PiK7GJVRwd2FA3SZUoW.jpg', '2011-08-03', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"}]'),
('62', '2001: A Space Odyssey', 'tt0062622', 'Humanity finds a mysterious object buried beneath the lunar surface and sets off to find its origins with the help of HAL 9000, the worlds most advanced super computer.', '/90T7b2LIrL07ndYQBmSm09yqVEH.jpg', '1968-04-05', '[{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"},{"id":12,"name":"Adventure"}]'),
('620', 'Ghostbusters', 'tt0087332', 'After losing their academic posts at a prestigious university, a team of parapsychologists goes into business as proton-pack-toting ghostbusters who exterminate ghouls, hobgoblins and supernatural pests of all stripes. An ad campaign pays off when a knockout cellist hires the squad to purge her swanky digs of demons that appear to be living in her refrigerator.', '/3FS3oBdorgczgfCkFi2u8ZTFfpS.jpg', '1984-06-07', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"},{"id":10751,"name":"Family"}]'),
('621', 'Grease', 'tt0077631', 'Australian good girl Sandy and greaser Danny fell in love over the summer. But when they unexpectedly discover theyre now in the same high school, will they be able to rekindle their romance despite their eccentric friends?', '/iMHdFTrCYhue74sBnXkdO39AJ3R.jpg', '1978-07-07', '[{"id":10402,"name":"Music"}]'),
('62177', 'Brave', 'tt1217209', 'Brave is set in the mystical Scottish Highlands, where Mérida is the princess of a kingdom ruled by King Fergus and Queen Elinor. An unruly daughter and an accomplished archer, Mérida one day defies a sacred custom of the land and inadvertently brings turmoil to the kingdom. In an attempt to set things right, Mérida seeks out an eccentric old Wise Woman and is granted an ill-fated wish. Also figuring into Mérida’s quest — and serving as comic relief — are the kingdom’s three lords: the enormous Lord MacGuffin, the surly Lord Macintosh, and the disagreeable Lord Dingwall.', '/qhABv2d4NZLhsOOA4iBFM4rfuJC.jpg', '2012-06-21', '[{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"}]'),
('62211', 'Monsters University', 'tt1453405', 'A look at the relationship between Mike and Sulley during their days at Monsters University — when they werent necessarily the best of friends.', '/a05xQU9huY3P5uurLcGGHmsf2Vh.jpg', '2013-06-20', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('627', 'Trainspotting', 'tt0117951', 'Renton is living the dream and that dream is Heroin. As Renton struggles with the agony and ecstasy of his life we follow him and his increasingly unstable mates. Drinking, fighting, drugs, sex and the most disgusting toilet in Scotland. Choose Trainspotting.', '/p1O3eFsdb0GEIYu87xlwV7P4jM1.jpg', '1996-02-23', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('629', 'The Usual Suspects', 'tt0114814', 'A sole survivor tells of the twisty events leading up to a horrific gun battle on a boat, which begin when five criminals meet at a seemingly random police lineup.', '/jgJoRWltoS17nD5MAQ1yK2Ztefw.jpg', '1995-07-19', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('63', 'Twelve Monkeys', 'tt0114746', 'In the year 2035, convict James Cole reluctantly volunteers to be sent back in time to discover the origin of a deadly virus that wiped out nearly all of the earths population and forced the survivors into underground communities. But when Cole is mistakenly sent to 1990 instead of 1996, hes arrested and locked up in a mental hospital. There he meets psychiatrist Dr. Kathryn Railly, and patient Jeffrey Goines, the son of a famous virus expert, who may hold the key to the mysterious rogue group, the Army of the 12 Monkeys, thought to be responsible for unleashing the killer disease.', '/6Sj9wDu3YugthXsU0Vry5XFAZGg.jpg', '1995-12-29', '[{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('634', 'Bridget Joness Diary', 'tt0243155', 'Bridget Jones’s Diary is a romantic love story comedy from the best selling novel of the same name by Helen Fielding. A chaotic Jones meets a snobbish lawer named Marc and soon he enters into her world of imperfections.', '/sF4siELLRWdvhR36u0q77WWGfDC.jpg', '2001-04-13', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('637', 'La vita è bella', 'tt0118799', 'A touching story of an Italian book seller of Jewish ancestry who lives in his own little fairy tale. His creative and happy life would come to an abrupt halt when his entire family is deported to a concentration camp during World War II. While locked up he tries to convince his son that the whole thing is just a game.', '/f7DImXDebOs148U4uPjI61iDvaK.jpg', '1997-12-20', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('640', 'Catch Me If You Can', 'tt0264464', 'Frank W. Abagnale Jr. is a cunning con man -- posing as a doctor, lawyer and pilot all before turning 21. Hes also a deft forger, and his work attracts the attention of FBI agent Carl Hanratty, who makes it his mission to put Frank behind bars. But Frank not only eludes capture, he revels in the pursuit, even taking time to taunt Carl by phone.', '/MywWCQGJNUr5kivAQ7eseCG7rm.jpg', '2002-12-25', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('646', 'Dr. No', 'tt0055928', 'In the film that launched the James Bond saga, Agent 007 (Sean Connery) battles mysterious Dr. No, a scientific genius bent on destroying the U.S. space program. As the countdown to disaster begins, Bond must go to Jamaica, where he encounters beautiful Honey Ryder (Ursula Andress), to confront a megalomaniacal villain in his massive island headquarters.', '/c3zP1U1P2OpD0504izo2KhyJfLU.jpg', '1962-10-04', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('64635', 'Total Recall', 'tt1386703', 'Welcome to Rekall, the company that can turn your dreams into real memories. For a factory worker named Douglas Quaid, even though hes got a beautiful wife who he loves, the mind-trip sounds like the perfect vacation from his frustrating life - real memories of life as a super-spy might be just what he needs. But when the procedure goes horribly wrong, Quaid becomes a hunted man. Finding himself on the run from the police - controlled by Chancellor Cohaagen, the leader of the free world - Quaid teams up with a rebel fighter to find the head of the underground resistance and stop Cohaagen. The line between fantasy and reality gets blurred and the fate of his world hangs in the balance as Quaid discovers his true identity, his true love, and his true fate.', '/tWBo7aZk3I1dLxmMj7ZJcN8uke5.jpg', '2012-08-02', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('64682', 'The Great Gatsby', 'tt1343092', 'An adaptation of F. Scott Fitzgeralds Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsbys nouveau riche existence, where obsession, madness, and tragedy await.', '/oJpOYPpVWyPeunGbbDGH1KFvea0.jpg', '2013-05-10', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('64688', '21 Jump Street', 'tt1232829', 'In high school, Schmidt was a dork and Jenko was the popular jock. After graduation, both of them joined the police force and ended up as partners riding bicycles in the city park. Since they are young and look like high school students, they are assigned to an undercover unit to infiltrate a drug ring that is supplying high school students synthetic drugs.', '/mH6xazzfGdszadd1Xy9JgdZYvn1.jpg', '2012-03-12', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"}]'),
('64690', 'Drive', 'tt0780504', 'A mysterious Hollywood stuntman who moonlights as a getaway driver seems to be trying to escape his shady past as he falls for his neighbor - whose husband is in prison and whos looking after her child alone. Meanwhile, his garage mechanic boss is trying to set up a race team using gangland money, which implicates our driver as he is to be used as the race teams main driver. Our hero gets more than he bargained for when he meets the man who is married to the woman he loves.', '/nu7XIa67cXc2t7frXCE5voXUJcN.jpg', '2011-08-06', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('6479', 'I Am Legend', 'tt0480249', 'Robert Neville is a scientist who was unable to stop the spread of the terrible virus that was incurable and man-made. Immune, Neville is now the last human survivor in what is left of New York City and perhaps the world. For three years, Neville has faithfully sent out daily radio messages, desperate to find any other survivors who might be out there. But he is not alone.', '/pfvQ3kkSbFsIPC5exKPUf5nOf60.jpg', '2007-12-14', '[{"id":18,"name":"Drama"},{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('65496', 'Mes chères études', 'tt1570970', 'Laura is a 19-year-old university freshman who desperately wants to do well in school. She works a part-time job but cannot make ends meet. One evening in which she is short of funds, she answers a personal ad online by Joe, 57, who seeks a female student for tender moments. The pay is 100 euros per hour. Laura pledges to do this just once, and three days later, she goes to a hotel room with Joe. And then her spiral begins.', '/ozKPo7l668X8yatgg4wIummpmQG.jpg', '2010-01-18', '[{"id":18,"name":"Drama"}]'),
('657', 'From Russia With Love', 'tt0057076', 'Agent 007 is back in the second installment of the James Bond series, this time battling a secret crime organization known as SPECTRE. Russians Rosa Klebb and Kronsteen are out to snatch a decoding device known as the Lektor, using the ravishing Tatiana to lure Bond into helping them. Bond willingly travels to meet Tatiana in Istanbul, where he must rely on his wits to escape with his life in a series of deadly encounters with the enemy', '/fvIG285JwenrV1K6kVASi1TECJ0.jpg', '1963-10-11', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"}]'),
('65754', 'The Girl with the Dragon Tattoo', 'tt1568346', 'This English-language adaptation of the Swedish novel by Stieg Larsson follows a disgraced journalist, Mikael Blomkvist, as he investigates the disappearance of a weary patriarchs niece from 40 years ago. He is aided by the pierced, tattooed, punk computer hacker named Lisbeth Salander. As they work together in the investigation, Blomkvist and Salander uncover immense corruption beyond anything they have ever imagined.', '/voxRWFTtagLiqnJQs9tWQLB0MN.jpg', '2011-12-14', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"},{"id":18,"name":"Drama"}]'),
('658', 'Goldfinger', 'tt0058150', 'Special agent 007 (Sean Connery) comes face to face with one of the most notorious villains of all time, and now he must outwit and outgun the powerful tycoon to prevent him from cashing in on a devious scheme to raid Fort Knox -- and obliterate the worlds economy.', '/vBNbFU3OS6okJIQBOos1aZXpy2Z.jpg', '1964-09-17', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('660', 'Thunderball', 'tt0059800', 'A criminal organization has obtained two nuclear bombs and are asking for a 100 million pound ransom in the form of diamonds in seven days or they will use the weapons. The secret service sends James Bond to the Bahamas to once again save the world.', '/sASN1VnJxWosdzp4mH40P47Xhhz.jpg', '1965-12-16', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('6637', 'National Treasure: Book of Secrets', 'tt0465234', 'Benjamin Franklin Gates and Dr. Abigail Chase -- who found riches and romance at the end of their first hunt for national treasure -- reteam with their wisecracking partner in crime, Riley Poole, for another romp through U.S. history. Now, armed with a stack of long-lost pages from John Wilkes Booths diary, Ben must follow a clue left there to prove his ancestors innocence in the assassination of Abraham Lincoln.', '/sHr05tz70r7y8A6XrdCBsHPK7tF.jpg', '2007-12-13', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('667', 'You Only Live Twice', 'tt0062512', 'A mysterious space craft kidnaps a Russian and American space capsule and brings the world on the verge of another World War. James Bond investigates the case in Japan and meets with his archenemy Blofeld. The fifth film from the legendary James Bond series starring Sean Connery as the British super agent.', '/7dnsJZniZK1Hbc9mOFDYa5W0dHi.jpg', '1967-06-12', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"}]'),
('668', 'On Her Majestys Secret Service', 'tt0064757', 'James Bond tracks archnemesis Ernst Blofeld to a mountaintop retreat where hes training an army of beautiful but lethal women. Along the way, Bond falls for Italian contessa Tracy Draco -- and marries her in order to get closer to Blofeld. Meanwhile, he locates Blofeld in the Alps and embarks on a classic ski chase.', '/7mcqT56ES5U3wg26vQQuEnOaFSj.jpg', '1969-12-12', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('6687', 'Transsiberian', 'tt0800241', 'A Trans-Siberian train journey from China to Moscow becomes a thrilling chase of deception and murder when an American couple encounters a mysterious pair of fellow travelers.', '/izYDkKxj9sI8KNKK0PR54dpuiFu.jpg', '2008-01-18', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"}]'),
('671', 'Harry Potter and the Philosophers Stone', 'tt0241527', 'Harry Potter has lived under the stairs at his aunt and uncles house his whole life. But on his 11th birthday, he learns hes a powerful wizard -- with a place waiting for him at the Hogwarts School of Witchcraft and Wizardry. As he learns to harness his newfound powers with the help of the schools kindly headmaster, Harry uncovers the truth about his parents deaths -- and about the villain whos to blame.', '/lR4drT4VGfts32j9jYTZUc1a3Pa.jpg', '2001-11-16', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('672', 'Harry Potter and the Chamber of Secrets', 'tt0295297', 'Everyones favorite novice wizard, Harry Potter, continues his high-flying adventures at Hogwarts. This time around, Harry ignores warnings not to return to school - that is, if he values his life - to investigate a mysterious series of attacks with Ron and Hermione.', '/lryNn7sNkvQIg45KwgeKnMxSSRX.jpg', '2002-11-13', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('673', 'Harry Potter and the Prisoner of Azkaban', 'tt0304141', 'Harry, Ron and Hermione return to Hogwarts for a third adventure and magic filled year in this follow-up to the first two Potter blockbusters. Harry comes face to face with danger yet again, this time in the form of escaped convict Sirius Black. In a bid for help, Harry turns to sympathetic Professor Lupin -- but will it be enough?', '/qMn0YCWKxt7xg8nqRnRj2Ei9qgx.jpg', '2004-05-31', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('674', 'Harry Potter and the Goblet of Fire', 'tt0330373', 'Young wizard Harry Potter starts his fourth year at Hogwarts, competes in the treacherous Triwizard Tournament and faces the evil Lord Voldemort. Friends Ron and Hermione help Harry manage the pressure… but Voldemort lurks, awaiting his chance to destroy Harry and all that he stands for.', '/6sASqcdrEHXxUhA3nFpjrRecPD2.jpg', '2005-11-05', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('675', 'Harry Potter and the Order of the Phoenix', 'tt0373889', 'Returning for his fifth year of study at the venerable Hogwarts School of Witchcraft and Wizardry, the ever-maturing Harry Potter is stunned to find that his warnings about the return of Lord Voldemort have been ignored. Left with no choice, Harry takes matters into his own hands, training a small group of students -- dubbed Dumbledores Army -- to defend themselves against the dark arts.', '/lmYmoXVzVrTadfXHZ3v1ySqA1fn.jpg', '2007-06-28', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"},{"id":9648,"name":"Mystery"}]'),
('676', 'Pearl Harbor', 'tt0213149', 'The lifelong friendship between Rafe McCawley and Danny Walker is put to the ultimate test when the two ace fighter pilots become entangled in a love triangle with beautiful Naval nurse Evelyn Johnson. But the rivalry between the friends-turned-foes is immediately put on hold when they find themselves at the center of Japans devastating attack on Pearl Harbor on Dec. 7, 1941.', '/gzjMpcyV1RksWonaA87DZ8wQTH0.jpg', '2001-05-21', '[{"id":36,"name":"History"},{"id":10749,"name":"Romance"},{"id":10752,"name":"War"}]'),
('679', 'Aliens', 'tt0090605', 'When Ripleys lifepod is found by a salvage crew over 50 years later, she finds that terra-formers are on the very planet they found the alien species. When the company sends a family of colonists out to investigate her story... all contact is lost with the planet and colonists. They enlist Ripley and the colonial marines to return and search for answers.', '/nORMXEkYEbzkU5WkMWMgRDJwjSZ.jpg', '1986-07-18', '[{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('680', 'Pulp Fiction', 'tt0110912', 'A burger-loving hit man, his philosophical partner, a drug-addled gangsters moll and a washed-up boxer converge in this sprawling, comedic crime caper. Their adventures unfurl in three stories that ingeniously trip back and forth in time.', '/dM2w364MScsjFf8pfMbaWUcWrR.jpg', '1994-10-14', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('681', 'Diamonds Are Forever', 'tt0066995', 'Diamonds are stolen only to be sold again in the international market. James Bond infiltrates a smuggling mission to find out who’s guilty. The mission takes him to Las Vegas where Bond meets his archenemy Blofeld.', '/viPjZ3JCOahcfNCcVhiPExusJoZ.jpg', '1971-12-13', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('682', 'The Man with the Golden Gun', 'tt0071807', 'A golden bullet has 007 engraved on it as it smashes into the secret service headquarters. The bullet came from the professional killer Scaramanga who has yet to miss a target and James Bond begins a mission to try and stop him.', '/7VSVgxAvA7IdTf8T6Oon1eaReeJ.jpg', '1974-12-01', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('68718', 'Django Unchained', 'tt1853728', 'With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.', '/5WJnxuw41sddupf8cwOxYftuvJG.jpg', '2012-12-25', '[{"id":18,"name":"Drama"},{"id":37,"name":"Western"}]'),
('68721', 'Iron Man 3', 'tt1300854', 'The brash-but-brilliant industrialist Tony Stark faces an enemy whose reach knows no bounds. When Stark finds his personal world destroyed at his enemy’s hands, he embarks on a harrowing quest to find those responsible. This journey, at every turn, will test his mettle. With his back against the wall, Stark is left to survive by his own devices, relying on his ingenuity and instincts to protect those closest to him. As he fights his way back, Stark discovers the answer to the question that has secretly haunted him: does the man make the suit or does the suit make the man?', '/1Ilv6ryHUv6rt9zIsbSEJUmmbEi.jpg', '2013-04-18', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('68724', 'Elysium', 'tt1535108', 'In the year 2159, two classes of people exist: the very wealthy who live on a pristine man-made space station called Elysium, and the rest, who live on an overpopulated, ruined Earth. Secretary Rhodes (Jodie Foster), a hard line government ofﬁcial, will stop at nothing to enforce anti-immigration laws and preserve the luxurious lifestyle of the citizens of Elysium. That doesn’t stop the people of Earth from trying to get in, by any means they can. When unlucky Max (Matt Damon) is backed into a corner, he agrees to take on a daunting mission that, if successful, will not only save his life, but could bring equality to these polarized worlds.', '/tHkjoAxmhp3Eau1h0Ir7maKMwUz.jpg', '2013-08-07', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('68726', 'Pacific Rim', 'tt1663662', 'When legions of monstrous creatures, known as Kaiju, started rising from the sea, a war began that would take millions of lives and consume humanitys resources for years on end. To combat the giant Kaiju, a special type of weapon was devised: massive robots, called Jaegers, which are controlled simultaneously by two pilots whose minds are locked in a neural bridge. But even the Jaegers are proving nearly defenseless in the face of the relentless Kaiju. On the verge of defeat, the forces defending mankind have no choice but to turn to two unlikely heroes—a washed-up former pilot (Charlie Hunnam) and an untested trainee (Rinko Kikuchi)—who are teamed to drive a legendary but seemingly obsolete Jaeger from the past. Together, they stand as mankinds last hope against the mounting apocalypse.', '/sCJEwEShZvruTpQ2a4yiX3Q9EyZ.jpg', '2013-07-11', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"}]'),
('68728', 'Oz: The Great and Powerful', 'tt1623205', 'Oscar Diggs, a small-time circus illusionist and con-artist, is whisked from Kansas to the Land of Oz where the inhabitants assume hes the great wizard of prophecy, there to save Oz from the clutches of evil.', '/7qzLIcYR7ev7iXngY8NKHBZHwwT.jpg', '2013-03-07', '[{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"}]'),
('68734', 'Argo', 'tt1024648', 'As the Iranian revolution reaches a boiling point, a CIA exfiltration specialist concocts a risky plan to free six Americans who have found shelter at the home of the Canadian ambassador.', '/oai3xLBQHpIh18VJdRCcL7D0Yg0.jpg', '2012-10-11', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('68735', 'Warcraft', 'tt0803096', 'The peaceful realm of Azeroth stands on the brink of war as its civilization faces a fearsome race of invaders: orc warriors fleeing their dying home to colonize another. As a portal opens to connect the two worlds, one army faces destruction and the other faces extinction. From opposing sides, two heroes are set on a collision course that will decide the fate of their family, their people, and their home.', '/ckrTPz6FZ35L5ybjqvkLWzzSLO7.jpg', '2016-05-25', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('68737', 'Seventh Son', 'tt1121096', 'John Gregory, who is a seventh son of a seventh son and also the local spook, has protected the country from witches, boggarts, ghouls and all manner of things that go bump in the night. However John is not young anymore, and has been seeking an apprentice to carry on his trade. Most have failed to survive. The last hope is a young farmers son named Thomas Ward. Will he survive the training to become the spook that so many others couldnt?', '/A3SBRfCSgKNcW2IkbaaOgugLwRt.jpg', '2014-12-12', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('693', 'Meet the Fockers', 'tt0290002', 'In this sequel to the hit comedy Meet the Parents, hard-to-crack ex-CIA man Jack Byrnes and his wife, Dina, head for the warmer climes of Florida to meet son-in-law-to-be Greg Fockers mom and dad, Bernie and Roz. Unlike their happily matched offspring, the future in-laws find themselves in a situation of opposites that definitely do not attract.', '/xHAqB06iL5D6HyOS6QpgyKkRQHD.jpg', '2004-12-15', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('694', 'The Shining', 'tt0081505', 'Jack Torrance accepts a caretaker job at the Overlook Hotel, where he, along with his wife Wendy and their son Danny, must live isolated from the rest of the world for the winter. But they arent prepared for the madness that lurks within.', '/9fgh3Ns1iRzlQNYuJyK0ARQZU7w.jpg', '1980-05-22', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('6957', 'The 40 Year Old Virgin', 'tt0405422', 'Andy Stitzer has a pleasant life with a nice apartment and a job stamping invoices at an electronics store. But at age 40, theres one thing Andy hasnt done, and its really bothering his sex-obsessed male co-workers: Andy is still a virgin. Determined to help Andy get laid, the guys make it their mission to de-virginize him. But it all seems hopeless until Andy meets small business owner Trish, a single mom.', '/wAKUo12pRBGyFJQV27LFJoTvMU5.jpg', '2005-08-11', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('696', 'Manhattan', 'tt0079522', 'The life of a divorced television writer dating a teenage girl is further complicated when he falls in love with his best friends mistress.', '/2OmmKrcLfFQeTd5N7pZeAw6fJPA.jpg', '1979-04-25', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('6977', 'No Country for Old Men', 'tt0477348', 'Llewelyn Moss stumbles upon dead bodies, $2 million and a hoard of heroin in a Texas desert, but methodical killer Anton Chigurh comes looking for it, with local sheriff Ed Tom Bell hot on his trail. The roles of prey and predator blur as the violent pursuit of money and justice collide.', '/6o0UWX2naW7HK45PDNYmoMIk5qs.jpg', '2007-11-08', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('698', 'Moonraker', 'tt0079574', 'During the transportation of a Space Shuttle a Boeing 747 crashes in the Atlantic Ocean yet when they go to look for the destroyed shuttle it is not there. James Bond investigates the missing mission space shuttle and soon learns that the shuttles owner Hugo Drax wants to kill all of mankind.', '/bIiTYuG1NRtLZAY7lxOwNafn2BV.jpg', '1979-06-26', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('699', 'For Your Eyes Only', 'tt0082398', 'A British spy ship has sunk and on board was a hi-tech encryption device. James Bond is sent to find the device that holds British launching instructions before the enemy Soviets get to it first.', '/vpZZZ2eq8z4I6PSeGxR2UWNciGG.jpg', '1981-06-23', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('700', 'Octopussy', 'tt0086034', 'James Bond is sent to investigate after a fellow “00” agent is found dead with a priceless Farberge egg. James bond follows the mystery and uncovers a smuggling scandal and a Russian General who wants to provoke a new World War.', '/s1GeJcwTclopbed1Bo2hjunSika.jpg', '1983-06-05', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('70160', 'The Hunger Games', 'tt1392170', 'Every year in the ruins of what was once North America, the nation of Panem forces each of its twelve districts to send a teenage boy and girl to compete in the Hunger Games.  Part twisted entertainment, part government intimidation tactic, the Hunger Games are a nationally televised event in which “Tributes” must fight with one another until one survivor remains.  Pitted against highly-trained Tributes who have prepared for these Games their entire lives, Katniss is forced to rely upon her sharp instincts as well as the mentorship of drunken former victor Haymitch Abernathy.  If she’s ever to return home to District 12, Katniss must make impossible choices in the arena that weigh survival against humanity and life against love. The world will be watching.', '/iLJdwmzrHFjFwI5lvYAT1gcpRuA.jpg', '2012-03-12', '[{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('707', 'A View to a Kill', 'tt0090264', 'A newly developed microchip designed by Zorin Industries for the British Government that can survive the electromagnetic radiation caused by a nuclear explosion has landed in the hands of the KGB. James Bond must find out how and why. His suspicions soon lead him to big industry leader Max Zorin.', '/veDMW7eX6tat86EapsvGEICJ8Tq.jpg', '1985-05-24', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('70981', 'Prometheus', 'tt1446714', 'A team of explorers discover a clue to the origins of mankind on Earth, leading them on a journey to the darkest corners of the universe. There, they must fight a terrifying battle to save the future of the human race.', '/sRbTWQn9Djs0wW8k3nkUun5ZBnt.jpg', '2012-05-30', '[{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":9648,"name":"Mystery"}]'),
('710', 'GoldenEye', 'tt0113189', 'James Bond must unmask the mysterious head of the Janus Syndicate and prevent the leader from utilizing the GoldenEye weapons system to inflict devastating revenge on Britain.', '/5c0ovjT41KnYIHYuF4AWsTe3sKh.jpg', '1995-11-16', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('7131', 'Van Helsing', 'tt0338526', 'Famed monster slayer Gabriel Van Helsing (Hugh Jackman) is dispatched to Transylvania to assist the last of the Valerious bloodline in defeating Count Dracula. Anna Valerious (Kate Beckinsale) reveals that Dracula has formed an unholy alliance with Dr. Frankensteins monster and is hell-bent on exacting a centuries-old curse on her family.', '/s2OPT5CZsZBQYAIlO9Mv4AimHvV.jpg', '2004-05-05', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('714', 'Tomorrow Never Dies', 'tt0120347', 'A deranged media mogul is staging international incidents to pit the worlds superpowers against each other. Now 007 must take on this evil mastermind in an adrenaline-charged battle to end his reign of terror and prevent global pandemonium.', '/k3eI9q7ISgpDEu2CMwR2s6inJVp.jpg', '1997-12-11', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('71552', 'American Reunion', 'tt1605630', 'In the comedy American Reunion, all the American Pie characters we met a little more than a decade ago are returning to East Great Falls for their high-school reunion. In one long-overdue weekend, they will discover what has changed, who hasn’t and that time and distance can’t break the bonds of friendship. It was summer 1999 when four small-town Michigan boys began a quest to lose their virginity. In the years that have passed, Jim and Michelle married while Kevin and Vicky said goodbye. Oz and Heather grew apart, but Finch still longs for Stifler’s mom. Now these lifelong friends have come home as adults to reminisce about - and get inspired by - the hormonal teens who launched a comedy legend.', '/yfOZaUh08d1YtLCtgvfRRAssrR7.jpg', '2012-04-04', '[{"id":35,"name":"Comedy"}]'),
('7191', 'Cloverfield', 'tt1060277', 'Five young New Yorkers throw their friend a going-away party the night that a monster the size of a skyscraper descends upon the city. Told from the point of view of their video camera, the film is a document of their attempt to survive the most surreal, horrifying event of their lives.', '/as01o40tJ2FhtheqeXf7bVZ0EQO.jpg', '2008-01-15', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('72105', 'Ted', 'tt1637725', 'John Bennett, a man whose childhood wish of bringing his teddy bear to life came true, now must decide between keeping the relationship with the bear or his girlfriend, Lori.', '/yLdP2vDa1BqxLSbikGypGtAEOGe.jpg', '2012-06-29', '[{"id":35,"name":"Comedy"},{"id":14,"name":"Fantasy"}]'),
('72190', 'World War Z', 'tt0816711', 'Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.', '/Ha5t0J21eyiq6Az1EXzx0iwsGH.jpg', '2013-06-20', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":27,"name":"Horror"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('72545', 'Journey 2: The Mysterious Island', 'tt1397514', 'Sean Anderson partners with his moms boyfriend on a mission to find his grandfather, who is thought to be missing on a mythical island.', '/jMu45saMeqB2RGDqV3HoQ3XgZ2a.jpg', '2012-01-19', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"}]'),
('72784', 'The Loft', 'tt1850397', 'For five men, the opportunity to share a penthouse in the city -- in which to carry on extramarital affairs -- is a dream come true, until the dead body of an unknown woman turns up. Realizing that her killer must be one of their group, the men are gripped by paranoia as each one suspects another. Friendships are tested, loyalties are questioned, and marriages crumble while fear and suspicion run rampant.', '/9hE6vesQoSREyvJha9z0g5OryHH.jpg', '2014-10-14', '[{"id":53,"name":"Thriller"}]'),
('73', 'American History X', 'tt0120586', 'Derek Vineyard is paroled after serving 3 years in prison for killing two thugs who tried to break into/steal his truck. Through his brother, Danny Vineyards narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.', '/fXepRAYOx1qC3wju7XdDGx60775.jpg', '1998-10-30', '[{"id":18,"name":"Drama"}]'),
('7326', 'Juno', 'tt0467406', 'A young girl named Juno gets herself pregnant and tries to stand on her own. She soon learns a few lessons about being grown up.', '/eE64N6PYCSRW2mtQucfK2av5Wk2.jpg', '2007-12-05', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('7340', 'Carrie', 'tt0074285', 'Carrie may be ostracized, but the shy teen has the ability to move objects with her mind. So when the high school in crowd torments her with a sick joke at the prom, she lashes out with devastating -- and deadly -- power.', '/n9JxLthRHwTWwu5OjFHVplkVSUg.jpg', '1976-11-03', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('7345', 'There Will Be Blood', 'tt0469494', 'When Daniel Plainview - a ruthless oil prospector - learns of oil-rich land in California that can be bought cheaply, he moves his operation there and begins manipulating and exploiting the local landowners into selling him their property. Using his young adopted son H.W. to project the image of a caring family man, Plainview gains the cooperation of almost all the locals with lofty promises to build schools and cultivate the land to make their community flourish. Over time, Plainviews gradual accumulation of wealth and power causes his true self to surface, and he begins to slowly alienate himself from everyone in his life.', '/p1GnnweLwSe82eMp55VEDio2Rcr.jpg', '2007-12-28', '[{"id":18,"name":"Drama"}]'),
('7350', 'The Bucket List', 'tt0825232', 'Corporate billionaire Edward and working class mechanic Carter have nothing in common except for their terminal illnesses. While sharing a hospital room together, they decide to escape and do all the things they have ever wanted to do before they die according to their bucket list. In the process, both of them heal each other, become unlikely friends, and ultimately find the joy in life.', '/3ktww154vChp5Y1qOrJZFLvqYz8.jpg', '2007-12-25', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"}]'),
('744', 'Top Gun', 'tt0092099', 'For Lieutenant Pete Mitchell and his friend and Co-Pilot Nick Bradshaw being accepted into an elite training school for fighter pilots is a dream come true.  A tragedy, as well as personal demons, threaten Petes dreams of becoming an Ace pilot.', '/orGXnBKfT41LxZhitLkXhqUfJJW.jpg', '1986-05-16', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":10749,"name":"Romance"}]'),
('7446', 'Tropic Thunder', 'tt0942385', 'Vietnam veteran Four Leaf Taybacks memoir, Tropic Thunder, is being made into a film. Director Damien Cockburn can’t control the cast of prima donnas. Behind schedule and over budget, Cockburn is ordered by a studio executive to get filming back on track, or risk its cancellation. On Taybacks advice, Cockburn drops the actors into the middle of the jungle to film the remaining scenes. Unbeknownst to the actors and production, the group have been dropped in the middle of the Golden Triangle, the home of heroin-producing gangs.', '/zoWUdaaWKPDyr9b0il0YcggDWgJ.jpg', '2008-08-09', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('745', 'The Sixth Sense', 'tt0167404', 'A psychological thriller about an eight year old boy named Cole Sear who believes he can see into the world of the dead. A child psychologist named Malcolm Crowe comes to Cole to help him deal with his problem, learning that he really can see ghosts of dead people.', '/imps263dHNe3SuoaAJORZyNTdDT.jpg', '1999-08-02', '[{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"}]'),
('747', 'Shaun of the Dead', 'tt0365748', 'Shaun of the Dead is a humorous homage to Zombie movies from director Edgar Wright; an outrageous romantic comedy with zombies.', '/2evlcGnsfdFWLb7geNlIjIewc0Q.jpg', '2004-04-09', '[{"id":27,"name":"Horror"},{"id":35,"name":"Comedy"}]'),
('75174', 'The Grey', 'tt1601913', 'In Alaska, an oil drilling team struggle to survive after a plane crash strands them in the wild. Hunting the humans are a pack of wolves who see them as intruders.', '/bwN4x9RTLtDUDvaOWg4yvOBU38I.jpg', '2011-12-11', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('752', 'V for Vendetta', 'tt0434409', 'In a world in which Great Britain has become a fascist state, a masked vigilante known only as V conducts guerrilla warfare against the oppressive British government. When V rescues a young woman from the secret police, he finds in her an ally with whom he can continue his fight to free the people of Britain.', '/AoGpqw4S4ZGgwhlM3FgzFVwyIGl.jpg', '2005-12-11', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":14,"name":"Fantasy"}]'),
('754', 'Face/Off', 'tt0119094', 'An antiterrorism agent goes under the knife to acquire the likeness of a terrorist and gather details about a bombing plot. When the terrorist escapes custody, he undergoes surgery to look like the agent so he can get close to the agents family.', '/q1i8QHiHZ1cukG5iOxai8pydmoa.jpg', '1997-06-27', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('755', 'From Dusk Till Dawn', 'tt0116367', 'Seth Gecko and his younger brother Richard are on the run after a bloody bank robbery in Texas. They escape across the border into Mexico and will be home-free the next morning, when they pay off the local kingpin. They just have to survive from dusk till dawn at the rendezvous point, which turns out to be a Hell of a strip joint.', '/ce0d4kM5KxT4x1Oq8JkSuNYevri.jpg', '1996-01-19', '[{"id":27,"name":"Horror"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('7555', 'Rambo', 'tt0462499', 'When governments fail to act on behalf of captive missionaries, ex-Green Beret John James Rambo sets aside his peaceful existence along the Salween River in a war-torn region of Thailand to take action.  Although hes still haunted by violent memories of his time as a U.S. soldier during the Vietnam War, Rambo can hardly turn his back on the aid workers who so desperately need his help.', '/ec1m7YgBYb4os06OSNW3QBaNYqZ.jpg', '2008-01-24', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('75612', 'Oblivion', 'tt1483013', 'Jack Harper (Tom Cruise) is one of the last few drone repairmen stationed on Earth.  Part of a massive operation to extract vital resources after decades of war with a terrifying threat known as the Scavs, Jack’s mission is nearly complete.  His existence is brought crashing down when he rescues a beautiful  stranger from a downed spacecraft.  Her arrival triggers a chain of events that  forces him to question everything he knows and puts the fate of humanity in his hands.', '/hmOzkHlkGvi8x24fYpFSnXvjklv.jpg', '2013-04-10', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":9648,"name":"Mystery"}]'),
('75656', 'Now You See Me', 'tt1670345', 'An FBI agent and an Interpol detective track a team of illusionists who pull off bank heists during their performances and reward their audiences with the money.', '/A06e9YJ5ry3WXEIFIAD1mKBxcuZ.jpg', '2013-05-29', '[{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('75780', 'Jack Reacher', 'tt0790724', 'In an innocent heartland city, five are shot dead by an expert sniper. The police quickly identify and arrest the culprit, and build a slam-dunk case. But the accused man claims hes innocent and says Get Jack Reacher. Reacher himself sees the news report and turns up in the city. The defense is immensely relieved, but Reacher has come to bury the guy. Shocked at the accuseds request, Reacher sets out to confirm for himself the absolute certainty of the mans guilt, but comes up with more than he bargained for.', '/38bmEXmuJuInLs9dwfgOGCHmZ7l.jpg', '2012-12-20', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('76163', 'The Expendables 2', 'tt1764651', 'Mr. Church reunites the Expendables for what should be an easy paycheck, but when one of their men is murdered on the job, their quest for revenge puts them deep in enemy territory and up against an unexpected threat.', '/dJPnTe1qOcO7XqsJvESFph83m6m.jpg', '2012-08-08', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":53,"name":"Thriller"}]'),
('76203', '12 Years a Slave', 'tt2024544', 'In the pre-Civil War United States, Solomon Northup, a free black man from upstate New York, is abducted and sold into slavery. Facing cruelty as well as unexpected kindnesses Solomon struggles not only to stay alive, but to retain his dignity. In the twelfth year of his unforgettable odyssey, Solomon’s chance meeting with a Canadian abolitionist will forever alter his life.', '/kb3X943WMIJYVg4SOAyK0pmWL5D.jpg', '2013-10-18', '[{"id":18,"name":"Drama"},{"id":36,"name":"History"}]'),
('76338', 'Thor: The Dark World', 'tt1981115', 'Thor fights to restore order across the cosmos… but an ancient race led by the vengeful Malekith returns to plunge the universe back into darkness. Faced with an enemy that even Odin and Asgard cannot withstand, Thor must embark on his most perilous and personal journey yet, one that will reunite him with Jane Foster and force him to sacrifice everything to save us all.', '/bnX5PqAdQZRXSw3aX3DutDcdso5.jpg', '2013-10-29', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"}]'),
('76341', 'Mad Max: Fury Road', 'tt1392190', 'An apocalyptic story set in the furthest reaches of our planet, in a stark desert landscape where humanity is broken, and most everyone is crazed fighting for the necessities of life. Within this world exist two rebels on the run who just might be able to restore order. Theres Max, a man of action and a man of few words, who seeks peace of mind following the loss of his wife and child in the aftermath of the chaos. And Furiosa, a woman of action and a woman who believes her path to survival may be achieved if she can make it across the desert back to her childhood homeland.', '/kqjL17yufvn9OVLyXYpvtyrFfak.jpg', '2015-05-13', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('76492', 'Hotel Transylvania', 'tt0837562', 'Dracula, who operates a high-end resort away from the human world, goes into overprotective mode when a boy discovers the resort and falls for the counts teen-aged daughter.', '/9qugesYpAWHUpdrw2w8URSGkAPt.jpg', '2012-09-20', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('765', 'Evil Dead II', 'tt0092991', 'Ash Williams and his girlfriend Linda find a log cabin in the woods with a voice recording from an archeologist who had recorded himself reciting ancient chants from “The Book of the Dead.” As they play the recording an evil power is unleashed taking over Linda’s body.', '/n49mpgUsPgBfRg2qIEj31HX0chu.jpg', '1987-03-13', '[{"id":27,"name":"Horror"},{"id":35,"name":"Comedy"},{"id":14,"name":"Fantasy"}]'),
('76649', 'Pompeii', 'tt1921064', 'Set in 79 A.D., POMPEII tells the epic story of Milo, a slave turned invincible gladiator who finds himself in a race against time to save his true love Cassia, the beautiful daughter of a wealthy merchant who has been unwillingly betrothed to a corrupt Roman Senator. As Mount Vesuvius erupts in a torrent of blazing lava, Milo must fight his way out of the arena in order to save his beloved as the once magnificent Pompeii crumbles around him.', '/idiv0IxVhVSDW8cWxfprYyY5Yev.jpg', '2014-02-18', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":36,"name":"History"},{"id":10749,"name":"Romance"},{"id":18,"name":"Drama"}]'),
('767', 'Harry Potter and the Half-Blood Prince', 'tt0417741', 'As Harry Potter begins his sixth year at Hogwarts, he discovers an old book marked as the property of the Half-Blood Prince and begins to learn more about Lord Voldemorts dark past...', '/bFXys2nhALwDvpkF3dP3Vvdfn8b.jpg', '2009-07-07', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('76726', 'Chronicle', 'tt1706593', 'Three high school students make an incredible discovery, leading to their developing uncanny powers beyond their understanding. As they learn to control their abilities and use them to their advantage, their lives start to spin out of control, and their darker sides begin to take over.', '/6uaJhUNP1VXyRQS6cGyQD4RbZsj.jpg', '2012-02-01', '[{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('76757', 'Jupiter Ascending', 'tt1617661', 'In a universe where human genetic material is the most precious commodity, an impoverished young Earth woman becomes the key to strategic maneuvers and internal strife within a powerful dynasty…', '/aMEsvTUklw0uZ3gk3Q6lAj6302a.jpg', '2015-02-04', '[{"id":878,"name":"Science Fiction"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('769', 'Goodfellas', 'tt0099685', 'Henry Hill is a small time gangster, who takes part in a robbery with Jimmy Conway and Tommy De Vito, two other gangsters who have set their sights a bit higher. His two partners kill off everyone else involved in the robbery, and slowly start to climb up through the hierarchy of the Mob. Henry, however, is badly affected by his partners success, but will he stoop low enough to bring about the downfall of Jimmy and Tommy?', '/pwpGfTImTGifEGgLb3s6LRPd4I6.jpg', '1990-09-12', '[{"id":18,"name":"Drama"},{"id":80,"name":"Crime"}]'),
('77', 'Memento', 'tt0209144', 'Suffering short-term memory loss after a head injury, Leonard Shelby embarks on a grim quest to find the lowlife who murdered his wife in this gritty, complex thriller that packs more knots than a hangmans noose. To carry out his plan, Shelby snaps Polaroids of people and places, jotting down contextual notes on the backs of photos to aid in his search and jog his memory. He even tattoos his own body in a desperate bid to remember.', '/fQMSaP88cf1nz4qwuNEEFtazuDM.jpg', '2000-10-11', '[{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('77338', 'Intouchables', 'tt1675434', 'A true story of two men who should never have met - a quadriplegic aristocrat who was injured in a paragliding accident and a young man from the projects.', '/4mFsNQwbD0F237Tx7gAPotd0nbJ.jpg', '2011-11-02', '[{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('77949', 'The Awakening', 'tt1687901', 'The Awakening is a British horror thriller film directed by Nick Murphy, starring Rebecca Hall, Dominic West, and Imelda Staunton. 1921 England is overwhelmed by the loss and grief of World War I. Hoax exposer Florence Cathcart (Hall) visits a boarding school to explain sightings of a child ghost.', '/1iIB1eR9pFxoOdAp4FhPCYwQ1TA.jpg', '2011-08-17', '[{"id":18,"name":"Drama"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('78', 'Blade Runner', 'tt0083658', 'In the smog-choked dystopian Los Angeles of 2019, blade runner Rick Deckard is called out of retirement to kill a quartet of replicants who have escaped to Earth seeking their creator for a way to extend their short life spans.', '/5ig0kdWz5kxR4PHjyCgyI5khCzd.jpg', '1982-06-25', '[{"id":878,"name":"Science Fiction"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('787', 'Mr. & Mrs. Smith', 'tt0356910', 'After five (or six) years of vanilla-wedded bliss, ordinary suburbanites John and Jane Smith (Pitt and Jolie) are stuck in a rut the size of the Grand Canyon?until the truth comes out! Unbeknownst to each other, they are both coolly lethal, highly paid assassins working for rival organizations. And when they discover theyre each others next target, their secret lives collide in a spicy, explosive mix of wicked comedy, pent-up passion, nonstop action and high-tech weaponry that gives an all-new meaning to Till death do us part!', '/dqs5BmwSULtB28Kls3IB6khTQwp.jpg', '2005-06-07', '[{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('792', 'Platoon', 'tt0091763', 'Chris Taylor, a young, naive recruit in Vietnam, faces a moral crisis when confronted with the horrors of war and the duality of man.', '/sYPOQI57JVNmjiLI3KeZ5KA8O9i.jpg', '1986-12-18', '[{"id":18,"name":"Drama"},{"id":10752,"name":"War"},{"id":28,"name":"Action"}]'),
('80278', 'Lo imposible', 'tt1649419', 'In December 2004, close-knit family Maria (Naomi Watts), Henry (Ewan McGregor) and their three sons begin their winter vacation in Thailand. But the day after Christmas, the idyllic holiday turns into an incomprehensible nightmare when a terrifying roar rises from the depths of the sea, followed by a wall of black water that devours everything in its path. Though Maria and her family face their darkest hour, unexpected displays of kindness and courage ameliorate their terror.', '/sEx5mrVvVyyJHICMGe55KaUzEgt.jpg', '2012-09-09', '[{"id":18,"name":"Drama"}]'),
('80321', 'Madagascar 3: Europes Most Wanted', 'tt1277953', 'Alex, Marty, Gloria and Melman are still trying to get back to the Big Apple and their beloved Central Park zoo, but first they need to find the penguins. When they travel to Monte Carlo, they attract the attention of Animal Control after gate crashing a party and are joined by the penguins, King Julian and Co., and the monkeys. How do a lion, zebra, hippo, giraffe, four penguins, two monkeys, three lemurs travel through Europe without attracting attention and get back to New York? They join a traveling circus. Their attempts to get back to New York are consistently hampered by the Captain of Animal Control who wants to make Alex part of her collection. Once they make it back to New York Marty, Alex, Gloria and Melman realize that they want to be part of the traveling circus.', '/wd7NcMifnuf66gD2Fm7Tzz3yJ54.jpg', '2012-06-06', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('8054', 'The Imaginarium of Doctor Parnassus', 'tt1054606', 'A traveling theater company gives its audience much more than they were expecting.', '/luvHWGTKOaPdOpvEtKmTKdRjZzw.jpg', '2009-10-01', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":9648,"name":"Mystery"}]'),
('8055', 'The Reader', 'tt0976051', 'Tells the story of Michael Berg, a German lawyer who as a teenager in the late 1950s had an affair with an older woman, Hanna, who then disappeared only to resurface years later as one of the defendants in a war crimes trial stemming from her actions as a concentration camp guard late in the war. He alone realizes that Hanna is illiterate and may be concealing that at the expense of her freedom.', '/mEqgCzhGO3gi9DkevgM7N6a5mY3.jpg', '2008-12-10', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('807', 'Se7en', 'tt0114369', 'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the seven deadly sins in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killers mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.', '/zgB9CCTDlXRv50Z70ZI4elJtNEk.jpg', '1995-09-22', '[{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"},{"id":53,"name":"Thriller"}]'),
('8077', 'Alien³', 'tt0103644', 'After escaping with Newt and Hicks from the alien planet, Ripley crash lands on Fiorina 161, a prison planet and host to a correctional facility. Unfortunately, although Newt and Hicks do not survive the crash, a more unwelcome visitor does. The prison does not allow weapons of any kind, and with aid being a long time away, the prisoners must simply survive in any way they can.', '/vz1vBw17F0x42bhziHdYRJC9uCv.jpg', '1992-05-22', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":27,"name":"Horror"}]'),
('8078', 'Alien: Resurrection', 'tt0118583', 'Two hundred years after Lt. Ripley died, a group of scientists clone her, hoping to breed the ultimate weapon. But the new Ripley is full of surprises … as are the new aliens. Ripley must team with a band of smugglers to keep the creatures from reaching Earth.', '/39WJ2YoLoWyDHxpTIwWT7AOKtZT.jpg', '1997-11-12', '[{"id":878,"name":"Science Fiction"},{"id":27,"name":"Horror"},{"id":28,"name":"Action"}]'),
('808', 'Shrek', 'tt0126029', 'It aint easy bein green -- especially if youre a likable (albeit smelly) ogre named Shrek. On a mission to retrieve a gorgeous princess from the clutches of a fire-breathing dragon, Shrek teams up with an unlikely compatriot -- a wisecracking donkey.', '/140ewbWv8qHStD3mlBDvvGd0Zvu.jpg', '2001-05-16', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('809', 'Shrek 2', 'tt0298148', 'Shrek, Fiona and Donkey set off to Far, Far Away to meet Fionas mother and father. But not everyone is happy. Shrek and the King find it hard to get along, and theres tension in the marriage. The fairy godmother discovers that Shrek has married Fiona instead of her Son Prince Charming and sets about destroying their marriage.', '/akWDA0BMVYK4OTM92T5i91DYnsT.jpg', '2004-05-18', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('8090', 'Untraceable', 'tt0880578', 'Special Agent Jennifer Marsh (Diane Lane) works in an elite division of the FBI dedicated to fighting cybercrime. She thinks she has seen it all, until a particularly sadistic criminal arises on the Internet. This tech-savvy killer posts live feeds of his crimes on his website; the more hits the site gets, the faster the victim dies. Marsh and her team must find the elusive killer before time runs out.', '/XX32uGigY8wVMGESal2BtEf8kU.jpg', '2008-01-22', '[{"id":18,"name":"Drama"}]'),
('810', 'Shrek the Third', 'tt0413267', 'Shrek and Co, return for more adventures. The King of Far Far Away has died and Shrek and Fiona are to become King &amp; Queen. Shrek however wants to return to his cozy swamp and live in peace and quiet. So when he finds out their is another heir to the throne, they set of to bring him back to rule the kingdom. Meanwhile, Prince Charming enlists the fairy tale baddies to steal the throne away.', '/lA17Mlz8hXVZsW5Y3WuUa8KPilQ.jpg', '2007-05-17', '[{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('812', 'Aladdin', 'tt0103639', 'Princess Jasmine grows tired of being forced to remain in the palace and she sneaks out into the marketplace  in disguise where she meets street-urchin Aladdin and the two fall in love, although she may only marry a prince. After being thrown in jail, Aladdin and becomes embroiled in a plot to find a mysterious lamp with which the evil Jafar hopes to rule the land.', '/7f53XAE4nPiGe9XprpGAeWHuKPw.jpg', '1992-11-25', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10749,"name":"Romance"}]'),
('813', 'Airplane!', 'tt0080339', 'Still craving for the love of his life, ex-Air Force pilot Ted Striker follows Elaine onto the flight that she is working on as cabin crew. Elaine doesnt want to be with Ted anymore, but when the crew and passengers fall ill from food poisoning, Ted might be the only one who can save them.', '/b4sAWNIbfXw4WTdc1wiVRBk2Vko.jpg', '1980-07-02', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('81774', 'Les exploits dun jeune Don Juan', 'tt0092995', 'Roger is a 16-year-old who seeks to lose his virginity in this softcore erotic drama. His initial efforts are unsuccessful, but World War I breaks out and men are seen marching off to battle. Roger goes overboard when he is presented with several amorous opportunities.', '/4mXgEy0RYbzmHuk4LNumfdunmQ7.jpg', '1986-11-04', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('82023', 'Hotel Desire', 'tt2080323', 'The story is about a woman who lives alone. Her son went to his father in another place. The first character is a maid in a hotel to serve the people. First, she got some serious problems in her job. She couldnt take care of both, her job and her son. Her supervisor solved some her problems because he was a good man and may like her. She was not rich and proud, she listened her colleague advice about sex because she didnt have sex for about seven years. She went accidentally to a room who a blind man is living. He was naked after a shower and he talked on his phone. after that, he looked for his socks but he touched the maid body that listened his conversation and be completely quiet. then they started to do sex.', '/4i77Qjxl8ppqquq2yMTKANp7qFZ.jpg', '2011-12-07', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('82507', 'Sinister', 'tt1922777', 'Found footage helps a true-crime novelist realize how and why a family was murdered in his new home, though his discoveries put his entire family in the path of a supernatural entity.', '/hrRYY7FcRc46Ue7h9jcKiW1xqJ3.jpg', '2012-03-29', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"}]'),
('82525', 'Savages', 'tt1615065', 'Pot growers Ben and Chon face off against the Mexican drug cartel who kidnapped their shared girlfriend.', '/ecN4PGSU6zhYlAUL8Jh4qyE2um9.jpg', '2012-07-06', '[{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('82654', 'Warm Bodies', 'tt1588173', 'After a zombie becomes involved with the girlfriend of one of his victims, their romance sets in motion a sequence of events that might transform the entire lifeless world.', '/jqJEkZKTqoAlmaexoWZIkjHdtA7.jpg', '2013-01-31', '[{"id":27,"name":"Horror"},{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('82675', 'Taken 2', 'tt1397280', 'In Istanbul, retired CIA operative Bryan Mills and his wife are taken hostage by the father of a kidnapper Mills killed while rescuing his daughter.', '/rDX2zd9aVMJnBmlS8efwOYsi76R.jpg', '2012-09-27', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"}]'),
('82690', 'Wreck-It Ralph', 'tt1772341', 'Wreck-It Ralph is the 9-foot-tall, 643-pound villain of an arcade video game named Fix-It Felix Jr., in which the games titular hero fixes buildings that Ralph destroys. Wanting to prove he can be a good guy and not just a villain, Ralph escapes his game and lands in Heros Duty, a first-person shooter where he helps the games hero battle against alien invaders. He later enters Sugar Rush, a kart racing game set on tracks made of candies, cookies and other sweets. There, Ralph meets Vanellope von Schweetz who has learned that her game is faced with a dire threat that could affect the entire arcade, and one that Ralph may have inadvertently started.', '/93FsllrXXWncp7BQYTdOU1XMRXo.jpg', '2012-11-01', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"}]'),
('82693', 'Silver Linings Playbook', 'tt1045658', 'After spending eight months in a mental institution, a former teacher moves back in with his parents and tries to reconcile with his ex-wife.', '/ilrZAV2klTB0FLxLb01bOp5pzD9.jpg', '2012-09-08', '[{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('82700', 'After Earth', 'tt1815862', 'One thousand years after cataclysmic events forced humanitys escape from Earth, Nova Prime has become mankinds new home. Legendary General Cypher Raige returns from an extended tour of duty to his estranged family, ready to be a father to his 13-year-old son, Kitai. When an asteroid storm damages Cypher and Kitais craft, they crash-land on a now unfamiliar and dangerous Earth. As his father lies dying in the cockpit, Kitai must trek across the hostile terrain to recover their rescue beacon. His whole life, Kitai has wanted nothing more than to be a soldier like his father. Today, he gets his chance.', '/pUCK62aHDUJYcCXUvdMKkr3dJmx.jpg', '2013-05-30', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('82702', 'How to Train Your Dragon 2', 'tt1646971', 'The thrilling second chapter of the epic How To Train Your Dragon trilogy brings back the fantastical world of Hiccup and Toothless five years later. While Astrid, Snotlout and the rest of the gang are challenging each other to dragon races (the islands new favorite contact sport), the now inseparable pair journey through the skies, charting unmapped territories and exploring new worlds. When one of their adventures leads to the discovery of a secret ice cave that is home to hundreds of new wild dragons and the mysterious Dragon Rider, the two friends find themselves at the center of a battle to protect the peace.', '/lRjOR4uclMQijUav4OjeZprlehu.jpg', '2014-06-12', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('82703', 'Mr. Peabody & Sherman', 'tt0864835', 'A young boy and his dog, who happens to have a genius-level IQ, spring into action when their time-travel machine is stolen and moments in history begin to be changed.', '/wGRWVfhMdGIThSDld2965oUkJ5E.jpg', '2014-02-07', '[{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"}]'),
('834', 'Underworld: Evolution', 'tt0401855', 'As the war between the vampires and the Lycans rages on, Selene, a former member of the Death Dealers (an elite vampire special forces unit that hunts werewolves), and Michael, the werewolf hybrid, work together in an effort to unlock the secrets of their respective bloodlines.', '/fogihlu39MuYgL6pKObI4SQWPOY.jpg', '2006-01-12', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('83542', 'Cloud Atlas', 'tt1371111', 'A set of six nested stories spanning time between the 19th century and a distant post-apocalyptic future. Cloud Atlas explores how the actions and consequences of individual lives impact one another throughout the past, the present and the future. Action, mystery and romance weave through the story as one soul is shaped from a killer into a hero and a single act of kindness ripples across centuries to inspire a revolution in the distant future.  Based on the award winning novel by David Mitchell. Directed by Tom Tykwer and the Wachowskis.', '/8VNiyIp67ZxhpNgdrwACW0jgvP2.jpg', '2012-10-26', '[{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"}]'),
('8355', 'Ice Age: Dawn of the Dinosaurs', 'tt1080016', 'Times are changing for moody mammoth Manny, motor mouthed sloth Sid and crafty saber-toothed tiger Diego in this third installment of the beloved computer-animated childrens franchise. Life heats up for our heroes when they meet some new and none-too-friendly neighbors: the mighty dinosaurs.', '/crAf8b9gFpcdvY7majL8xWzTbem.jpg', '2009-06-29', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"}]'),
('8358', 'Cast Away', 'tt0162222', 'Chuck, a top international manager for FedEx, and Kelly, a Ph.D. student, are in love and heading towards marriage. Then Chucks plane to Malaysia ditches at sea during a terrible storm. Hes the only survivor, and he washes up on a tiny island with nothing but some flotsam and jetsam from the aircrafts cargo. Can he survive in this tropical wasteland? Will he ever return to woman he loves?', '/w515BrZvczKIxbHurG6HIiYYrba.jpg', '2000-12-22', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"}]'),
('8363', 'Superbad', 'tt0829482', 'High school best buddies are facing separation anxiety as they prepare to go off to college. While attempting to score alcohol for a party with help from their fake ID-toting friend, McLovin, the guys evening takes a turn into chaotic territory.', '/7RZWtDkf0mgrxvJNFj43YW2Ugi8.jpg', '2007-08-17', '[{"id":35,"name":"Comedy"}]'),
('8392', 'となりのトトロ', 'tt0096283', 'Two sisters move to the country with their father in order to be closer to their hospitalized mother, and discover the surrounding trees are inhabited by Totoros, magical spirits of the forest. When the youngest runs away from home, the older sister seeks help from the spirits to find her.', '/2i0OOjvi7CqNQA6ZtYJtL65P9oZ.jpg', '1988-04-16', '[{"id":14,"name":"Fantasy"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('8413', 'Event Horizon', 'tt0119081', 'In the year 2047 a group of astronauts are sent to investigate and salvage the long lost starship Event Horizon. The ship disappeared mysteriously 7 years before on its maiden voyage and with its return comes even more mystery as the crew of the Lewis and Clark discover the real truth behind its disappearance and something even more terrifying.', '/vo02iJLsem3VCJ2TNvSzRiJMpAE.jpg', '1997-08-15', '[{"id":27,"name":"Horror"},{"id":878,"name":"Science Fiction"},{"id":9648,"name":"Mystery"}]'),
('846', 'The X Files', 'tt0120902', 'Blackwood, Texas: After falling through a hole in the ground, a young boy is infected by the alien Black Oil. One week later, in Dallas, a federal building is bombed by terrorists, killing five people, including the Blackwood boy. Mulder and Scully, now part of an FBI anti-terrorism unit, learn that the boy as well as three other victims were dead even before the bombing, cause of death: an alien virus. In the Texas desert, the agents find an agricultural complex that may hold the key to unlocking the government conspiracy surrounding the extraterrestrials and their lethal virus which Mulder and Scully must fight the government in a conspiracy and find the truth about an alien colonization of Earth.', '/cpvwMPMkvsZLzThJTcnh8wcNPMH.jpg', '1998-06-19', '[{"id":9648,"name":"Mystery"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('85', 'Raiders of the Lost Ark', 'tt0082971', 'When Dr. Indiana Jones – the tweed-suited professor who just happens to be a celebrated archaeologist – is hired by the government to locate the legendary Ark of the Covenant, he finds himself up against the entire Nazi regime.', '/44sKJOGP3fTm4QXBcIuqu0RkdP7.jpg', '1981-06-12', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"}]'),
('853', 'Enemy at the Gates', 'tt0215750', 'Enemy at the Gates is a war film from Jean-Jacques Annaud from 2001 that takes place during the battle of Stalingard in World War II between the Russians and the Germans.', '/dOWSbEn3ucyoiBE9IgFWAo1O7Sg.jpg', '2001-03-13', '[{"id":10752,"name":"War"}]'),
('85350', 'Boyhood', 'tt1065073', 'The film tells a story of a divorced couple trying to raise their young son. The story follows the boy for twelve years, from first grade at age 6 through 12th grade at age 17-18, and examines his relationship with his parents as he grows.', '/eKi4e5zXhQKs0De4xu5AAMvu376.jpg', '2014-06-05', '[{"id":18,"name":"Drama"}]'),
('8536', 'Superman II', 'tt0081573', 'Three escaped criminals from the planet Krypton test the Man of Steels mettle. Led by Gen. Zod, the Kryptonians take control of the White House and partner with Lex Luthor to destroy Superman and rule the world. But Superman, who attempts to make himself human in order to get closer to Lois, realizes he has a responsibility to save the planet.', '/uvxjXSfph2FD07A2jBG9NHJnl27.jpg', '1980-12-04', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]');
INSERT INTO `movielist` (`ID`, `Name`, `IMDB_ID`, `Overview`, `Poster`, `ReleasedDate`, `Genres`) VALUES
('854', 'The Mask', 'tt0110475', 'When timid bank clerk Stanley Ipkiss (Jim Carrey) discovers a magical mask containing the spirit of the Norse god Loki, his entire life changes. While wearing the mask, Ipkiss becomes a supernatural playboy exuding charm and confidence which allows him to catch the eye of local nightclub singer Tina Carlyle (Cameron Diaz). Unfortunately, under the masks influence, Ipkiss also robs a bank, which angers junior crime lord Dorian Tyrell (Peter Greene), whose goons get blamed for the heist.', '/v8x8p441l1Bep8p82pAG6rduBoK.jpg', '1994-07-29', '[{"id":10749,"name":"Romance"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"},{"id":14,"name":"Fantasy"}]'),
('855', 'Black Hawk Down', 'tt0265086', 'When U.S. Rangers and an elite Delta Force team attempt to kidnap two underlings of a Somali warlord, their Black Hawk helicopters are shot down, and the Americans suffer heavy casualties, facing intense fighting from the militia on the ground.', '/yUzQ4r3q1Dy0bUAkMvUIwf0rPpR.jpg', '2001-12-28', '[{"id":28,"name":"Action"},{"id":36,"name":"History"},{"id":10752,"name":"War"}]'),
('857', 'Saving Private Ryan', 'tt0120815', 'As U.S. troops storm the beaches of Normandy, three brothers lie dead on the battlefield, with a fourth trapped behind enemy lines. Ranger captain John Miller and seven men are tasked with penetrating German-held territory and bringing the boy home.', '/gc7IN6bWNaWXv4vI6cxSmeB7PeO.jpg', '1998-07-24', '[{"id":18,"name":"Drama"},{"id":36,"name":"History"},{"id":10752,"name":"War"}]'),
('8587', 'The Lion King', 'tt0110357', 'A young lion cub named Simba cant wait to be king. But his uncle craves the title for himself and will stop at nothing to get it.', '/bKPtXn9n4M4s8vvZrbw40mYsefB.jpg', '1994-06-23', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":18,"name":"Drama"}]'),
('861', 'Total Recall', 'tt0100802', 'Construction worker Douglas Quaid discovers a memory chip in his brain during a virtual-reality trip. He also finds that his past has been invented to conceal a plot of planetary domination. Soon, hes off to Mars to find out who he is and who planted the chip.', '/ikYpJ0AjGBNnAYFnPJDUVIOcduR.jpg', '1990-06-01', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]'),
('8619', 'Master and Commander: The Far Side of the World', 'tt0311113', 'After an abrupt and violent encounter with a French warship inflicts severe damage upon his ship, a captain of the British Royal Navy begins a chase over two oceans to capture or destroy the enemy, though he must weigh his commitment to duty and ferocious pursuit of glory against the safety of his devoted crew, including the ships thoughtful surgeon, his best friend.', '/4o4JyEQldHQiqJn0BBRFppDmI65.jpg', '2003-11-14', '[{"id":12,"name":"Adventure"}]'),
('862', 'Toy Story', 'tt0114709', 'Woody the cowboy is young Andy’s favorite toy. Yet this changes when Andy get the new super toy Buzz Lightyear for his birthday. Now that Woody is no longer number one he plans his revenge on Buzz. Toy Story is a milestone in film history for being the first feature film to use entirely computer animation.', '/uMZqKhT4YA6mqo2yczoznv7IDmv.jpg', '1995-10-30', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('863', 'Toy Story 2', 'tt0120363', 'During a garage sale Andy’s mother sells some of Andy’s old things including his favorite toy Woody to a collector. Buzz Lightyear and the other toys begin a reckless mission to save their friend. The sequel to the revolutionary computer animated feature film Toy Story.', '/gd12nM0VnrgbaUmZDjte4oBedGZ.jpg', '1999-10-30', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('86331', 'Q', 'tt1879030', 'In a social context deteriorated by a countrywide economic crisis, the life of several people will be turned upside down after they meet Cecile, a character who symbolizes desire.', '/9Jg9s4yTEndNmy1SSXRF9jdxY9D.jpg', '2011-09-14', '[{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('86555', 'Take This Waltz', 'tt1592281', 'Twenty-eight-year-old Margot is happily married to Lou, a good-natured cookbook author. But when Margot meets Daniel, a handsome artist who lives across the street, their mutual attraction is undeniable.', '/dLHwIyDGcuKeMo4Msftl1fxxccm.jpg', '2012-05-25', '[{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('8681', 'Taken', 'tt0936501', 'While vacationing with a friend in Paris, an American girl is kidnapped by a gang of human traffickers intent on selling her into forced prostitution. Working against the clock, her ex-spy father must pull out all the stops to save her. But with his best years possibly behind him, the job may be more than he can handle.', '/3zlffXmo7QpVBc17QIJWrRfasVr.jpg', '2008-02-18', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('86834', 'Noah', 'tt1959490', 'A man who suffers visions of an apocalyptic deluge takes measures to protect his family from the coming flood.', '/5wioUjzwr91fvq7ydunxK2CPSxi.jpg', '2014-03-20', '[{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"}]'),
('87', 'Indiana Jones and the Temple of Doom', 'tt0087469', 'After arriving in India, Indiana Jones is asked by a desperate village to find a mystical stone. He agrees, and stumbles upon a secret cult plotting a terrible plan in the catacombs of an ancient palace.', '/f2nTRKk2zGdUTE7tLJ5EGGSuKA6.jpg', '1984-05-23', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"}]'),
('87101', 'Terminator Genisys', 'tt1340138', 'The year is 2029. John Connor, leader of the resistance continues the war against the machines. At the Los Angeles offensive, Johns fears of the unknown future begin to emerge when TECOM spies reveal a new plot by SkyNet that will attack him from both fronts; past and future, and will ultimately change warfare forever.', '/5JU9ytZJyR3zmClGmVm9q4Geqbd.jpg', '2015-06-23', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":12,"name":"Adventure"}]'),
('87421', 'Riddick', 'tt1411250', 'Betrayed by his own kind and left for dead on a desolate planet, Riddick fights for survival against alien predators and becomes more powerful and dangerous than ever before. Soon bounty hunters from throughout the galaxy descend on Riddick only to find themselves pawns in his greater scheme for revenge. With his enemies right where he wants them, Riddick unleashes a vicious attack of vengeance before returning to his home planet of Furya to save it from destruction.', '/AgApctRBSSQQ6SRCC1sxcgby8Gf.jpg', '2013-09-02', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('87502', 'Flight', 'tt1907668', 'Commercial airline pilot Whip Whitaker has a problem with drugs and alcohol, though so far hes managed to complete his flights safely. His luck runs out when a disastrous mechanical malfunction sends his plane hurtling toward the ground. Whip pulls off a miraculous crash-landing that results in only six lives lost. Shaken to the core, Whip vows to get sober -- but when the crash investigation exposes his addiction, he finds himself in an even worse situation.', '/8XEbkjgorAm9xk15mF63jqJ4ByV.jpg', '2012-11-02', '[{"id":18,"name":"Drama"}]'),
('87516', 'Oldboy', 'tt1321511', 'An everyday man has only three and a half days and limited resources to discover why he was imprisoned in a nondescript room for 20 years without any explanation.', '/cmspwpe1usgG5hYijfEcTrueKRC.jpg', '2013-11-14', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":9648,"name":"Mystery"},{"id":28,"name":"Action"}]'),
('87827', 'Life of Pi', 'tt0454876', 'The story of an Indian boy named Pi, a zookeepers son who finds himself in the company of a hyena, zebra, orangutan, and a Bengal tiger after a shipwreck sets them adrift in the Pacific Ocean.', '/sLYdcz7easaS7CmJGwQcVVYZqiF.jpg', '2012-11-20', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":28,"name":"Action"}]'),
('8844', 'Jumanji', 'tt0113497', 'When siblings Judy and Peter discover an enchanted board game that opens the door to a magical world, they unwittingly invite Alan -- an adult whos been trapped inside the game for 26 years -- into their living room. Alans only hope for freedom is to finish the game, which proves risky as all three find themselves running from giant rhinoceroses, evil monkeys and other terrifying creatures.', '/vzmL6fP7aPKNKPRTFnZmiUfciyV.jpg', '1995-12-15', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":10751,"name":"Family"}]'),
('89', 'Indiana Jones and the Last Crusade', 'tt0097576', 'When Dr. Henry Jones Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Indiana Jones must team up with Marcus Brody, Sallah, and Elsa Schneider to follow in his fathers footsteps and stop the Nazis from recovering the power of eternal life.', '/4p1N2Qrt8j0H8xMHMHvtRxv9weZ.jpg', '1989-05-24', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"}]'),
('8909', 'Wanted', 'tt0493464', 'Doormat Wesley Gibson discovers that his recently murdered father -- who Wesley never knew -- belonged to a secret guild of assassins. After a leather-clad sexpot drafts Wesley into the society, he hones his innate killing skills and turns avenger.', '/mUrkppyahzk6koYFekxeu0tmcPd.jpg', '2008-06-12', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('8916', 'Antz', 'tt0120587', 'In this animated hit, a neurotic worker ant in love with a rebellious princess rises to unlikely stardom when he switches places with a soldier. Signing up to march in a parade, he ends up under the command of a bloodthirsty general. But hes actually been enlisted to fight against a termite army.', '/3biVcPu5hrfKUMC73sTFq17dmmS.jpg', '1998-10-02', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('8966', 'Twilight', 'tt1099212', 'When Bella Swan moves to a small town in the Pacific Northwest to live with her father, she starts school and meets the reclusive Edward Cullen, a mysterious classmate who reveals himself to be a 108-year-old vampire. Despite Edwards repeated cautions, Bella cant help but fall in love with him, a fatal move that endangers her own life when a coven of bloodsuckers try to challenge the Cullen clan.', '/nlvPMLCdum7bkHKmDSMnNLGztmW.jpg', '2008-11-20', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"}]'),
('8967', 'The Tree of Life', 'tt0478304', 'The impressionistic story of a Texas family in the 1950s. The film follows the life journey of the eldest son, Jack, through the innocence of childhood to his disillusioned adult years as he tries to reconcile a complicated relationship with his father. Jack finds himself a lost soul in the modern world, seeking answers to the origins and meaning of life while questioning the existence of faith.', '/ptDOdfOg0srtk4TGdeYbLqxv2nd.jpg', '2011-05-18', '[{"id":18,"name":"Drama"},{"id":14,"name":"Fantasy"}]'),
('89899', 'Les infidèles', 'tt2087850', 'A series of short films set around the theme of infidelity.', '/hT5A8SjbA8MDCQXR4Upw5ga31Aw.jpg', '2012-02-29', '[{"id":35,"name":"Comedy"}]'),
('9016', 'Treasure Planet', 'tt0133240', 'When space galleon cabin boy Jim Hawkins discovers a map to an intergalactic loot of a thousand worlds, a cyborg cook named John Silver teaches him to battle supernovas and space storms. But, soon, Jim realizes Silver is a pirate intent on mutiny!', '/yfcoA7q9n852yVnYa0VcAchgA72.jpg', '2002-11-26', '[{"id":12,"name":"Adventure"},{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('9032', 'Big Daddy', 'tt0142342', 'Layla Maloney is fed up with boyfriend Sonny Koufaxs perpetual loafing, so when 5-year-old Julian is left on Sonnys doorstep, he assumes a fatherly role to prove hes responsible and to win Laylas love. Trouble is, Sonny has grown attached to the kid, whos really the son of his out-of-town roommate.', '/zDJ4GVch7Iw2i0j84ceoElRUZUR.jpg', '1999-06-25', '[{"id":35,"name":"Comedy"},{"id":18,"name":"Drama"}]'),
('91314', 'Transformers: Age of Extinction', 'tt2109248', 'As humanity picks up the pieces, following the conclusion of Transformers: Dark of the Moon, Autobots and Decepticons have all but vanished from the face of the planet. However, a group of powerful, ingenious businessman and scientists attempt to learn from past Transformer incursions and push the boundaries of technology beyond what they can control - all while an ancient, powerful Transformer menace sets Earth in his cross-hairs.', '/ykIZB9dYBIKV13k5igGFncT5th6.jpg', '2014-06-25', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"}]'),
('91586', 'Insidious: Chapter 2', 'tt2226417', 'The haunted Lambert family seeks to uncover the mysterious childhood secret that has left them dangerously connected to the spirit world.', '/qjzk0pig5c7aTLlvKzcegD9PXA.jpg', '2013-09-12', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('920', 'Cars', 'tt0317219', 'Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the towns offbeat characters.', '/5damnMcRFKSjhCirgX3CMa88MBj.jpg', '2006-06-08', '[{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('928', 'Gremlins 2: The New Batch', 'tt0099700', 'Young sweethearts Billy and Kate move to the Big Apple, land jobs in a high-tech office park and soon reunite with the friendly and lovable Gizmo. But a series of accidents creates a whole new generation of Gremlins. The situation worsens when the devilish green creatures invade a top-secret laboratory and develop genetically altered powers, making them even harder to destroy!', '/mkWD9W27JYmQPbgcryPBdI2cF4r.jpg', '1990-06-15', '[{"id":35,"name":"Comedy"},{"id":27,"name":"Horror"},{"id":14,"name":"Fantasy"}]'),
('9297', 'Monster House', 'tt0385880', 'Monsters under the bed are scary enough, but what happens when an entire house is out to get you? Three teens aim to find out when they go up against a decrepit neighboring home and unlock its frightening secrets.', '/m0gpGljVAKAHM36BLX0RR4cxrNl.jpg', '2006-07-21', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"},{"id":14,"name":"Fantasy"}]'),
('9315', 'Flightplan', 'tt0408790', 'A claustrophobic, Hitchcockian thriller. A bereaved woman and her daughter are flying home from Berlin to America. At 30,000 feet the child vanishes and nobody admits she was ever on that plane.', '/pZetr5lKqN12sRLDvgW7UUxfYtj.jpg', '2005-09-22', '[{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"},{"id":9648,"name":"Mystery"}]'),
('9316', 'Ong Bak', 'tt0368909', 'When the head of a statue sacred to a village is stolen, a young martial artist goes to the big city and finds himself taking on the underworld to retrieve it.', '/t4TIJWdnxcKXcsLYqKUoNzDkeU8.jpg', '2003-01-21', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('9325', 'The Jungle Book', 'tt0061852', 'The Jungle Book follows the ups and downs of the man-cub Mowgli as he makes his way back to the human village with wise panther Bagheera to escape ruthless tiger Shere Khan. Along the way, he meets unforgettable friends and foes including mad King Louie of the Apes, the hypnotic snake Kaa and the loveable, happy-go-lucky bear Baloo, who teaches Mowgli about true friendship.', '/1AreNcL9s24Qfghbzomy0IlzCFk.jpg', '1967-10-18', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":12,"name":"Adventure"}]'),
('9334', 'The Scorpion King', 'tt0277296', 'In ancient Egypt, peasant Mathayus is hired to exact revenge on the powerful Memnon and the sorceress Cassandra, who are ready to overtake Balthazars village. Amid betrayals, thieves, abductions and more, Mathayus strives to bring justice to his complicated world.', '/3hDjKsezb0vso63l3Ecw9XZmh9l.jpg', '2002-04-16', '[{"id":28,"name":"Action"},{"id":14,"name":"Fantasy"},{"id":12,"name":"Adventure"}]'),
('9335', 'Transporter 2', 'tt0388482', 'Professional driver Frank Martin is living in Miami, where he is temporarily filling in for a friend as the chauffeur for a government narcotics control policymaker and his family. The young boy in the family is targeted for kidnapping, and Frank immediately becomes involved in protecting the child and exposing the kidnappers.', '/bZKkwfQf4mHYlNbmViNjmAN60zY.jpg', '2005-08-02', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('9342', 'The Mask of Zorro', 'tt0120746', 'It has been twenty years since Don Diego de la Vega fought Spanish oppression in Alta California as the legendary romantic hero Zorro. Having escaped from prison he transforms troubled bandit Alejandro into his successor, in order to foil the plans of the tyrannical Don Rafael Montero who robbed him of his freedom, his wife, and his precious daughter Elena all those years ago.', '/eh59q4ksXDQc97s52FUUQOkE8Th.jpg', '1998-07-16', '[{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":37,"name":"Western"},{"id":10749,"name":"Romance"},{"id":53,"name":"Thriller"}]'),
('93456', 'Despicable Me 2', 'tt1690953', 'Gru is recruited by the Anti-Villain League to help deal with a powerful new super criminal.', '/kQrYyZQHkwkUg2KlUDyvymj9FAp.jpg', '2013-06-25', '[{"id":16,"name":"Animation"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('9355', 'Mad Max Beyond Thunderdome', 'tt0089530', 'Mad Max becomes a pawn in a decadent oasis of a technological society, and when exiled, becomes the deliverer of a colony of children.', '/9ciqnBU2YlMtMrqNwRzhmaMeL9l.jpg', '1985-06-29', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":878,"name":"Science Fiction"}]'),
('9377', 'Ferris Buellers Day Off', 'tt0091042', 'Charismatic teen Ferris Bueller plays hooky in Chicago with his girlfriend and best friend.', '/kto49vDiSzooEdy4WQH2RtaC9oP.jpg', '1986-06-11', '[{"id":18,"name":"Drama"},{"id":35,"name":"Comedy"}]'),
('938', 'Per qualche dollaro in più', 'tt0059578', 'Two bounty hunters are in pursuit of El Indio one of the most wanted fugitives in the western territories, and his gang.', '/f5cEyMeoSUc5AB7o8WDgFKR8EtY.jpg', '1965-12-18', '[{"id":37,"name":"Western"}]'),
('9381', 'Babylon A.D.', 'tt0364970', 'In Babylon A.D Vin Diesel stars as a veteran-turned-mercenary who is hired to deliver a package from the ravages of post-apocalyptic Eastern Europe to a destination in the teeming megalopolis of New York City. The package is a mysterious young woman with a secret.', '/ipAZBhmBsJa6W8iKwtJL0u02bPb.jpg', '2008-08-20', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('9383', 'Hollow Man', 'tt0164052', 'Cocky researcher Sebastian Caine is working on a project to make living creatures invisible. Hes so confident hes found the right formula that he tests it on himself and soon begins to vanish. The only problem is, no one can figure out how to make him visible again. This predicament begins to drive Caine mad, with terrifying results.', '/ubc2Nf3fJirAUcxVLUismTSo4XD.jpg', '2000-08-04', '[{"id":28,"name":"Action"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('942', 'Lethal Weapon 2', 'tt0097733', 'In the opening chase, Martin Riggs and Roger Murtaugh stumble across a trunk full of Krugerrands. They follow the trail to a South African diplomat whos using his immunity to conceal a smuggling operation. When he plants a bomb under Murtaughs toilet, the action explodes!', '/7XAusKpFNv8x9sHpFLAS2lWCT8l.jpg', '1989-07-07', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('94329', 'Serbuan maut', 'tt1899353', 'Deep in the heart of Jakartas slums lies an impenetrable safe house for the worlds most dangerous killers and gangsters. Until now, the run-down apartment block has been considered untouchable to even the bravest of police. Cloaked under the cover of pre-dawn darkness and silence, an elite swat team is tasked with raiding the safe house in order to take down the notorious drug lord that runs it.  But when a chance encounter with a spotter blows their cover and news of their assault reaches the drug lord, the buildings lights are cut and all the exits blocked. Stranded on the sixth floor with no way out, the unit must fight their way through the citys worst to survive their mission. Starring Indonesian martial arts sensation Iko Uwais.', '/mfDGRp19BcZUfPIhdqzdQ2uGZrf.jpg', '2011-09-08', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('9480', 'Daredevil', 'tt0287978', 'He dwells in a world of eternal night, but the blackness is filled with sounds and scents, tastes and textures that most cannot perceive. Although attorney Matt Murdock is blind, his other four senses function with superhuman sharpness. By day, Murdock represents the downtrodden. At night he is Daredevil, a masked vigilante stalking the dark streets of the city, a relentless avenger of justice.', '/dNVEqwgIdrwWQL3zXI5mQG60oM5.jpg', '2003-02-14', '[{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":878,"name":"Science Fiction"},{"id":53,"name":"Thriller"}]'),
('9486', 'Johnny English', 'tt0274166', 'Rowan plays the eponymous lead character in a spoof spy thriller. During the course of the story we follow our hero as he attempts to single-handedly save the country from falling into the hands of a despot.', '/oSsisFLSeRJJaTX5l13jMqDKpwH.jpg', '2003-04-06', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"}]'),
('9487', 'A Bugs Life', 'tt0120623', 'On behalf of oppressed bugs everywhere, an inventive ant named Flik hires a troupe of warrior bugs to defend his bustling colony from a horde of freeloading grasshoppers led by the evil-minded Hopper.', '/u9qGMRwcPwP0WETxulS5hKUsEum.jpg', '1998-11-25', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"}]'),
('949', 'Heat', 'tt0113277', 'Obsessive master thief Neil McCauley leads a top-notch crew on various daring heists throughout Los Angeles while determined detective Vincent Hanna pursues him without rest. Each man recognizes and respects the ability and the dedication of the other even though they are aware their cat-and-mouse game may end in violence.', '/zMyfPUelumio3tiDKPffaUpsQTD.jpg', '1995-12-15', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"}]'),
('95', 'Armageddon', 'tt0120591', 'An asteroid the size of Texas is heading directly toward Earth at 22,000 mph. NASAs executive director, Dan Truman, has only one option - to send up a crew to destroy the asteroid. He enlists the help of Harry S. Stamper - the worlds foremost deep core oil driller - and Stampers roughneck team of drillers to land on the asteroid, drill into its surface, and drop a nuclear device.', '/coINnuCzcw5FMHBty8hcudMOBnO.jpg', '1998-07-01', '[{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"}]'),
('950', 'Ice Age: The Meltdown', 'tt0438097', 'Diego, Manny and Sid return in this sequel to the hit animated movie Ice Age. This time around, the deep freeze is over, and the ice-covered earth is starting to melt, which will destroy the trios cherished valley. The impending disaster prompts them to reunite and warn all the other beasts about the desperate situation.', '/isRuztu5Ch7FJdtSBLcG8QSOpEI.jpg', '2006-03-23', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"},{"id":12,"name":"Adventure"}]'),
('9502', 'Kung Fu Panda', 'tt0441773', 'When the Valley of Peace is threatened, lazy Po the panda discovers his destiny as the chosen one and trains to become a kung fu hero, but transforming the unsleek slacker into a brave warrior wont be easy. Its up to Master Shifu and the Furious Five -- Tigress, Crane, Mantis, Viper and Monkey -- to give it a try.', '/2Paj1nufT0jeSY0G4u3RC31HIGT.jpg', '2008-06-04', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"}]'),
('953', 'Madagascar', 'tt0351283', 'Zoo animals leave the comforts of man-made habitats for exotic adventure in this animated family film. After escaping from the zoo, four friends -- a lion, a hippo, a zebra and a giraffe -- are sent back to Africa. When their ship capsizes, stranding them on Madagascar, an island populated by crazy critters, the pals must adapt to jungle life and their new roles as wild animals.', '/2YiESGB68BGQSAFvfJxBi774sc4.jpg', '2005-05-25', '[{"id":10751,"name":"Family"},{"id":16,"name":"Animation"}]'),
('954', 'Mission: Impossible', 'tt0117060', 'When Ethan Hunt, the leader of a crack espionage team whose perilous operation has gone awry with no explanation, discovers that a mole has penetrated the CIA, hes surprised to learn that hes the No. 1 suspect. To clear his name, Hunt now must ferret out the real double agent and, in the process, even the score.', '/1PVKS17pIBFsIhgFws2uagPDNLW.jpg', '1996-05-21', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('9543', 'Prince of Persia: The Sands of Time', 'tt0473075', 'A rogue prince (Jake Gyllenhaal) reluctantly joins forces with a mysterious princess (Gemma Arterton) and together, they race against dark forces to safeguard an ancient dagger capable of releasing the Sands of Time—a gift from the gods that can reverse time and allow its possessor to rule the world. Based on the action-adventure video game of the same name.', '/dtjz9Z6MTsuFyrzqdwVB4dgHENA.jpg', '2010-05-19', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":10749,"name":"Romance"}]'),
('955', 'Mission: Impossible II', 'tt0120755', 'With computer genius Luther Stickell at his side and a beautiful thief on his mind, agent Ethan Hunt races across Australia and Spain to stop a former IMF agent from unleashing a genetically engineered biological weapon called Chimera. This mission, should Hunt choose to accept it, plunges him into the center of an international crisis of terrifying magnitude.', '/eRaEC0vf5q5TSvaoJPwGTt2wa9T.jpg', '2000-05-23', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('9552', 'The Exorcist', 'tt0070047', '12-year-old Regan MacNeil begins to adapt an explicit new personality as strange events befall the local area of Georgetown. Her mother becomes torn between science and superstition in a desperate bid to save her daughter, and ultimately turns to her last hope: Father Damien Karras, a troubled priest who is struggling with his own faith.', '/kCimAd6QNYTn28xfYBmqhLLyfIX.jpg', '1973-12-26', '[{"id":18,"name":"Drama"},{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('956', 'Mission: Impossible III', 'tt0317919', 'Retired from active duty to train new IMF agents, Ethan Hunt is called back into action to confront sadistic arms dealer Owen Davian. Hunt must try to protect his girlfriend while working with his new team to complete the mission.', '/qjy8ABAbWooV4jLG6UjzDHlv4RB.jpg', '2006-05-03', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"}]'),
('95610', 'Bridget Joness Baby', 'tt1473832', 'Breaking up with Mark Darcy leaves Bridget Jones over 40 and single again. Feeling that she has everything under control, Jones decides to focus on her career as a top news producer. Suddenly, her love life comes back from the dead when she meets a dashing and handsome American named Jack. Things couldnt be better, until Bridget discovers that she is pregnant. Now, the befuddled mom-to-be must figure out if the proud papa is Mark or Jack.', '/a4qrfP2fVWqasbUUdKCwjDGCTTM.jpg', '2016-09-15', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('957', 'Spaceballs', 'tt0094012', 'When the nefarious Dark Helmet hatches a plan to snatch Princess Vespa and steal her planets air, space-bum-for-hire Lone Starr and his clueless sidekick fly to the rescue. Along the way, they meet Yogurt, who puts Lone Starr wise to the power of The Schwartz. Can he master it in time to save the day?', '/xWt9KAcToCRdJ6JH8JyZZlhkVgG.jpg', '1987-06-24', '[{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"}]'),
('9593', 'Last Action Hero', 'tt0107362', 'Danny is obsessed with a fictional movie character action hero Jack Slater. When a magical ticket transports him into Jacks latest adventure, Danny finds himself in a world where movie magic and reality collide. Now its up to Danny to save the life of his hero and new friend.', '/yeLurMF2Xy3nex17hBbxft6zGR0.jpg', '1993-06-17', '[{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":10751,"name":"Family"}]'),
('9654', 'The Italian Job', 'tt0317740', 'After being betrayed and left for dead in Italy, Charlie Croker and his team plan an elaborate gold heist against their former ally.', '/dmWki38vOAvesXMCxlMOV7hzF6K.jpg', '2003-05-30', '[{"id":53,"name":"Thriller"},{"id":28,"name":"Action"},{"id":80,"name":"Crime"}]'),
('9659', 'Mad Max', 'tt0079501', 'In a dystopic future Australia, a vicious biker gang murder a cops family and make his fight with them personal.', '/uc0kLg1UX0ao62O46hdPIFYz8oz.jpg', '1979-04-12', '[{"id":12,"name":"Adventure"},{"id":28,"name":"Action"},{"id":53,"name":"Thriller"},{"id":878,"name":"Science Fiction"}]'),
('966', 'The Magnificent Seven', 'tt0054047', 'The Magnificent Seven is a western film from John Sturges and a remake of the Akira Kurosawas film The Seven Samurai from 1954.', '/7w3JmmyL8GpBvW6BusQfQCSm2h0.jpg', '1960-10-23', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":37,"name":"Western"}]'),
('96721', 'Rush', 'tt1979320', 'A biographical drama centered on the rivalry between Formula 1 drivers James Hunt and Niki Lauda during the 1976 Formula One motor-racing season.', '/cjEepHZOZAwmK6nAj5jis6HV75E.jpg', '2013-09-02', '[{"id":18,"name":"Drama"},{"id":28,"name":"Action"}]'),
('97020', 'RoboCop', 'tt1234721', 'In RoboCop, the year is 2028 and multinational conglomerate OmniCorp is at the center of robot technology.  Overseas, their drones have been used by the military for years, but have been forbidden for law enforcement in America.  Now OmniCorp wants to bring their controversial technology to the home front, and they see a golden opportunity to do it.  When Alex Murphy – a loving husband, father and good cop doing his best to stem the tide of crime and corruption in Detroit – is critically injured, OmniCorp sees their chance to build a part-man, part-robot police officer.  OmniCorp envisions a RoboCop in every city and even more billions for their shareholders, but they never counted on one thing: there is still a man inside the machine.', '/hFQcC5eSSHqJfk70RdgrMMxGuYt.jpg', '2014-01-30', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"}]'),
('9732', 'The Lion King 2: Simbas Pride', 'tt0120131', 'The circle of life continues for Simba, now fully grown and in his rightful place as the king of Pride Rock. Simba and Nala have given birth to a daughter, Kiara whos as rebellious as her father was. But Kiara drives her parents to distraction when she catches the eye of Kovu, the son of the evil lioness, Zira. Will Kovu steal Kiaras heart?', '/13KXcps8lVy8EhnftGU8sJVTtIf.jpg', '1998-10-24', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":12,"name":"Adventure"}]'),
('9737', 'Bad Boys', 'tt0112442', 'Marcus Burnett is a hen-pecked family man. Mike Lowry is a foot-loose and fancy free ladies man. Both are Miami policemen, and both have 72 hours to reclaim a consignment of drugs stolen from under their stations nose. To complicate matters, in order to get the assistance of the sole witness to a murder, they have to pretend to be each other.', '/nkRagoJbx9H3zVSEDyH5ldfgwyR.jpg', '1995-04-07', '[{"id":12,"name":"Adventure"},{"id":18,"name":"Drama"},{"id":28,"name":"Action"},{"id":35,"name":"Comedy"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"}]'),
('9738', 'Fantastic Four', 'tt0120667', 'During a space voyage, four scientists are altered by cosmic rays: Reed Richards gains the ability to stretch his body; Sue Storm can become invisible; Johnny Storm controls fire; and Ben Grimm is turned into a super-strong … thing. Together, these Fantastic Four must now thwart the evil plans of Dr. Doom and save the world from certain destruction.', '/aJwUBmUA11lkNVSJ3if3h3xHSFd.jpg', '2005-07-07', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":878,"name":"Science Fiction"}]'),
('9739', 'Demolition Man', 'tt0106697', 'Simon Phoenix, a violent criminal cryogenically frozen in 1996, has escaped during a parole hearing in 2032 in the utopia of San Angeles. Police are incapable of dealing with his violent ways and turn to his captor, John Spartan, who had also been cryogenically frozen when wrongfully accused of killing 30 innocent people while apprehending Phoenix.', '/k0PN3Ho12cGGIVJW7SCS7apLYaP.jpg', '1993-10-08', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":35,"name":"Comedy"},{"id":878,"name":"Science Fiction"}]'),
('9762', 'Step Up', 'tt0462590', 'Everyone deserves a chance to follow their dreams, but some people only get one shot. Tyler Gage is a rebel from the wrong side of Baltimore¹s tracks and the only thing that stands between him and an unfulfilled life are his dreams of one day making it out of there. Nora is a privileged ballet dancer attending Baltimore¹s ultra-elite Maryland School of the Arts', '/uy1kUNtvYTZLkBSpQP8FQMRdAg7.jpg', '2006-08-11', '[{"id":10402,"name":"Music"},{"id":18,"name":"Drama"},{"id":10749,"name":"Romance"},{"id":80,"name":"Crime"}]'),
('97630', 'Zero Dark Thirty', 'tt1790885', 'A chronicle of the decade-long hunt for al-Qaeda terrorist leader Osama bin Laden after the September 2001 attacks, and his death at the hands of the Navy S.E.A.L. Team 6 in May, 2011.', '/yg6IDNucLAEj7E5loTyTnUW2pgb.jpg', '2012-12-19', '[{"id":53,"name":"Thriller"},{"id":18,"name":"Drama"},{"id":36,"name":"History"}]'),
('979', 'Irréversible', 'tt0290673', 'Events over the course of one traumatic night in Paris unfold in reverse-chronological order as the beautiful Alex is brutally raped and beaten by a stranger in the underpass. Her boyfriend and ex-lover take matters into their own hands by hiring two criminals to help them find the rapist so that they can exact revenge. A simultaneously beautiful and terrible examination of the destructive nature of cause and effect, and how time destroys everything.', '/xxgJJmReMLg01aaEIGLUC8JIjmh.jpg', '2002-05-22', '[{"id":18,"name":"Drama"},{"id":53,"name":"Thriller"},{"id":80,"name":"Crime"},{"id":9648,"name":"Mystery"}]'),
('98', 'Gladiator', 'tt0172495', 'Gladiator is an epic film of love, death and betrayal set in the Roman Empire. General Maximus success in battle earns the favour of an elderly Emperor at the expense of the Emperors son. In a fit of jealous rage the son slays his father before turning his anger towards Maximus. Now reduced to a slave, his family dead, Maximus must fight as a gladiator to gain his freedom, and his revenge.', '/6WBIzCgmDCYrqh64yDREGeDk9d3.jpg', '2000-05-01', '[{"id":28,"name":"Action"},{"id":18,"name":"Drama"},{"id":12,"name":"Adventure"}]'),
('9806', 'The Incredibles', 'tt0317705', 'Bob Parr has given up his superhero days to log in time as an insurance adjuster and raise his three children with his formerly heroic wife in suburbia. But when he receives a mysterious assignment, its time to get back into costume.', '/9gBnaVySWaXulJNzR796Nd8kdje.jpg', '2004-11-04', '[{"id":878,"name":"Science Fiction"},{"id":12,"name":"Adventure"},{"id":10751,"name":"Family"},{"id":16,"name":"Animation"},{"id":28,"name":"Action"}]'),
('984', 'Dirty Harry', 'tt0066999', 'When a madman dubbed the Scorpio Killer terrorizes San Francisco, hard-boiled cop Harry Callahan -- famous for his take-no-prisoners approach to law enforcement -- is tasked with hunting down the psychopath. Harry eventually collars Scorpio in the process of rescuing a kidnap victim, only to see him walk on technicalities. Now, the maverick detective is determined to nail the maniac himself.', '/6AlKDmfVi5cqQFprxJCf1FWihPk.jpg', '1971-12-22', '[{"id":28,"name":"Action"},{"id":80,"name":"Crime"},{"id":53,"name":"Thriller"}]'),
('98566', 'Teenage Mutant Ninja Turtles', 'tt1291150', 'The city needs heroes. Darkness has settled over New York City as Shredder and his evil Foot Clan have an iron grip on everything from the police to the politicians. The future is grim until four unlikely outcast brothers rise from the sewers and discover their destiny as Teenage Mutant Ninja Turtles. The Turtles must work with fearless reporter April and her wise-cracking cameraman Vern Fenwick to save the city and unravel Shredders diabolical plan.', '/oDL2ryJ0sV2bmjgshVgJb3qzvwp.jpg', '2014-08-07', '[{"id":878,"name":"Science Fiction"},{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":14,"name":"Fantasy"},{"id":35,"name":"Comedy"}]'),
('9889', 'Shallow Hal', 'tt0256380', 'A shallow man falls in love with a 300 pound woman because of her inner beauty.', '/xhdJKfDp7TihFcO5CF6BFY1xImE.jpg', '2001-11-01', '[{"id":35,"name":"Comedy"},{"id":10749,"name":"Romance"}]'),
('9902', 'Wrong Turn', 'tt0295700', 'Chris crashes into a carload of other young people, and the group of stranded motorists is soon lost in the woods of West Virginia, where theyre hunted by three cannibalistic mountain men who are grossly disfigured by generations of inbreeding.', '/kyn0ZC8tvLWuKN85mhlG1lwB1WQ.jpg', '2003-05-30', '[{"id":27,"name":"Horror"},{"id":53,"name":"Thriller"}]'),
('9947', 'Elektra', 'tt0357277', 'Elektra the warrior survives a near-death experience, becomes an assassin-for-hire, and tries to protect her two latest targets, a single father and his young daughter, from a group of supernatural assassins.', '/dyvqAJs20UrqTJGOHtJ0tNbU54m.jpg', '2005-01-14', '[{"id":28,"name":"Action"}]'),
('9982', 'Chicken Little', 'tt0371606', 'When a tiny acorn bonks Chicken Little on the head, he causes widespread panic and gets on the bad side of the entire town. But when hes hit on the head by a real piece of sky, its up to Chicken Little and his friends to save the world.', '/iLMALbInUmbNn1tHmxJEWm5MyjP.jpg', '2005-02-12', '[{"id":16,"name":"Animation"},{"id":10751,"name":"Family"},{"id":35,"name":"Comedy"}]'),
('99861', 'Avengers: Age of Ultron', 'tt2395427', 'When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.', '/t90Y3G8UGQp0f0DrP60wRu9gfrH.jpg', '2015-04-22', '[{"id":28,"name":"Action"},{"id":12,"name":"Adventure"},{"id":878,"name":"Science Fiction"}]');
